(18, '_Pašování rumu', 1328648586, 22, '<a href="http://maps.google.cz/maps/ms?msa=0&amp;msid=202010519094597531222.0004b849ff189c5e9f6a7">http://maps.google.cz/maps/ms?msa=0&amp;msid=202010519094597531222.0004b849ff189c5e9f6a7</a>\r\n', 1, 1, 0),
(19, 'Studijní materiály', 1328650089, 26, '<div>\r\nSeznam povinné četby:\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nCIA, KUBARK Counterintelligence Interrogation, July 1963&nbsp;\r\n</div>\r\n<div>\r\n<a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Kubark%201-60.pdf" class="odkaz">Part 1 (pp. 1-60)</a> - <a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Kubark%2061-112.pdf" class="odkaz">Part II (pp. 61-112)</a> - <a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Kubark%20113-128.pdf" class="odkaz">Part III (pp. 113-128)</a>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nCIA, Human Resource Exploitation Training Manual - 1983\r\n</div>\r\n<div>\r\n<a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Human%20Res%20Exploit%20A1-G11.pdf" class="odkaz">Part I (pp. 1-67)</a> - <a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Human%20Res%20Exploit%20H0-L17.pdf" class="odkaz">Part II (pp. 68-124)</a>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n<a rel="nofollow" href="http://www.ballistichelmet.org/school/free.html" class="odkaz">Freedom Fighter''s Manual</a>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nMKULTRA <a rel="nofollow" href="http://www.archive.org/details/tmdg" class="odkaz">http://www.archive.org/details/tmdg</a>\r\n</div>\r\n', 0, 0, 1),
(20, 'Incident &quot;kasino&quot;', 1328882288, 26, '<h1>Zápis o průběhu&nbsp;</h1>\r\n<p>\r\nBěhem tohoto incidentu údajně léčitelka mimo kategorie, před kterou nás varovala rychlá londýnská spojka (Fullbrook), vytvořila pět pěkně nasvačených golemů kteří pro ní po městě nakreslili pět mandal uzavírajících Vinohrady do pentagramu který byl součástí nějakého mocného rituálu.\r\n</p>\r\n<p>\r\nRituál se podařilo díky příkladné práci denní hlídky úspěšně narušit až na místě kde k řešení Filip V. Ragulin připustil nejsvětlejšího Maršíka. Ten hodlal problém vyřešit telefonátem na přeskvělé analytické oddělení noční hlídky. Bohužel prsty páně Maršíka jsou příliš tlusté než aby při vytáčení čísla mačkaly pouze jeden knoflík na klávesnici. Šéf světlých se tak nikam nedovolal, kardinálně to zvoral, golem učinil, co učinil a rozpadl se. Filip V. Ragulin si je vědom svého selhání a zpytuje svědomí. Ostatním hlídkařům toto budiž důkazem vysokého stupně nebezpečnosti páně Maršíka.&nbsp;\r\n</p>\r\n<p>\r\nZe záznamů operačních týmů máme k dispozici fotografie všech obrazců a popis čtyř z pěti golemů. Pátý byl tak strašlivý, že si ho nikdo raději nepamatuje. Popis golemů a jejich rozmístění je v odkazu na přiloženou mapu. Editace mapy je zakázána pod trestem likvifikace pohlavních orgánů dostatečně mnohokrát aplikovanou metodou &quot;penalta&quot;. Fotografie obrazců jsou v přílohách.&nbsp;\r\n</p>\r\n<p>\r\nVeškeré okolnosti tohoto incidentu jsou stále v šetření.\r\n</p>\r\n<p>\r\nAnalytické slíbilo informace o obrazcích mandal, v současné chvíli mají obraz první mandaly, na rozbor se pošlou veškeré informace (stejně nám asi nic neřeknou, ale pro korektnost).&nbsp;\r\n</p>\r\n<h2><strong> Je potřeba zjistit</strong>&nbsp;</h2>\r\n<ol>\r\n	<li>k čemu rituál sloužil&nbsp;</li>\r\n	<li>stačil k jeho částečné kompletaci pouze jeden záchytný bod (sub-incident &quot;Maršík je debil&quot;)&nbsp;</li>\r\n	<li>&nbsp;následky</li>\r\n	<li>totožnost pachatele&nbsp;</li>\r\n	<li>zkompletované materiály poslat analytickému</li>\r\n</ol>\r\n<h2><strong>Zjištěná fakta&nbsp;</strong>&nbsp;</h2>\r\n<ul>\r\n	<li>Maršík je debil</li>\r\n	<li>Golemové podle standardizovaných stupnic magické a fyzické obrany a útočných schopností dosahovali ve všech oblastech stupně 5</li>\r\n	<li>Na golemy působilo kouzlo prach</li>\r\n	<li>operativec Hradil použil amulet s kouzlem Prach z vlastních zásob</li>\r\n	<li>Alexander Strauss (šéf) použil amulet s kouzlem Prach ze zásob Noční Hlídky</li>\r\n	<li>Pavel Maršík, představený jednoho z pražských ohrožených živočišných druhů použil amulet s kouzlem Prach ze zásob Noční Hlídky</li>\r\n	<li>po spojení míst na kterých Golemové kreslili symboly vyšel Pentagram se středem poblíž kasina</li>\r\n</ul>\r\n<h3>Potvrzené energetické výdaje</h3>\r\n<h4>Temní&nbsp;</h4>\r\n<ul>\r\n	<li>1xPrach(amulet) -25 magů (Hradil)&nbsp;&nbsp;</li>\r\n	<li>3xšero =&lt;15min -45 magů (Novotný)&nbsp;</li>\r\n	<li>2xšero + TrimScan (Alexandr)</li>\r\n</ul>\r\n<h4>Světlí &nbsp;</h4>\r\n<ul>\r\n	<li>&nbsp;2xPrach(amulet) -50 magů (Maršík + Alexandr)</li>\r\n</ul>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n<a rel="nofollow" href="http://maps.google.cz/maps/ms?msa=0&amp;msid=202010519094597531222.0004b8644eb17417e6651" class="odkaz"><font size="2" color="green"><strong>Rozmístění golemů a mandal během incidentu &quot;kasino&quot;</strong></font></a>\r\n</p>\r\n<p>\r\n<em><u>Je bezpodmínečně nutné doplnit soupis energetických výdajů, případně doplnit zjištěná fakta!&nbsp;</u></em>\r\n</p>\r\n<a rel="nofollow" href="http://maps.google.cz/maps/ms?msa=0&amp;msid=202010519094597531222.0004b8644eb17417e6651" class="odkaz"></a>\r\n', 0, 0, 1),
(21, 'asdfasdf', 1330099306, 22, 'asdfasdf\r\n', 0, 1, 0),
(22, 'Čachry na magistrátě', 1363351416, 45, '<p>\r\nZdá se, že magistrátní úředník Karel Husinecký přiklepl někomu nějakou zakázku tak trochu bokem. Nás zajímá ten někdo, protože to je jiný.\r\n</p>\r\n<p>\r\nTen jiný co ovlivnil Husineckého je Jan Zelený, upír 6. kategorie, který dodává zakázku multifunkčních zařízení pro pražský Magistrát. Pan Zelený při svých obchodních jednáních ojediněle náhodně využívá upírského Hypnotického pohledu, což Denní hlídka nepovažuje za ilegální a proti panu Zelenému v tomto ohledu nepodniká žádné kroky.\r\n</p>\r\n<p>\r\n&nbsp;Další takoví jsou Tomáš Pacák a pan Mareš. \r\n</p>\r\n<p>\r\nTito tři upíři zajišťují tři různé zakázky pro Magistrát hlavního města Prahy. Každý z nich pro své obchodní zájmy občas využije upírského Hypnotického pohledu, Dohodu však neporušují. Z neznámých důvodů tyto zakázky či setkání těchto Jiných narušují pravděpodobnostní linie. DH se proto snaží dostat k nejvyššímu článku společnosti, která zaštiťuje Zeleného, Pacáka a Mareše.&nbsp;&nbsp;\r\n</p>\r\n<p>\r\nDalší osoba co se klem případy vynořila je Radovana Záhorská, upírka třetí kategorie stará teprve 2 roky.&nbsp;\r\n</p>\r\n<p>\r\nRadovana není dlouhou dobu dostupná na telefonu, její telefon je out.&nbsp;\r\n</p>\r\n<p>\r\nZelený a Pacák normálně na telefonu k zastižení jsou. \r\n</p>\r\n', 0, 0, 1),
(23, 'tadaa', 1330172858, 35, 'bla\r\n', 0, 1, 0),
(24, 'Změny Velké dohody', 1330357038, 32, '<p>\r\nInkvizice (jmenovitě Kašpar Hrubý) přišla na tribunálu ohledně žádosti DH Praha mimo jiné s informací, že dojde k aktualizaci Velké dohody, a to dosti divokým, netransparentním způsobem - viz&nbsp;<a href="http://inkvizicnicentrala.webnode.cz/news/nove-zneni-dohody-/" target="_blank">http://inkvizicnicentrala.webnode.cz/news/nove-zneni-dohody-/</a>\r\n</p>\r\n<p>\r\nPřestože se Alexandr s Maršíkem dohodli, že budou tuto snahu vetovat, Maršík nakonec odsouhlasil postup, který chtěl inkvizitor.\r\n</p>\r\n<p>\r\nPřestože má DH Praha k Velké dohodě připomínky, v prvé řadě je třeba si uvědomit nebezpečnost počínání inkvizice a nesmyslnost jejího požadavku na změnu předpisu, který platil po staletí. Alexandr pro zatím blokuje svým hlasem další jednání, Eva provádí neformální jednání a pokouší se zjistit skryté motivace zúčastněných. \r\n</p>\r\n<p>\r\nNakonec se případu chopil inkviziční právník, Jonathan Edwards. Vyplynulo najevo, že se jedná jen o jakési &quot;učesání&quot; české verze Velké dohody, kde se nebude měnit hmotně-právní materie.\r\n</p>\r\n<p>\r\nPo krátkém čase na poradě vedení DH bylo rozhodnuto, že Alexandr uvedené změny čistě formálního charakteru podpoří. \r\n</p>\r\n', 1, 0, 1),
(25, 'Blue Mountain', 1354723161, 51, '<p>\r\nBlue Mountain je droga, která se získává blíže nespecifikovanou extrakcí z modrého mechu, který, jak všicni dobře víme, je parazit obývající nízké hladiny šera. Její původ a doprava do prahy byla vystopována z Plzně, kde nyní dělá velkou paseku. V plzni bojují gangy závislých upírů a vlkodlaků. Nejvýše postavený člen sítě, kterého se nám alespoň minimálně podařilo popsat a vypátrat, je jistý &quot;pan K&quot;. Tato osoba má pravděpodobně pod palcem obchod s touto drogou. Dostupné jsou informace pouze z doslechu a to, že pan K je velký sběratel magických předmětů a má mít někde doslova sklady těchto relikvií.\r\n</p>\r\n<p>\r\n<strong>Bambula - poznámka, </strong><strong><strong>prosinec </strong>2012</strong>: <em>&quot;kterého se nám alespoň minimálně podařilo popsat a vypátrat...&quot;</em> - fakt? Že vo tom ale vůbec nic nevim...? A že zrovna já bych měl? Ale nevim?\r\n</p>\r\n<p>\r\n<strong>Bambula - poznámka, </strong><strong><strong>prosinec </strong>2012</strong>: <em>&quot;Dostupné jsou informace pouze z doslechu...&quot;</em> - já vám dám dostupné z doslechu... Ten doslech jsem já a poznámka &quot;ten toho někde musí mít hangár&quot;, kterou jsme několikrát jak já, tak moje sestra byli učinili, se zakládá čistě na tom, kolik jen nám toho mezi prstama proteklo. Zájem zkrátka byl - svého času - obrovský. Takže ten &quot;hangár&quot; byl takovým alegorickým popisem skutečnosti: hodně.\r\n</p>\r\n<p>\r\n<strong>Bambula - poznámka, prosinec 2012</strong>: případ už asi těžko kdy bude (takže nebude) vyřešen. Jak je známo od jara nebo léta 2012, války v Plzni najednou utichly a nastal šlus/ende/konec, výroba i dealing přestaly a dealeři a vařilové zmizeli. Někdo - a dodnes nevíme kdo, kdopak jsi, tajemný pane K? - patrně (zdůrazňuji: <strong>patrně</strong>) dokončil fázi I &quot;Experimentujeme s Blue Mountain&quot;, přešel na fázi II (&quot;Tak už vyrábíme Green Mountain&quot;) a v profláklé Plzni to zkrátka zabalil a zametl. Zbyli zoufalci, kteří, až dojdou lokálně nasyslené zásobičky, jakože už asi docházejí či došly, budou pak skutečně zoufalí a nakonec i mrtví.\r\n</p>\r\n', 0, 0, 0),
(26, 'Smrtihlav a Thule', 1354545079, 26, '<p>\r\nSmrtihlavove - vime o existencii dvou. Jeden u Evy, druhy byl u Ragulina, no na podzim on napaden na Tylove namesti z druhe hladiny sera dvema silnymy udery, do bezvedomi, a Smrtihlava sebrali. \r\n</p>\r\n<p>\r\nSmrtihlavi pochazeji z laboratori Thule. Ta shorela na popel, zadne stopy. Tam jeden mrtvy Jiny. \r\n</p>\r\n<p>\r\nBrener uz na podzim tvrdil, ze Smrtihlavu bylo 5. Pak objevili Krener, ten z Thule, a pry ted jde po Smrtihlavoch.&nbsp; \r\n</p>\r\n<p>\r\nCharistarch na dva Smrtiglavy nenapadnu ochranu sdelal, no posraty Protegon na jare 2012 rozslapal ritualom ochranu tak durakovo, kak smrtiglavy jeste vice dojebal. \r\n</p>\r\n<p>\r\nV Prosinci 2012 do prahz přijíždí Malinovkij, někdo ho přepadl a sebral mu něco, co měl kolem krku. (možná smrtihlava) Malinovskij je fašoun&nbsp;z Thule. Otázkou je, kde je případný další smrtihlav, kterého mu někdo ukradl? A kdo to byl? Malinovskij není žádný ořezávátko, jak potvrdí Ragulin.\r\n</p>\r\n', 1, 0, 0),
(27, 'Autobus decek - vampyri pitomci', 1330865209, 22, '<p>\r\nAutobus decek uneseny, upiri teroristi, chocu zmenu dogoy.\r\n</p>\r\n<p>\r\nJednogo my zabili.&nbsp;\r\n</p>\r\n<p>\r\nV příloze je celý zápis o průběhu vyšetřování a veškeré informace co o tom osobně vím. Alexandr \r\n</p>\r\n<p>\r\nněkteré dodatečné věci: Wolf volal jako první z důvodu toho, že nemáme zasahovat, že to dělá pro temné. pak nebral telefon, aby podal vysvětlení a začalo právě vyšetřování. Chvilku po jeho volání se právě objevilo info o nalezeném autobusu.\r\n</p>\r\n<p>\r\nna Míráku chtěl opravdu se sejít sám, a slíbit, že se mu nic nestane, jinak právě ty děti zabije rovnou jako odvetu. Byl mnou vyslechnut v mírové náladě, a opravdu byl nasranej na světlý a chtěl ty děti zabít hned, ale nechal se ukecat, a jim dá šanci a prodlouží i tu dobu. Dokonce právě šel světlé kontaktovat, ale já nemohl nic říct a oni byli kokoti slepí. Jinak se ještě vyjádřil, že jsou dle něj tyto možnosti co udělají: 1) zabijí děti pokud jim dál nikdo nevyhoví a pak zmizí, 2) budou vyjednávat se světlýma o dalších podmínkác, 3) jiná možnost co neřekl jaká\r\n</p>\r\n<p>\r\nByl opravdu nasranej, jak s ním světlí zametají, že to opravdu svět neviděl. \r\n</p>\r\n<p>\r\n&nbsp;(zcela neherně: CPka z toho byla už tak nasraná, že to mělo být na dvě hodky a museli jezdit po Praze jak blbci a chteli to uz nejak, byt nelogicky, ukoncit a proto byl Wolf takto chytnutelny a proto deti zabili...)\r\n</p>\r\n<p>\r\nNa Nové Butovice to s ním jel tým vyřídit. Hradil ho do zad rozstřílel Trojitejma ostříma. Pan Wolf tam byl po telefonátu, kde jsme se dohodli, že se ještě musíme setkat (vylákán). Tou dobou jsme od něj měli již veškeré známé informace, o výskytu v tu chvíli dětí prý raději nevěděl, aby se kryl. Teroristi fungovali dobře v utajení.\r\n</p>\r\n', 0, 0, 1),
(28, 'Orákulum', 1390818748, 26, '<div>\r\nOrákulum, ach ta prokletá věc. Věděli jsme, že ve vědění je moc, ale tolik moci nikdo nečekal. Jeho síla je děsivá\r\n</div>\r\n<div>\r\nLegen\r\n</div>\r\n<div>\r\nPředstavovali jsme si mnohé, ale toto ne.\r\n</div>\r\n<div>\r\nA zničit nejde. Musíme ho schovat. Ale kam?\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nOrákulum prastarých bylo po použití v Teheránu ukryto...\r\n</div>\r\n<div>\r\nJest příliš mocné a nekontrolovatelné.\r\n</div>\r\n<div>\r\nOdvezl ho dnes šerý posel na sever do města Praag.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nAnx\r\n</div>\r\n<div>\r\nDat\r\n</div>\r\n<div>\r\nWaddat\r\n</div>\r\n<div>\r\n4 upíří zuby\r\n</div>\r\n<div>\r\nzlatý prach\r\n</div>\r\n<div>\r\nAqua vitae\r\n</div>\r\n<div>\r\nsíra\r\n</div>\r\n<div>\r\noxo\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nOrákulum vyjevilo mnohé. Ne každý mu věřil, ne každý pochopil. Říkalo jen pravdu. Pravdu, které jsme se báli.&nbsp;\r\n</div>\r\n<div>\r\nPošetile a bláhově jsme jednali v silách Světla i Tmy, ale Oheň nás nakonec sežehl všechny.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nNesmrtelnost neexistuje!\r\n</div>\r\n<div>\r\nStřezte se Šerých hlubin.\r\n</div>\r\n', 1, 0, 0),
(29, 'Karolínský kříž', 1354298580, 47, '<p>\r\nO co se jednalo: Karolínský kříž byl mocný artefakt vytvořený Karlem IV (zaříkávač cca 3 kategorie) a mistrem Teodorikem (znám v dnešních dnech jako Mistr a Nathaniel).\r\n</p>\r\n<p>\r\nAtrefakt sloužil k vtáhnutí sil všech svatých (mocných Jiných) z hlubin šera do aktivátora kříže a jeho pomocníků. \r\n</p>\r\n<p>\r\nKarel, uvědomujíc si, co vytvořil nechal kříž zničit a rozdělil jej na 4 části, které byly ztraceny, zabezpečeny a ukryty po Praze.&nbsp;\r\n</p>\r\n<p>\r\nMistr teodorik, Charistarch a třetí Jiný po kříži pátrali. Charistarch nakonec z pověření inkvizice zařídil vypátrání kusů kříže a jejich získání hlídkami města Prahy. První pokus o aktivaci kříže se nepovedl, neboť byla potřeba pátá, klíčová část, kterou držel CH sám.\r\n</p>\r\n<p>\r\nKříž byl nakonec aktivovaný samotným CH i přes útok světlých v čele s mistrem a díky silám kříže, které CH pohltil, byl schopen Mistra v souboji porazit. Mistr byl poté předán inkvizici a odsouzen an 600 let sarkofágu času. \r\n</p>\r\n<p>\r\nRituálu s křížem se krom CH účastnil: jiří Silovský (tou dobou mág 1.kategorie), Vlastimil Perlík (také tou dobou mág 1.kategorie), Alena Zikmundová (vědma 2kategorie tou dobou) a Alexandr Strauss (tou dobou upír 1.kategorie).\r\n</p>\r\n<p>\r\n&nbsp;V minulých dnech se stalo to, že Silovský, Perlík a zikmundová zmizeli za divných okolností a ani CH je není schopen zaměřit (velké podezření na sarkofág času a zapojení inkvizice).\r\n</p>\r\n<p>\r\nInkvizice je nejspíše nasraná, neboť získala pouze přesně to, co Ch zadala získat: 4 části Kříže, který byl ovšem před předáním použit a učiněn tak nepoužitelným pro dalších cca pár století. \r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nShrnutí: Alexandr má na čele další pěkně velký terč, tento od nasrané inkvizice shora. :D \r\n</p>\r\n', 1, 0, 0),
(30, 'Agresivita svetlych', 1354286153, 22, '<p>\r\nV posledne dobe svetlije v Prage agresivnoje - net jen Druga strana mince, no dalsije problemy se svetlymi.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 1),
(31, 'Manuskript Aqua', 1331209291, 22, '<p>\r\nVtoroj manuskript od Kroenera, puvodne od Brenera. Dolzno vylustit.\r\n</p>\r\n<p>\r\nAz postupno ty stranky otocim a subory zmensim, tak sem nahraju.&nbsp;\r\n</p>\r\n<p>\r\nNejaky Hamyd Jasan tvrdi, ze je jediny, kdo to umi cist a ze to pry pomuze vsem.&nbsp;\r\n</p>\r\n', 1, 0, 0),
(32, 'Lethold', 1363212882, 26, '<p>\r\nLethold - dříve silný mág, nyní se silou cca 5. kategorie\r\n</p>\r\n<p>\r\nbyl kdysi (hodně kdysi) odhmotněn - neznámo kým\r\n</p>\r\n<p>\r\nmá nadání se udržet v realitě, ale ve skutečnosti je &quot;mrtvý&quot; \r\n</p>\r\n<p>\r\nshání někoho se znalostmi necromancie (pravděpodobně kvůli zvrácení odhmotnění)\r\n</p>\r\n<p>\r\njeho magie je na jiné bázi (dle jeho slov se s dobou změnily formule, a často upravili efekty daných kouzel) - sám tvrdí, že jeho minulé znalosti jsou spíše obecně slabší, ale elementárnější \r\n</p>\r\n<p>\r\npo staletí se dost schovával, naposledy, když se nepočítá dnešek, se ukázal o husitském povstání a to už byl dávno odhmotněn.(takže musí být fakt starej :)\r\n</p>\r\n<p>\r\nbojí se, aby se tu neobjevil někdo, kdo by o něm leccos věděl a měl s ním staré účty(ale to by musel být někdo fakt starý) \r\n</p>\r\n<p>\r\n&nbsp;je dost zmatený z toho, kam se myšlení lidí a Jiných vivinulo a že dost opadly ideály\r\n</p>\r\n<p>\r\n&nbsp;&quot;magie není to co určila pravidla, ale to co pravidla určovalo dřív&quot;\r\n</p>\r\n<p>\r\n&quot;Dohoda je něco, co si Jiní sami určili jako neměnné pravidlo. Neměnná pravidla nejsou, je jen to, co si lidi sami udělali&quot;\r\n</p>\r\n<p>\r\n&nbsp;má zde prý nějaké nevyřešené záležitostii kvůli kterým se právě drží zde\r\n</p>\r\n<p>\r\npamět má jako by byl smrtelníkem, takže si prostě pamatuje minulost špatně, až na to podstatné o sobě (co to je přesně, nevíme)\r\n</p>\r\n<p>\r\ndle jeho odhadů by tady na světě v tomto stavu ještě tak dvě století vydržel, ale pomalu ztrácí sílu, která se mu pomalu obnovuje a skomírá \r\n</p>\r\n<p>\r\nobjevil se zde i proto, že si myslí, že je zde někdo, kdo má souvislost s jeho minulostí a jeho bývalými rozhodnutími\r\n</p>\r\n<p>\r\n13.3.2013\r\n</p>\r\n<p>\r\nZ Letholda je inkvizicni cekatel, ma na povel inkvizicni motorkarsky gang&nbsp;\r\n</p>\r\n', 1, 0, 0),
(33, 'Grimoary', 1332005107, 27, '<p>\r\nAmnézie\r\n</p>\r\n<p>\r\n&nbsp;Dlaha\r\n</p>\r\n<p>\r\nLékařský rituál\r\n</p>\r\n<p>\r\nIron maiden\r\n</p>\r\n<p>\r\nPrstenec šílencův\r\n</p>\r\n<p>\r\nSlabost\r\n</p>\r\n<p>\r\nOdolnost proti fyzickému zranění\r\n</p>\r\n<p>\r\nIndikační cejch\r\n</p>\r\n<p>\r\nVysátí energie\r\n</p>\r\n<p>\r\nPodrobný scan\r\n</p>\r\n<p>\r\nKonzumační cejch\r\n</p>\r\n<p>\r\nPrst smrti\r\n</p>\r\n<p>\r\nZóna klidu\r\n</p>\r\n<p>\r\nDominanta\r\n</p>\r\n<p>\r\nBariéra duše\r\n</p>\r\n<p>\r\nAmplify damage\r\n</p>\r\n<p>\r\nHradba 1000 čepelí\r\n</p>\r\n<p>\r\nZnamení avicenna\r\n</p>\r\n<p>\r\nZrcadlo\r\n</p>\r\n<p>\r\nSilenceum\r\n</p>\r\n<p>\r\nFialový mrak\r\n</p>\r\n<p>\r\nBetlémský oheň\r\n</p>\r\n<p>\r\nKrycí kouzlo&nbsp;\r\n</p>\r\n', 0, 1, 0),
(34, 'Mrtva Machackova', 1332668343, 22, 'Vlkodlak zfetovany zabil Machackovu.\r\n', 0, 1, 0),
(35, 'Blby a blbejsi', 1332674886, 22, '<p>\r\nDva Donaldi v meste, zadny je tu nechce.\r\n</p>\r\n<p>\r\nMydli se, bordel delaji, a ten svetly pridava neslusne navrhy.&nbsp;\r\n</p>\r\n', 1, 0, 1),
(36, 'Protegon', 1332675030, 22, '<p>\r\nProtegon v Protegone, co z teho dal vyleze?\r\n</p>\r\n<p>\r\nChoceme Protegona? I jesli da, vazmozno nam nejak pomoci, aby vylezl z Protegony?&nbsp;\r\n</p>\r\n', 0, 0, 0),
(37, 'Unosy Drugych', 1344329729, 22, '<p>\r\nV Prage na mnozitsja unosy druhych.\r\n</p>\r\n<p>\r\nZdes etot Martin (docka Nikola), zdes eta vedma, katoraja gledajet svoju kamoskuci kogo, y zdes eta Nikola Sobotkova. Vazmozno ze etot suvislo, vazmosno sto net. Dolzno proverit.&nbsp;\r\n</p>\r\n', 0, 0, 0),
(38, 'Zřídla', 1363107940, 38, '<p>\r\nV Praze je díky magické manipulaci vědmáka Slepého, pracujícího pro Silviovo bratrstvo, otevřeno pět zřídel (to na Hvězdě je zavřené, viz léto 2012 Šoukující akce u zřídla).<br />\r\nZřídla se nacházejí:<br />\r\nv Bezručových sadech<br />\r\nna Vítkově<br />\r\nNa Vyšehradě (jihozápadní terasy)<br />\r\nv zahradách Kinských (u kostela sv. Michala)<br />\r\nna Střeleckém ostrově (cíp směřující na pražský Hrad)\r\n</p>\r\n<p>\r\nPodle Charistarcha jsou zřídla místem vyvření masivních toků magické energie, které prochází Šerem. Paralela s ponornou řekou, vyvěrající na povrch a opětovně mizící v hlubinách. <br />\r\nMágové mimo kategorie se na ně mohou přímo napojit a čerpat z nich energii (proto jejich rychlá regenerace energie) běžní Jiní pouze sbírají &quot;prosakující&quot; energii (pomalá regenerace). <br />\r\n<br />\r\nZnámý efekt: rituály na zřídlech, jsou v součtu o 25% úspornější. \r\n</p>\r\n', 0, 0, 1),
(39, 'Vlad i jego pitomci', 1363292124, 22, '<p>\r\nVlad pravdepodobno tuhy. Charistarch jego ubyl.\r\n</p>\r\n<p>\r\n&nbsp;Dal resitsja glavne pitomci.&nbsp;\r\n</p>\r\n', 0, 0, 1),
(40, 'Okradená léčitelka', 1352798801, 22, '<p>\r\nVloupání do bytu Světlé léčitelky 4. kat Marie Kolínské. Zmizely amulety v celkové hodnotě asi 800mg.\r\n</p>\r\n<p>\r\nVlkodlaka, sto eto sdelal, my sebrali, vsjo choroso dopadlo. Vtaroj vlkodlak zdrhl na Kubu.&nbsp;\r\n</p>\r\n', 0, 0, 1),
(41, 'Uškrcená Světlá', 1354124018, 47, '<div class="field-text">\r\nZavražděná Světlá mágyně, šlo tam o milostný trojúhelník - mágyně, manžel, milenka - vědma.\r\n</div>\r\nDoplnit.\r\n', 0, 0, 1),
(42, 'Alexanderovo zbytky', 1355231478, 26, 'Dla obchodnika se starozitnostmi Sforzy zdes po Alexanderovi zustaly veci i informacije. Dolzno preverit, idealno ziskat.\r\n', 0, 0, 0),
(43, 'Dostavenicko celego Vychodu', 1383920517, 22, '<p>\r\nDo Pragy se sjizdejut drugyje i z Moskvy, pravdepodobno kvuli Charistarchovi zabasnutemu. Dolzno poglidat eto.\r\n</p>\r\n<p>\r\nUz zdes tajemnica suloznica Zavulonova i superkuzelnica suloznica Antonova.\r\n</p>\r\n', 0, 0, 1),
(44, 'Rozsápaní lidé různě po Praze', 1354449405, 66, '<p>\r\nPo Praze dochazi k nalezum podezrelych vrazd viz. prirazena hlaseni s podobnym rukopisem.\r\n</p>\r\n<p>\r\nPodezreni (zatim nepodlozene) na spolecneho pachatele|organizovane spolceni.&nbsp;\r\n</p>\r\n', 0, 1, 0),
(45, 'Vlcica', 1377337672, 51, '<p>\r\nPodle vsego nam zdes roste mafia vlkodlaci, eto nada pod kontrolu dostat ili temu tipec zatnut.\r\n</p>\r\n<p>\r\n*** \r\n</p>\r\n<p>\r\n<strong>jaro 2013 Provokace - Bambula (veřejná)</strong>\r\n</p>\r\n<div>\r\n<p>\r\nPoslal jsem veřejnými kanály (trollmarket) a ve vlkodlačích hospodách \r\núplně stejně nablábolil a vykřikoval urážlivé poznámky směrem na Robíka \r\nSekeru a &quot;vlkodlačí buzeranty&quot;, jak jen to šlo - takže jestli i tohle \r\n&quot;přeslechnou&quot; a nikdo si mě nenajde a nenaveze se do mě, tak už fakt \r\nnevím, co mám dělat.\r\n</p>\r\n<p>\r\n<strong>jaro 2013 Výslech Zemánka - Bambula (veřejná)</strong>\r\n</p>\r\n<div>\r\n<p>\r\nOzval se mi noční hlídkař Dub <a href="readperson.php?rid=189&amp;hidenotes=0">http://www.dhbistro.cz/readperson.php?rid=189&amp;hidenotes=0</a>\r\na když slovo dalo slovo, odtáhl mě rovnou na štáb světlých, kde jsem \r\nvyslechl Zemánka (agresor z Břevnova, podřízený Robíka Sekery). Po \r\ndobrém to se Zemánkem nešlo, tak jsem ho musel zmlátit - podotýkám, že \r\nbyl nepříjemně tuhej. Nicméně jsem ho dokázal přesvědčit a za alfu uznal\r\n- namísto Robíka - mě. Celé se to ovšem komplikuje, protože &quot;gang&quot; se \r\nprý přesouvá a Robíka by musel najít on sám (Zemánek), přičemž bychom ho\r\nmuseli pustit a dát mu pardon.\r\n</p>\r\n<p>\r\nZa druhé, když jsem se vykecával s Dubem, zmínil jsem (snad nečekaně, \r\nnáhlý obrat v tématu) &quot;pokusy na vlkodlacích&quot;. Dub takovou eventualitu \r\nvýslovně nepopřel, ale ujišťoval mě, že pouze na mrtvých tělech (ve \r\nstylu &quot;pokusy snad dělaj všichni, ne?&quot;). Jak s tímhle naložíme dál, \r\nnechať rozhodne Filip.\r\n</p>\r\n</div>\r\n<p>\r\n<strong>jaro 2013 Další postup v případu - Bambula (veřejná)</strong>\r\n</p>\r\n</div>\r\n<div>\r\nPo řadě sériových vyjednávání se světlými - přesná sekvence byla\r\nDub, Smutný, Viktorie a nakonec Miler - se nejspíš dneska sejdu s \r\nMilerem, abychom si <strong>konečně</strong> definitivně ujasnili ty \r\npodmínky (byrokraticky a hodnostně/oprávněně to drhne u nich, já každému\r\npořád dokola opakuji to samé) a <strong>snad</strong> už na podmínku a \r\nse zajištěními (cejch, osobní předmět atd.) pustili toho Zemánka, a tedy\r\ntaké konečně viděli, jestli nám najde toho Sekeru anebo ho (toho \r\nZemánka) zase budeme muset chytit a opařit natvrdo.\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<strong>12/03/2013 další vývoj - Bambula (veřejná)</strong>\r\n<div>\r\n<div>\r\ntak během noci 11/03/2013 - 12/03/2013 přišla sms od Milera, že \r\ntedy Zemánka konečně pustili v souladu s dohodou (světlí pro něj budou \r\nchtít trest podmíněný, když nás posune v pátrání dál) a můžeme jen \r\ndoufat ve dvě věci: a) že si ho nějak zabezpečili (stopovací cejch, \r\nosobní předmět) a b) že Zemánek má rozum, aby si to neposral a k milému \r\nSekyrkovi nás opravdu dovedl.\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<strong>27/03/2013 aktuální stav - Bambula (veřejná)</strong>\r\n<div>\r\n<div class="poznamka">\r\n<div>\r\n<p>\r\nStav: absolutně žádný nový vývoj. Dle Milera (NH) zatím Zemánek někde \r\nbrousí Prahou a hledá (jsou prý zprávy od Cogena, který na něj vlepil \r\nten cejch).\r\n</p>\r\n<p>\r\nKrautner/Graubner taky nic, ani nereagoval na SMSku. \r\n</p>\r\n<p>\r\n<em>Vzhledem k tomu (nic, nic) a 0vému výsledku provokací nemám žádný další nápad - a Miler, jak spolu e-mailujeme, taky ne.</em>\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 0, 0, 0),
(46, 'Nemagicke utoky', 1363551683, 69, '<div>\r\nAsi by jste to měli vědět:\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nběhem dnešní noci došlo k třem zločinům, které se týkají pražských Jiných, alespoň co&nbsp;\r\n</div>\r\n<div>\r\nse výtahu z policejních složek a naší databanky týká.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nPravděpodobnostní linie to nejspíše nezachytili, neboť ani v jednom případě nebylo&nbsp;\r\n</div>\r\n<div>\r\npoužito magických prostředků. Tady je stručně o co šlo, další informace se pokusím co&nbsp;\r\n</div>\r\n<div>\r\nnejdříve specifikovat, jen mi dejte holt čas a ještě lépe dobrého hackera.&nbsp;\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\npřípad 1:\r\n</div>\r\n<div>\r\nNapadení pana Evžena Rožmitála (registrovaný jiný, zaříkávač 6. kategorie)\r\n</div>\r\n<div>\r\nk útoku došlo mezi 1:00 a 3:00 v okolí Vyšehradské vyhlídky.&nbsp;\r\n</div>\r\n<div>\r\nPan Rožmitál je v současné chvíli údajně hospitalizován a bojuje o život na jednotce&nbsp;\r\n</div>\r\n<div>\r\nintenzivní péče.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\npřípad 2:\r\n</div>\r\n<div>\r\nByla nalezena zavražděná Jiná Eva Mašková (registrovaná Jiná, zaříkávačka 5. kat).\r\n</div>\r\n<div>\r\nNalezena byla ve svém bytě v Nuslích.\r\n</div>\r\n<div>\r\nPolicie v první chvíli vyhodnotila případ jako obzvlášť brutální. Dotyčná byla dle&nbsp;\r\n</div>\r\n<div>\r\nprvních zpráv dost ošklivě &quot;vyslýchána&quot; pachateli. Její ostatky jsou nyní v rukou&nbsp;\r\n</div>\r\n<div>\r\nspecialistů. Ke smrti došlo v rozmezí 2:30 - 4:30.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\npřípad 3:\r\n</div>\r\n<div>\r\nV parku na Újezdě byl nalezen zavražděný Radovan Líka (upír, 7. kategorie,&nbsp;\r\n</div>\r\n<div>\r\nregistrovaný a iniciovaný v roce 2012). Oběť byla nalezena s několika bodnými ranami,&nbsp;\r\n</div>\r\n<div>\r\npravděpodobně nožem či podobným předmětem. Tělo se aktuálně nalézá k posudku na&nbsp;\r\n</div>\r\n<div>\r\npatologii. Ke smrti došlo někdy kolem 3 hodiny ranní.\r\n</div>\r\n', 0, 0, 0),
(47, 'Sera provokacija', 1363212987, 26, '<p>\r\nMinimalne dvakrat probeglo cerpani velke (400 - 500), doprovazeno textom:\r\n</p>\r\n<p>\r\nJsme Jiní\r\n</p>\r\n<p>\r\na služba běžným silám nás oslabuje.\r\n</p>\r\n<p>\r\nVždyť v Šeru není rozdíl mezi absencí Světla a absencí Tmy.\r\n</p>\r\n<p>\r\nNáš zápas je sto celý svět zničit - a možná proto nás v něm udržují.&nbsp;&nbsp;\r\n</p>\r\n<p>\r\nCerpani provedl Nestor Machno, ma nejakou schopnost menit svuj otisk aury primo v seru, nevim jak to dela a nevim ani jakym zpusobem to cerpal&nbsp;\r\n</p>\r\n', 0, 0, 0),
(48, 'Defendoriát II.', 1362569970, 32, 'Vážený pane koryfeji,<br />\r\n<br />\r\nráda bych vyjádřila pohled Denní hlídky Praha na Vaši vyhlášku č. 61, ustanovující IAS.<br />\r\n<br />\r\nJedná se o založení vyšetřovacího inkvizičního uskupení s jedním velmi \r\nnepříjemným precedentem, proto je nezbytné stanovit jasné hranice \r\npraktického zacházení s tímto uskupením.<br />\r\nJelikož si jistě nikdo z nás nepřeje, aby se jakékoli tahanice \r\nopakovaly, nelze uznat tuto vyhlášku v celém jejím rozsahu, neboť jde \r\nnad rámec Dohody.<br />\r\n<br />\r\nToto uskupení se může jmenovat jakkoli (stejně jako jeho velitel), ovšem\r\nnemění to nic na tom, že se jedná o ad hoc vytvořenou, dočasně \r\nustanovenou vyšetřovací skupinu, jež má sice za úkol pomáhat zjišťovat \r\nnějaké skutečnosti, avšak Inkvizice na ni svou agendu (soudní a \r\nexekutivní) nepřenáší.<br />\r\n<br />\r\nDH Praha je ochotna propůjčit k této aktivitě dva členy ze svých řad, \r\navšak tito rozhodně nepozbydou status hlídkaře (hlídkařský cejch jim \r\nzůstane) a stále budou mít své povinnosti vůči Hlídce. O své činnosti v \r\nrámci vyšetřovací skupiny budou samozřejmě zachovávat mlčenlivost.<br />\r\n<br />\r\nPovolení k zásahům, zmiňovaná v předmětné vyhlášce, je třeba vydávat \r\npísemně (např. formou permanentek s omezenou dobou platnosti). Nelze se \r\nspoléhat na to, že povolení k zásahům, uvedené v diskutabilní vyhlášce, \r\nbude dostatečné pro ty, kteří by se mohli celým vznikem tohoto \r\nvyšetřovacího týmu zabývat (ano, mám obavu, že by některý z Vašich \r\nkolegů nemusel být tak vstřícný jako Vy).<br />\r\n<br />\r\nDále je nezbytné uvést, že IAS rozhodně nestojí nad Hlídkami. Jak již \r\nbylo uvedeno výše, nejedná se o inkviziční skupinu jako takovou. Tato \r\nskupina může pozorovat, být přítomna výslechům, příp. svědky po vlastní \r\nose vyslýchat, až s nimi Hlídky skončí (zde se neobávejte obstrukcí, to \r\nnení v zájmu ani jednoho z nás). Pokud se ovšem IAS bude chovat \r\nnevhodně, je možné, že narazí. DH Praha ovšem potřebuje dělat svou \r\npráci.<br />\r\n<br />\r\nRozumím tomu, že vzhledem k jedinečnosti Prahy cítíte potřebu mít tu \r\nprodloužené ruce ke sběru informací. Ráda Vám vyjdu vstříc, ovšem \r\nvyhlášku č. 61 považuji (už jen vzhledem k její praktické \r\nnevymahatelnosti) za gentlemanskou dohodu, jejíž specifika jsem uvedla \r\nvýše.<br />\r\n<br />\r\nPřeji Vám krásný den a věřím, že si někdy v našem nabitém časovém \r\nharmonogramu najdeme místo na tu večeři. Oběma by nám to prospělo.<br />\r\n<br />\r\nS pozdravem,<br />\r\n<br />\r\nEva Schwarzkoppová<br />\r\nNejtemnější města Prahy\r\n', 0, 0, 0),
(49, 'Maxičerpání', 1363019068, 47, 'velké čerpání na Jiřího z Poděbrad a u Rudolfina\r\n', 0, 1, 0),
(50, 'Revolucionář', 1363295371, 69, '<p>\r\nNestor Machno, Ivo Kačer, Anežka Fídlerová - zjistit o nich maximum co půjde, Nestor i Kačer mluví o nějakém senátu Jiných, který by tu bylo záhodno zřídit... nepotřebujeme žádné potížisty...\r\n</p>\r\n<p>\r\nFídlerová s nima peče, je podezřele ochotná a milá, hrozně moc se snaží pomáhat... Doporučuju nevěřit jí ani nos mezi očima. \r\n</p>\r\n', 0, 0, 0),
(51, 'Manipulace s esencí', 1363020352, 47, '<p>\r\nPoslední dobou s enám tady množí různé manipulace s šerem a z toho plynoucí manipulace s esencí, duší, říkejte si tomu jak chcete. \r\n</p>\r\n<p>\r\nCharistarch se postaral o návrat z šera u Sakeeny a Protegona, loni tu s esencemi čachroval Vlad, je tu Adlerová, Lethold...\r\n</p>\r\n<p>\r\nA teď jako by se roztrhl pytel s lidmi, kteří nabízejí, že tzv. střípky duší mohou sehnat nebo je naopak shání (Kačer, Fídlerová, Wernerová). \r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 1, 0, 0),
(52, 'Sára Wernerová', 1363020534, 47, '<p>\r\nPřijela ze Švédska, pátrá po vrazích svých rodičů. Spis týkající se této vraždy záhadně zmizel z archivu DH (je možné, že ho stopil Charistarch, když byl tehdy ve vedení hlídky - proč?). Podle všeho je Sára na Charistarchově straně. \r\n</p>\r\n<p>\r\nZajímavost: kam si jel Charistarch vyléčit zraněnou ruku potom, co vytáhl Sakeenu ze šera? Bingo, do Švédska! \r\n</p>\r\n', 0, 0, 0),
(53, 'Pokusy na upírech a vlkodlacích', 1363036151, 45, 'Tak k tomuhle máme jenom drby a domněnky, Světlí prý chytají upíry a vlkodlaky a dělají na nich pokusy kvůli regeneraci. Černá se jednou prokecla na výjezdu, pak se to trapně snažila zamluvit... Tady bude asi nejlíp poptávat se po hospodách a nažhavit staré upíří kontakty.\r\n', 0, 0, 0),
(54, 'Kámen mudrců', 1363080979, 45, '<p>\r\nhledají ho Flamelovi\r\n</p>\r\n<p>\r\npracuje přímo s energií Jiných \r\n</p>\r\n<p>\r\núdajně je to univerzální surovina do rituálů\r\n</p>\r\n<p>\r\núdajně umožňuje kouzlení bez manter \r\n</p>\r\n', 0, 0, 0),
(55, 'Sochy sv. Charistarcha', 1374603157, 38, '<p>\r\nCharistarch nám bručí, co jsem se doslech v sedmnácti, sochách sv. Václava. Stalo se tak po triunálu, který se konal záčátkem března 2013. Zabil Vlada Drakulu, podle všeho naprosto čistě, ale inkvizice si řekla, že by bylo fajn se ho nějak zbavit.\r\n</p>\r\n<p>\r\nSeznam soch (ne ve všech je)\r\n</p>\r\n<p>\r\n<strong style="font-family: ''Times New Roman''; font-size: medium"><span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Pražský hrad , nároží starého proboštství </span></strong><strong style="font-family: ''Times New Roman''; font-size: medium"><span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap"><strong style="font-family: ''Times New Roman''; font-size: medium"><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">---zabezpečená---</span></strong></span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Pražský hrad, nároží nového proboštství</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Karlův most, ludmila s malým václavem</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Karlův most, strana líž k malé straně, postava s praporem</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Karlův most, sousoší třech postav, vlevo</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Lucerna, vzhůru nohama</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Vyšehrad, severní část</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Prosek, kostel sv. václava</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Křižovnické nám. Viničný sloup  </span><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">---zabezpečená---</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Katedrála sv. Víta, nad oltářem  </span><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">---zničena---</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Busta na plášt katedrály sv. Víta</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Reliéf svatého jiří , svatojiřský klášter</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Socha na hradní rampě pražského hradu</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Morový sloup, hradčanské nám.</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Morový sloup, malostranské nám</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Česká gologická služba, zahrada (bývalý klárův ústav slepců)</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Lapidárium nár. muzea, celkem 7 různých soch</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Přední stěna kostelu sv. františka</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Staroměstská, barabizna naproti tramvajím, ve dvoře je kaple</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Arkýř staroměstské radnice</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Prašná rána, postava se &nbsp;zlatou korouhví</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Přední strana nemocnice na františku</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Hlávkova kolej, vrchol štítu</span><br />\r\n<span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap"><span style="font-weight: normal">Václavské nám.   </span>---zničena---</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Kostel Cyrila a Metoděje, Karlínské nám. </span><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">---ukradena---</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Reliéf nad vchodem do sv. ludmili, nám. Míru</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Park kavalírka</span><br />\r\n<span style="font-weight: normal; font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap">Tryskovická ulice, areál domu s pečovateslkou službou</span></strong>\r\n</p>\r\n', 0, 0, 1),
(56, 'Konec miru', 1376982397, 22, 'Minimalno dva opicaky kanec miru blabolili. Dolzno preverit.\r\n', 0, 0, 0),
(57, 'Jiné pověsti pražské', 1377258852, 47, 'pražské drby, zlomky informací a podobně, házejte to sem\r\n', 0, 0, 0);
INSERT INTO `nw_cases` (`id`, `title`, `datum`, `iduser`, `contents`, `secret`, `deleted`, `status`) VALUES
(58, 'Reálie měst pražských', 1386750017, 51, '<p>\r\n<em>Poznámka na úvod: tento spis obsahuje 4 části; v náležitém pořadí jsou to:</em>\r\n</p>\r\n<ul>\r\n	<li><em>Historie vedení pražské NH 2010 - 2013</em></li>\r\n	<li><em>Významné pražské události 2011 - 2013</em></li>\r\n	<li><em>Blue Mountain 2011 - 2013</em></li>\r\n	<li><em>Jiní v lidové slovesnosti</em></li>\r\n</ul>\r\n<br />\r\n<hr />\r\n<h1>Historie vedení pražské NH 2010 - 2013\r\n</h1>\r\n<p>\r\n<em>Aby si každý mohl udělat přehled o minulosti posledních let, a lépe tak pochopit současnou pražskou situaci (v tomto případě &quot;proč jsou světlí tam, kde jsou&quot;), uvádím posloupnost šéfů NH od roku 2010 až doposud - doporučuji jako povinnou vzdělávací četbu.\r\n</em>\r\n</p>\r\n<p>\r\n<strong>2010:</strong> do roku 2010 vedl pražskou NH světlý, údajně 250 let starý mág mimo kategorie <a href="readperson.php?rid=193&amp;hidenotes=0">Protegon</a>, vlastním jménem <a href="http://www.prazskahlidka.cz/?page_id=1068">František Sirkař</a>. V roce 2010 vyzval na souboj (schválený inkvizicí) velkého temného mága <a href="http://www.prazskahlidka.cz/?page_id=1068">Jonase Karolínu Hořínského</a> alias <a href="readperson.php?rid=135&amp;hidenotes=0">Charistarcha</a> a v tomto souboji podlehl a byl zabit. Po této události začíná období, které lze z hlediska stability vedení pražské NH označit za problematické a v němž se &quot;nejsvětlejší v Praze často střídají.&quot;\r\n</p>\r\n<p>\r\n<strong>Intermezzo:</strong> přesné podrobnosti ohledně vedení NH <strong>po</strong> Protegonově úmrtí a <strong>před</strong> nástupem Pavla Maršíka nejsou zcela jasné. Známo je toto: na <strong>jaře 2011</strong> byl nejsvětlejším mág (pravděpodobně) mimo kategorie šerým jménem Mortimer, kterého ve Vršovicích ubodali cikáni... Ano, zní to neuvěřitelně, ale je to tak. V <strong>létě 2011</strong> se další nejsvětlejší stala mágyně (pravděpodobně) 3. kategorie Gabriela Marie Horáková, bývalá šéfka pardubické NH pověřená přímo Paříží. Vydržela týden.\r\n</p>\r\n<p>\r\n<strong>2011, podzim:</strong> tou dobou byl novým nejsvětlejším <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>. Závěry si po prostudování osobního hesla a souvisejících případů každý vyvodí sám. Maršík vedl pražskou NH do jara 2012, na jaře 2012 odjel do lázní, z nichž se již nevrátil - zabil ho tam jeho dávný známý z mládí, temný mág <a href="readactrep.php?rid=100&amp;hidenotes=0&amp;truenames=0">Tomáš Zima</a>, kvůli artefaktu, o nějž ti dva vedli letitý spor. Nakolik je známo, temný mág Zima, který zabil Maršíka, při soudním řízení přesvědčil tribunál, že šlo skutečně o letitý spor mezi ním a Maršíkem, a nebyl odsouzen za vraždu. Jedná se o téhož temného mága, který <a href="readactrep.php?rid=100&amp;hidenotes=0&amp;truenames=0">unesl noční hlídkařku Sobotkovou</a>.\r\n</p>\r\n<p>\r\n<strong>2012, jaro - léto:</strong> po dobu nepřítomnosti Pavla Maršíka a po jeho úmrtí vedl NH <a href="readperson.php?rid=62&amp;hidenotes=0">Andrej Kováč</a>. (<strong>Neplést</strong> s <a href="readperson.php?rid=139&amp;hidenotes=0">Vladimírem Kováčem</a>!) Dnes lze jednoznačně říci, že by byl býval dobrým vůdcem, kdyby mu prakticky libovolnou snahu nezhatil <a href="readperson.php?rid=162&amp;hidenotes=0">Donald McGillavry</a> [čti: Galavry], který si naopak počínal jako pitomec. (Nebylo tou dobou tak úplně jasné, kdo vlastně NH vede - prakticky to byl Kováč, ale McGillavry o sobě tvrdil totéž. Minimálně McGillavry podepisoval - a také DH podepsal - spousty papírů a povolenek. Podle některých zdrojů naopak &quot;oficiálně&quot; vedl NH McGillavry a Kováč ho zastupoval.) Každopádně, ani Kováč, ani McGillavry se formálně nikdy nejsvětlejším nestal. Kováč to vydržel jen krátkou dobu a pak se nechal z vlastní vůle přeložit na Slovensko.\r\nMcGillavry snad odcestoval.\r\n</p>\r\n<p>\r\n<strong>\r\nIntermezzo:</strong> po Andreji Kováčovi vedl nějakou (krátkou) dobu hlídku <a href="readperson.php?rid=66&amp;hidenotes=0">Viktor Miler</a>. Ani on se nestal formálně nejsvětlejším.\r\n</p>\r\n<p>\r\n<strong>2012, srpen:</strong> v druhé polovině léta 2012 se novým oficiálním nejsvětlejším stal <a href="readperson.php?rid=204&amp;hidenotes=0">Martin Smutný</a>. Vydržel do jara 2013, viz osobní heslo. Oproti období &quot;bezvládí&quot; (jaro - léto 2012) se pokusil NH konsolidovat a snad i částečně uspěl. Ve většině soudních sporů proti nejtemnější <a href="readperson.php?rid=95&amp;hidenotes=0">Evě Schwarzkoppové</a> naopak neuspěl. Jeho zástupkyní byla <a href="readperson.php?rid=67&amp;hidenotes=0">Viktorie Tesařová</a>.\r\nKonec Smutného kariéry poznamenala kuriózní situace. Když došlo k <a href="readcase.php?rid=48&amp;hidenotes=0">vytvoření inkvizičního tělesa IAS</a>, známého též jako &quot;defendoriát 2&quot;, \r\nvzdal se vedení NH, aby se mohl stát součástí IASu. Zda chtěl takto \r\nzatopit temným anebo naopak sabotovat činnost IASu, není přesně známo, ani \r\nuspokojivě doloženo. (On sám tvrdil v ústranní to druhé.)\r\nKdyž po úvodních jednáních začalo být jasné, že členové IASu zdaleka \r\nnebudou mít takové pravomoci, jak žádala původní ustanovující vyhláška,\r\nSmutného počáteční nadšení poněkud ochladlo. Než se ovšem celá situace \r\ndořešila a Smutný stihl zaujmout definitivní stanovisko, učinili s ním \r\nkrátký proces <a href="readactrep.php?rid=168&amp;hidenotes=0&amp;truenames=0">Ermoliovci</a>.\r\n</p>\r\n<p>\r\n<strong>2013, jaro:</strong> po rezignaci Smutného si světlí zvolili za novou nejsvětlejší <a href="readperson.php?rid=133&amp;hidenotes=0">Leu Polákovou</a>. K působení bez komentáře, viz osobní heslo. Její zástupkyní byla <a href="readperson.php?rid=67&amp;hidenotes=0">Viktorie Tesařová</a>.\r\n</p>\r\n<p>\r\n<strong>2013, jaro:</strong> novou nejsvětlejší se stává <a href="readperson.php?rid=67&amp;hidenotes=0">Viktorie Tesařová</a>. Již v průběhu léta 2013 jeví známky únavy a vyčerpání.\r\n</p>\r\n<hr />\r\n<h1>Významné pražské události 2011 - 2013\r\n</h1>\r\n<p>\r\n<em>Aby si každý mohl udělat přehled o neobvyklých až výjimečných událostech posledních let, a lépe \r\ntak pochopit současnou pražskou situaci, uvádím orientační posloupnost - doporučuji jako povinnou vzdělávací četbu.</em>\r\n</p>\r\n<p>\r\n<strong>2011, listopad</strong>: neznámý pachatel v průběhu společenské události intoxikuje nejsvětlejšího <a href="readperson.php?rid=63&amp;hidenotes=0">Pavla Maršíka</a> pro jiné vysoce návykovou drogou <a href="readcase.php?rid=25&amp;hidenotes=0">Blue Mountain</a>. Na samotné intoxikaci není zajímavého nic, její průběh i vznik následné silné závislosti odpovídá známým skutečnostem. Přesto se ale Maršík stane prvním (a prozatím také posledním) známým případem, kdy postižený svou závislost překoná. Dosti drastickým způsobem: v akutním abstinenčním deliriu prakticky umírá a následně je &quot;na prahu smrti&quot; oživen léčivým kouzlem. Není známo, že by kdy kdo podobný experiment zopakoval. Je známo, že na tento ojedinělý a nikdy podruhé neověřený postup a jeho kladný výsledek se &quot;nelze nijak spolehnout&quot;.\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>, nejtemnější: <a href="readperson.php?rid=87&amp;hidenotes=0">Alexandr Strauss</a></em>\r\n</p>\r\n<p>\r\n<strong>2012, přelom únor/březen:</strong> poprvé (nikoliv ale naposledy) zaznamenán výskyt vlkodlaka projevujícího neobvykle vysoké/silné vlastnosti/schopnosti, o moc větší, než by odpovídalo zjištěné kategorii - anebo kdy je nemožné kategorii běžnými prostředky určit. Vlkodlak je intoxikován <a href="readcase.php?rid=25&amp;hidenotes=0">Blue Mountain</a>, respektive její novou a pokročilejší formou tzv. Green Mountain. Její vlastnosti v tu chvíli nejsou ještě známy, její existence již ano. <em>(Pozn. autora: lidové, ale fakticky nesprávné označení Green Mountain vzniklo na základě odlišné barvy prvních vzorků 2. generace drogy, které se v Praze objevily; obecně je droga modrá a to jak původní, tak i novější/pokročilé verze; navíc od 2. generace výrobci nedlouho poté, co se v Praze objevila, pokročili.)</em> Zfetovaného vlkodlaka tehdy zajala NH.\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>, nejtemnější: <a href="readperson.php?rid=87&amp;hidenotes=0">Alexandr Strauss</a></em>\r\n</p>\r\n<p>\r\n<strong>2012, březen:</strong> na Vyšehradě na šancích se odehraje velice neobvyklý rituál, při němž asistuje (dalo by se přímo říci &quot;okouní&quot;) řada světlých i temných (včetně <a href="readperson.php?rid=143&amp;hidenotes=0">Evžena Bolíta</a>) a který provede velký temný mág <a href="readperson.php?rid=135&amp;hidenotes=0">Charistarch</a> osobně. Rituálem je navrácen zpět ze šera velký světlý mág <a href="readperson.php?rid=193&amp;hidenotes=0">Protegon</a>. Pozadí celé události: do šera se Protegon, vlastním jménem <a href="http://www.prazskahlidka.cz/?page_id=1068">František Sirkař</a> a bývalý šéf NH, odebral poté, co v roce 2010 vyzval na (inkvizicí schválený) duel Charistarcha, vlastním jménem Jonase Karolínu Hořínského, a řečený souboj prohrál. Charistarch vytáhl Protegona zpět ze šera po 2 letech zákulisních jednání, machinací a čachrů. Snad proto, že vlivem nepřítomnosti Protegona došlo k silné disbalanci a výrazné převaze tmy nad světlem v Praze převyšující tu obvyklou dlouhodobou. <strong>Technická poznámka:</strong> ať již šlo o náhodu anebo záměr, Protegon se navrátil do těla světlé zaříkávačky a příslušnice NH <a href="readperson.php?rid=64&amp;hidenotes=0">Markéty Feitové</a>. Tu dle dostupných informací šlo stěží považovat za příčetnou již před touto událostí, natožpak po ní. Trvalo ještě chvíli a vyžádalo si ještě jeden rituál (opět na Vyšehradě), než byl Protegon z této duální existence vysvobozen a Feitové zbaven. Feitová, když se opět stala sama sebou, rezignovala na své postavení v pražské NH. <strong>Zajímavost:</strong> u onoho druhého rituálu byla přítomna i mimokategoriální vědma <a href="http://www.prazskahlidka.cz/?page_id=1068">Alita/Yrime</a>, která do Prahy přijela jako temná, ale z ještě dalšího a jiného rituálu provedeného Charistarchem v Kinského zahradě dost možná odkráčela coby světlá<em>.</em> <em>(Pozn. autora: i zde se názory rozcházejí - někdo tvrdí, že změnila barvu, jiný, že pouze šeré jméno; každopádně se jí od té doby po straně přezdívá &quot;Zebra&quot;.)</em>\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>, nejtemnější: <a href="readperson.php?rid=87&amp;hidenotes=0">Alexandr Strauss</a></em>\r\n</p>\r\n<p>\r\n<strong>2012, březen:</strong> Prahou projde a notně krvavou stopu po sobě zanechá <a href="readperson.php?rid=155&amp;hidenotes=0">Hamid Jasan</a>. Známo je, že... se jednalo o velice silného temného mága, který vykazoval výjimečné schopnosti; pátral po mocném artefaktu nazývaném Orákulum (šera/pravdy); pozabíjel několik vědem a vědmáků (<a href="readactrep.php?rid=73&amp;hidenotes=0&amp;truenames=0">hlášení 21/03/2012</a>, <a href="readactrep.php?rid=77&amp;hidenotes=0&amp;truenames=0">hlášení 28/03/2012</a>). Hamid byl nakonec chycen a (inkvizicí) deportován z Prahy. (Po kuloárech se říká, že Hamid pracoval pro inkvizici a &quot;utrhl se ze řetězu&quot;.) Hamidova návštěva Prahy odstartovala doslova příval zájmu o Orákulum a vše s ním související, který pak DH i NH musí po nějakou dobu řešit a který ve svém důsledku přivodí takřka jednomyslnou (alespoň navenek tak deklarovanou) shodu mocných světlých i temných ve znění: &quot;Tokenová turistika nadále v Praze absolutně není vítána.&quot; Nejtemnější sama vydá v tomto smyslu oficiální prohlášení. Lze interpretovat i tak, že další &quot;tokenový turista&quot; by za podobné snažení mohl dostat ukrutně na budku (ne-li něco horšího) i od náhodného kolemjdoucího. Tento stav trvá až doposud (29/08/2013). <strong>Technická poznámka:</strong> &quot;tokeny&quot; jsou magické předměty s Orákulem související.\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>, </em><em>nejtemnější: </em><em><em><a href="readperson.php?rid=87&amp;hidenotes=0">Alexandr Strauss</a></em> (do poloviny března 2012), <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em> <em>(od poloviny března 2012)</em>\r\n</p>\r\n<p>\r\n<strong>Intermezzo - 2012, březen až srpen:</strong> aneb &quot;silní světlí mágové dělají v Praze pořádek&quot;. Zviditelnili se především dva jedinci: <a href="readperson.php?rid=136&amp;hidenotes=0">Jan Černý</a>, příslušník White Fistu. White Fist je elitářská (údajně přijímá pouze od 2. kategorie výše) organizace světlých mágů s ideologií &quot;kovaně světlou&quot;. Jejím cílem patrně není nic jiného než eliminace silných temných anebo temných vůbec. Její příslušníci vystupují vůči temným nepřátelsky a agresivně a neopominou žádného legálního prostředku. Jan Černý přijel do Prahy z Paříže na podzim 2011 coby posila NH a stal se mentorem <a href="readperson.php?rid=66&amp;hidenotes=0">Viktora Milera</a>. Toho dokonce na čas do Paříže odvezl a již na jaře 2012 byli oba zpět. (Miler po návratu začal nosit vojenský baret, kterýžto zvyk mu vydržel až doposud - 29/08/2013.) Černý osobně si získal u několika temných (např. <a href="readperson.php?rid=81&amp;hidenotes=0">Ragulin</a>) dokonce jistý respekt, jen... &quot;kdyby to nebyl zasratý fašista.&quot; (Většina temných, pochopitelně, ani toto stanovisko nesdílela.) Přestože původně měl Černý na mušce především šéfa DH <a href="readperson.php?rid=87&amp;hidenotes=0">Alexandra Strausse</a>, v srpnu 2012 podnikl akci jiným směrem: na &quot;příkaz shora&quot; unesl příslušníka DH <a href="readperson.php?rid=91&amp;hidenotes=0">Aleše Hradila</a> a ve střetu na Letenské pláni následujícím po celopražské pátračce nejprve zaútočil na denního hlídkaře <a href="readperson.php?rid=106&amp;hidenotes=0">Jičínského</a>, aby posléze zahynul v boji se zbytkem DH. Detaily nejsou známy. Říká se nicméně, že Černý by si nebyl býval Jičínského všiml, kdyby jej neupozornila noční hlídkařka <a href="readperson.php?rid=150&amp;hidenotes=0">Černá</a>. <strong>Druhým &quot;vykonavatelem spravedlnosti&quot;</strong> se stal <a href="readperson.php?rid=143&amp;hidenotes=0">Evžen &quot;doktor&quot; Bolíto</a>. Ten náležel k samozvané světlé domobraně <a href="readgroup.php?rid=22">Druhá strana mince</a> a šlo o mimořádně silného světlého mága producírujícího se po městě prakticky výhradně v druhé hladině šera s tzv. <a href="http://www.prazskahlidka.cz/?page_id=901">Dangexerovou obranou</a> a <a href="http://www.prazskahlidka.cz/?page_id=901">Mágovým mečem</a>. Do Prahy přijel proto, aby zabil denního hlídkaře <a href="readperson.php?rid=84&amp;hidenotes=0">Richarda Novotného</a>, záhy poté si i on vzal na mušku šéfa DH Alexandra Strausse, v několika střetech <a href="readactrep.php?rid=49&amp;hidenotes=0&amp;truenames=0">napráskal DH</a> (viz Bolítovo <a href="http://inkvizicnicentrala.webnode.cz/news/a13-3-2012-utok-na-nejtemnejsiho/">osobní prohlášení</a>), byl přítomen velkému Charistarchovu rituálu na Vyšehradě a týden nebo dva po <a href="readactrep.php?rid=48&amp;hidenotes=0&amp;truenames=0">13. březnu</a> zahynul v (sou)boji právě s Alexandrem Straussem<em>. (Pozn. autora: Evžen Bolíto Alexandra Strausse</em><em><em> opakovaně vyzýval</em> na duel, Strauss tyto výzvy oslyšel; jak nakonec ke střetnutí došlo, není známo, je známo, že Bolíto Strausse pronásledoval, a tedy jej buď dostihl anebo jím sám byl přepaden; Strauss patrně měl alespoň jednoho <a href="readperson.php?rid=96&amp;hidenotes=0">společníka</a>.)</em>\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>, nejtemnější: </em><em><em><a href="readperson.php?rid=87&amp;hidenotes=0">Alexandr Strauss</a></em> (do poloviny března 2012), <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em> <em>(od poloviny března 2012)</em>\r\n</p>\r\n<p>\r\n<strong>2012, srpen:</strong> na veřejnosti se začne objevovat a aktivně konat do té doby několik let v Praze zcela neaktivně žijící <a href="readperson.php?rid=157&amp;hidenotes=0">Vlad Dracula</a>. (Ano, tamten Dracula, absolutní jednička a bůh mezi upíry, minimálně těmi evropskými.) Co přesně se vlastně dělo, není veřejně známo, ví se ale, že... Několik jiných po setkání s Draculou výrazně oslabilo; Dracula používal jakýsi mocný artefakt, který snad <a href="readactrep.php?rid=103&amp;hidenotes=0&amp;truenames=0">zcizil z inkvizičního skladu</a> <em>(pozn. autora: údajně šlo o tzv. Pohár duší a Dracula jej nezcizil, ale prostě našel na místě bývalého přestěhovaného inkvizičního skladu; pohár byl posléze navrácen do rukou &quot;inspektora&quot; <a href="readperson.php?rid=200&amp;hidenotes=0">Trachty</a>)</em>; v Praze se začal aktivně projevovat i další nejvyšší upír, <a href="readperson.php?rid=87&amp;hidenotes=0">Alexandr Strauss</a> (tou dobou již bývalý velitel DH), který se utkal s Draculou o nadvládu nad <a href="readgroup.php?rid=28&amp;hidenotes=0">jeho potomky</a> (a prohrál). Posléze se Dracula pokusil zabít Strausse v Dejvicích na Vítězném náměstí. Do tohoto střetu zasáhl <a href="readperson.php?rid=135&amp;hidenotes=0">Charistarch</a>, umožnil Straussovi uprchnout a když Dracula neuposlechl Charistarchovu výzvu k opuštění Čech, došlo mezi ním a Charistarchem k okamžitému souboji, v němž byl Dracula se svou ženou zničen. <a href="readgroup.php?rid=28&amp;hidenotes=0">Draculovi potomci</a> nikoliv. Uposlechli výzvu velkého temného mága a finálního střetnutí mezi jím a svým stvořitelem se nezúčastnili. Setrvali pak v Praze ještě nějakou dobu a zahynuli - až na <a href="readperson.php?rid=217&amp;hidenotes=0">jednoho</a> - během následných bojů o uvolněnou pozici upíra č. 1. Celý případ měl (na jaře 2013) oficiální dohru v podobě inkvizičního tribunálu, v němž byl Charistarchovi udělen velice <a href="readcase.php?rid=55&amp;hidenotes=0">nepříjemný trest</a> a jejž nemalá část pražských temných považovala za vykonstruovaný a výsměch spravedlnosti. V uvedeném procesu byl žalobcem nový nejsvětlejší <a href="readperson.php?rid=204&amp;hidenotes=0">Martin Smutný</a>, který sám ale později naznačil, že s touto rolí zdaleka nebyl srozuměn. <strong>Technická poznámka:</strong> <a href="readperson.php?rid=200&amp;hidenotes=0">Viktor Trachta</a>, po straně přezdívaný &quot;<a href="http://www.csfd.cz/film/8544-rozpusteny-a-vypusteny/">inspektor</a>&quot;, je inkviziční koryfej nově jmenovaný do Prahy. Nahradil předchozího koryfeje <a href="readperson.php?rid=86&amp;hidenotes=0">Kašpara Hrubého</a>. Ten byl z Prahy odvolán a po soudu kolegia inkvizičních magistrů <a href="http://www.prazskahlidka.cz/?page_id=1068">degradován na adepta</a>.\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: </em><em><a href="readperson.php?rid=204&amp;hidenotes=0">Martin Smutný</a>, nejtemnější: <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em>\r\n</p>\r\n<p>\r\n<strong>2012, podzim:</strong> do Prahy přijíždí velká světlá <a href="readperson.php?rid=213&amp;hidenotes=0">Světlana Goroděcká</a>. Jinak vládne neobvyklý klid. Tedy snad až na <a href="readactrep.php?rid=133&amp;hidenotes=0&amp;truenames=0">Rolničky</a>.\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: </em><em><a href="readperson.php?rid=204&amp;hidenotes=0">Martin Smutný</a>, nejtemnější: <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em>\r\n</p>\r\n<p>\r\n<strong>2013, březen:</strong> odehraje se velký inkviziční tribunál, v němž je&nbsp;<a href="readperson.php?rid=135&amp;hidenotes=0">Charistarchovi</a> udělen <a href="readcase.php?rid=55&amp;hidenotes=0">nepříjemný trest</a>. A vzápětí vypukne zuřivá soutěž o pozici &quot;nové temné jedničky&quot; v Praze. Nejvážnějšími pretendenty se stanou sourozenci <a href="readactrep.php?rid=168&amp;hidenotes=0&amp;truenames=0">Ermoliovi</a>: dvojice mimokategoriálních temných - ona vědma(?) Andrea a on mág Matthiass - s doprovodnou suitou několika dalších temných vysokých kategorií. Vznesou požadavky na v podstatě výlučně dominantní postavení v Praze a když jim ani NH (nechce), ani DH (nemá jak) nevyhoví, události naberou spád. V prvním hromadném střetnutí u <a href="readactrep.php?rid=46&amp;hidenotes=0&amp;truenames=0">magického zřídla</a> v Bezručových sadech sourozenci se svou suitou rozpráší prakticky kompletní DH, včetně několika přítomných pozorovatelů z NH. (Toto střetnutí nicméně Ermoliovce stojí větší část jejich <a href="readactrep.php?rid=170&amp;hidenotes=0&amp;truenames=0">doprovodu</a>.) Tlak vyvíjený sourozeneckým párem dále eskaluje a vrcholí zabitím (v oněch dnech právě na pozici nejsvětlejšího rezignovavšího) <a href="readperson.php?rid=204&amp;hidenotes=0">Martina Smutného</a>. Pro obě pražské hlídky představují Ermoliovci záhy hrozbu takového kalibru, že dojde ke vzácné, byť jen velmi dočasné, spolupráci, v jejímž důsledku je na oficiální společnou žádost obou hlídek ukončen Charistarchův trest. Při druhém velkém střetu jsou - již za pomoci Charistarcha - sourozenci Ermoliovi příslušníky denní i noční hlídky zpacifikováni a předáni &quot;inspektorovi&quot; <a href="readperson.php?rid=200&amp;hidenotes=0">Trachtovi</a>. Matthiass vzápětí uprchne, Andrea je inkvizicí deportována do Amsterodamu. Matthiass opustí Prahu - poté, co oběma hlídkám adresuje náležitou porci výhrůžek, včetně příslibu možného návratu. <strong>Dalším temným mimo kategorie</strong>, který do Prahy tou dobou zavítá, je vědmák <a href="readperson.php?rid=242&amp;hidenotes=0">Mortis Cogen</a>. On sám přímo žádnou katastrofu nezaviní, nervozitu ale vyvolá stále zřejmější skutečnost, že se jedná o dalšího &quot;tokenového turistu&quot;. <strong>V souvislosti s Charistarchovým trestem </strong>(dokud tento trvá) začne <a href="readcase.php?rid=55">dělat problémy</a> i náhle se objevivší &quot;skupina anarchistů&quot;, patrně vedená <a href="readperson.php?rid=244&amp;hidenotes=0">Nestorem Machnou</a>. Po chvíli v činnosti ustane a zmizí, jako se prve objevila. <em>(Pozn. autora: konec počátečního rozletu (dle sebe sama) mimořádně lstivého manipulátora Nestora Machny znamenal okamžik, kdy se mimořádně neprozřetelně pokusil opít vědmáka <a href="readperson.php?rid=238&amp;hidenotes=0">Anguse MacMalloryho</a> - MacMallory tehdy vážil 130 kg, Machna 80, you see? - a vyblábolil i to, co sám nevěděl; tedy kromě toho, že vedl hodinový rozhovor se šéfem operativy DH <a href="readperson.php?rid=81&amp;hidenotes=0">Ragulinem</a>, aby mu čtvrt hodiny na to chroptěl do telefonu výhrůžky bez hlasového modulátoru.)</em> <strong>Zajímavost:</strong> opíjení s temnými, konkrétně s příslušníky a externisty pražské DH, je vůbec pro mnoho jiných rizikovou záležitostí. Legendárním se stane výrok Martina Smutného &quot;Já mám problém se u vás na štábu opít&quot;, po němž následuje pitka rovněž legendární. Dojde málem i na striptýz (pánský v pánské společnosti - sic), účastníci vidí dvojmo ještě celý příští den a Nejsmutnějšího k ránu musí odnést golem. Vzpomínka na tuto akci rozhodně jen tak nevymizí. <em>(Pozn. autora: po přečtení předcházející pasáže by světlí nepochybně káravě pronesli &quot;o mrtvých jen dobře&quot; - my, temní, víme, že o mrtvém právě v dobrém hovoříme.)</em> <strong>Po delší nepřítomnosti</strong> se do Prahy vrací temný mág <a href="readperson.php?rid=137&amp;hidenotes=0">Lethold</a> coby inkviziční čekatel. Je to poprvé, kdy v Praze nastálo působí 2 inkvizitoři. <strong>Na konci března</strong> opouští Prahu velká světlá <a href="readperson.php?rid=213&amp;hidenotes=0">Světlana Goroděcká</a>. A patrně ji neopouští v dobrém rozpoložení... Světlí totiž provedli jakýsi záhadný rituál, v jehož důsledku se zaříkávač <a href="readperson.php?rid=252&amp;hidenotes=0">Tadeáš Vávra</a> rázem vyhoupl na 2. kategorii - jenže v tu chvíli to kdesi na východě udělalo *plop* a o kus síly přišla Naděnka, milovaná dcerka Světlany a Antona Goroděckého a světlý nulový supermág. <em>(Pozn. autora: v létě 2013 se ukáže, že to rozhodně nebyla šťastná investice.)</em>\r\n</p>\r\n<p>\r\n<em>nejsvětlejší: </em><em><a href="readperson.php?rid=133&amp;hidenotes=0">Lea Poláková</a>, nejtemnější: <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em>\r\n</p>\r\n<p>\r\n<strong>2013, srpen:</strong> již od jara 2013 se u různých (světlých i temných) jiných vyskytují chaotické a nejasné vize věcí příštích, v létě tento stav nabývá na intenzitě. Po straně se někdy hovoří i o možnosti &quot;probuzení Prahy&quot;, aniž by ovšem bylo zcela jasné, co přesně se tím vlastně míní. <em>(Pozn. autora: někteří informovanější jiní disponují kusými zprávami o podobných událostech jinde ve světě; kusé zprávy se většinou shodují v tom, že se v žádném případě nejedná o událost bezproblémovou.)</em> Zákulisní šepot zesílí, když <a href="readperson.php?rid=84&amp;hidenotes=0">Richard Novotný</a> za přítomnosti členů DH, NH a inkvizitora <a href="readperson.php?rid=200&amp;hidenotes=0">Trachty</a> provede svůj velký rituál na Albertově. Co přesně mělo být jeho výsledkem, není známo, známo ale je, že bezprostředně po ukončení rituálu se na první hladině šera zjevilo několik šerých přízraků, s nimiž měly následně obě hlídky nemalé problémy. Znepokojený Trachta vyhlásí &quot;albertovské rituální embargo&quot;. <strong>Společenskou hladinu rozčeří</strong> a terčem uštěpačných poznámek se stane případ, kdy příslušník NH <a href="readperson.php?rid=252&amp;hidenotes=0">Tadeáš Vávra</a> - který na jaře 2013 poskočil na 2. kategorii, přijal šeré jméno Ateron a složil slavnou přísahu &quot;rytíře světla&quot; - okrade dva rozhádané světlé zaříkávače o vzácnou magickou hůlku. Okradení jsou nuceni se obrátit na Denní hlídku, zastane se jich <a href="readperson.php?rid=95&amp;hidenotes=0">nejtemnější</a> osobně. Z rytíře světla je rázem rytíř straka a z popudu <a href="readperson.php?rid=81&amp;hidenotes=0">neznámého temného kreativce</a> proběhne &quot;masivní letáková kampaň&quot;. <strong>Dalším neoblíbeným cizincem v Praze</strong> se stane vědmák (pravděpodobně) 1. kategorie Fritz Rentrop (aka Steinhoffer - do Prahy přibyl již v březnu 2013), který se nijak netají svou příslušností k Thule a který chladnokrevně provede rituální &quot;experiment&quot;, jehož výsledkem je mrtvý vlkodlak (&quot;vždyť je to jen nižší rasa&quot;). Dle na veřejnosti a před svědky pronesených poznámek lze soudit, že Rentrop má s podobnou praxí bohaté zkušenosti. Nyní se nachází ve vazbě a probíhá šetření (29/08/2013). <em>(Pozn. autora: pobytu Fritze Rentropa v Praze předcházel, rovněž problémový, pobyt nájemného vědmáka <a href="readperson.php?rid=224&amp;hidenotes=0">Ladislava Alexandra Malinovského</a>, též vyslance, nikoliv ale příslušníka Thule</em><em>.)</em> <strong>Technická poznámka:</strong> Thule je původně tajný spolek světlých i temných jiných s aristokratickými \r\nkořeny. Filozofii příslušníků Thule lze především charakterizovat hesly \r\n&quot;účel světí prostředky&quot; a &quot;v zájmu vědy vše&quot; a velkou měrou \r\nantisemitismu. Thule vznikla v roce 1912 z již dříve aktivních \r\nmetaspolků. Za druhé světové války využila nacismus, jehož rozmach jí \r\nposkytl do té doby nepředstavitelné možnosti a zdroje, lidské, materiální i \r\njiné.<strong><br />\r\n</strong>\r\n</p>\r\n<p>\r\n<em>nejsvětlejší:&nbsp;</em><em><a href="readperson.php?rid=67&amp;hidenotes=0">Viktorie Tesařová</a>, nejtemnější: <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em>\r\n</p>\r\n<p>\r\n<strong>2013, prosinec:</strong> vědmák 1. kategorie a příslušník Thule Fritz Rentrop (aka Steinhoffer), který v srpnu 2013 chladnokrevně provedl rituální experiment, jehož výsledkem byl mrtvý vlkodlak, spravedlnosti nakonec skutečně vyklouzne. Podle zákulisních zdrojů pro něj přijeli dva inkvizitoři, vyzvedli jej přímo před soudem, Rentrop obdařil okolí zářivým úsměvem ve stylu &quot;já to přece říkal&quot; a pak celé trio odfrčelo. <strong>Vztahy mezi NH a DH (světlými a temnými</strong>)<strong> </strong>jsou opět napjaté. Dle temných (DH) se světlí (NH) radikalizují a začínají být až nepříjemně drzí, světlí sami to vidí tak, že &quot;se konečně dokážeme postavit na odpor a říci ''Ne!''&quot;. Pouliční šum bůhvíproč začne vydávat vlny o délce &quot;hlídky jsou ve válečném stavu&quot;, což notnou část DH (tedy jednu z válčících stran) překvapí (&quot;my jsme ve válečném stavu?&quot;). <strong>V Praze se vyskytne elitní asasin</strong> z jednoho ze dvou (údajně) starodávných rodů Sinisterů a Dexterů. Řečené rody spolu po hroznou fůru let, snad i staletí, soupeří, a v důsledku toho se jejich příslušníci s železnou pravidelností utkávají v rituálních soubojích. Tedy abychom byli přesní: v Praze se vyskytnou hned dva elitní asasini, po jednom z každého z obou rodů, ale jednoho neznámý pachatel promptně podřízne na Parukářce, pročež druhý začne postrádat osudem mu předurčeného protivníka a dělat dusno. Situaci nakonec vyřeší šampion světla <a href="readperson.php?rid=248&amp;hidenotes=0">Muttermuller</a>: k všeobecnému překvapení v souboji elitního asasina postrádajícího původně osudem mu předurčeného protivníka porazí. <a href="readperson.php?rid=81&amp;hidenotes=0">Ragulina</a> to přijde na <a href="http://boidus.co.uk/wp-content/uploads/3-EURO-FRONT.jpg">pěkný litr</a> za prohranou sázku - všeobecno na ztrátu překvapení, když se pak ukáže, že elitní asasin si počínal tak trochu jako <a href="http://www.youtube.com/watch?v=i01B9_5MWC8">Franta Jouda</a> a nestihl vyšrotovat logický závěr, že když bude mít jiného než původně osudem mu předurčeného protivníka, mohla by původní předem připravená kombatní specializace hrubě nedostačovat. <em>(Pozn. autora: nedostačila. Nu což, kdo jsme my, abychom elitní asasiny posuzovati mohli...)</em>\r\n</p>\r\n<p>\r\n<em>nejsvětlejší:&nbsp;</em><em><a href="readperson.php?rid=67&amp;hidenotes=0">Viktorie Tesařová</a>, nejtemnější: <a href="readperson.php?rid=95&amp;hidenotes=0">Eva Schwarzkoppová</a></em>\r\n</p>\r\n<hr />\r\n<h1>Blue Mountain 2011 - 2013</h1>\r\n<h1>\r\n</h1>\r\n<p>\r\n<strong>2011, listopad:</strong> v Praze se objeví první skutečně velká dodávka toxické a pro jiné vysoce návykové magické drogy <a href="readcase.php?rid=25&amp;hidenotes=0">Blue Mountain</a>. Jedná se o &quot;1. generaci&quot; této drogy a brzy je zřejmé, že ke vzniku fatální závislosti dochází u většiny jiných již po aplikaci druhé dávky. Spolu s dodávkou drogy se začne vyskytovat i řada zájemců a závislých, nejčastěji z řad upírů. O drogu se zajímá DH i NH. Během společenské události v baru Necropolis na Vinohradské je intoxikován nejsvětlejší <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>, který se stane prvním - a prozatím také jediným - známým závislým překonavším návyk. (Viz &quot;Významné pražské události 2011 - 2013&quot;, heslo &quot;2011, listopad&quot;.)\r\n</p>\r\n<p>\r\n<strong>Pozadí:</strong> Blue Mountain byla do Prahy přivezena z Plzně, kde se před listopadem 2011 již několik let vyráběla. Situace v Plzni v průběhu té doby vyústila v podstatě v otevřenou válku mezi konkurenčními výrobně-distribučními gangy upírů a vlkodlaků a do stavu, kdy se příslušníci plzeňské DH i NH buď báli vystrčit nos na ulici anebo na celé záležitosti i sami podíleli. Stručně: <a href="http://en.wikipedia.org/wiki/Dodge_City,_Kansas">Dodge City</a> v tuzemském provedení, jenže bez <a href="http://en.wikipedia.org/wiki/Wyatt_Earp">Wyatta Earpa</a>. Přesná struktura &quot;drogových klanů&quot; není známa, známo je jen to, že v pozadí stál jakýsi &quot;pan K.&quot; (a to je také vše, co je známo). Není ani známo, která skupina (zda vlkodlaci či upíři) s výrobou začala a která - a jak - jí recepturu ukradla anebo okopírovala. A tedy není ani známo, zda tajemný pan K. stál za oběma skupinami anebo pouze za jednou z nich a ta druhá byla svébytnou, nevítanou a nepotřenou konkurencí. Ví se ale, že jeden ze soupeřících &quot;klanů&quot; tvořili téměř výhradně upíři, zatímco ten druhý, byť v něm převažovali vlkodlaci, i další jiní. Za drogu se platilo povolenkami všech kategorií a magickými předměty všeho druhu. (Táž monetární politika následně zafungovala i v Praze.) Podle kusých informací, které k dispozici jsou, by &quot;to stačilo naplnit hangár&quot;. Ani povolenky, ani předměty nebyly nikdy vystopovány či zadrženy. Někteří dealeři (a doprovodní ranaři) později tvrdili, že byli tak či onak panem K. vydíráni a pracovat pro něj museli.\r\n</p>\r\n<p>\r\n<strong>Podstata:</strong> Blue Mountain se vyrábí z modrého mechu, cizopasného parazita obývajícího 1. hladinu šera. Výrobní proces není znám a nebyl odhalen ani navzdory snaze výzkumníků pražské NH, ani navzdory vzorkům odvezeným či odeslaným do zahraničí. Droga se poměrně rychle samovolně rozkládá, takže nelze uchovávat zásoby déle než jen velice krátce. Na jiné má vysoce opojný účinek, který se naprosto vymyká veškerým známým normálním drogám - alespoň dle slov závislých uživatelů. A, jak se ukázalo v průběhu času, na tzv. nižší temné, upíry a vlkodlaky, má i jiné než pouze opojné účinky. U 1. generace drogy vznikala fatální závislost po požití druhé dávky. U 2. generace drogy - s lidovým, ale fakticky nesprávným označením Green Mountain - vznikala fatální závislost po požití první dávky (tedy okamžitě). Jak a zdali vznik závislosti probíhá u dalších generací/verzí preparátu, není známo/doloženo. Abstinenční stav u závislých na 1. a 2. generaci drogy měl rychlou progresi v řádu hodin, max. dní, vedl ke stavu (agresivní) nepříčetnosti až deliria, u vlkodlaků a upírů doprovázeného prakticky neovladatelným hladem (záhy té nejvyšší intenzity). V několika dnech každý abstinující zemřel, nebyla-li mu podána další dávka drogy. Uspokojivě prokázán a doložen je jediný případ přeživšího abstinujícího: <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a>.\r\n</p>\r\n<p>\r\n<strong>2012, březen:</strong> drogový byznys v Praze jede na plné obrátky. Přitahuje zájem četných jiných (opět: velice často, ale ne pouze upírů) z Čech i Evropy. Alespoň jednoho vzorku se zmocní příslušnice NH Paříž a obratem jej do Paříže odveze. <em>(Pozn. autora: zbytečně, výrobní proces - minimálně do prosince 2012 - nikdo nedokázal odhalit a drogu nelze dlouhodobě přechovávat.)</em> Objeví se 2. generace drogy lidově označovaná jako Green Mountain. <em>(Pozn. autora: tento fakticky a v širším horizontu zavádějící název se zakládal na nestandardní barvě několika prvních vzorků: byly zelené; předchozí 1. generace i veškeré následné várky 2. generace drogy již byly &quot;normálně&quot; modré.)</em> Noční hlídka s překvapivými obtížemi zatkne (abstinujícího a hladového) vlkodlaka projevujícího neobvykle vysoké/silné vlastnosti/schopnosti, o moc větší,\r\nnež by odpovídalo zjištěné kategorii - anebo nelze kategorii \r\nběžnými prostředky určit. Vlkodlak nese stopy intoxikací Green Mountain, tedy 2. generací drogy. Takových jedinců se v Praze do konce roku 2012 vyskytne anebo je v podezření ještě několik. <strong>Technická poznámka:</strong> pražská NH se dlouhodobě (až do března 2013) pokoušela <a href="readactrep.php?rid=140&amp;hidenotes=0&amp;truenames=0">testovat/prokazovat stopy Blue/Green Mountain</a> v krvi řady zadržených. Neuspěla. Přítomnost Green Mountain v těle prvního zadrženého vlkodlaka &quot;mimořádných vlastností&quot; určil vlastní metodou specialista mimo NH.\r\n</p>\r\n<p>\r\n<strong>Intermezzo - 2012, duben až červenec:</strong> drogový byznys v Plzni nečekaně a zcela naráz skončí. Vytratí se, beze stop, všichni dealeři, zmizí veškeré dodávky a vše s tím spojené. Do konce roku 2012 postupně v Plzni nastane i relativní klid a normální život, který v ní kdysi před začátkem celé několikaleté modré aféry panoval. <strong>V Praze</strong> obchod s drogou i dění s ní spojené pokračuje, nicméně s postupně poněkud klesající intezitou. &quot;Trhem&quot; projdou poslední zbytky 1. generace drogy (Blue Mountain), pak je nahradí 2. generace drogy (tou dobou již zcela &quot;normálně&quot; modrá Green Mountain). A posléze se zdá, jako by i toto ustalo. \r\n</p>\r\n<p>\r\n<strong>2012, srpen:</strong> na sklonku léta (po smrti svého stvořitele <a href="readperson.php?rid=157&amp;hidenotes=0">Vlada Draculy</a>) informuje <a href="readperson.php?rid=214&amp;hidenotes=0">Scara Dragonari</a> DH o tom, že Blue Mountain se v Praze vyskytovat opět začala. (Pravděpodobně tedy mezi upíry). Krátce na to Scara Dragonari <a href="readcase.php?rid=39">zemře</a> a DH už se dalších informací nedočká. Jelikož nemůže jít o zbytky původních dodávek 1. a 2. generace drogy (nevydržely by), ani o nové dodávky z Plzně (výroba ustala), musí jít o novou produkci. Kde a jak, není známo (16/03/2013). Zda jde stále o 2. generaci drogy anebo vývoj od té doby pokročil, není známo (16/03/2013). \r\n</p>\r\n<hr />\r\n<h1>Jiní v lidové slovesnosti\r\n</h1>\r\n<p>\r\n<em>Jak my temní říkáme (nejen) světlým...</em>\r\n</p>\r\n<p>\r\n<strong>Česílko</strong> - <a href="readperson.php?rid=248&amp;hidenotes=0">Jan Muttermuller</a> (světlý obrateň, NH Praha)&nbsp;\r\n</p>\r\n<p>\r\n<strong>Maskáčové duo</strong> - <a href="readperson.php?rid=150&amp;hidenotes=0">Krista Černá</a> (světlý mág, NH Praha) a <a href="readperson.php?rid=66&amp;hidenotes=0">Viktor Miler</a> (světlý pův. obrateň/nyní mág, NH Praha)<a href="readperson.php?rid=66&amp;hidenotes=0"></a> \r\n</p>\r\n<p>\r\n<strong>Mengele</strong> - <a href="readperson.php?rid=67&amp;hidenotes=0">Viktorie Tesařová</a> (světlá léčitelka, od jara 2013 nejsvětlejší NH Praha)<a href="readperson.php?rid=67&amp;hidenotes=0"></a>\r\n</p>\r\n<p>\r\n<strong>Nejsmutnější</strong> - <a href="readperson.php?rid=204&amp;hidenotes=0">Martin Smutný</a> (světlý mág, od srpna 2012 do jara 2013 nejsvětlejší NH Praha) (+RIP)\r\n</p>\r\n<p>\r\n<strong>Planetka</strong> - <a href="readperson.php?rid=63&amp;hidenotes=0">Pavel Maršík</a> (světlý mág, od podzima 2011 do jara 2012 nejsvětlejší NH Praha) (+RIP) \r\n</p>\r\n<p>\r\n<strong>Straka</strong> -&nbsp; <a href="readperson.php?rid=252&amp;hidenotes=0">Tadeáš Vávra</a> (světlý zaříkávač, NH Praha - viz události, srpen 2013) \r\n</p>\r\n<p>\r\n<strong>Sysel</strong> - <a href="readperson.php?rid=250&amp;hidenotes=0">Anděla Ondruchová</a> (světlý obrateň, NH Praha)<a href="readperson.php?rid=250&amp;hidenotes=0"></a>\r\n</p>\r\n<p>\r\n<strong>\r\nZebra</strong> - <a href="http://www.prazskahlidka.cz/kdo">Alita/Yrime</a> (mimokategoriální vědma/léčitelka(?) - viz události, březen 2012)\r\n</p>\r\n<p>\r\n<em>... a jak oni říkají nám (i sami sobě)</em>\r\n</p>\r\n<p>\r\n<strong>Haf</strong> - <a href="readperson.php?rid=248&amp;hidenotes=0">Jan Muttermuller</a> (světlý obrateň, NH Praha)&nbsp;&nbsp;\r\n</p>\r\n<p>\r\n<strong>Chujodlak</strong> - <a href="readperson.php?rid=91&amp;hidenotes=0">Aleš Hradil</a> (temný mág, DH Praha)<a href="readperson.php?rid=91&amp;hidenotes=0"></a>\r\n</p>\r\n<p>\r\n<strong>Pyčus / Ryšánek</strong> - <a href="readperson.php?rid=84&amp;hidenotes=0">Richard Novotný</a> (temný mág, DH Praha)\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 0);
INSERT INTO `nw_dashboard` (`id`, `created`, `iduser`, `content`) VALUES
(1, 1354200439, 34, '<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Oběžník Denní hlídky Praha, 29/11/2012</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Prohlášení Nejtemnější města Prahy</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Drazí Temní,</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>společně se nám podařilo překonat mnohé překážky. Když se zvedla bouře nepokojů Světlých, vaše Hlídka stála při vás. Když jste se na nás obrátili v tíživé situaci, vaše Hlídka vám přispěchala ku pomoci. Na tom se nic nezměnilo a nezmění, Praha zůstane temnou a bude vůči vám vždy pohostinná.</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>V posledních několika letech se vyskytl v Praze jistý fenomén - vyvolávání tzv. tokenů k něčemu, co se nazývá Orákulem. O tomto Orákulu kolují divoké zkazky, z nichž je jen zlomek pravdivý. Přesto se však v Praze stalo vyvolávání tokenů, tedy jakýchsi klíčů, téměř sportem pro vědmáky i ostatní Temné. Dovoluji si vás tímto všechny upozornit, že takové počínání vždy vedlo k fatálním následkům. Vězte, že Denní hídka města Prahy se v tomto směru angažuje a vyšetřuje dostatečně. Pokud byste proto cítili puzení něco takového provozovat, obraťte se na Denní hlídku Praha a společně můžeme zabránit tomu, abyste přišli k úhoně. Pokud se rozhodnete toto doporučení neuposlechnout, ponesete následky nelibosti Denních hlídkařů a mého lehkého rozladění. &ldquo;Tokenová turistika&rdquo; se tímto zapovídá ve všech svých podobách.</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Proslula jsem v Praze tím, že jsem advokátkou Temných a jsem připravena se ve prospěch pražských Temných silně angažovat (viz povolenky pro upíry a vlkodlaky). Přesto se již našli tací, kteří se pokusili mého nasazení zneužívat. Zřejmě zde došlo k politováníhodnému nedorozumění - budou chráněni takoví Temní, kteří jsou si vědomi důležitosti toho, co pro ně Denní hlídka činí, a prokazují jí za to patřičnou úctu. Ti, již toto nechápou, zůstanou na pospas následků své hlouposti.</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Věřím, že spoustě z vás toto mé prohlášení nepřineslo nic nového a vše si již dávno uvědomujete. Avšak je třeba myslet na ty, kteří se v Praze nezdržují příliš dlouho, nebo o situaci nijak zvlášť nepřemýšleli. Nyní jsem přesvědčena, že je vše zcela jasné. V opačném případě neváhejte se svými dotazy kontaktovat centrálu Denní hlídky Praha.</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>S pozdravem,</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Eva Schwarzkoppová,</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Nejtemnější města Prahy</span></font>\r\n</div>\r\n'),
(2, 1363363331, 22, '<div>\r\n<strong>Telefon na štáb: 606 855 813</strong>&nbsp;\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Oběžník Denní hlídky Praha, 29/11/2012</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Prohlášení Nejtemnější města Prahy</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>Drazí Temní,</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>společně se nám podařilo překonat mnohé překážky. Když se zvedla bouře nepokojů Světlých, vaše Hlídka stála při vás. Když jste se na nás obrátili v tíživé situaci, vaše Hlídka vám přispěchala ku pomoci. Na tom se nic nezměnilo a nezmění, Praha zůstane temnou a bude vůči vám vždy pohostinná.</span></font>\r\n</div>\r\n<div>\r\n<font face=&quot;Verdana, Arial, sans-serif&quot;><span style=&quot;font-size: 12px; line-height: 18px&quot;>V posledních několika letech se vyskytl v Praze jistý fenomén - vyvolávání tzv. tokenů k něčemu, co se nazývá Orákulem. O tomto Orákulu kolují divoké zkazky, z nichž je jen zlomek pravdivý. Přesto se však v Praze stalo vyvolávání tokenů, tedy jakýchsi klíčů, téměř sportem pro vědmáky i ostatní Temné. Dovoluji si vás tímto všechny