INSERT INTO `nw_groups` (`id`, `title`, `contents`, `datum`, `iduser`, `deleted`, `secret`) VALUES
(5, 'SkupinaA', 'asdfasdfas\r\n', 1328278839, 21, 1, 1),
(6, 'Studijní materiály', '<div>\r\nCIA, KUBARK Counterintelligence Interrogation, July 1963&nbsp;\r\n</div>\r\n<div>\r\n<a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Kubark%201-60.pdf" class="odkaz">Part 1 (pp. 1-60)</a> - <a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Kubark%2061-112.pdf" class="odkaz">Part II (pp. 61-112)</a> - <a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Kubark%20113-128.pdf" class="odkaz">Part III (pp. 113-128)</a>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nCIA, Human Resource Exploitation Training Manual - 1983\r\n</div>\r\n<div>\r\n<a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Human%20Res%20Exploit%20A1-G11.pdf" class="odkaz">Part I (pp. 1-67)</a> - <a rel="nofollow" href="http://www.gwu.edu/~nsarchiv/NSAEBB/NSAEBB122/CIA%20Human%20Res%20Exploit%20H0-L17.pdf" class="odkaz">Part II (pp. 68-124)</a>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n<a rel="nofollow" href="http://www.ballistichelmet.org/school/free.html" class="odkaz">Freedom Fighter''s Manual</a>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nMKULTRA <a rel="nofollow" href="http://www.archive.org/details/tmdg" class="odkaz">http://www.archive.org/details/tmdg</a>\r\n</div>\r\n', 1328648935, 26, 1, 0),
(7, 'Noční Hlídka', '<p>\r\nInkompetenti od protistrany\r\n</p>\r\n<p>\r\nje tam i lecitelka&nbsp;\r\n</p>\r\n', 1328711487, 26, 0, 0),
(8, 'Denní Hlídka', '<p>\r\nTo jsme my, případně vy, co to čtete. :) (a světlý co to čtou volejte Charistarchovi)&nbsp;\r\n</p>\r\n', 1328712610, 26, 0, 0),
(9, 'Obrateň', 'Světlý mág se schopností přeměny do bojově zdatného zvířete.\r\n', 1328729591, 22, 0, 0),
(10, 'Závislí na Blue Mountain', 'Projevy závislosti: netuším\r\n', 1328729752, 22, 0, 0),
(11, 'Léčitel', 'Doplnit informace.\r\n', 1328783041, 22, 0, 0),
(12, 'Zaříkávač', 'Světlí uživatelé amuletů a hůlek.\r\n', 1328783664, 22, 0, 0),
(13, 'Bílý mág', 'Doplnit informace.\r\n', 1328783878, 22, 0, 0),
(14, 'agfa', 'sdfgsd\r\n', 1330099289, 22, 1, 0),
(15, 'Upír', 'Tupíři\r\n', 1330294304, 26, 0, 0),
(16, 'Inkvizice', 'Mají je všude a všude jsou stejně oblíbení.\r\n', 1330294326, 26, 0, 0),
(17, 'Černý mág', 'The dark side is strong with this one.\r\n', 1330294978, 26, 0, 0),
(18, 'Vlkodlak', 'Vlkodlaci a jiní dlaci.\r\n', 1330532657, 26, 0, 0),
(19, 'Vědma', 'Dělají amulety a páchají všelijaké jiné rozmanité zlo.\r\n', 1330533859, 26, 0, 0),
(20, 'Zácvik', 'Nováčci\r\n', 1330539409, 26, 0, 0),
(21, 'Operativa', 'Operativa\r\n', 1330539506, 26, 0, 0),
(22, 'Druhá strana mince', '<p>\r\nDomobrana Světlých, dříve pobouřená údajnou neschopností Hlídek v kauze autobus, t. č. pobouřená neschopností Noční hlídky.\r\n</p>\r\n<p>\r\nŽivelná síla, nutno s jejich členy zacházet opatrně. \r\n</p>\r\n', 1331130137, 32, 0, 0),
(23, 'White Fist', '<p>\r\n&quot;tajné&quot; bojové oddíly světlých. návaznost na NH neznámá plně. skupian která často operuje mimo hlídky i v hlídkách v utajení.\r\n</p>\r\n<p>\r\njejí členové jsou mezi druhou kategorií a mimo&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nBílá pěst (White Fist)<br />\r\nJiné z této skupiny slouží nebo sloužili v \r\narmádách a různých speciálních jednotkách celého světa. Jedná se o \r\nhlavní úderný oddíl Noční hlídky. Je to drobná, ale o to silněji a lépe \r\norganizovaná skupina mocných světlých &ndash; z důvodu lepšího utajení se \r\njedná hlavně o první <br />\r\na druhé kategorie &ndash; kteří se specializují na \r\nrychlé zásahy, bleskové souboje a přepadávání. <br />\r\n<br />\r\nElitnější jedinci\r\nsídlí ve Spojených státech. <br />\r\n<br />\r\nK historicky významným událostem \r\npatří některé skutky, které dokázali již na bojištích první a druhé \r\nsvětové války. Účastnili se bitvy o Ardeny, odráželi útoky Rommela v \r\nAfrice, nebo byli u prvního nasazení bojového plynu u bitvy v Ypres. \r\nNěkteří se účastnili dokonce bitvy u Stalingradu. <br />\r\n<br />\r\nBojují za \r\nsvětlo, nikoliv za dobro. Vzhledem ke svému postavení a postoji, který k\r\nnim zachovává vrchnost Světlých, se jedná o velmi elitářskou skupinu, \r\nkterá se může rovnat předním elitním jednotkám. Byli založeni v Itálii \r\njakožto předchůdci slavných templářů. Momentální sídlo mají v Benátkách.\r\n<br />\r\n<br />\r\nVětšina z artefaktů, které jsou zabaveny Noční hlídkou, jde \r\npřímo k Bílé Pěsti. Představený je téměř neznámý, komunikuje pouze \r\npomocí poslů. <br />\r\n<br />\r\nBěhem křížových výprav byli známi jako Očistec \r\nGesherův. \r\n</p>\r\n', 1331557775, 27, 0, 1),
(24, 'Kmotřenci', '<p>\r\nNebo též registr dlužníků :) \r\n</p>\r\n', 1334303266, 32, 0, 1),
