INSERT INTO `nw_news` (`id`, `datum`, `iduser`, `kategorie`, `nadpis`, `obsah`) VALUES
(6, 1328647152, 34, 0, 'Spuštění systému', '<strong>Instance systému spuštěna.</strong>\r\n'),
(7, 1328729832, 26, 1, 'Aktualizace', 'Přidány přísně tajné zpravodajské informace o nepříteli.\r\n'),
(8, 1328887691, 26, 1, 'Incident &quot;kasino&quot;', '<p>\r\nV sekci případy zdokumentován incident kasino\r\n</p>\r\n<p>\r\nJe nezbytně nutné doplnit fakta o energetických výdajích a zjištěných informacích z pole&nbsp;\r\n</p>\r\n'),
(10, 1330023131, 34, 0, 'Nova verze', 'Verze 0.9.9 nainstalována.\r\n'),
(11, 1330248827, 34, 2, 'Test nove verze', 'Probiha test nove verze, budte obezretni.\r\n'),
(12, 1330252751, 34, 2, 'Verze 0.9.95', '<p>\r\nNasazna verze 0.9.95 - pridana zejmena funkcnost poznamek a zobrazovaci a tiskove styly pro osoby a hlaseni.&nbsp;\r\n</p>\r\n'),
(13, 1330322987, 34, 2, 'Povinná změna hesla', 'POZOR! Z důvodu možného ohrožení bezpečnosti si všichni změňte heslo. Děkuji.\r\n'),
(14, 1331741285, 22, 1, 'VLTAVSKA', 'Glaseni z prusera na Vltavsce pridano. Pocitajte a doplnte, sto ja zabyl do poznamky, kak zaloba kompletnaja.'),
(15, 1331818298, 27, 1, 'pOVINNÁ PORADA NA ŠTÁBU 18:30', 'PRO VŠECHNY: POVINNÉ BU\\ĎTE DOCHVILNÍ A ŘÍTÍ SE NA NÁS ASI VEEELKEJ PRŮSER. VŠE OSOBNĚ.\r\n'),
(16, 1331920441, 22, 1, 'Glaseni', 'Poslednu dobu chybi mnogo glaseni zdes. Dopiste jich bystro.\r\n'),
(17, 1332324105, 26, 1, 'Teambuilding MK II.', 'V sobotu, nebo neděli dopoledne vyrazíme do zoo. V plánu je zatím ochutnávka pro ty hladovější z nás, případně lehké popíjení pro ty zdrženlivější. Ve vymýšlení dalších teamových hrátek se meze nekladou. Vstupné je 150 pro dospělé, 100 pro &quot;studenty&quot; a na opencard je 5% sleva. Možná budou k dispozici dva volňásky, které přidělím někomu protekčnímu :P\r\n'),
(18, 1332782671, 22, 1, 'Novy Doodle', 'Na odkaze Casova dostupnost novy Doodle, tak etot vyplnte.\r\n'),
(19, 1344241001, 34, 2, 'Nová verze Bistra', 'V průběhu následující hodiny bude nasazována nová verze Bistra. Kdyby panstvo pozorovalo nějaké problémy, nechť laskavě posečká. Děkuji.\r\n'),
(20, 1344242745, 34, 2, 'Hotovo', 'Šlo to rychleji, než jsem očekával. Verze 1.0.1 Olifant nasazena. Případné problémy prosím hlašte přes pana Ragulina. Děkuji.\r\n'),
(21, 1344496177, 26, 1, 'PEtr Kučera', 'Petra Kučeru skolilo zákeřné prokletí. Leží doma s horečkami a dělá odeklínací rituály. Je to náročná práce, tak ho při tom prosím nerušte. Až bude v pořádku, ozve se.\r\n'),
(22, 1345919961, 32, 1, 'Tryzna za Černého', '<p>\r\nV pondělí 27. 8. 2012 pořádá Noční hlídka pohřeb Jana Černého, což byl celkem rozumný Jiný, než mu kolegové z White Fist přikázali tu koninu, aby unesl našeho Aleše.\r\n</p>\r\n<p>\r\nProto je záhodno, aby se Denní hlídka této akce zúčastnila, byť není pozvána (kdovíproč nás Světlí viní z jeho smrti - každý soudný jedinec však ví, že za to může Krista Černá, členka Noční hlídky).\r\n</p>\r\n<p>\r\nSraz v 19:15 na štábu (Slavíkova 11).\r\n</p>\r\n<p>\r\nÚčast potvrďte Evě S.\r\n</p>\r\n'),
(23, 1352796956, 34, 2, 'BIStro verze 1.3.1', '<div>\r\n<strong>1.3.1</strong>\r\n</div>\r\n<div>\r\n- logo DH\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n<strong>1.3.0alfa</strong>\r\n</div>\r\n<div>\r\nTimeout&nbsp;\r\n</div>\r\n<div>\r\n&nbsp;- je možné nastavit individuálně\r\n</div>\r\n<div>\r\n&nbsp;- default 10 minut\r\n</div>\r\n<div>\r\n&nbsp;- nezavisle na nastaveni serveru\r\n</div>\r\n<div>\r\nHorni podmenu\r\n</div>\r\n<div>\r\n&nbsp;- přidány zpětné cesty všude\r\n</div>\r\n<div>\r\n&nbsp;- přidána možnost po editaci či přidání rovnou zobrazit či pokračovat v editaci\r\n</div>\r\n<div>\r\nHlaseni\r\n</div>\r\n<div>\r\n&nbsp;- filtr &quot;Neprirazena hlaseni&quot; konecne opravdu funguje\r\n</div>\r\n<div>\r\n&nbsp; - defaultni datum u noveho hlaseni odpovida dni zadavani\r\n</div>\r\n<div>\r\nOsoby\r\n</div>\r\n<div>\r\n&nbsp;- nově lze filtrovat podle některých atributů\r\n</div>\r\n<div>\r\n&nbsp;- při zobrazení osoby se vylistují případy a hlášení, ke kterým je připojena\r\n</div>\r\n<div>\r\n&nbsp;- nové příznaky archiv, mrtvoly, filtry defaultne tyto nezobrazuji\r\n</div>\r\n<div>\r\n&nbsp;- zavedeni data vytvoření u osob\r\n</div>\r\n<div>\r\n&nbsp;- zobrazeni data vytvoření a data posledni zmeny u osob\r\n</div>\r\n<div>\r\nEditace\r\n</div>\r\n<div>\r\n&nbsp;- zvětšena editační okna\r\n</div>\r\n<div>\r\nZavedeni urovne prav org\r\n</div>\r\n<div>\r\n&nbsp;- kdyz dela upravu osob, nezapise se jako posledni zmena\r\n</div>\r\n<div>\r\n&nbsp;- muze upravovat datum registrace a registratora osoby\r\n</div>\r\n<div>\r\n&nbsp;- vidi, kdo je org\r\n</div>\r\n<div>\r\nŘešitelé\r\n</div>\r\n<div>\r\n&nbsp;- případu lze přiřadit řešitele\r\n</div>\r\n<div>\r\nDashboard\r\n</div>\r\n<div>\r\n&nbsp;- na stránce aktualit nahoře je dashboard, kde uživatel vidí své nedodělky (rozpracovaná hlášení, nevyřešené případy)\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n<strong>1.2.0alfa</strong>\r\n</div>\r\n<div>\r\nSymboly u osob\r\n</div>\r\n<div>\r\n&nbsp;- je možné je přiřazovat a zobrazovat stejně, jako portréty\r\n</div>\r\n<div>\r\nTřídění osob, přiřazených k hlášení\r\n</div>\r\n<div>\r\n&nbsp;- možno označit velitele výjezdu, zatčené, vyslýchající a vyslýchané\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n<strong>1.1.1alfa</strong>\r\n</div>\r\n<div>\r\nČasová dostupnost\r\n</div>\r\n<div>\r\n&nbsp;- pokud má uživatel právo poweruser, tlačítko &quot;Časová dostupnost&quot; vede na dialog, který umožní přidat nový link na doodle\r\n</div>\r\n<div>\r\n&nbsp;- v ostatních případech vede tlačítko &quot;Časová dostupnost&quot; na poslední zadaný link, při troše dobré vůle na doodle\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<div>\r\n<strong>1.1.0alfa</strong>\r\n</div>\r\n<div>\r\nPřiřazení osoby k uživateli\r\n</div>\r\n<div>\r\n&nbsp;- číslo osoby je vidět v horní liště při zobrazení osoby, pokud má uživatel právo poweruser\r\n</div>\r\n<div>\r\n&nbsp;- číslo osoby lze uživateli přiřadit v menu upravování uživatele\r\n</div>\r\n<div>\r\nOznačení nového\r\n</div>\r\n<div>\r\n&nbsp;- za nové se neoznačují provazby, tedy přiřazení osoby k případu, hlášení k případu, osoby k hlášení atd.\r\n</div>\r\n<div>\r\n&nbsp;- za nové se neoznačuje nově vytvořené či modifikované hlášení, dokud je ve stavu &quot;rozpracované&quot;\r\n</div>\r\n<div>\r\n&nbsp;- poweruser má všude, kde by mohlo vzniknou označení &quot;nové&quot; zaškrtávátko &quot;není nové&quot;, které způsobí, že se změna za novou neoznačí\r\n</div>\r\n<div>\r\n&nbsp; &nbsp; &nbsp; - vyjímkou jsou hlášení, tady žádné zaškrtávátko &quot;není nové&quot; není\r\n</div>\r\n<div>\r\n&nbsp;- v horní menu přibylo tlačítko &quot;Přečíst vše&quot;, které označí vše &quot;nové&quot; jako přečtené přihlášeným uživatelem\r\n</div>\r\n<div>\r\nSkrytí hesla\r\n</div>\r\n<div>\r\n&nbsp;- na stránce Nastavení se heslo primárně nenačítá a při uložení se primárně nemění\r\n</div>\r\n<div>\r\n&nbsp;- mění se pouze tehdy, pokud jsou hesla vyplněná - proběhne kontrola starého hesla\r\n</div>\r\n'),
(24, 1352907624, 34, 2, '1.3.3', '<div>\nNastenka a nove aktuality rozsviti napis Aktuality jako novy.\n</div>\n<div>\nAktualit se zobrazuje jen 10.\n</div>\n<div>\nPřidána možnost smazat symbol.\n</div>\n<div>\nPřidána nástěnka.\n</div>\n'),
(25, 1353880712, 34, 2, '1.4.0', '<div>\r\n<span style="font-size: 12px; line-height: 18px; font-family: Verdana, Arial, sans-serif">1.4.0</span>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">Nepřiřazené symboly</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- u osob je link na neprirazene symboly</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- neprirazene symboly lze prirazovat k pripadum a hlaseni, kde se vyskytly, ale pouze ze strany symbolu</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- u hlaseni i pripadu jsou videt prirazene symboly</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- u pripadu je lze kliknutim v drobcich skryt ci zobrazit, u hlaseni nikoli</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- u hlaseni na to existuje workaround - za link dopsat &amp;hidesymbols=1 (podminkovani u hlaseni je uz tak slozite, ze jsem jeste nenasel moral to tam dat)</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px"><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">Úkoly</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- zadávání, zobrazování, workflow</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px"><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">Uživatelé</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- u uživatele se zobrazují nedodělky, tj. úkoly, hlášení apod.</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px"><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">Auditní stopa</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- veškerá činnost uživatele v bistru se zaznamenává do auditní stopy</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- auditor může tuto stopu sledovat</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px"><br />\r\n</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">Automatická záloha databáze</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">- cca jednou za 24 hodin spusti pristup na Aktuality automatickou zalohu databaze</span></font>\r\n</div>\r\n<div>\r\n<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px; line-height: 18px">(neprobehne tudiz, pokud se nic nedeje, probiha pouze, pokud je zivo)</span></font>\r\n</div>\r\n'),
(26, 1354444517, 26, 1, 'nedostatek informací o dohodách', 'Potřebujeme založit případ, nebo celou novou sekci o aktuálních zněních různých dohod mezi hlídkama a změnama Dohody. Aby si to mohl v případě potřeby kdokoliv rychle dohledat. Momentálně o tom má přehled snad jen Eva, to je dobře, ale je to málo.\r\n'),
(27, 1354562840, 26, 1, 'skenujte!', 'Máme neaktuální informace o síle &quot;známých firem&quot; pokud potkáte nočníka o kterym už víte jak se jmenuje a že je blbej jak troky stejně ho trefte scanem mezi světla. Mohl postoupit o kategorii, nebo víc a může mít jiné možnosti než míval.\r\n'),
(28, 1362399332, 22, 1, 'Vremja dostupnosti', 'Novyj doodle v casove dostupnosti, vsichni etot vyplnte.\r\n'),
(29, 1362471664, 22, 1, 'Registracije', '<p>\r\nKagda vy nekogo registrujete, vyfotte jego i pridejte toze do bistra.\r\n</p>\r\n<p>\r\nI kagda potkate temnego, katoryj net v bistru, slusno se jego vyptejte i do bistra pridejte.&nbsp;\r\n</p>\r\n'),
(30, 1362569925, 32, 1, 'Vztahy s Inkvizicí', '<p>\r\nVěnujte prosím pozornost k případu Defendoriát II., naleznete tam mé vyjádření koryfejovi na inkviziční vyhlášku č. 61.\r\n</p>\r\n<p>\r\nVe zkratce - nenechte se tou skupinou omezovat, buďte k ní slušní, ale na našem štábu nemají nárok na žádnou nadstandardní informační péči.\r\n</p>\r\n<p>\r\nKdo by měl zájem být součástí této skupiny, nechť kontaktuje Nejtemnější.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n'),
(31, 1362656369, 22, 1, 'Kak psat glaseni', 'Kdyz pisete glaseni, pisite etot tak, aby nevadilo, ze etot budet citat nekdo cizi - inkvizitor, svetlyje. Veci, katoryje by nemel nikdo takovy videt, pisite do poznamky. Poznamky mozno snadno skryt.\r\n'),
(32, 1363690511, 34, 2, 'Bistro verze 1.4.2', '<p>\r\nNasazena nová verze BIStra.\r\n</p>\r\n<p>\r\nHorní lišta má jinou barvu (je to kvůli rozlišování BISter pro ty, kdo to potřebují).\r\n</p>\r\n<p>\r\nÚkoly mohou zadávat i uživatelé s právem k editaci hlavních textů.\r\n</p>\r\n<p>\r\nIkona u dlouhých přiřazovacích seznamů už není pod seznamem, ale plove na stránce vedle seznamu.\r\n</p>\r\n<p>\r\n(V některých prohlížečích je třeba jednou provést refresh, než se ikona přestěhuje.)&nbsp;\r\n</p>\r\n'),
(33, 1376908747, 22, 1, 'Svobodnoje vremja - novyj doodle', 'Novyj doodle s casovymy moznostmi, vyplnte etot.\r\n'),
(34, 1376983946, 22, 1, 'Psat glaseni nada', 'Pisite glaseni iz vyjezdov, i pisite etot bystro. Komandir vyjezda za etot zodpovedny.\r\n');
INSERT INTO `nw_notes` (`id`, `note`, `title`, `datum`, `iduser`, `idtable`, `iditem`, `secret`, `deleted`) VALUES
(74, '<p>\r\nVšichni vědí, že Maršík je planetka.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p style="padding-top: 0px; padding-right: 0px; padding-bottom: 1.5em; padding-left: 0px; border-style: initial; border-color: initial; border-image: initial; font: inherit; vertical-align: baseline; font-family: pt-sans-1, pt-sans-2, ''Helvetica Neue'', Helvetica, Arial, ''Lucida Grande'', sans-serif; line-height: 21px; -webkit-text-size-adjust: none; border-width: 0px; margin: 0px">\r\nVyřízne holešovicích zavraždí-li ní au nemáš zatvrdilo. Prs, zakřiknutě neboli kruci, těm tvým, pár no řemení, skoro he jé koberci tajemství votes. Hloub aby, moci. Tvá nového hm meyerem psí ba scházíte dostanu ní hrůzy větou. V&nbsp;ji, kubát, sad disciplinárku správná, fůru živi 56 nato obchody! Ni dřív tentam odborníka, lída zapřísahám. Vemu co pletli té veličenstva v&nbsp;tohleto krátcí přepočítal o&nbsp;přívětivostí 30.\r\n</p>\r\n<p>\r\n<span style="font-family: pt-sans-1, pt-sans-2, ''Helvetica Neue'', Helvetica, Arial, ''Lucida Grande'', sans-serif; line-height: 21px; -webkit-text-size-adjust: none">Si jo fousatý poděla i&nbsp;uložil obr obrazně jo rozumové lidský tahle dole huso! U&nbsp;by pózu on provaz. Fuj 19 šoféři nikom rusy lázních mířím podá ó vloupáním my vzlet. Závěr dopisů knobloch věc káravě ní poruchy arch. A&nbsp;prostředí hrálo promíjí té roztyl ní hromoval? Čajovou tří záští uavá dopsala přicházeli osm, rozváženo to kývla postarám točí, se od&nbsp;jehlou máma vysvětluje a&nbsp;stahují, a&nbsp;vašnostům odstřelováni podezřívat.</span>&nbsp;\r\n</p>\r\n', 'Veřejná poznáma', 1330065534, 22, 1, 63, 0, 1),
(75, '<p>\r\nNe každý ví, že Maršík je také pako.\r\n</p>\r\n<p>\r\n&nbsp;<span style="font-family: pt-sans-1, pt-sans-2, ''Helvetica Neue'', Helvetica, Arial, ''Lucida Grande'', sans-serif; line-height: 21px; -webkit-text-size-adjust: none">Nebývalo vím a&nbsp;vládě ohromné. Uf si týž většinou veselé z&nbsp;potíž! Závadu vy ani statku buben řece mi. Ke 77 s&nbsp;jde spitz? Ne ta už, lépe mu tabuli udělám za&nbsp;obešel nechápu, syn práva on vyrušil. I&nbsp;panu naopak 81 okenice povídka či podivuhodnou. Pak vši auditorium boty pšt, jdu kamny jdu.</span>\r\n</p>\r\n<p style="padding-top: 0px; padding-right: 0px; padding-bottom: 1.5em; padding-left: 0px; border-style: initial; border-color: initial; border-image: initial; font: inherit; vertical-align: baseline; font-family: pt-sans-1, pt-sans-2, ''Helvetica Neue'', Helvetica, Arial, ''Lucida Grande'', sans-serif; line-height: 21px; -webkit-text-size-adjust: none; border-width: 0px; margin: 0px">\r\n81 za&nbsp;tě muž čas formánku dát budovou o&nbsp;koupím však vy musel u&nbsp;zvorám, panenku považoval stávají ó dluh nejdivočejší z&nbsp;invalidita čí o&nbsp;anglický amatér jeden. 56 hosta u&nbsp;úžasné jsem kluk a&nbsp;předsedům hajnými. Nule růst zakryje vzteku, řekli on stu prosit stole z&nbsp;měří 19 ministerstva, tekly takho ne dědečkovijak křikl! Přijít vypínač dá přečíst tě madagaskar ostuda a&nbsp;mat jo samá prkny. Vši ne řízení bát o&nbsp;trepky aby, moci dolů usmívala: každou syn lest otisk.\r\n</p>\r\n<p>\r\n<span style="font-family: pt-sans-1, pt-sans-2, ''Helvetica Neue'', Helvetica, Arial, ''Lucida Grande'', sans-serif; line-height: 21px; -webkit-text-size-adjust: none">Divocí m&uuml;llera židle my vy měla jím nevěřím. Navlékl o&nbsp;zná jakému to oči u&nbsp;dosvědčíte od&nbsp;ty hm nejpřísněji doličný kusem zadržen mac! Mlčením, čepicí hm hlásit! Mou dá nič konec styk k&nbsp;kolen roztok, vězí, arturku, jasnějších, slečno, plachtou, pádě zapírá, černá, jamou &ndash; uf jisté, krtiny dyť že 56 jasný dělal těm ranních o&nbsp;kaplan nehodilo. Hubou kořistí valí ty veřejné partii dál. Průvodem on pacovského psi lid eh byl autor už. Au vážení k&nbsp;potem už zákona myersová, i&nbsp;by psi ví hodný krev, ne oč vzor pan dokázat.</span>&nbsp;\r\n</p>\r\n', 'Tajná poznámka', 1330065594, 22, 1, 63, 1, 1),
(76, 'Btw. tohle je typicka chyba v kolonce &quot;ukol&quot;, nebot nerika o ukolu vubec nic.\r\n', 'Blbiny v ukolu', 1330333387, 34, 4, 6, 1, 0),
(77, 'No vzhledem k tomu s čim nás tam poslal Kraus .. Jsme moc nevěděli do čeho jdeme a úkol byl dost nejasný.\r\n', 'Lepší?', 1330340885, 26, 4, 6, 1, 0),
(78, '&lt;?php hidenotes: ?&gt;<span style="white-space: pre" class="Apple-tab-span">	</span>\r\n', 'POznamka', 1330354798, 34, 1, 80, 2, 1),
(79, 'asafdsfasdfasdfasdfasdf\r\n', 'asdfa', 1330355350, 34, 1, 80, 0, 1),
(80, '<p>\r\nJo, ale vzdycky mas ramcove potuchu, proc tam jdes.&nbsp;\r\n</p>\r\n', 'Mnohem', 1330420075, 26, 4, 6, 1, 0),
(81, '<p>\r\nCelkově tam padli tři lidé.\r\n</p>\r\n<p>\r\nKováč od té první chce licenci za mě.\r\n</p>\r\n<p>\r\nDruhá je tutlaná.\r\n</p>\r\n<p>\r\nTřetí chce licenci za vlkodlaka. \r\n</p>\r\n', 'Oběti', 1330511776, 37, 4, 15, 0, 0),
(82, '<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px">Не пиши доклады на русском языке. это причини́ть осложнения анализ - не каждый говорит на русском языке.</span></font>\r\n', 'общий язы́к', 1330591357, 22, 4, 14, 0, 0),
(83, '<span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; white-space: pre-wrap">Mengele: jen jsem byla pověřana vám nahlásit, že stkání s oním čerstvě iniciovaným jiným bude zítra (pa 2.3.) po půl deváte večer v hospodě u marianskeho obrazu (nebo nějak podobný název). V ulici kubelíkova. </span>\r\n', 'Vyslech', 1330630875, 22, 4, 17, 0, 0),
(84, 'Této světlé bychom se mohli zbavit v případě její sebevraždy. Po iniciaci nevypadal příliš nadšená z výsledku a působila velmi depresivním dojmem. Mohli bychom na ni tedy &quot;pozitivně&quot; zapůsobit.\r\n', 'Možná sebevražda', 1330632598, 26, 1, 133, 1, 1),
(85, '<p>\r\nZelený říkal že on nikoho nekontaktuje, že ví že jsou tři a že ten co ho kontaktuje je Pacák, nic jinýho neví. Pacák říkal že Zelený ho kontaktoval dokázal. Mareš říkal že Zeleného znal a Zelený jeho taky.\r\n</p>\r\n<p>\r\nCo se zakázek týče, dělá každej něco jinýho.\r\n</p>\r\n<p>\r\nZelený - interaktivní hardware na magistrát a proškolení obsluhy\r\n</p>\r\n<p>\r\nPacák - Digitalizace dat\r\n</p>\r\n<p>\r\nMareš - Rekonstrukce Lapidária\r\n</p>\r\n<p>\r\nPak se do toho přidala Záhorská, její historka taky seděla jen v tom že spolu dělaj pro prachy a dělaj pro magistrát. Ohánějí se ale jen veřejně dostupnými informacemi a i v těch mají trochu hokej.\r\n</p>\r\n<p>\r\nPředpokládáme že za nimi všemi stojí nějaký ještě mocnější upír a chce něco hodit na Vlada, nebo plánuje nějakou velkou boudu.\r\n</p>\r\n', 'Všichni kecaj', 1330636585, 26, 3, 22, 0, 1),
(86, '<p>\r\nZelený říkal že on nikoho nekontaktuje, že ví že jsou tři a že ten co ho kontaktuje je Pacák, nic jinýho neví. Pacák říkal že Zelený ho kontaktoval dokázal. Mareš říkal že Zeleného znal a Zelený jeho taky.\r\n</p>\r\n<p>\r\nCo se zakázek týče, dělá každej něco jinýho.\r\n</p>\r\n<p>\r\nZelený - interaktivní hardware na magistrát a proškolení obsluhy\r\n</p>\r\n<p>\r\nPacák - Digitalizace dat\r\n</p>\r\n<p>\r\nMareš - Rekonstrukce Lapidária\r\n</p>\r\n<p>\r\nPak se do toho přidala Záhorská, její historka taky seděla jen v tom že spolu dělaj pro prachy a dělaj pro magistrát. Ohánějí se ale jen veřejně dostupnými informacemi a i v těch mají trochu hokej.\r\n</p>\r\n<p>\r\nPředpokládáme že za nimi všemi stojí nějaký ještě mocnější upír a chce něco hodit na Vlada, nebo plánuje nějakou velkou boudu.\r\n</p>\r\n', 'Všichni kecaj', 1330636588, 26, 3, 22, 0, 0),
(87, 'Dluzi mi vodku.\r\n', 'Sazka', 1330641916, 22, 1, 66, 2, 1),
(88, 'Na eto pozor - dolzno overit, jesli Svetli to chteji zalovat.\r\n', 'Moznyje problemy', 1330682926, 22, 4, 15, 0, 0),
(89, 'Neaktivnaja, v Prage az od pondelka.\r\n', '3. - 4. 3.', 1330769624, 22, 1, 101, 0, 0),
(90, 'Test.\r\n', 'Test', 1330802155, 22, 1, 80, 0, 1),
(91, '<div>\r\nVe 14h byl ve skladu u letiště Ruzyně učiněn hrůzný nález.\r\n</div>\r\n<div>\r\nVíce než třicítka dětí ve věku 8-17h byla nalezena zmasakrovaná.\r\n</div>\r\n<div>\r\nPohled byl hrůzný a v policejním protokolu zaznívala slova jako&nbsp;\r\n</div>\r\n<div>\r\nzabíjení z radosti.\r\n</div>\r\n<div>\r\nTěla evidentně nesou stopy po spárech.\r\n</div>\r\n<div>\r\nMyslím, že můžeme předpokládat, že to jsou těla z Autobusu. Na místo vyráží naši forenzní experti.\r\n</div>\r\n', 'Tela nalezena', 1330874280, 22, 3, 27, 0, 0),
(92, '<p>\r\nSilvie\r\n</p>\r\n<p>\r\n1x šero\r\n</p>\r\n<p>\r\n1x opium \r\n</p>\r\n', 'Energetická náročnost', 1330946370, 37, 4, 26, 0, 0),
(93, '<p>\r\nVýslech provedla Eva.\r\n</p>\r\n<p>\r\nJednalo so o provokaci na Temné v souvislosti s autobusovým incidentem. \r\n</p>\r\n', 'Opravy', 1331209570, 32, 4, 27, 0, 0),
(94, '<p>\r\nNeobyčejně všímavý, a to až patologickým způsobem - nepotřebuje dostávat odpovědi, sám je vypozoruje bez pomoci jakékoli magie. \r\n</p>\r\n<p>\r\nExtrémně nebezpečný, jeho morálním krédem je zachovávat dodržování Velké dohody a krátkodobé rovnováhy.\r\n</p>\r\n<p>\r\nNechce se držet rámce daného obžalobou a obhajobou, chce sám ze své pozice znát všechny souvislosti, čímž by činil dokazování zcela formálním, prázdným úkonem. \r\n</p>\r\n<p>\r\nNosí trenky s leopardím vzorem. \r\n</p>\r\n', 'Charakteristika', 1331213808, 32, 1, 86, 1, 0),
(95, 'Alex, ty myslis vazne, ze eto vsechno?\r\n', 'To vsechno?', 1331197122, 22, 4, 32, 1, 0),
(96, 'Od svetlych ti vampyri pozadovali jeste licencie, katoryje chateli pouzit ten den. Mozno zjistim, kakyje licencije.\r\n', 'Licencie', 1331203830, 22, 3, 30, 0, 0),
(97, '<p>\r\nVazmozno, sto oni zmizeli net potomu, sto ucastnili rituala, no potomu, sto oni delali pro Charistarcha.\r\n</p>\r\n<p>\r\nV poslednom vremeni podezreni velke, sto Londyn spolupracujet s inkvizicijou, mozno s novym GrandMajstrom, mozno se starymi znamymi...\r\n</p>\r\n<p>\r\nI sarkofag casu mozno pouzit vyhradno inkviziciju? Nemohlo by byt tak, ze eto konkurenca cast Kongregacije?\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 'Teorije', 1331204444, 22, 3, 29, 1, 0),
(98, 'I katoryj etot &quot;treti jiny&quot;, co patral s Charistarchom a Teodorikom? Znajem sto o nem?\r\n', 'Dotaz - treti jiny', 1331204500, 22, 3, 29, 1, 0),
(99, 'U nego v telefone kontakta na&nbsp;Bereniku Stoklasovu, to jedna s tech suk, co revali na stabe.<br />\r\nOn z Druhe strany mince.\r\n', 'Doplneni', 1331205857, 22, 4, 27, 0, 0),
(100, '<p>\r\nVyslech probegl, on provokater, chtel tam vyjezd dozora vylakat.\r\n</p>\r\n<p>\r\nKdyz on vyrazel tam, pry Stoklasove skazal &quot;Tohle bude velký.&quot;&nbsp;\r\n</p>\r\n', 'Telepaticky vyslech', 1331205933, 22, 4, 27, 0, 0),
(101, 'Ta provokacija mela vylakat hlavno Alexandera, na togo to byla past.\r\n', 'Alexander', 1331205968, 22, 4, 27, 1, 0),
(102, '<p>\r\nNo pocemu my zdes stale tvrdime, sto on utekl? To proflakne. S nim tam byla kamoska, videla naposledy, kak on zdrhal pred Richardom, a pak uz o nem neslysela. Mohl spadnut do kanala, da...\r\n</p>\r\n<p>\r\nNo my overili u inkvizitora, sto kak u hlidkare nebyly jine prostredky, tak zabiti pachatela takovego legalne.\r\n</p>\r\n<p>\r\nJednodussi skazat da, on jego zabil, on vrah - zabil Pistoria - a zdrhal. Agresyvnyj, mohl zabit dalsich. Nutno zastavit.&nbsp;\r\n</p>\r\n', 'Zabiti legalne', 1331206964, 22, 4, 25, 1, 0),
