(106, '<div>\r\nOd Tjoplego: \r\n</div>\r\n<div>\r\nAhoj, Filipe, tady je všechno, co jsem dokázal vydolovat ze záznamů:\r\n</div>\r\n<div>\r\nAno o této paní vedeme záznamy. Nejsem si úplně jistý, zda bude možné jí kontaktovat teď, neboť vzhledem ke stáří nevlatní téměř žádnou z vymožeností moderní doby, jako je telefon nebo email. Mohu se jí ale pokusit sehnat přes kurýra.\r\n</div>\r\n', 'Baďurová', 1331496942, 22, 4, 42, 0, 0),
