(118, '<p>\r\nSto tam Marsik sdelal? Nechapu eto...\r\n</p>\r\n<p>\r\nNarušoval výslech. Nejdřív mě v nějaké hypotetické debatě nazval k*rvou, těsně poté, co jsem zvládla po něm nehodit betlémským ohněm a pouze ho důrazně napomenout, usnul. Nejdřív to vypadalo jako rozhození organismu při abstinenčním příznaku z Blue Mountain, ale posléze se ukázalo, že šlo o obyčejné fyzické vyčerpání. Nevěděl, co blábolí, a upadal do mikrospánku. \r\n</p>\r\n', 'Marsik', 1331734866, 32, 4, 47, 0, 0),
