(122, '<p>\r\nDnes posel přivezl to\r\n</p>\r\n<p>\r\nZatím si nejsem jist oč\r\n</p>\r\n<p>\r\nse jedná, ale je jasné, že\r\n</p>\r\n<p>\r\nto je cenné.\r\n</p>\r\n<p>\r\nInu co, přezKoumáme.\r\n</p>\r\n<p>\r\nMám z toho ale dobrý\r\n</p>\r\n<p>\r\npocit je to docela trumf.\r\n</p>\r\n<p>\r\nZatím to uložíme u\r\n</p>\r\n<p>\r\nRabbiho.&nbsp;\r\n</p>\r\n', 'Strana 10', 1331823771, 26, 3, 31, 1, 0),
(123, '<p>\r\nKrásne se leskne.\r\n</p>\r\n<p>\r\nA ta moc. Jsem ohromen.\r\n</p>\r\n<p>\r\nV životě jsem nic takového\r\n</p>\r\n<p>\r\nneviděl.\r\n</p>\r\n<p>\r\nRabbi tvrdí, že se jedná\r\n</p>\r\n<p>\r\no ono proslulé\r\n</p>\r\n<p>\r\nORÁKULUM.\r\n</p>\r\n<p>\r\nMoc mu ale nevěřím.\r\n</p>\r\n<p>\r\nNedává to smysl.\r\n</p>\r\n<p>\r\nNic tady.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 'Strana 26', 1331824582, 26, 3, 31, 1, 0),
