(130, '<p>\r\nNa Zizkove jsme potkali Feithovou a Marsika. Slepy trouba dbil a kokot v jednom nam nabidl, ze u tohodle ritualu se muze nekdo zucastnit. Feithova bez premysleni do toho sla... co tam posleme jen svetloiu? Mno tak jsem tam vlezl i ja i kdyz Sakine se to nelibilo....\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nBozi tobogan divadlo jak svin.... Dalsi otevrene zridlo&nbsp;\r\n</p>\r\n', 'Posledni zridlo', 1331923863, 45, 4, 46, 0, 0),
(131, 'Vlkodlak je 6.kategorie, jmenuje se Jan Suchý, tel. 605924252. Ve čtvrtek 15. jsme ho na Vítkově kontrolovali taky, nic neudělal, nikoho nezabil, prostě tam jenom tak smutně seděl a nešťastně koukal na dva Světlý, co ho našli - zase - dřív, takže jsme ho nechali. No, a podruhý toho chudáka světlušky pro jistotu umlátili, takže - žalovat, žalovat, žalovat.\r\n', 'doplnění', 1331982689, 47, 4, 51, 0, 0),
