(139, '<p>\r\nTomáš Pokorný, 4. kategoría, na místě před přijezdom dozoristov zabil čelověka, Františka Růžičku, on skazal, što Ružička masovy vrah. Golema jemu sdělala lečitelka Barbora Křížová, kontakta:&nbsp;\r\n<span style="font-family: arial, sans, sans-serif; white-space: pre-wrap">731458370</span>\r\n</p>\r\n<p>\r\nTělo ukryto zděs:&nbsp;&nbsp;Zingrova 12 (6) byt v druhem patre vlevo.\r\n</p>\r\n', 'Vyslecha', 1332331373, 22, 4, 63, 0, 0),
