(144, '<p>\r\nLethold - dříve silný mág, nyní se silou cca 5. kategorie\r\n</p>\r\n<p>\r\nbyl kdysi (hodně kdysi) odhmotněn - neznámo kým\r\n</p>\r\n<p>\r\nmá nadání se udržet v realitě, ale ve skutečnosti je &quot;mrtvý&quot;\r\n</p>\r\n<p>\r\nshání někoho se znalostmi necromancie (pravděpodobně kvůli zvrácení odhmotnění)\r\n</p>\r\n<p>\r\njeho magie je na jiné bázi (dle jeho slov se s dobou změnily formule, a často upravili efekty daných kouzel) - sám tvrdí, že jeho minulé znalosti jsou spíše obecně slabší, ale elementárnější\r\n</p>\r\n<p>\r\npo staletí se dost schovával, naposledy, když se nepočítá dnešek, se ukázal o husitském povstání a to už byl dávno odhmotněn.(takže musí být fakt starej :)\r\n</p>\r\n<p>\r\nbojí se, aby se tu neobjevil někdo, kdo by o něm leccos věděl a měl s ním staré účty(ale to by musel být někdo fakt starý)\r\n</p>\r\n<p>\r\n&nbsp;je dost zmatený z toho, kam se myšlení lidí a Jiných vivinulo a že dost opadly ideály\r\n</p>\r\n<p>\r\n&nbsp;&quot;magie není to co určila pravidla, ale to co pravidla určovalo dřív&quot;\r\n</p>\r\n<p>\r\n&quot;Dohoda je něco, co si Jiní sami určili jako neměnné pravidlo. Neměnná pravidla nejsou, je jen to, co si lidi sami udělali&quot;\r\n</p>\r\n<p>\r\n&nbsp;má zde prý nějaké nevyřešené záležitostii kvůli kterým se právě drží zde\r\n</p>\r\n<p>\r\npamět má jako by byl smrtelníkem, takže si prostě pamatuje minulost špatně, až na to podstatné o sobě (co to je přesně, nevíme)\r\n</p>\r\n<p>\r\ndle jeho odhadů by tady na světě v tomto stavu ještě tak dvě století vydržel, ale pomalu ztrácí sílu, která se mu pomalu obnovuje a skomírá\r\n</p>\r\n<p>\r\nobjevil se zde i proto, že si myslí, že je zde někdo, kdo má souvislost s jeho minulostí a jeho bývalými rozhodnutími\r\n</p>\r\n', 'Informacie, sto Alex vytahl z nego', 1332341268, 22, 1, 137, 1, 0),
(145, '<p>\r\nVypada to, ze ty &quot;tokeny&quot; jsou zatim dva o kterych vime. Jeden ma ta vedmacka banda a jeden ma Charistarch, z ty mantry usuzuji, ze by mohly byt ctyri, pro kazdy element jeden.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nJo, a Charistarch ma pravdepodobne runu pro vzduch.&nbsp;\r\n</p>\r\n', 'Teorie', 1332347109, 26, 4, 64, 1, 0),
