(149, 'Dobrá práce, týme, všem zúčastněným přidávám zlobod.\r\n', 'Pochvala', 1332507726, 32, 4, 66, 0, 0),
(150, '<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">U mlekarny jsme potkali partu 5ti svetlych ... tedy bylo jhich na vyjezdu o jednoho vice&nbsp;</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">kristu a tu obratenku jak byla v charistarchiatu prohlasili jako zalohu...</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Nejaky svetly cucal nelegalne. Nevim co se presne udalo, ale pres krovi jsem zachytil beh. A nasel Li jak dohani pana a zmrazuje ho...</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Podle Li ji typek napadl nozem, ale bohuzel li vypovedela pri vyslechu (nejsem ji stacil zastavit) u svetlych ze se neprokazala jako denni hlidka... a on si myslel ze ho napada genericka temna... Tezko se na tom vozit</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Nicmene nakonci vyslechu nam dali prostor se vyjadrit jako pozorovatele. Donutil jsem je aby pana proskenovali a zapsali ze mel 150mg ... jako mag svetla 6 kategori ma kapacitu 100mg...nasledne pan priznal ze nelegalne cerpal&nbsp;</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">tak se snima trebas skus dohodnout na nejakych zasazich za nej :D to to vse jsem nechal zapsat do vyslechu...</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">jinak prosim zlobody za sikanovani svelych behem toto zasahu...</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">prskajici svetly museli dojit za necelych 15 minut dotycneho registrovat k nam na stab, pac jsem v poli nemel formular :D a pan uz byl 2 hodiny 45 minut v praze</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Pak jsem na miste je presvedcil ze jako spravni hlidkari maji vyplitvat z hulky na pana zahviho pouta a nasledne unich na stabu krysta musela zakouzlit velky scan a nasledne jim padla celist protoze nevedeli jak dotycneho z tohoto dukazu dostat a nasledneho priznani dostat</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Li jsem zastavil co nejdrive aby nekomentovala vyslech... pac na vyslechu byl dotycny co lhal jak kdyz tiskne a mi jen pozorovali...</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">mimochodme pri vyslechu se pana vubec neptali na to proc nas tam zavedli linie a teprve kdyz dali prostor me dostal jsem z neho priznani a dukazy jak jsem popsal vyse&nbsp;</span><br />\r\n<br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">zadrzeny:</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Jméno: Alois Podvratný</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Zaměření: mág</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Kategorie: 6. kategorie</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Kontakt: 602377699</span><br />\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 12px; background-color: #b8b992">Pobyt: neurčito registrace na týden (podle Ragulina)</span>\r\n', 'vyslech a prubeh', 1332592393, 45, 4, 67, 0, 0),
(151, '<div>\r\nBudova Lapidária je součástí areálu Výstaviště v Holešovicích. Stavba pochází z konce 19.století. Při její výstavbě jsme nezaznamenali žádné nenormální aktivity &ndash; ať lidí či Jiných.&nbsp;\r\n</div>\r\n<div>\r\nV současné době probíhá jeho rekonstrukce, na kterou bylo vydáno výběrové řízení. Pouze o nepatrný rozdíl zvítězila ve výběru architektonická skupina Arch.Design project, a.s. ačkoli všechny předešlé informace směřovaly k tomu, že jasnou volbou pro Magistrát města Prahy je společnost DaM spol. s r.o.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nPřed vchodem do pražského Lapidária je umístěna socha: Anděl s ďáblem, od českého sochaře Jana Jiřího Bendla. Bendl byl světlým mágem, a kvůli svému malému nadaní na práci s šerem se rozhodl projevovat své přesvědčení sochařským uměním. Socha Anděl s ďáblem je analogii na boj Světlých a Temných. Socha znázorňuje očividnou převahu anděla nad ďáblem, čili dobra nad zlem.\r\n</div>\r\n<div>\r\nBendl stvořil desítky soch a děl , které měly v lidech evokovat dobré vlastnosti a myšlenky. Jeho působení bylo zastaveno v roce 1680 temnou vědmou, které se již očividně jeho styl &bdquo;světlých&ldquo; soch nezamlouval, a uvrhla na něj prokletí. Oficiální lidské záznamy tvrdí, že zemřel na mor.\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<div>\r\n<a href="http://upload.wikimedia.org/wikipedia/commons/a/a4/Jan_Ji%C5%99%C3%AD_Bendl_-_And%C4%9Bl_s_%C4%8F%C3%A1blem_%281650%29.jpg">http://upload.wikimedia.org/wikipedia/commons/a/a4/Jan_Ji%C5%99%C3%AD_Bendl_-_And%C4%9Bl_s_%C4%8F%C3%A1blem_%281650%29.jpg</a>&nbsp;\r\n</div>\r\n', 'Lapidarium - podrobno', 1332616678, 22, 3, 22, 0, 0),
(152, 'Vypoved potvrzena serom pravdy.\r\n', 'Potvrzeno', 1332621698, 22, 4, 69, 0, 0),
(153, '<p>\r\nNa štábu NH Barboru Křížové lhali, že když vymění Pokorného svobodu za licence pro DH (2x zásah 6. kategorie), užijeme to na strašlivé žrací orgie pro upíry a vlkodlaky.\r\n</p>\r\n<p>\r\nPoslala jsem jí následující zprávu:\r\n</p>\r\n<p>\r\nVážená paní Křížová,<br />\r\n<br />\r\ndoslechla jsem se, co Vám sdělili na centrále Noční hlídky Praha, a je \r\nmi z toho poněkud smutno. Nezájem Světlých hlídkařů o řadové Světlé \r\nzjevně dosáhl takové intenzity, že (což jsem slyšela na vlastní uši) \r\nnechají raději inkvizičně potrestat někoho, koho mají chránit, než aby \r\nDenní hlídce vydali 2 licence na zásah 6. kategorie (tedy 2 x 40 magů, \r\ncož opravdu není mnoho). Naproti tomu panu Pokornému hrozí snížení \r\nkategorie a omezení energie, což je pro mága opravdu nepříjemné. Sama \r\njste s ním mluvila, získala jsem dojem, že své ponaučení si už odnesl. \r\nProto by ho neměla Noční hlídka titulovat označeními typu &quot;blbec&quot;.<br />\r\n<br />\r\nPřípadné získané licence na zásah se rozhodně nepoužívají k lovu pro \r\nupíry či vlkodlaky, žádný člověk by tedy netrpěl. Zpravidla se jedná o \r\nzásahy čerpání energie, které možná dotyčnému dočasně zhorší náladu nebo\r\nho trochu unaví. O nic jiného nejde.<br />\r\n<br />\r\nMrzí mne, že zrovna v Praze, kde bych očekávala zvýšený zájem Noční \r\nhlídky o běžné Světlé, se toto nekoná.<br />\r\n<br />\r\nS pozdravem,<br />\r\n<br />\r\nEva Schwarzkoppová<br />\r\nNejtemnější města Prahy\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nUvidíme, jestli se ještě vzmůže na nějaké rozhořčení, tribunál s Pokorným je vyhlášen na 29. 3. \r\n</p>\r\n<p>\r\n&nbsp;Její odpověď:\r\n</p>\r\n<p>\r\nVážená paní Schwarzkoppová,<br />\r\n<br />\r\nvelice Vám děkuji za snahu a dobrou vůli, které v případě pana Pokorného\r\nprojevujete. <br />\r\nPokusím se ještě přesvědčit Noční hlídku k nějaké dohodě, ale moc šancí \r\ntomu nedávám.<br />\r\nKaždopádně, <strong>pokud by Denní hlídka někdy potřebovala mou pomoc, cítím se \r\nbýt Vaším dlužníkem</strong>.<br />\r\n<br />\r\nS pozdravem<br />\r\n<br />\r\nBarbora Křížová \r\n</p>\r\n', 'Další vývoj situace', 1332847871, 32, 4, 69, 0, 0),
(154, '<p>\r\nSilvia - uze vapjervych byla nacata, vaza Protegonka to jesco posunula, Charistarch dojebal. Ja pokusilsja napravit, vazmozno ze pomoglo. Doverujet Eve i Ragulinovi.\r\n</p>\r\n<p>\r\nAnnie - podle vsego dost srovnana, jen Charistarcha nerada.\r\n</p>\r\n<p>\r\nAdam - Charistarch nesdelal choroso, bylo dolzno rozbit si s nim gubu i vytagnut z nego agresiju. No podle vsego molodec.\r\n</p>\r\n<p>\r\nRenatočka - něznaju, što Charistarch sdělal. Ja mnogo mluvil. Dlja majego nazora v parjadke.&nbsp;\r\n</p>\r\n', 'Vyvoj', 1333031080, 22, 4, 75, 1, 0),
(155, '<p>\r\nAmnézie\r\n</p>\r\n<p>\r\nCejch Iron Maiden\r\n</p>\r\n', 'Známá kouzla', 1333114822, 51, 1, 106, 0, 1),
(156, 'Byla v nemocnici, umíral jí brácha, umřel (to zařídil Charistarch). Ona v žalu a hrůze přešla do Šera a zpátky. Doma pak už nic nebylo jako dřív...\r\n', 'Iniciace', 1334141556, 32, 1, 149, 2, 0),
(157, '<p>\r\nBylo jí 5 let, rodiče ji z Londýna poslali s chůvou do Prahy, psal se rok 1968.\r\n</p>\r\n<p>\r\nPřijeli Rusáci, zabili chůvu, ona si přála utéct, dostala se do Šera, odkud si ji vyzvedli a s velkou slávou opět přitáhli do Londýna.\r\n</p>\r\n<p>\r\nSoukromá spekulace - jejím otcem je sám Vandragaron, kterého tituluje &quot;stařík&quot;. Možná by nebylo od věci zjistit Vandragaronovo skutečné jméno... \r\n</p>\r\n', 'Iniciace', 1334141727, 32, 1, 97, 2, 0),
(158, 'Jednou přišla domů, její otec se tvářil divně, matka prohlásila, že se na to odmítá dívat, a odešla. Otec ji posléze změnil v upíra...\r\n', 'Iniciace', 1334142135, 32, 1, 85, 2, 0),
(159, 'Oběť přepadení, zabil je, inicioval se. Or sumfink...\r\n', 'Iniciace', 1334142188, 32, 1, 103, 2, 0),
(160, '<p>\r\nNetřeba zjišťovat, je tuhý jako nikdo druhý.\r\n</p>\r\n<p>\r\nZaklepal bačkorama při rituálu na přenesení Protegona do jiného těla.\r\n</p>\r\n', 'Dodatek', 1334231838, 26, 1, 167, 0, 0),
(161, '<font face="Verdana, Arial, sans-serif"><span style="font-size: 12px">\r\n<div>\r\nNo my pochodili do Rígráča sděěělat cvičonije bojove. Zase. Pochodil ja, Eva, Sylvia, Anne, Koblih, Gradil, Jičinsky a děděk Charistarch. Ukrutnaja švanda. No světli nepochodili. Salati. My zrobili arénu a všici glídkaři po týmoch bitvili sa. Ja, Charistarch a Eva a Jičinsky dělali podrazy, potomu što eto tažšie. Nakonec vsja polječili sa a to i vazy Protegonky. A patom eto prichodilos: vsja chovalis jako banda gipisáků zgulenejch na mraky. Oni zesvětlalis ili što. Koblih se divně šklebil, no on šklébil kak normálno. Jičinsky si znechuceně odplivoval. Zgulenci objimalisja a ztropili sceny ukrutně gystericke. Chvili ja bal, što eto kaněc glidky, no nakonec oni znormalneli. No pamalu. Do normala vraceli se děn, vtoroj a ukrutnoje vylevy milostne, hystericke, lesbicke, depresivne, sadisticke, masochisticke a vo vsjom beverlygillske konaly se. Uf, chorošo, što etomu těpěr kaněc. Resume: vazu protegonku neuživat, tolko v situacijach kritickych.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nŘečí ragulinskou sepsal\r\n</div>\r\n<div>\r\nhlídkař Jičínský\r\n</div>\r\n</span></font>\r\n', 'Jicinskego pohled', 1334145633, 22, 4, 75, 0, 0),
(162, 'Alex v etom tolko sebe pokryl, Silviju v etom nechal. On takovy durak, ze neni vtorovo.\r\n', 'Durak Alex', 1343994841, 22, 4, 72, 0, 0),
(163, 'Na vyzvu Charistarcha my se svjetlymi prijechali na naplavku u viadukta. Tam bitka s Hamidom sdelana, Hamid zajaty, Kaspar jego ovezl do chujocentraly.\r\n', 'Hamid zajatyj', 1343995146, 22, 3, 28, 1, 0),
(164, '<p>\r\nDva tokeny u Charistarcha, zbytek znicenyj. \r\n</p>\r\n<p>\r\n&nbsp;<span style="font-size: 10pt">Charistarch má tokeny tři. Jeden měl dávno před tím, než kolem orákula začalo být rušno. Jak k němu přišel nevíme.</span>\r\n</p>\r\n<p>\r\n27/3/13 - aktulnyj stav tokenov: adin u menja v truhlicce, vtoroj u Renatocky, tretij u Krakonosa, cetvjertyj u Teplakovej.&nbsp;\r\n</p>\r\n', 'Tokeny', 1364381052, 22, 3, 28, 1, 0),
(165, 'Vtoroj Smrtihlav u Ragulina zpet.\r\n', 'Smrtihlav', 1343995277, 22, 3, 26, 1, 0),
(166, '<p>\r\nJe známým faktem, o kterém mluvil i Charistarch, že kříž hledali:<br />\r\nCharistarch (Denní hlídka), Fulbert de Chartes (Noční hlídka) a Alexander Kanus (Inkvizice).<br />\r\nByla to mi se pod trojí patronací<br />\r\n<br />\r\nKanus se otrávil paštikou v roce 2011\r\n</p>\r\n<p>\r\nFulberta zabil Charistarch v době Napoleonských válek, někde v Rusku \r\n</p>\r\n', 'Třetí Jiný', 1344048472, 28, 3, 29, 1, 0),
(167, 'Původní počet částí po rozdělením Karlem IV byl čtyři. K rozdělení došlo nejnom protože to bylo moc silné a Karel se bál, ale hlavně protože se jemu a Mistrovi ne dařilo energii z kříže dostat.<br />\r\n<br />\r\nPátý dílek kříže byl Charistarchovým konstruktem\r\n', 'Karolinský kříž', 1344048558, 28, 3, 29, 0, 0),
(168, 'Skazal sto na trvalo.\r\n', 'Zpatky jego mame', 1344204921, 22, 1, 66, 0, 0),
(169, 'Skazal sto docasno prideleny k Nocnomu dozoru.\r\n', 'Nazpatky', 1344204959, 22, 1, 136, 0, 0),
(170, 'Pripojite etu nagravku.\r\n', 'Nahravka', 1344322565, 22, 4, 82, 0, 1),
(171, 'Jestli &nbsp;za váma přístě někdo přijde zase s tim, že vám jako asi nevadí že dělal tááámhle tááákovejhle bordel. Tak toho dotyčného debila můžete rovnou sebrat, protože se právě usvědčil z toho, že tam šel dělat bordel záměrně.\r\n', 'provokace', 1344332612, 26, 4, 87, 0, 0),
(172, 'Sysoj nám vyléčil dva velmi zraněné hlídkaře, do nichž skoro sjel blesk. Tím svůj dluh splatil, nicméně jsem mu jasně řekla, že pokud by cokoli potřeboval, ať se na nás klidně obrátí znovu.\r\n', 'Splacení dluhu', 1344336327, 32, 1, 180, 0, 0),
(173, 'Mohli bychom &quot;ztratit&quot; dodavatele kteří vypadají že by mohli dodávat světlým a odstřihnout je tak od některých magických surovin.\r\n', 'dodavatelé', 1344414170, 26, 4, 90, 0, 0),
(174, '<p>\r\nJak už asi většina ví, Protegon již chodí mezi námi zas jako Protegon (a nikoliv už jako Protegona). A má stejný problém se vstupem do II. hladiny šera - alespoň 7. 8. 2012 ještě měl - jako další jiní, kteří se &quot;vrátili ze šera&quot;...\r\n</p>\r\n<p>\r\n- Rudolf Jičínský&nbsp;\r\n</p>\r\n', 'Protegon mezi námi', 1344418778, 51, 3, 36, 0, 1),
(175, '<p style="color: #000000; font-family: ''Trebuchet MS'',sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px">\r\nJak\r\nuž asi většina ví, Protegon již chodí mezi námi zas jako Protegon (a \r\nnikoliv už jako Protegona). A má stejný problém se vstupem do II. \r\nhladiny šera - alespoň 7. 8. 2012 ještě měl - jako další jiní, kteří se \r\n&quot;vrátili ze šera&quot;...\r\n</p>\r\n<p style="color: #000000; font-family: ''Trebuchet MS'',sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px">\r\n- Rudolf Jičínský , 8. 8. 2012\r\n</p>\r\n', 'Protegon mezi námi', 1344419227, 51, 3, 36, 0, 0),
(176, 'hokus\r\n', 'pokus', 1344419183, 22, 1, 193, 0, 1),
(177, 'asdf\r\n', 'asdf', 1344419347, 35, 1, 193, 0, 1),
(178, 'Jego flastr vymeneny za jehovisticku vedmu.\r\n', 'Reseni', 1344436675, 22, 1, 192, 0, 0),
(179, '<p>\r\nPan Kováč je světlý velice rozumný a netrpí žádnými hovadskými předsudky. (Nebo ne v míře nesnesitelné a menší než řada jiných světlých.) Není také hloupý a neradno zkoušet prostoduché lži a výmluvy. Mezi (služebně) staršími hlídkaři je respektován a považován za &quot;našeho oblíbeného světlého&quot; (pakliže takové věci existují). Je oddán profesi, &quot;politika&quot; mu smrdí a velice nerad se do ní míchá.\r\n</p>\r\n<p>\r\nPřevzal velení světlé hlídky po a namísto Maršíka (jaro 2012), naneštěstí nějakou dobu poté byl odvelen někam mimo Českou republiku, a nastoupil Miller Viktor (léto 2012).\r\n</p>\r\n', 'k osobě p. Kováče', 1344851204, 51, 1, 62, 0, 0),
(180, 'Pan Brenner - známý rovněž jako pan Wolf - je poměrně zkušený a znalý obchodník s mag. artefakty a rituálními ingrediencemi všeho druhu. Je to především obchodník, dodává proto klidně jak temným, tak světlým. Od fašistické minulosti se slovně distancuje. Je inteligentní, i když si někdy dává záležet, aby to tak nevypadalo, a není to žádný utřinos - proto zejména nováčkové nechať se ve styku s ním nepřeceňují (a hlavně nepřeceňují svoji &quot;ďábelskou lstivost&quot;).\r\n', 'k osobě p. Brennera', 1344437662, 51, 1, 158, 0, 0),
(181, 'O dobrotivosti jeho úmyslů bych se neodvážil cokoliv tvrdit, nicméně: dá se s ním mluvit a domluvit. Když nastává situační tření (a ono nám nastává často při střetu hlídek), je on možným smířlivějším protějškem, který může chtít blesku vzniklému z tření i zabránit ve prospěch slovní dohody.\r\n', 'k osobě', 1344438062, 51, 1, 83, 0, 0),
(182, '<p>\r\nNarko-epilepticko-somnambulně-hysterický chaos řešící vše a nic v jeden a týž okamžik (s odpovídajícími výsledky). Připravte se na to, že s ní je domluva příčetná jen <em>málokdy</em> a následné spolehnutí se na domluvené projevem veliké odvahy a zároveň pošetilosti.\r\n</p>\r\n<p>\r\nKdyž působí/působila v NH, tak hlavní světlá továrna na amulety, artefakty a tak.\r\n</p>\r\n<p>\r\nTato již původně poněkud šílená osoba je od pobytu Protegona ve svém těle ještě o něco šílenější, asi.&nbsp;\r\n</p>\r\n<p>\r\nNo a čerstvě - konkrétně 9/8/2012 - nám proslula výrokem aspirujícím na blbost alespoň pololetí: &quot;Už nejsem v hlídce, už mi nemůžete nic udělat.&quot; (myšleno &quot;vy, denní hlídka&quot;) Výrok se pravděpodobně zapíše zlatým písmem do učebnic tzv. reverzibilní logiky. (tedy logiky, jejíž výsledek se vám zaručeně vrátí, ovšem radost z toho mít nebudete.)\r\n</p>\r\n', 'k osobě', 1344529941, 51, 1, 64, 0, 0),
(183, 'Dokáže jednat (a taky jedná) velice přívětivě, mírně, rozumně a vykazuje nesporné charisma... a je to chodící nelítostný vrah a se vší pravděpodobností nástroj inkvizice, tak bacha! Tam, kde on je, vy ani nechcete být. Kdo nedbá tohoto varování, sám si sám...\r\n', 'k osobě', 1344438441, 51, 1, 155, 0, 0),
(184, '<p>\r\nMrkev, neboť podříznut v oněch lázních svým známým z mládí (temný mág) kvůlivá artefaktu.(stalo se mezi jarem a létem 2012)\r\n</p>\r\n<p>\r\nJinak nějakou dobu šéfoval NH. Nelze říci než to, že se považoval za náramně lstivého manipulátora, přičemž jej zmanipuloval prakticky libovolný temný. Jím pořádané výslechy (Maršík vyslýchá vás) byly radost: vy jste se dozvěděli téměř cokoliv, co jste chtěli.\r\n</p>\r\n', 'ke stavu', 1344851512, 51, 1, 63, 0, 1),
(185, '3,14ča\r\n', 'k osobě', 1344438765, 51, 1, 96, 0, 1),
(186, 'Mrkev, zabit Alexem Straussem.\r\n', 'ke stavu', 1344438843, 51, 1, 143, 0, 0),
(187, 'Zelena verzija extra drsna.\r\n', 'Zelena', 1344448140, 22, 2, 25, 0, 1),
(188, 'Většinou působí apaticky a poddajně. Taky toho moc nenamluví. A někdy i vypadá, že neví... To ona byla unesena tím &quot;Maršíkovým&quot; (bývalý šéf pražské NH) &quot;kamarádem&quot;, co Maršíka krocnul, protože každý chtěl od druhého tu druhou polovinu artefaktu.(A to ji jsme v rámci &quot;spojené operace DH a NH&quot; (srpen 2012) světlým našli a zase vrátili.)\r\n', 'k osobě', 1344449681, 51, 1, 138, 0, 0),
(189, 'hokus\r\n', 'POKUS', 1344454172, 35, 4, 92, 0, 1),
(190, 'Zopakuj si pravopis a oprav si ty chyby! =D\r\n', 'achjo...', 1344508725, 47, 4, 93, 0, 0),
(191, 'Bojová transformace + 3násobné užití dalších schopností\r\n', 'doplněk energetické náročnosti', 1344615047, 51, 4, 93, 0, 0),
(192, '<p>\r\nČernotská navedla člověka Veselého, aby speciální škrtící šňůrou (kterou získala od své učitelky nacházející se daleko v zahraničí) zabil svou manželku, Světlou. Sakeena poslána na policii, aby tento artefakt získala z Šera.\r\n</p>\r\n<p>\r\nČernotskou jsem zastrašila, že po ní jde NH, a že ji ochráním výměnou za protislužbu do budoucna. Souhlasila. \r\n</p>\r\n', 'Bližší okolnosti dluhu', 1344636488, 32, 1, 198, 1, 0),
(193, '<p>\r\nVlad a spol. ovládají nějaký prapodivný turborituál, jímž dokáží někomu (1x -dlak, 1x upír) sebrat/ukrást kategorii v řádu 2 - 3 minut, možná dokonce i rychleji (sekund).&nbsp;Obětmi byli:&nbsp;Brenner/Wolf,&nbsp;Alex Strauss. (platilo 11/08/2012)\r\n</p>\r\n<p>\r\n&quot;Rodinka&quot; je s největší pravděpodobností - pravděpodobností, jisté to není - strukturována takto:&nbsp;Vlad + jeho družka a pak&nbsp;dvě dcery, dva vnuci. Vyskytují se převážně pohromadě, alespoň však po dvojicích, dcery nadřazeny vnukům. (platilo 07/08/2012, mohlo se již změnit)\r\n</p>\r\n<p>\r\nVlad je hajzl, který nabídne komukoliv cokoliv (zkrátka by prodal vlastní sestru a kdyby dvěma stranám, nejspíš by ji rozsekl vejpůl): DH nabídl, že dodá Alexe Strausse, NH nicméně nejspíš nabízel totéž.&nbsp;Vlad rád slibuje, blamuje a kecá a využívá a zneužívá kohokoliv, koho může, prozatím vyjma vlastní rodiny. (platilo 11/08/2012)\r\n</p>\r\n<p>\r\nVlad tvrdil, že může &quot;rovnou&quot; do 3. hladiny šera - podle mých zdrojů kec, musí pěkně postupně jako každej.&nbsp;\r\n</p>\r\n', 'k Vladovi a rodince', 1344679354, 51, 3, 39, 0, 0),
(194, 'Případ tehdy řešila - kupodivu - NH v koordinaci s námi (jmenovitě p. Kováč Andrej). Bylo to dost brutální: podle všeho vlkodlak vlítl k ní do bytu, sežral ji, vymaloval a pocákal krví všechno a pak - podle stop - ve vlčí formě(!) s krvácející mordou doběhl až k cihlové porodnici U Apolináře na Karlově a tam se ztratil, nejspíše vstoupil do šera. Kam zmizel a kdo to byl? Nepodařilo se zjistit, stopař byl na místě až se zpožděním. Kolem je kromě porodnice ještě léčebna pro závislé a neuro ústav a taky, myslím, cvokárna.\r\n', 'k úmrtí', 1344689277, 51, 1, 131, 0, 0),
(195, 'Vladovi ruka zcornala, pak postupovalo, sejcas polovina Vlada cornaja.\r\n', 'Tleje', 1344694292, 22, 2, 39, 0, 0),
(196, 'Vladovi zcornala ruka i postupno cornajet celyj. Sejcas dlja Duba cornyj celyj.\r\n', 'Negr Vlad', 1344696755, 22, 3, 39, 0, 0),
(197, 'To nahoře je oficiální zpráva. V e skutečnosti jsem toho šmejda arogantního sestřelila několikanásobným neurálním úderem a mrtvolu jsme s číslem na Millera pohodili u štábu Světlých.\r\n', 'Skutečná verze', 1344765149, 47, 4, 110, 1, 0),
(198, 'ddd\r\n', 'ddd', 1344792216, 35, 1, 136, 0, 1),
(199, 'Test.\r\n', 'Testovaci poznamka', 1344792246, 35, 1, 136, 0, 1),
(200, '<p>\r\nDočernil. I v té své zasraté druhé hladině.\r\n</p>\r\n<p>\r\n<em>Jičínský</em> <br />\r\n</p>\r\n', 'Dočerněno', 1344792415, 51, 1, 136, 0, 1),
(201, 'zabit 5xprstem smrti, Alexem označováno jako &quot;Ruka smrti&quot; (výzkum tohoto kouzla zařadím do workflow okultního oddělení :))\r\n', 'ruka smrti', 1344850877, 26, 1, 143, 0, 0),
(202, '<p>\r\nsvým debilním pokřikováním zbytečně eskalovala střet s Černým -&gt; natapetovat\r\n</p>\r\n<p>\r\nmařila práci denní hlídky když torpédovala naše snahy o kontaktování nově příchozího jiného z vatikánu -&gt; již natapetovanou zapálit \r\n</p>\r\n', 'připomínka', 1377690643, 26, 1, 150, 0, 0),
(313, 'Bylo eto prokleti, zakryte ritualom totemickym.\r\n', 'Prokleti', 1377692532, 22, 4, 199, 1, 0);
INSERT INTO `nw_notes` (`id`, `note`, `title`, `datum`, `iduser`, `idtable`, `iditem`, `secret`, `deleted`) VALUES
(203, '<p>\r\nNo, jak jen to... Není vysloveně hloupý, to ne, nicméně myslí tak trochu &quot;po vojansku&quot;, přímočaře, spletitější/složitější úvaze (má-li k ní v jeho hlavě dojít) občas nutno napomoci.\r\n</p>\r\n<p>\r\nFunguje ve dvou módech: 1) mám za zadkem mentora (white fista) Černého = úplný imbecil a 2) nemám za zadkem mentora (white fista) Černého = sundám ten směšný baret a chvílemi to i jde. Mentor momentálně Mrkev, tak uvidíme, koho nového z Paříže Milerovi za zadek pošlou. (srpen 2012)\r\n</p>\r\n<p>\r\nJinak je Miler objektem lehce twilightovsky hysterické erotické vášně <a href="readperson.php?rid=85&amp;hidenotes=0">upírky Silvie Krásnohorské</a>. \r\n</p>\r\n', 'k osobě', 1354547162, 51, 1, 66, 0, 1),
(204, 'vlastním jménem František Sirkař\r\n', 'Jméno', 1345013957, 26, 1, 193, 0, 0),
(205, 'Někdo jí při nejbližší příležitosti proskenujte, ta 6. kategorie vážně nesedí\r\n', 'sken', 1345014811, 26, 1, 67, 0, 1),
(206, 'Pravděpodobně sem jel oživit Černého, neuspěl. (zatím)\r\n', 'účel návštěvy', 1345014982, 26, 1, 203, 0, 0),
(207, '<p>\r\nRabi tvrdí že Orákulum nikdo nikdy nepoužil - to je v rozporu s tím co tvrdí manuskript aqua.\r\n</p>\r\n<p>\r\nOrákulum buď stvořilo šero samo, (Je to možnost, zrcadla se taky objevují sama od sebe)&nbsp;nebo &quot;věštci&quot; co byli věštci zač jsem nezjistil.\r\n</p>\r\n<p>\r\nOrákulum na území české kotliny mělo údajně něco společného se čtyřmi věštci.\r\n</p>\r\n<p>\r\nRabi dělal narážky na jakousi třetí stranu mimo tmu a světlo (inkvizice to není, tu tvoří taky temní a světlí). Kdo/co je třetí strana?&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 'Co vypadlo z Rabiho', 1345920928, 26, 3, 28, 1, 0),
(208, '<p>\r\nVyslýchaný na štábu pomocí telepatického vyšetření předal informaci, že byl členem skupiny, která měla Tenebra jako svůj idol, a plánovali ukrást ostatky a najít způsob, jak Tenebra přivést k životu.\r\n</p>\r\n<p>\r\nTo ovšem měla být náplň činnosti pro příští pětiletku, resp. příští generaci, neboť na tomto úkolu ještě ani nezačali pracovat a ani moc nevěděli, za jaký konec to vzít. \r\n</p>\r\n', 'Výslech', 1346226344, 32, 4, 104, 0, 0),
(209, '<p>\r\nNašli jsme jednoho vlkodlaka, měl u sebe jen pár věcí, ale baterky se hodí. Chtěl na Kubu. Sehnali jsme mu kufřík peněz s tím, že ho dostane, pokud přivede svého kolegu, který měl zbytek věcí.\r\n</p>\r\n<p>\r\nTo se mu nepodařilo, takže das Pech. Kolínovou jsem informovala, že se pomocí jednoho pachatele snažíme zajistit druhého, který má všechny její věci. Ale zjevně se to nezadaří. Chudák děvče. \r\n</p>\r\n', 'Dohra', 1346227072, 32, 4, 105, 0, 0),
(210, 'Tvrdil, že jen Silviovo bratrstvo to s námi a s Prahou myslí dobře, ostatní ne. Šankar si přál, aby Slepý otevřel zřídla zde. Za tu černou smršť mohl někdo, kdo ho proklel (pozn.: možná je tam ještě dostatečný otisk, chtělo by to nějak vypátrat, kdo to byl, nebo aspoň z jaké zájmové skupiny). Taktéž Šankar by si přál, aby se k nám (DH) dostal svitek s postupem výroby výživových náhrad.\r\n', 'Co říkal Slepý', 1346415442, 32, 4, 82, 0, 0),
(211, 'test\r\n', 'a', 1353056118, 34, 4, 87, 0, 1),
(212, 'test\r\n', 'asdfa', 1353056136, 34, 1, 71, 0, 1),
(213, 'd\r\n', 'd', 1353056151, 34, 3, 40, 0, 1),
(214, 't\r\n', 't', 1353056164, 34, 2, 13, 0, 1),
(215, 'Eto vygaslo davno. Vazmozno ze znovu objevitsja.\r\n', 'Uzavreno', 1354286179, 22, 3, 30, 0, 0),
(216, 'Vazmozno ze tam nocniky ubyli nejakego vampira.\r\n', 'Mrtvi vampiri', 1354286424, 22, 4, 112, 0, 0),
(217, '<a href="http://znamost.cz/seznamka.php?id=486725" target="_blank" title="http://znamost.cz/seznamka.php?id=486725">http://znamost.cz/seznamka.php?id=486725</a>\r\n', 'Inzerat na seznamke', 1354286611, 22, 4, 114, 0, 0),
(218, '<div>\r\nNaši milí analytici,\r\n</div>\r\n<div>\r\ndnes v noci nějak celkem dramaticky zemřeli tři upíři. Mohli byste se na to mrknout a vyzvědět víc? Něco takového přece musí zanechat nějakou stopu.\r\n</div>\r\n<div>\r\nAsi nemusím připomínat, jak je to důležité, teď, když se nám rozpadá pražská upíří komunita...\r\n</div>\r\n<div>\r\nPokud se zadaří, nechám k vám zanést vodku.&nbsp;\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nPrvní věc, kterou my to vyplivlo je nějaký incident v podniku Zulu kolem 0:30. Linky predikují přítomnost Noční hlídky.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nDalší co tu prohlížím, tak k jednomu incidentu došlo kolem druhé rodiny ranní na náměstí míru, protnutí linek ukazuje na přítomnost Noční hlídky.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nTřetí incident směřuje někam do okolí Palmovky, jednalo se o nějaký střet vlkodlaka s upírem, kdy upír prohrál. Bližší informace neznámé.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nVeškeré incidenty projevují známky agresivního chování a brutality, ne nutně na stranách upírů.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nStačí vám takováto odpověď či mám pátrat hloubš a vy přidáte další díl vodky?\r\n</div>\r\n', 'Mrtvi vampiri tri', 1354288428, 22, 3, 39, 0, 0),
(219, 'Je více než pravděpodobné, že pátý díl Karolinského kříže má Charistarch stále někde zašitý, ačkoli všem tvrdí, že ho zahodil do Vltavy po rituálu... Do Vltavy sice něco házel, ale bůhvíco to bylo, že...\r\n', 'pátý díl', 1354298631, 47, 3, 29, 1, 0),
(220, '<p>\r\nCelou cestu jsme dotycneho zpracovavali s Richardem v jeho dusevnim rozruseni. Stridave uklidnovali, ze vlkodlaci stim ziji a umeji se smirit. Zaroven mu pripomeli ze dotycny mohl mit deti a podobne...\r\n</p>\r\n<p>\r\n&nbsp;Pri vyslechu jsem ho primel prozit celou zalezitost znovu a uvedomit si ze se mu zabijeni cloveka libilo a nejspsis to bude opakovat.\r\n</p>\r\n<p>\r\n&nbsp;Sakeena nejak spanikarila a snazila se mu zacit pomahat s polu se Sivou. Nastesti jsme Sakeenu a Sivou zablokovali az do chvile kdy pro dotycneho nebylo cesty zpet...\r\n</p>\r\n<p>\r\n&nbsp;Vybral si sam, ze uz nechce zit.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 'jak to bylo doopravdy', 1354322738, 45, 4, 121, 1, 0),
(221, 'Druhá možnost je, že tělo neodnosl, ale jednalo se o dlaka a tak tělo sežral, je to jen hapotéza.\r\n', 'Tělo', 1354384500, 38, 4, 122, 0, 0),
(222, '<p>\r\nSobota 1.12.\r\n</p>\r\n<p>\r\n- schuzka se &quot;Sirkou&quot;\r\n</p>\r\n<p>\r\n- poznamka: &quot;dodelat prezentaci&quot; \r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nNedele 2.12.\r\n</p>\r\n<p>\r\n- sraz s &quot;Hrebcem&quot; v parku Fidlovacka v 11:00\r\n</p>\r\n<p>\r\n- poznamka: &quot;nezapomenout&quot;\r\n</p>\r\n<p>\r\n- poznamka2: &quot;priprava veci&quot;\r\n</p>\r\n<p>\r\n- poznamka3: &quot;dopsat knihu&quot;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\ndodatek:\r\n</p>\r\n<p>\r\nzajisteny papir obsahuje tez nakupni seznam na sobotu 1.12 - &quot;rohliky&quot;, &quot;mliko&quot;, &quot;susenky&quot;, &quot;skrob&quot; \r\n</p>\r\n', 'Doplneni seznamu schuzek', 1354401543, 66, 4, 122, 0, 0),
(223, 'sjedemese<span style="color: #666666; font-family: helvetica, arial, sans-serif; line-height: 18px; text-align: right">@seznam.cz, heslo budemejdan</span>\r\n', 'odkaz ze Zulu', 1354461357, 47, 3, 42, 1, 0),
(224, 's upírme byla vcelku řeč a choval se rozumně, tak jsme ho předali madam Scaře\r\n', 'upír', 1354462145, 47, 4, 131, 1, 0),
(225, 'Ragulin potvrzujet. Vtaraja gladina sumraku, kladivo osudu i poklop...\r\n', 'Malinovski', 1354551185, 22, 3, 26, 0, 0),
(226, 'Zima na stabu oziven Ragulinem a poslan na Sibir shanet ritual spojeni hvezdy a misky.\r\n', 'Oziven', 1354619137, 22, 4, 109, 1, 0),
(227, 'Nekdo, patrno drugyje vampiri, pobil vladovych pitomcu na Jiraku. Na govno.\r\n', 'BItka', 1354627993, 22, 3, 39, 0, 0),
(228, '<p>\r\nPo prichodu na misto, jsem vyhledal pana Millera a informoval ho o povaze naseho vysetrovani. Tedy ze podezrele budeme sledovat z druhe hladiny sera. Pokud maji na miste nekoho v druhe hladine, tak at se klidne pripoji. Jinak at udrzuji odstup nejlepe s nasi zalohou z dalky, aby nedoslo k naruseni sledovani.\r\n</p>\r\n<p>\r\n&nbsp;Pres opakovane me varovani se Miller priblizoval nebezpecne blizko ke kavarne a mohl byt vyciten podezrelymi.\r\n</p>\r\n<p>\r\nByl jsem nucen pana Millera odeslat z mista prikazem. To jsem provedl s omluvou a s velkou litosti.\r\n</p>\r\n<p>\r\n&nbsp;Jeho kolega pochopil a rozhodl se misto sledovat z protejsi strany ulice. Nasledne odesel jeste pred skoncenim akce.\r\n</p>\r\n<p>\r\n&nbsp;Nejspise to byli oni kdo pana Sforzu varoval o nasem sledovani&nbsp;\r\n</p>\r\n', 'koblizek a miller', 1354729504, 45, 4, 116, 0, 0),
(229, '<p>\r\nScara i jeji vampiri potvrdili, ze v Prage opet Blue mountain. Jesli zbytky iz drivejska nebo nova varka, neznaju.\r\n</p>\r\n<p>\r\nBambula: vím na beton, že blue mountain se časem rozloží - měl jsem příležitost to prakticky ověřit asi <em>u litru</em> :-) takže staré zbytky to být nemohou.\r\n</p>\r\n<p>\r\nNo eto znacit, ze nekde jest vyrobny, katoraja dodavajet. Ocen choroso...&nbsp;\r\n</p>\r\n<p>\r\nBambula: da da a musí být nová - staré labky v Plzni zrušeny a staří dealeři (volal jsem i pár kolegům) odstřihnuti a nevyužíváni. samozřejmě, vždycky existuje varianta, že někdo něco *vymyslel* a objevil způsob, jak konzervovat - to si ale *spíš nemyslím*, abych byl zcela přesný.\r\n</p>\r\n<p>\r\n<strong>16/03/2013</strong>&nbsp; Žádný nový vývoj, o němž bych věděl. Vím jen to, že světlí - dle svého vlastního tvrzení (p. Miler) - testovali krev některých zadržených agresorů/vlkodlaků (například Zemánek, případ <a href="readactrep.php?rid=140&amp;hidenotes=0&amp;truenames=0">Břevnov a kachny</a>) a žádné chemické/biologické zbytky nějaké drogy v té krvi nenalezli. Jak oni říkají. <strong>- Bambula</strong>\r\n</p>\r\n', 'Opet v Prage', 1377710258, 22, 3, 25, 0, 0),
(230, 'v shan byla mailová adresa, viz poznámky u případu\r\n', 'shangri-la', 1354954612, 47, 4, 135, 1, 0),
(231, 'I sto bylo v etot schrance? Sejcas nefungujet heslo.\r\n', 'Schranka', 1355222787, 22, 3, 42, 0, 0),
(232, '<p>\r\nvidíte v těch informacích co po sobě Alex nechal nějakej smysl?\r\n</p>\r\n<p>\r\n jsou to buď věci naprd a nebo věci co už víme\r\n</p>\r\n<p>\r\nVíme jestli po něm zbylo něco víc a jestli to maj nočníci? Chtělo by to zjistit.&nbsp;\r\n</p>\r\n', 'smysl?', 1355759869, 26, 3, 42, 0, 0),
(233, '<div id="wm-message-head" style="position: relative; border-bottom: 1px solid #dddddd; padding: 0px 10px 20px; color: #333333; font-family: helvetica,arial,sans-serif; line-height: 16px">\r\n<div id="wm-message-headers" style="margin-left: 58px">\r\n<p style="margin: 0px 0px 1px">\r\n<strong>sjedemese@seznam.cz</strong>\r\n</p>\r\n<p style="margin: 0px 0px 1px">\r\nBlue Mountain\r\n</p>\r\n<p style="margin: 0px 0px 1px">\r\n<em style="font-style: normal; color: #666666">1. 12. 2012, 8:05:04</em>\r\n</p>\r\n<p style="margin: 0px 0px 1px">\r\n<em style="font-style: normal; color: #666666">Komu:</em>&nbsp;sjedemese@seznam.cz\r\n</p>\r\n<div id="wm-message-labels" style="margin-top: 3px">\r\n<a style="color: #003399; text-decoration: initial; text-shadow: 0px 1px 1px #ffffff; margin-right: 3px" href="https://novy.email.seznam.cz/#" class=" marked"><span style="font-family: SeznamIconFont; font-size: 18px; vertical-align: middle; color: #999999" class="wm-icon">g</span></a>\r\n</div>\r\n</div>\r\n</div>\r\n<div id="wm-message-body" style="padding-top: 25px; font-size: 15px; font-family: Arial,sans-serif; line-height: 16px">\r\n<div id="wm-message-text" style="padding: 0px 20px 35px 10px; min-height: 30px">\r\n<div style="line-height: 19px">\r\n<div>\r\n...krom běžného vyšetřování kauzy s Modrou drogou, jak bylo psáno v předchozím textu, jsem pátral po tom, jak je asi distribuovaný a kde se tu co vzalo.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nHlavním poznatkem je dedukce toho, jak asi mohla fungovat struktutra celého Projektu a kdo stál v pozadí.\r\n</div>\r\n<div>\r\nDomněnky, skládání informací a další dílky puzzlí v této aféře mě vedou k tomuto schématu. Jistojistě mi to nejmenovaná instance nikdy nepotvrdí, a asi bych se dostal i docela do problémů, kdyby to prosáklo na špatná místa, ale nakonec mi tu vychází jediná možná forma celé pyramidy:\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nběžní dealeři - gang pana &quot;K&quot; - pan &quot;K&quot; osobně - Chronomancer Hamid - Inkvizice\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nAno, je docela troufalé myslet si, že sejednalo o projekt Iknvizice samotné, ale zamysleme se? Kdo by měl prostředky, znalosti, možnosti a schopnost celou aféru koordinovat, řídit a vlastně zaštiťovat jiný?\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nTřeba se mýlím, ale za tímto názorem si nakonec po dvou letech vyšetřování osobně stojím.\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<div>\r\n<strong>Jičínský:</strong> až na to, že jsou *dost dobré* důvody k tomu, aby to mohl být klidně i někdo jiný. jinými slovy, inkvizici nelze vyloučit, zároveň ale existují silné faktory hovořící proti a ve prospěch (v daném případě neprospěch:) jiných entit/zájmových složek. smím vědět, kdo došel k tomuto nezvratnému přesvědčení o kvizici?<br />\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Blue Mountain', 1361892175, 22, 3, 42, 0, 0),
(234, '<p style="font-family: ''Times New Roman''; font-size: medium">\r\nRozhodnutí Inkviziční Rady\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\nVelký inkviziční tribunál, složený ze zástupců inkvizičních centrál celé střední a západní Evropy uznává situaci ve městě Praha jako nedostatečně řešenou. Dále shledává za akt nezodpovědnosti ukončení fungován na oficiální pozici mága mimo kategorie, Temného Jiného, Velkého, Jonase Karolíny Hořínského, šerým jménem Charistarcha (dále jen Charistarch). Inkvizice tímto nařizuje, aby se mág Charistarch ujal role inkvizičního zmocněnce pro Prahu a Pražskou krizi. Budiž mu nařízeno, odpovídat za bezproblémové vyřešení a zakončení Pražské krize, stejně tak, jako vyřešení situace se Světlým odpadlíkem, mágem mimo kategorie, Teodorikem (dále jen Mistr). Veškeré energetické nároky jdou na vrub mága Charistarcha, jakožto potrestání za neetické opuštění bojové zóny, za níž nesl odpovědnost. Mág Charistarch v této věci spadá výhradně pod přímá nařízení Velkého inkvizičního tribunálu a musí mu být poskytnuta náležitá a bezodkladná pomoc.\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\nVysvětlení: Temný, Charistarch svým odchodem hrubě porušil dlouholeté rozvrstvení sil v Praze a celé české republice. Svou byť se svou chybu pokoušel napravit, jeho snaha nebyla dostatečná. Inkvizice v této věci rozhodla takto také z důvodu, že mág Charistarch, který po staletí působil v městě Praha jakožto představený Denní hlídky Praha, je ze všech Jiných, žijících na území prahy nejkompetentnější a tudíž pravděpodobně nejschopnější celou situaci úspěšně vyřešit.\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\nToto jsou slova Šera, vyřčená a neměnná.\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\nZa Inkvizici Praha: Sekretář Dr. Karel Toman v. r. Dne: 4. 3. 2011\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\n&nbsp;\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\nZa Denní hlídku převzal:\r\n</p>\r\n<p style="font-family: ''Times New Roman''; font-size: medium">\r\nZa Noční Hlídku převzal:\r\n</p>\r\n', 'Zmocnenec', 1355739926, 22, 3, 42, 0, 0),
(235, '<div id="wm-message-head" style="position: relative; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #dddddd; padding: 0px 10px 20px; color: #333333; font-family: helvetica, arial, sans-serif; line-height: 16px">\r\n<div id="wm-message-headers" style="margin-left: 58px">\r\n<p style="margin: 0px 0px 1px">\r\n<strong>sjedemese@seznam.cz</strong>\r\n</p>\r\n<p style="margin: 0px 0px 1px">\r\nRozloučení\r\n</p>\r\n<p style="margin: 0px 0px 1px">\r\n<em style="font-style: normal; color: #666666">1. 12. 2012, 8:04:34</em>\r\n</p>\r\n<p style="margin: 0px 0px 1px">\r\n<em style="font-style: normal; color: #666666">Komu:</em>&nbsp;sjedemese@seznam.cz\r\n</p>\r\n<div id="wm-message-labels" style="margin-top: 3px">\r\n<a style="color: #003399; text-decoration: initial; text-shadow: #ffffff 0px 1px 1px; margin-right: 3px" href="https://novy.email.seznam.cz/#" class=" marked"><span style="font-family: SeznamIconFont; font-size: 18px; vertical-align: middle; color: #999999" class="wm-icon">g</span></a>\r\n</div>\r\n</div>\r\n</div>\r\n<div id="wm-message-body" style="padding-top: 25px; font-size: 15px; font-family: Arial, sans-serif; line-height: 16px">\r\n<div id="wm-message-text" style="padding: 0px 20px 35px 10px; min-height: 30px">\r\n<div style="line-height: 19px">\r\n<div>\r\nKaždém, kdo najde jeden z těchto dopisů:\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nTy, kdož čteš tyto řádky, věz, že se ti do ruky dostal první střípek mého odkazu zanechaného zde v Praze.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nOdjíždím na nějaký čas, zhnusen neustálými štvanicemi a přetahované jak Hlídek, tak jiných mocných tohoto světa. Roky pobytu v Praze i služba ve Hlídce a hlavně mimo ni, mě naučila spousty věcí i mé síly zde vzrostly více, než jsme zpočátku vůbec doufal, že by kdy mohly narůst. Mnoho událostí se stalo, mnoho bylo zapomenuto a další ztraceny. A tak, aby znalosti, jenž jsme posháněl a zkompletoval zůstali pro vás, budoucí generaci a některé hledače pokladů, kteří budou kráčet po stopách mého odkazu, zůstaly zachovány, sepsal jsem své paměti a uschoval je na různých místech i u různých osob zde v hlavním městě. Doufám, že ty jenž některé střípky vědění i pokladů mých nalezneš, dovedeš ocenit jejich obsah i síly.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nToto je mé sbohem, prozatím. Možná se sem vrátím a pak uvidím, kam až dospěly situace, které v Praze započali a nejspíš i v Praze skončí.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nAlexandr\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Rozlouceni', 1355739975, 22, 3, 42, 0, 0),
(236, '<p>\r\nNa to ze je slecna 5. kategorie tak umi krasne kouzlit zakryvaci kouzlo :)\r\n</p>\r\n<p>\r\nzatim jeji plany jsou podle toho co rika jen zalozeni galerie, ale snad z ni casem vytahnu pravy duvod jeji navstevy...\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Vcera to byl jeji napad sledovat Kristu. Jinak se da krasne vyhecovat do trolleni svetlych :) je s ni sranda :)</span><span style="font-size: 10pt">&nbsp;</span>\r\n</p>\r\n', 'neco na tom nehraje', 1362357573, 45, 1, 235, 1, 0),
(237, '<div>\r\nHele lidi, právě se ke mě s pár zdrojů dostalo toto prohlášení, které se šíří Prahou:\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nBratři a sestry,\r\n</div>\r\n<div>\r\nv minulých dnech se k vašim uším jistě dostalo prohlášení Nejsvětlejšího a mnoho&nbsp;\r\n</div>\r\n<div>\r\ndalších zkazek. Za mou paní mohu říct, že se jedná o snůšku řečí a planých nadějí.&nbsp;\r\n</div>\r\n<div>\r\nHlídky jsou v rozkladu a nebrání vaše práva ani vaše výsady, jak tomu bývalo dřív.&nbsp;\r\n</div>\r\n<div>\r\nVlčice je jen jednou z těch, kteří už nehodlají dál snášet útlak a násilí ze strany&nbsp;\r\n</div>\r\n<div>\r\npověřených orgánů. Ona i její smečky mají den ode dne stále větší sílu i postavení&nbsp;\r\n</div>\r\n<div>\r\nurvat si zpátky veškeré výsady, které nám byly ukradeny.\r\n</div>\r\n<div>\r\nDlouho nad námi, krom hlídek, stáli Jiní mocní v Praze, ale ani Drákula, ani&nbsp;\r\n</div>\r\n<div>\r\nAlexandr, a podle informací, které jsme obdrželi od našich kontaktů v Hlídkách, ani&nbsp;\r\n</div>\r\n<div>\r\nCharistarch, ani další silní Jiní, nám už nebudou bránit v našich právech. Upíři jsou&nbsp;\r\n</div>\r\n<div>\r\noslabeni, Hlídky zkorumpované a elitářské, vše nám nyní nahrává.\r\n</div>\r\n<div>\r\nProto vyzývám všechny, kteří smýšlí stejně, aby se nebáli vystoupit ze stínu a&nbsp;\r\n</div>\r\n<div>\r\npřestali se podřizovat útlaku orgánů. Vezměte si, co nám po právu náleží a kdokoli se&nbsp;\r\n</div>\r\n<div>\r\nnám pokusí stát v cestě, nechť ho smete vlna svobody.\r\n</div>\r\n<div>\r\nVlčice a její lid ať je vám příkladem.\r\n</div>\r\n<div>\r\nÚplněk se blíží, vzhlédněme k němu a bojujme za svá práva.\r\n</div>\r\n<div>\r\nVlčice je s Vámi.\r\n</div>\r\n', 'Prohlaseni', 1362470912, 22, 3, 45, 0, 0),
(238, '<p>\r\nPoslal jsem veřejnými kanály (trollmarket) a ve vlkodlačích hospodách úplně stejně nablábolil a vykřikoval urážlivé poznámky směrem na Robíka Sekeru a &quot;vlkodlačí buzeranty&quot;, jak jen to šlo - takže jestli i tohle &quot;přeslechnou&quot; a nikdo si mě nenajde a nenaveze se do mě, tak už fakt nevím, co mám dělat.\r\n</p>\r\n', 'Provokace', 1362478972, 51, 3, 45, 0, 1),
(239, '<p>\r\nV dobe, kdy my byli na Jiraku, Nejtemnejsi Eve negdo volal i skazal:\r\n</p>\r\n<div>\r\nJsme Jiní\r\n</div>\r\n<div>\r\na služba běžným silám nás oslabuje.\r\n</div>\r\n<div>\r\nVždyť v Šeru není rozdíl mezi absencí Světla a absencí Tmy.\r\n</div>\r\n<div>\r\nNáš zápas je sto celý svět zničit - a možná proto nás v něm udržují.&nbsp;\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<div>\r\nEtot skazal slabyj zenskyj hlas.&nbsp;\r\n</div>\r\n', 'Telefonat', 1362562319, 22, 4, 144, 0, 0),
(240, 'Den na to (5.3.) jsem se s Anetou sešla (Aleše jsem měla s sebou jako backup), světlušky nám u toho překážely za zadkem (i přes několikerá varování) tak schytali to schytali freezem a opiem, aby dali pokoj. Anetu jsme potom úspěšně iniciovali, je z ní Temná, vědma 6.kategorie.\r\n', 'iniciace', 1362570495, 47, 4, 142, 0, 0),
(241, 'V šeru jsem nebyl 2x ale asi 10x furt jsem vyskakoval mizel v trmvaji jsem tam strávil hodně času v kuse. Mělo to za účel jí vyděsit...\r\n', 'Energetická náročnost', 1362573299, 38, 4, 142, 0, 0),
(242, '<p>\r\nOzval se mi noční hlídkař Dub <a href="readperson.php?rid=189&amp;hidenotes=0">http://www.dhbistro.cz/readperson.php?rid=189&amp;hidenotes=0</a> a když slovo dalo slovo, odtáhl mě rovnou na štáb světlých, kde jsem vyslechl Zemánka (agresor z Břevnova, podřízený Robíka Sekery). Po dobrém to se Zemánkem nešlo, tak jsem ho musel zmlátit - podotýkám, že byl nepříjemně tuhej. Nicméně jsem ho dokázal přesvědčit a za alfu uznal - namísto Robíka - mě. Celé se to ovšem komplikuje, protože &quot;gang&quot; se prý přesouvá a Robíka by musel najít on sám (Zemánek), přičemž bychom ho museli pustit a dát mu pardon.\r\n</p>\r\n<p>\r\nZa druhé, když jsem se vykecával s Dubem, zmínil jsem (snad nečekaně, náhlý obrat v tématu) &quot;pokusy na vlkodlacích&quot;. Dub takovou eventualitu výslovně nepopřel, ale ujišťoval mě, že pouze na mrtvých tělech (ve stylu &quot;pokusy snad dělaj všichni, ne?&quot;). Jak s tímhle naložíme dál, nechať rozhodne Filip.\r\n</p>\r\n', 'Výslech Zemánka', 1377337391, 51, 3, 45, 0, 1),
(243, 'Další postup byl takový, že jsme zabavili veškeré zajímavé předměty, a nechali celý objekt vybuchnout.\r\n', 'Co se dělo', 1362609009, 38, 4, 149, 0, 0),
(244, 'Dub do jisté míry postupuje stejně jako Brenner/Wolf: rád dělá prostáčka a la Švejk, ale <strong>není</strong> (prostáčkem). Tak, zejména pro nováčky, pozor pozor.\r\n', 'Modus operandi', 1362649701, 51, 1, 189, 0, 0),
(245, 'Bylo tam jen několik kádinek, zkumavek a základní chemikálie. Vše uklizené a srovnané. Prach na nich nebyl, bylo videt ze se pouzivaji, ale v nijak extremni míre.\r\n', 'Laborator', 1362649899, 22, 4, 149, 0, 0),
(246, 'Hovořil jsem s ním cca v 1:00 dnes 07/03/2013\r\n', 'Ch. zatím v pořádku', 1362660480, 51, 1, 135, 1, 0),
(247, '<p>\r\nPodle Anežky, která se tahá s obchodníkem Katcherem, se ho vyptávala, jestli nemá na prodejstřípky duší. Takže bacha, smrt rodičů může být jen krycí historka. \r\n</p>\r\n<p>\r\nSáru jsem skenovala je to III. kategorie.\r\n</p>\r\n', 'skutečný důvod její návštěvy', 1362662494, 32, 1, 235, 1, 0),
(248, 'http://cs.wikipedia.org/wiki/Nestor_Machno\r\n', 'Něco navíc', 1362684712, 38, 1, 244, 0, 0),
(249, 'Je z Bristolu. Tvrdí že kouzel moc neumí, ve skutečnosti prý umí jen balzám a tvůrcův rituál. Kamarádí se s Nestorem. Vypadá to, že si získává důvěru světlých, toho by se dalo využít.\r\n', 'Co jsem zjistil', 1362685598, 38, 1, 239, 0, 0),
