(255, 'Po debatach na stabe i s Viktoriju domluveno, sto opicakov pustime, opicaky nebudut zalovat dozor i dozor nebudet zalovat opicakov.\r\n', 'Reseni', 1362954634, 22, 4, 156, 0, 0),
(256, 'Je potřeba zjistit, proč se stále pohybuje v Praze, o co jí tu jde, jaký má názor na ničení soch sv. Václava atd. Pokud jde o její vyjádření k Charistarchově odsouzení, považuje toto inkviziční rozhodnutí za nepříliš šťastné a vedoucí k destabilizaci Prahy\r\n', 'Goroděcká', 1363019196, 47, 3, 43, 0, 0),
(257, 'bylo by dobrý si o Goroděcké promluvit s Trachtou...\r\n', 'Trachta', 1363019298, 47, 3, 43, 0, 0),
(258, 'Po řadě sériových vyjednávání se světlými - přesná sekvence byla Dub, Smutný, Viktorie a nakonec Miler - se nejspíš dneska sejdu s Milerem, abychom si <strong>konečně</strong> definitivně ujasnili ty podmínky (byrokraticky a hodnostně/oprávněně to drhne u nich, já každému pořád dokola opakuji to samé) a <strong>snad</strong> už na podmínku a se zajištěními (cejch, osobní předmět atd.) pustili toho Zemánka, a tedy také konečně viděli, jestli nám najde toho Sekeru anebo ho (toho Zemánka) zase budeme muset chytit a opařit natvrdo.\r\n', 'Další postup v případu', 1363019439, 51, 3, 45, 0, 1),
(259, 'Je třeba zjistit, o co mu tady jde a ohlídat ho, aby nedělal nějaké pičoviny...\r\n', 'O´Connor', 1363019890, 47, 1, 237, 0, 0),
(260, 'Světlí evidentně pracují na nějaké lepší verzi Rituálu obnovy, která by mohla Protegonovi pomoci s jeho problémem, komunikuju o tom se Světlanou... Zatím nebyli úspěšní. A očividně to testují na Adlerové nebo to minimálně maskují za její kalibrace.\r\n', 'Rituál obnovy', 1363019995, 47, 3, 36, 0, 0),
