(263, 'Symbol, který jsme našli u rituálu (je přiložen) patří taky kreténovi, co tady po Praze dělal tzv. vertikální rituály\r\n', 'symbol', 1363020898, 47, 4, 155, 0, 0),
(264, '<p>\r\nCharistarch mi rekl ze ma dost informaci ktere by dokazali me dovezt k ke kamenu mudrcu...\r\n</p>\r\n<p>\r\nMusim mu jen dokazat ze jsem zraly...\r\n</p>\r\n<p>\r\n&nbsp;Pry ty informace byli&nbsp;I v tom tabletu ktery mel charistarch v bunkru\r\n</p>\r\n', 'charistarch', 1363035881, 45, 3, 54, 1, 0),
(265, 'Scara mi kdysi rekla ze tyto veci myslim ze v Madarsku delal Sobotkuv otec a Sobotka nyni v nich pokracuje. \r\n', 'Scara', 1363036149, 45, 3, 53, 0, 0),
(266, '<p>\r\nVčera se se mnou Machno sešel v hospodě jako revolucionář s revolucionářem. Po pokusu mě přesvědčit přísahat na světlo a tmu, že nikomu nevykecám, co se tam řešilo, nakonec po pár pivech povolil a i bez přísahy vykecal i to, co nevěděl.\r\n</p>\r\n<p>\r\n1. Ty sochy likviduje on osobně, má pifku na Ch. a navíc se snaží rozpoutat válku - na to verbuje další Jiné, má v plánu zabít pár jedinců z NH i DH (jeden z cílů je šéfka NH, odstopoval si ji a ví, kde bydlí a kam se přes den pohybuje)\r\n</p>\r\n<p>\r\n2. Umí měnit osobní otisk v Šeru - pokusil jsem se ho donutit mě to naučit, jinak mu nedodám &quot;magickou bombu&quot;, ale vypadá to, že se mu do toho buď nechce, nebo neví jak to předat.\r\n</p>\r\n<p>\r\n3. Dostal včera tip jak se dostat do Muzea a kde konkrétně tam ty busty jsou, kde jsou vchody a tak. A milá volavka vyrazila přímo k zadnímu vchodu.\r\n</p>\r\n<p>\r\n4. Snaží se najít Vlčici a zneužít ji k rozpoutání války&nbsp;\r\n</p>\r\n<p>\r\n5. dneska po mně chce bombu, kterou bude zničen další cíl. Mám tak trochu plán, co s ním, ale budu potřebovat konzultaci, backup a asi i schopnějšího rituálistu než jsem já.\r\n</p>\r\n', 'Včerejší Machno', 1363076543, 70, 3, 50, 0, 0),
(267, '606440774\r\n', 'telefon', 1363077056, 70, 1, 244, 0, 1),
(268, '<p>\r\nPotreba vyslechnout Kristu Cernou a Sobotku<span style="font-size: 10pt">&nbsp;</span>\r\n</p>\r\n<p>\r\nSobotka i cerna vyslechnuta serom pravdy.\r\n</p>\r\n<p>\r\nDalsi DUB a Muller...nejdrive ale rozhovor a pri podezreni serum pravdy...\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Promluvit si zo Zelenym&nbsp;</span>\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nBavil jsem se na to tema se Zelenym a vypadal trochu prekvapene.\r\n</p>\r\n', 'TO DO', 1363350968, 45, 3, 53, 0, 0),
(269, '11.3. prý bylo rozmláceno 9 soch v národním muzeu, netušim který to jsou nebo kde se vzaly, ale podle mých informací by tam žádný být neměly.\r\n', 'Nár. muzeum', 1363080692, 38, 3, 55, 0, 0),
(270, '<p>\r\nZDROJ SARA WERNEROVA<br />\r\n<span style="font-size: 10pt">Zdelila mi ze Flanelovi patraji v Praze po kopii kamenu mudrcu, ktery vytvoril a nasledne znicil jejich predek. Pry se pokusi casem vytvorit novy, vlastni lepsi kamen Mudrcu.&nbsp;</span>\r\n</p>\r\n', 'Informace od Flanelu', 1363080970, 45, 3, 54, 0, 0),
(271, 'tak během noci 11/03/2013 - 12/03/2013 přišla sms od Milera, že tedy Zemánka konečně pustili v souladu s dohodou (světlí pro něj budou chtít trest podmíněný, když nás posune v pátrání dál) a můžeme jen doufat ve dvě věci: a) že si ho nějak zabezpečili (stopovací cejch, osobní předmět) a b) že Zemánek má rozum, aby si to neposral a k milému Sekyrkovi nás opravdu dovedl.\r\n', '12/03/2013 další vývoj', 1363082904, 51, 3, 45, 0, 1),
(272, 'Našel jsem zajímavý článek.<br />\r\n<br />\r\nKonec svatováclavského kultu v Čechách?<br />\r\n<br />\r\nNeznámí\r\npachatelé během posledního týdne zničili již dvanáct pražských soch \r\nsvatého Václava. První z nich, jezdeckou sochu na Václavském náměstí, \r\nzcela zdevastoval náraz nákladního vozu a následná exploze, další socha \r\npadla za oběť výbuchu granátu ve vyšehradských kasematech, třetí sochu \r\nstrhl pachatel lanem přímo zprostředka davu turistů na pražském hradě. \r\nCo je zvláštní, nikde se neobjevili žádní svědkové, nikdo nic neviděl a \r\nvšichni si sochy všimli až ve chvíli, kdy se rozstříšrila o zem. Jako \r\nzázrakem nebyl nikdy nikdo zraněn.<br />\r\nZatím nejmasovějšího útoku proti \r\nsvatému Václavu byla Praha svědkem včera v nočních hodinách, kdy podle \r\nzáznamu z kamer devět vzácných soch rozmlátil v srdci Národního muzea \r\nopilý mladý noční hlídač bouracím kladivem. Motiv jeho činu se \r\nvyšetřuje, podle nepodložených informací mohl být členem pravicové \r\nextremistické organizace a tímto činem na sebe chtěl upozornit. Záhadou \r\nzůstává, proč pravděpodobný neonacista útočil zrovna na svatého Václava,\r\ntradiční symbol všech holohlavých vlastenců. Hlídač z místa činu zmizel\r\na je po němvyhlášeno intenzivní pátrání.\r\n', 'Noviny', 1363103789, 38, 3, 55, 0, 0),
(273, '<p>\r\nSobotka pod serom pravdy:\r\n</p>\r\n<p>\r\nPodilel ses na pokusech na vlkodlacich ci upirech v poslednich nekolika mesicich? Ne.\r\n</p>\r\n<p>\r\nVis, kdo provadi pokusy na vlkodlacich ci upirech v Praze? Ne.&nbsp;\r\n</p>\r\n', 'Sobotka', 1363168345, 22, 3, 53, 0, 0),
(274, 'Opravdu Vašek(já) jsem fungoval jako pozorovatel u dvou světých, zatímco Koblížek chytil za rohem, pod tram. zastávkou, kurýra, sebral mu zásilku, vymazal pamět a poslal dál. Potom přijel na místo střetu a dál už výše.\r\n', 'jak to tak bylo', 1363289112, 69, 4, 163, 1, 0),
(275, '<p>\r\nzásilka upozorňuje na údajné donašeče v hlídkách, které je třeba &quot;přetáhnout na naši stranu&quot;:\r\n</p>\r\n<p>\r\nNH: Matouš Maxwell, Viktor Miler, Anděla Ondruchová\r\n</p>\r\n<p>\r\nDH: Pavel Chelčický, Adam Koblížek&nbsp;\r\n</p>\r\n', 'text', 1363290316, 47, 4, 164, 1, 0),
(276, '<p>\r\nPo schůzce s Fídlerovou můžu potvrdit, že není dobré jí věřit to, co říká, ale aspoň něco:\r\n</p>\r\n<p>\r\n- Když uvidí nějaký otisk aury, tak dokáže nakreslit jeho obličej\r\n</p>\r\n<p>\r\n- chce vstoupit do denní hlídky, protože nemá co dělat a taky schání ochranu, před někým, kdo po ní jde (prý nějací vlkodlaci, nebo co)\r\n</p>\r\n<p>\r\n- to že nic neumí, není úplně pravda. Umí nějaké rituály a podobné věci.\r\n</p>\r\n<p>\r\n- opravdu zbírá co se kde šustne a tak 50/50 je to pravda.\r\n</p>\r\n<p>\r\n- je to ženská co ví, jak má zapůsobit na chlapa, takže pozor&nbsp;\r\n</p>\r\n', 'Fídlerová', 1363296349, 69, 3, 50, 1, 0),
