(281, '<p>\r\nZjistil jsem transakce penez (davno predano Gargamel). Vsechny penize sly z Vidne evidentno od Rodiny co chtela ozivit kdysi Vlada.<span style="font-size: 10pt">&nbsp;</span>\r\n</p>\r\n', 'Kdysi zjistitl koblih', 1363351408, 45, 3, 22, 0, 0),
(282, '<p>\r\nví Eva S. Neptejte se jí, nevrtejte v této záležitosti. \r\n</p>\r\n<p>\r\nNedávejte z bezpečnostních důvodů žádné záznamy o Hodináři do BIStra. \r\n</p>\r\n<p>\r\nKdo ví, ví, kdo neví, dobře pro něj.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 'Odkud a proč přijel', 1363540570, 32, 1, 206, 0, 0),
(283, '<p>\r\nRožmitál byl propuštěn do domácího léčení, ale vyzjistit na něj číslo je jak hledat jehlu v kupce sena/domluvit se s Lilkem.\r\n</p>\r\n<p>\r\nPatolog co měl na stole Líku, tak nechce nic sdělit, pouze PČR, nebo Ministerstvu vnitra (asi ho přitáhnu za uši na štáb...)&nbsp;\r\n</p>\r\n', 'Kontakty', 1363551680, 69, 3, 46, 0, 0),
(284, 'Vávra měl hůlku, tedy spíš klacek, z prsty smrti. Vypadlo z něj že to má coby člen IMG. Je moc hezký, že je u inkvizice je prst smrti přitěžující okolnost, ale jejich motorkáři je dostávají na hraní v hůlkách.\r\n', 'Prsty smrti', 1363709745, 38, 4, 171, 0, 0),
