(287, '<p>\r\nTrávníčkův kolega zabil upíra, shodou okolností člena ruského gangu, po kterém šli (oba jsou u PČR) - vzali spravedlnost do svých rukou\r\n</p>\r\n<p>\r\ndohoda s ním je taková, že pokud my budeme něco potřebovat od PČR, ozveme se mu a naopak (nabídli jsme případnou pomoc s tím ruským gangem, jehož činnost rozkrývají)\r\n</p>\r\n<p>\r\ndále jsme domluveni, že pokud by znovu v rámci PČR zadrželi Jiného, ozvou se nám a předají nám ho, protože lidská spravedlnost s ním nic moc nezmůže \r\n</p>\r\n', 'podrobnosti', 1363962277, 47, 1, 263, 1, 0),
(288, 'Ahoj Koblížku, tohle mi odpověděli z Milovic:\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\n17.3.\r\nbylo v Milovicích nahlášen agresivní čin. Vyšetřování na místě ukázalo,\r\nže byl zabit pan Ladislav Smetánek, upír 6. kategorie dle registrace \r\nbydlící právě v obci Milovice.\r\n</div>\r\n<div>\r\nVyšetřovací tým zajistil stopy,\r\nhlavně energetickou stopu, která byla identifikována na pana Andreje \r\nSazela. Bohužel se zatím nepovedlo pana Sazela zadržet a proto je na něj\r\nvypsán zatykač, aby podal vysvětlení o daném incidentu.\r\n</div>\r\n<div>\r\nSvědci na místě nebyli žádní.\r\n</div>\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n', 'spis z milovic', 1364227215, 45, 1, 264, 0, 0),
(289, '<p>\r\n1. &quot;je možné, že jsou od Vlčice...&quot; - z toho nějak plyne (jak? co vyšetřovaný uvedl?) nebo jde čistě o žádným faktem PŘÍMO z výpovědi vyšetřovaného vyplývajícím nepodložený dohad?\r\n</p>\r\n<p>\r\n2. k čemu je taková kost? alespoň rámcově. \r\n</p>\r\n<p>\r\ndíky \r\n</p>\r\n', 'dva dotazy', 1364346313, 51, 4, 183, 0, 0),
(290, 'SVETLY NEVEDI ZE HO MAME!!!!\r\n', 'Schovat', 1364368024, 22, 4, 183, 1, 0),
