(292, '<p>\r\n1. ok. faktor &quot;možná jsou od vlčice&quot; <strong>zatím</strong> proto nebudeme uvažovat, dokud se libovolně nepotvrdí.tedy vzhledem k tomu, že existence vlčice zatím není <em>nijak</em> prokázána, viz <a href="readcase.php?rid=45&amp;hidenotes=0">http://www.dhbistro.cz/readcase.php?rid=45&amp;hidenotes=0</a>\r\n</p>\r\n<p>\r\n2.&nbsp; ok. jaké povahy je to &quot;ošklivéubližování na dálku&quot;? je to rituál? (tudíž vědma + mág vysoké úrovně, který se dal na rituály + <em>kdo další?</em>) anebo stačí něco takového (kost bla bla bla) vlastnit a pak už majitel celkem může ošklivě ubližovat sám? \r\n</p>\r\n', 'upřesnění', 1364368884, 51, 4, 183, 0, 0),
(293, '<p>\r\nStav: absolutně žádný nový vývoj. Dle Milera (NH) zatím Zemánek někde brousí Prahou a hledá (jsou prý zprávy od Cogena, který na něj vlepil ten cejch).\r\n</p>\r\n<p>\r\nKrautner/Graubner taky nic, ani nereagoval na SMSku. \r\n</p>\r\n<p>\r\n<em>Vzhledem k tomu (nic, nic) a 0vému výsledku provokací nemám žádný další nápad - a Miler, jak spolu e-mailujeme, taky ne.</em>\r\n</p>\r\n', '27/03/2013 aktuální stav', 1364369037, 51, 3, 45, 0, 1),
(294, '<p>\r\n2. Ritual. AFAIK bez omezeni, tedy kazdy, kdo je schopen ritualni magie a umi patricny ritual.\r\n</p>\r\n<p>\r\n<strong>BTW. tu kost nenarozeneho 7. syna nekdo uz chvili shani, chteli ji i upiri v porodnici.</strong>&nbsp;\r\n</p>\r\n', 'Chat', 1364371785, 22, 4, 183, 0, 0),
(295, 'Na místo kde padnul poslední velký vlk (kaple na Okoři) přinést trofej ze silnějšího nepřítele, a zaspívat píseň dětí noci (dlačí vytí, ideálně ženská). Vypadá to trochu vymyšleně...\r\n', 'Jak přivolat Vlčici', 1364550129, 38, 4, 186, 0, 0),
(296, 'Postup ve skupině IAS:<br />\r\nSchůzka s Letholdem, domluva na další schůzce. Přišel o dvě hodiny pozdě, a z jeho jednání vyplývá velká dávka neschopnosti plánovat nebo odhadnout dopředu situaci (zvládá naopak osobní jednání na místě, nicméně jeho vystupování je velmi diplomatické, tj. logicky zvažuje všechny předhozené argumenty a nechá se jimi utlouct).<br />\r\nPočkali jsme na Trachtu, byl jsem s Chelčickým jmenován členem skupiny, obdrželi jsme jmenovací dekret a bianco povolení k zásahu 6. a 5. stupně na výlohy ve vyšetřování. Bylo nám předneseny naše pravomoci a co se od nás očekává - vystupovat s důstojností, do ničeho se osobně neplést, předávat hlášení a bonzovat všechno na všechny od nás. Dalším aspektem bylo monitorovat artefakty - kdo je má, kde jsou, na co jsou použity. Po každém použití hlásit, aby je mohla Inkvizice zabavit. Byly nám předloženy případy, na které jsme byli Inkvizicí přiřazeni.<br />\r\nČinnost IAS jsem blokoval pozdními odpověďmi na výzvy od Letholda, nepodáváním vůbec žádných hlášení, nulovou spoluprácí a předkládáním desinformací, když jsme se náhodou setkali. Zhruba v polovině doby činnosti IAS jsem byl přidělen na případ Charistarch, na kterém jsem měl spolupracovat s Vávrou. Vhodnou kombinací nedostatku času na mé a na jeho straně a ubezpečováním Letholda, že situaci nejlépe vyřeším sám, protože jsem už na stopě a kdokoliv jiný by jen narušoval postup, jsem dosáhl toho, že mé průtahy trvaly až do rozpuštění IAS.<br />\r\nNaopak jsem na všech schůzkách lobboval za věci Denní hlídky a zejména na té poslední za povolání Charistarcha jakožto nejmenšího zla ze všech dostupných možností. Zároveň se mi podařilo získat řadu (nyní už ne až tak) důležitých informací (není potřeba zmiňovat, buďto přešly ve všeobecnou známost nebo už nejdou využít) .<br />\r\nPo rozpuštění IAS jsem měl vrátit jmenovací dekret, ale čas na Letholda už jsem si neudělal. Předpokládám, že mě znovu neuvidí příliš rád, ale jsem schopen situaci rychle urovnat, pokud to bude zapotřebí.<br />\r\nPovolenku 6. kategorie jsem zcela legitimně věnoval Koblihovi za kontakt na pyrotechnika (ehm), 5. kategorie propadla.\r\n', 'Vandrovec - rozbor', 1365274420, 67, 3, 48, 0, 0),
(297, 'Dopisite co nejdetailnejsi informacie o etom, sto ona skazala.\r\n', 'Detailu nada', 1376982352, 22, 4, 193, 0, 0),
(298, 'Zmiňovala se o nadcházející velké bitvě, o tom, že ona zemře a zemře i spousta dalších. To je všechno, co řekla před námi, zkusím ještě něco dalšího vyrazit z Alice Malenové, ta si s ní pak povídala u kafe.\r\n', 'detaily', 1376987981, 47, 4, 193, 0, 0),
(299, '<p>\r\n<em>upravuji do jedné shrnující poznámky, jednotlivé/dílčí vstupy možno promazat (doporučuji, je to takhle přehlednější) - Bambula</em> \r\n</p>\r\n<p>\r\n2013 08. (srpen) 19. - na scanu se už projevuje plně jako <u>mág 4. kategorie</u>. <strong>(Sobranie)</strong> \r\n</p>\r\n<p>\r\n2013 08. (srpen) 20. - asi tak v rozmezí 0:00 až 1:00 na sobě měl <u>Hradbu tisíce čepelí</u>. upozorňoval na to hlasitě, hrdě a často.\r\n</p>\r\n<ul>\r\n	<li>na Gargamelův dotaz: sesláno na místě, zda z amuletu či přímo jako kouzlo, nelze říci. <strong>(Bambula)</strong>\r\n	</li>\r\n</ul>\r\n<p>\r\n2013 08. (srpen) 20. (večer, &quot;Richardův slavný rituál&quot;) - tak si *myslím*, že jsem ho viděl sesílat i <u>Cejch Iron Maiden</u>. <strong>(Bambula)</strong>\r\n</p>\r\n<p>\r\n2013 08. (srpen) 20. (večer, &quot;Richardův slavný rituál&quot;) - na Richardově rituálu se rozhodně taky oháněl <u>Hradbou tisíce čepelí</u> (&quot;žiletkami&quot;), takže si \r\nmyslím, že z amuletu je nemá... a stoprocentně sesílal <u>Znamení trojitého\r\nklíče</u><strong> (Sobranie)</strong>\r\n</p>\r\n', 'aktuální známý stav', 1377342462, 51, 1, 66, 0, 1),
(300, 'Karl už nám nic dalšího neřekne, protože je mrtvý následkem (velmi pravděpodobně) Renkopfova prokletí.\r\n', 'Karl', 1376988989, 47, 4, 194, 0, 0),
(301, 'Na scanu se už projevuje plně jako mág, 4. kategorie\r\n', 'scan z 19.8.', 1376989179, 47, 1, 66, 0, 1),
(302, '<a href="readactrep.php?rid=192&amp;hidenotes=0&amp;truenames=0">http://www.dhbistro.cz/readactrep.php?rid=192&amp;hidenotes=0&amp;truenames=0</a>\r\n', 'Již rozepsáno zde.', 1376990271, 72, 4, 194, 0, 0),
(303, '<p>\r\nnevíme jestli tu hradbu tisíce čepelí nekouzlil z amuletu? není to příliš rozšířené kouzlo, kdo by jí ho naučil?\r\n</p>\r\n<p>\r\n&nbsp;- to při opatrném sledovacím odstupu u zásahu NH nemohu přesně říci. *myslím*, že tam s ní nepřišel, vznikla až na místě. zda amulet či kouzlo, nejsem schopen rozlišit. náš pozorovací výjezd vedl mág (Filip ví), ten snad bude schopen říci víc. \r\n</p>\r\n', 'ad. schopnosti update', 1376992502, 26, 1, 66, 0, 1),
(304, 'na Richardově rituálu se rozhodně taky oháněl žiletkama, takže si mylsím, že z amuletu je nemá... a stoprocentně sesílal Znamení trojitého klíče\r\n', 'schopnosti', 1377089581, 47, 1, 66, 0, 1),
(305, '<p>\r\nDorazili jsme na místo v předstinu, pozorovali jsme dění. Vyběhli světli, jenž jej vyzvali At vystoupí ze šera, ve kterém sami byli.\r\n</p>\r\n<p>\r\nPo tom co jim několikrát slovně řekl, at jej nechají být, vyběhl Muller a zautořil hradbou tisíce čepeli.\r\n</p>\r\n<p>\r\nSergejuv vlkodlak byl bez jakeho koliv jeho zásahu zpacifikovan příkazem a pouty.\r\n</p>\r\n<p>\r\nPoté co Sergej Karabáčem zmlátil Muttermullera, byl zajat a odvezen na štáb světlých.\r\n</p>\r\n<p>\r\nPři výslechu nehodlál jakkoliv vypovídat, výslech přesunut na 20.8.2013 14:00.\r\n</p>\r\n<p>\r\nVýslýchaný uvedl, že je byl zástupcem šefa DH minsk, a že temná odnož pro ně přišla, šefa zabila a on začal utíkat.\r\n</p>\r\n<p>\r\nUdajně to byli Bělorusové, zřejmě odnož nové kliky.\r\n</p>\r\n<p>\r\nPřes Prahu pouze projíždějí.\r\n</p>\r\n<p>\r\nPosleze byl vyhádán ze světlími a po rozumné dohodě vodky, azylu a tance u tyče se nechal eskortovat k nám bez odporu.&nbsp;\r\n</p>\r\n', 'Podrobnosti', 1377181216, 22, 4, 195, 1, 0),
(306, 'Neutekl, skrývá se pod našim dohledem v Praze, nelze zveřejnit.&nbsp;\r\n', 'Je to jinak', 1377192432, 72, 4, 195, 1, 0),
(307, '<p>\r\nPopis se mi prostě neuložil, už 3x, nevím proč.\r\n</p>\r\n<p>\r\nProstě:\r\n</p>\r\n<p>\r\nSál energii, cca 200 mg z kafárny, po té přišli světlí, ohlásíli se jako Noční Hlídka, napadli ho, zpacifikovali, odvedli.\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Výslech:</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Je to zástupce DH Minsk, utekl po Minskem masakru mezi temnými.</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Při eskortu na DH Praha bohužel utekl, po té co v autě mne a Sakeenu zpacifikovalm kouzly, vzhledem k dopravní situaci utekl.&nbsp;</span>\r\n</p>\r\n', 'Popis', 1377192605, 72, 4, 195, 0, 0),
(308, '<p>\r\nzásilku máme, Lethold utřel nos... jednalo se o artefakt (?) který pomohl vyléčit Filipa.\r\n</p>\r\n<p>\r\nLethold se tam sešel se Sergejem, proto, že ho Sergej kontaktoval a chtěl od něj pomoc ve své současné situaci, zřejmě se znají z dřívějška. \r\n</p>\r\n', 'zásilka', 1377258505, 47, 4, 197, 1, 0);
