(309, '<p>\r\naktuální znění Barcelonského indexu (aktualizováno 15.4. 13)\r\n</p>\r\n<p>\r\n1. Zavulon &ndash; Mág, Prastarý - Moskva<br />\r\n2. Vandragaron &ndash; Mág, mimo Kategorie - Londýn<br />\r\n3. Tarviel &ndash; Vědma, Mimo Kategorie - Mnichov<br />\r\n4. Taviskaron &ndash; Mág, Mimo Kategorie - Kyjev<br />\r\n5. Charistarch &ndash; Mág, Velký - Praha<br />\r\n6. Richard Novotný &ndash; Mág 4. kategorie - Praha<br />\r\n7. Uma Schlaif &ndash; Vědma, 1. kategorie - Atény<br />\r\n8. Sakeena &ndash; Mág, 2. Kategorie - Praha<br />\r\n9. Pablo Fetuttio &ndash; Nejvyšší upír - Turín<br />\r\n10. Edvin Laszlo &ndash; Nejvyší Upír - Gdaňsk<br />\r\n11. Sonia Henie &ndash; Mág, 1. Kategorie - Mnichov\r\n</p>\r\n<p>\r\nTaviskaron v Kyjevě zakukal, vyčistili to tam světlí .. hrozí mi, pokud jeho místo nezaplní někdo jiný, že se posunu v indexu na páté místo. Bezva ..&nbsp;\r\n</p>\r\n', 'Barcelonský Index', 1377473181, 26, 3, 57, 0, 0),
(310, 'Celkom nabita hulkami.\r\n', 'Hulky', 1377362284, 22, 1, 233, 0, 0),
(311, '<p>\r\nMaike na místě tvrdila, ž ejde o rituál prokletí - proč lhala? Nebo nelhala a skutečně šlo o nějak podivně upravený totemický rituál?\r\n</p>\r\n<p>\r\nOpravdu šlo o prokletí, koblížek u Maike ověřil sérem pravdy.&nbsp;\r\n</p>\r\n', 'Maike', 1377472663, 26, 4, 199, 1, 0),
(312, 'Podle Niny se jedná skutečně o standardní totemický rituál.\r\n', 'info', 1377365837, 47, 4, 199, 0, 0),
(314, 'Tak jak to tedy je? postoupil v srpnu o kategorii, nebo ho do druhýho šera někdo s sebou tahá? Viděl ho někdo lézt do druhýho šera? (ne už v druhym šeru, to je neprůkazný, protože ho tam někdo mohl vtáhnout)\r\n', 'kategorie', 1377729746, 26, 1, 66, 0, 0),
(315, 'proskenovat, můj odhad je 5. kategorie\r\n', 'skenovat', 1377729831, 26, 1, 248, 0, 0),
(316, 'po proskenování dplňte kategorii a smažte poznámku\r\n', 'opět prosím scan', 1377729878, 26, 1, 250, 0, 0),
(317, '<p>\r\nsobotková je minimálně 4.ka protože jsem vyhrál v pokeru hůlku co vyrobila a byl v ní trojkovej karabáč, takže ho musela umět (varianta že je jednička s přístupem ke čtyřkovejm kouzlum a trojkovej karabáč tam nabila třeba přes Milera nepřipadá v úvahu, pokud NH opravdu neexpí nějak<strong>&nbsp;<em>jinak</em></strong>&nbsp;než my) a aby zaříkávač mohl trojkový kouzla, musí bejt minimálně čtyřka, což nás přivádí k tomu, že musí umět i trojkovej tvůrcův rituál\r\n</p>\r\n<p>\r\nněkdo ji pro jistotu proskenujte, tuhle poznámku pak asi můžete smazat&nbsp;\r\n</p>\r\n', 'teorie', 1377771343, 26, 1, 138, 0, 0),
(318, 'proskenovat, ten údaj už bude notně zatuchlý\r\n', 'proskenova', 1377773563, 26, 1, 139, 0, 0),
(319, 'S panem Polákem se následně na štábu dohodla Eva, máme nového kmotřence... Jen ať si SVětlí myslí, že je na odvykačce, i když ve skutečnosti tak úplně není =) Prozatímně mu zajišťujeme ubytování na štábu.\r\n', 'Polák', 1386585634, 47, 4, 207, 1, 0),
(320, 'S pravděpodobností hraničící s jistotou má Orákulum NH Praha. Proslýchá se, že si s ním neví rady a budou chtít poradit. Otázkou je, nakolik je tenhle drb pravdivý.\r\n', 'stav k 27.1.2014', 1390818745, 26, 3, 28, 1, 0),
(321, 'Nefigurovala tam taky nejaka lecitelka?\r\n', 'lecitelka', 1411329274, 22, 3, 39, 0, 0);
