(61, 'Lucie', 'Sivá', '732705889', 1345014348, 26, '<p>\r\nSlovenská obrateň (v ještěra) v jináči.\r\n</p>\r\n<p>\r\nuž neni v jináči, údajně to má s Kováčem\r\n</p>\r\n', 0, 0, '1331803849289b19971569ebad4a49b556de1a8961', 1, 6, 4, '', 0, 0, 0, 0),
(62, 'Andrej', 'Kováč', '602887131', 1332848969, 32, '<p>\r\nMomentálně Nejsvětlejší města Prahy.\r\n</p>\r\n<p>\r\nMág, slovák, Sivá má podle jeho slov toho haranta s nim.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nZnáma kouzla:\r\n</p>\r\n<p>\r\nAmnézie\r\n</p>\r\n<p>\r\nTrojité ostří&nbsp;\r\n</p>\r\n<p>\r\nDvojkovy protikouzlo\r\n</p>\r\n<p>\r\npodrobny scan&nbsp;\r\n</p>\r\n<p>\r\nzahviho pouta\r\n</p>\r\n<p>\r\ntransfer&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, '13323415004196138352f9d2fe179a37fff834bb1d', 1, 4, 1, '', 0, 0, 0, 0),
(63, 'Pavel', 'Maršík', '776049380', 1377709927, 51, '<p>\r\nV roce <strong>2011</strong> již nějakou dobu stál v čele pražské NH. Původní záznam v kartotéce zněl doslova takto: <em>&quot;Prostě Maršík. S ním v čele bude ze světlejch v Praze brzo ohrožený druh.&quot;</em> Tuto předpověď dokonale naplnil sám na sobě, viz <a href="readcase.php?rid=58&amp;hidenotes=0">Pražské reálie</a>, oddíl &quot;Historie vedení pražské NH 2011 - 2013&quot; - Pavel Maršík nás opustil v prvé polovině roku <strong>2013</strong>.\r\n</p>\r\n<p>\r\nZ jím ovládaných kouzel byla DH známa tato: Velká šerá motlitba / Karabáč Šaabův\r\n</p>\r\n<p>\r\n<strong>osobní poznámka - Bambula: </strong>Nějakou dobu šéfoval NH. Nelze říci než to, že se považoval za \r\nnáramně lstivého manipulátora, přičemž jej zmanipuloval prakticky \r\nlibovolný temný. Jím pořádané výslechy (Maršík vyslýchá vás) byly \r\nradost: vy jste se dozvěděli téměř vše, co jste chtěli, on téměř nic, co vy jste nechtěli (aby on se dozvěděl).\r\n</p>\r\n<p>\r\n<strong>osobní poznámka - Bambula: </strong>Je to jediný známý ověřený případ, kdy někdo překonal závislost na <a href="readcase.php?rid=25&amp;hidenotes=0">Blue Mountain</a>. Velice drastickým způsobem: zemřel v deliriu vyvolaném pokročilým absťákem a &quot;byl zvednut&quot; (<em>Silou ohně</em> myslím). Tento postup je rizikový a úspěšné provedení údajně není nijak zaručeno.\r\n</p>\r\n', 0, 0, '1328824542e94cc861e0be9b55aad764ea0b19bac7', 1, 3, 1, '', 1, 0, 0, 0),
(64, 'Markéta', 'Feitová', '773137891', 1332341662, 22, '<p>\r\nPROTEGON&nbsp;\r\n</p>\r\n<p>\r\nZaklínačka, pravděpodobně si pro sebe syslí artefakt známý jako mentor, tudíž umí zásobu kouzel třetího stupně. \r\n</p>\r\n<p>\r\nSlepice co zřídkakdy vystrčí zobák ze štábu světlých.\r\n</p>\r\n<p>\r\npotřebujeme lepší fotku a jakékoliv další informace &nbsp;\r\n</p>\r\n<p>\r\n&nbsp;mnoho zkušeností, které zatím nevyužila&nbsp;\r\n</p>\r\n', 0, 0, '133234166249f86ae35c39a88c896df9d9333991a0', 1, 2, 8, '', 0, 0, 0, 0),
(65, 'Alfréd', 'Pěnkava', '605258729 nebo 724234333', 1331563410, 26, '<p>\r\n&nbsp;Může mít golemy (až 3 díky artefaktu známém jako Odkaz Rabbi L&ouml;wa) .. \r\n</p>\r\n<p>\r\nMyslí jak je strašně chytrej a byrokraticky obratnej, nechme ho v tom.\r\n</p>\r\n<p>\r\npotřebujeme fotku a jakékoliv další informace &nbsp;\r\n</p>\r\n', 0, 0, '13288245598d0cae55e1575500ddb7aa29d2e267cd', 1, 1, 3, '', 0, 0, 0, 0),
(66, 'Viktor', 'Miler', '607629651', 1377729752, 26, '<strong>info:</strong> Viktor Miler <em><strong>býval</strong></em> obrateněm 4. úrovně (disponoval tehdy <u>Neurálním úderem</u>). Také býval jednu dobu chráněncem/žákem <a href="readperson.php?rid=136&amp;hidenotes=0">Jana Černého</a>, světlého mága a příslušníka White Fistu. Odjel s ním dokonce do Paříže a zase se vrátil zpět do Prahy. (<em>&quot;Skazal sto na trvalo&quot;</em> - <strong>Standard</strong>)\r\n<p>\r\nV přítomnosti bývalého mentora (stejně jako nyní v přítomnosti <a href="readperson.php?rid=150&amp;hidenotes=0">Kristy Černé</a>, s níž evidentně má nějaký vztah (minimálně jaro - léto 2013)) vykazoval vyšší agresivitu vůči temným (a úměrně snížený úsudek). Sám osobně se leckdy nachází ve stavu, kdy se s ním lze relativně rozumně dohodnout.\r\n</p>\r\n<p>\r\n<em>Na jaře 2013 se <strong>nějak</strong> stal mágem a postupně jsou zjišťovány následující skutečnosti:</em> \r\n</p>\r\n<p>\r\n2013 08. (srpen) 19. - na scanu se už projevuje plně jako <u>mág 4. kategorie</u>. <strong>(Sobranie)</strong> \r\n</p>\r\n<p>\r\n2013 08. (srpen) 20. - asi tak v rozmezí 0:00 až 1:00 na sobě měl <u>Hradbu tisíce čepelí</u>. upozorňoval na to hlasitě, hrdě a často.\r\n</p>\r\n<ul>\r\n	<li>na Gargamelův dotaz: sesláno na místě, zda z amuletu či přímo jako kouzlo, nelze říci. <strong>(Bambula)</strong>\r\n	</li>\r\n</ul>\r\n<p>\r\n2013 08. (srpen) 20. (večer, &quot;Richardův slavný rituál&quot;) - tak si *myslím*, že jsem ho viděl sesílat i <u>Cejch Iron Maiden</u>. <strong>(Bambula)</strong>\r\n</p>\r\n<p>\r\n2013 08. (srpen) 20. (večer, &quot;Richardův slavný rituál&quot;) - na Richardově rituálu se rozhodně taky oháněl <u>Hradbou tisíce čepelí</u> (&quot;žiletkami&quot;), takže si \r\nmyslím, že z amuletu je nemá... a stoprocentně sesílal <u>Znamení trojitého\r\nklíče</u><strong> (Sobranie)</strong>\r\n</p>\r\n', 0, 0, '133029359837035c96cdf9b0368cbd96c9319765aa', 1, 3, 1, '1377433352a75275f61f5b8ef6288099df79e3a8ee', 0, 0, 0, 0),
(67, 'Viktorie', 'Tesařová', '608284419', 1377710875, 51, '<p>\r\n<strong>dlouhodobé info: </strong>Řečená &quot;Mengele&quot;. Dle informací nejpotenciálnější výzkumník NH <em>(platilo 2012)</em>. Zajímá se o problematiku závislosti na <a href="readcase.php?rid=25&amp;hidenotes=0">blue mountain</a>: nakrmit jí bludy, které ji zaměstnají, je preferované řešení této iniciativy světlých <em>(platilo 2012)</em>. Členka defendoriátu za noční hlídku <em>(březen 2012)</em>. Jeden ze zástupců nejdepresivnějšího <em>(býv. <a href="readperson.php?rid=204&amp;hidenotes=0">nejsvětlejší Smutný</a>, platilo 2012 - jaro 2013)</em>.\r\n</p>\r\n<p>\r\n<strong>aktuální info:</strong> <a href="readcase.php?rid=58&amp;hidenotes=0">od jara 2013 nejsvětlejší náčelnice NH</a>. Ať je, jaká je, je rozhodně inteligentní a dovede si dát dohromady 2 a 2 - proto nepropadejte pocitu supermanství a moc před ní nechytračte. <em>Srsly</em>.\r\n</p>\r\n<p>\r\nkategorie z původní údajné 6. opravena na aktuální 3. v srpnu 2013 \r\n</p>\r\n<p>\r\n<strong>ovládá:</strong>\r\n</p>\r\n<p>\r\nléčivá kouzla (dokáže zvednout i z vyřazení) \r\n</p>\r\n<p>\r\nrituál energetické optimalizace\r\n</p>\r\n<p>\r\n<em>patrně</em> si dokáže stvořit golema, někdy ho sebou vodí \r\n</p>\r\n', 0, 0, '1328824583562d7922a6c9fe36ea72a224487d8e87', 1, 3, 3, '1362472350f1bf1448661fc9e0d7b7b1b9e1c26ad0', 0, 0, 0, 0),
