(80, 'Alita', '', '776799282', 1330632084, 26, '<p>\r\núdajná Charistarchova návštěva z Moskvy, faktem je, že se za ní CH zaručil\r\n</p>\r\n<p>\r\nkdo mu tohle věří, ať si dá rovnou facku&nbsp;&nbsp;\r\n</p>\r\n<p>\r\nZaregistrována na údajně neurčitý, avšak kratší pobyt v Praze.&nbsp;\r\n</p>\r\n<p>\r\nPOZOR, PRAVDĚPODOBNĚ NEBEZPEČNÁ\r\n</p>\r\n<p>\r\npřivezla Charistarchovi obálku z Londýna s nějakým osobním předmětem\r\n</p>\r\n<p>\r\nbývalá temná známá ako Arina\r\n</p>\r\n<p>\r\nevidentně schopná sesílat i nejvyšší kouzla (normálně to umí jen mágové mimo kategorie)\r\n</p>\r\n<p>\r\nnešťastná z inkompetence světlých v Praze\r\n</p>\r\n<p>\r\ns velkou pravděpodobností jedna z mála v Praze schopná zjistit potenciál jiného (strop)&nbsp;\r\n</p>\r\n', 1, 0, '1330632084168d9008b12bdbf59a6f23a2609873b5', 1, 8, 3, '', 0, 0, 0, 0),
(81, 'Filip Viktorovič', 'Ragulin', '777625528', 1364051516, 47, '<p>\r\nVodku pije, da.\r\n</p>\r\n<p>\r\nPravdivé vidění\r\n</p>\r\n<p>\r\nDýka ze šera\r\n</p>\r\n<p>\r\nKrvácivá rána\r\n</p>\r\n<p>\r\nSlabost\r\n</p>\r\n<p>\r\nPoklop\r\n</p>\r\n<p>\r\nFreeze\r\n</p>\r\n<p>\r\nStínochodec\r\n</p>\r\n<p>\r\nZrcadlo&nbsp;\r\n</p>\r\n<p>\r\nVelký magický pořadač\r\n</p>\r\n<p>\r\nPrst smrti&nbsp;\r\n</p>\r\n<p>\r\nSíla ohně III.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n<strong>23.3. 2013</strong> - 3.kategorie \r\n</p>\r\n', 0, 0, '1330632652e48f115d67928b02cfb75a54c6fca199', 2, 3, 2, '1354242201a0b592446dcb4e608c6c233119fe99df', 0, 0, 0, 0),
