(135, 'Charistarch', '', '775579953', 1355681415, 38, '<p>\r\nCharistarch, bývalý šéf denní hlídky praha. Vlastním jménem Jonas Karolína Hořínský. Poslední potíž co nám způsobil je ten Rituál s Alitou kterej nám všem srazil regeneraci a pravděpodobně zvedl stropy a zvedl maximální kapacitu magenergie.\r\nPotvrzeno \r\n</p>\r\n', 0, 0, '13442956059fa00b508a3906bc5fa7e798e524fd0f', 2, 8, 2, '13556814156890c14c8a6d241019f8cffd578655d1', 0, 0, 0, 0),
(134, 'Vincent', 'Malý', '', 1330630185, 22, '<p>\r\nSamovolna iniciacia, udajne vrah temnych (zdroj Kraus). Aktualno zavreny u svetlych, meli bychom byt u vyslechu.\r\n</p>\r\n<p>\r\nMa podivne zeljone kameny, knigu Kladivo na carodejnice a taroty. Kaze, sto vsichni do kostela a zubaty spatny.&nbsp;\r\n</p>\r\n<p>\r\n<span style="color: #333333; font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: 14px; text-align: left; white-space: pre-wrap">Mengele: jen jsem byla pověřana vám nahlásit, že stkání s oním čerstvě iniciovaným jiným bude zítra (pa 2.3.) po půl deváte večer v hospodě u marianskeho obrazu (nebo nějak podobný název). V ulici kubelíkova. </span>&nbsp;\r\n</p>\r\n', 0, 0, '', 1, 7, 1, '', 0, 0, 0, 0),
(133, 'Lea', 'Poláková', '739622189', 1380981351, 26, '<p>\r\nNová světlá (29. 2. 2012), původně očekávaná temná, vypadala po iniciaci dost v depresi.\r\n</p>\r\n<p>\r\n6. 3. 2013 - nova nejsvetlejsi...\r\n</p>\r\n<p>\r\n...ale vydrželo jí to jen přes kus jara 2013, byla to skutečná tragédie, dokonce i pro nás, temné. Taková nadšená a přitom silně manipulačním vlivům podléhající, když se na to jde z té správné strany. Dopřejte jí pocit důležitosti a že ji berete vážně a neproděláte.\r\n</p>\r\n', 0, 0, '13306326171f6d6c75ee6b3e6ccf7cb7126cf3aa43', 1, 6, 8, '', 0, 0, 0, 0),
(132, 'Vladimir', '', '', 1330632141, 26, 'Nějakej světlej od noční hlídky.\r\n', 0, 1, '1330632141419f669dd88b43c631071f1318322f4d', 1, 0, 0, '', 0, 0, 0, 0),
