(136, 'Jan', 'Černý', '774536347', 1377760360, 51, '<p>\r\nNějaký atomhovado poslaný na pomoc pravděpodobně z Paříže\r\n</p>\r\n<p>\r\nWHITE FIST \r\n</p>\r\n<p>\r\nZnámá kouzla:\r\n</p>\r\n<p>\r\nTelepatické vyšetření&nbsp;\r\n</p>\r\n<p>\r\nBetlémský oheň\r\n</p>\r\n<p>\r\nRozhovor, magut byť lži:\r\n</p>\r\n<p>\r\n- s <a href="readperson.php?rid=143&amp;hidenotes=0">Bolítom</a> neni ve stejne bandě, jen maji společnyje zajmy - <a href="readperson.php?rid=87&amp;hidenotes=0">Alexa</a>\r\n</p>\r\n<p>\r\n- Richard jemu buřt\r\n</p>\r\n<p>\r\n- jego seret rovnovaga v Prage plochaja - mimo jine dva silni cerni magi do Pragy v posledni dobe prijechali (<a href="readperson.php?rid=155&amp;hidenotes=0">Hamyd</a> i <a href="readperson.php?rid=137&amp;hidenotes=0">Lethold</a>?)&nbsp;\r\n</p>\r\n<p>\r\n- vadi mu problemy s drugu stranu mince, valka se blizi\r\n</p>\r\n<p>\r\n- WF pro nego jen okrajovo, vazmozno ze necego s inkvizicii\r\n</p>\r\n<p>\r\n- naznacoval, ze sem prijechajut nejakaja esa, katoraja to tady vymetu\r\n</p>\r\n<p>\r\n- chocet sejmut <a href="readperson.php?rid=87&amp;hidenotes=0">Alexa</a>, aby dozory lepe fungovaly&nbsp;\r\n</p>\r\n<p>\r\n<strong>závěr:</strong> Jan Černý odešel do šera v srpnu 2012 při únosu (jehož byl pachatelem, údajně na příkaz &quot;shora&quot;) denního hlídkaře <a href="readperson.php?rid=91&amp;hidenotes=0">Aleše Hradila</a>. V závěrečném střetnutí napadl denního hlídkaře <a href="readperson.php?rid=106&amp;hidenotes=0">Jičínského</a>, poté zbytek DH. Střetnutí nepřežil. (technická: hlídkaře Jičínského by si nebyl býval všiml, kdyby jej neupozornila noční hlídkařka <a href="readperson.php?rid=150&amp;hidenotes=0">Černá</a>.)\r\n</p>\r\n', 0, 0, '', 1, 2, 1, '', 1, 0, 0, 0),
