(138, 'Nikola', 'Sobotková', '777990296', 1377771394, 26, '<p>\r\n<span style="font-family: Verdana, Arial, sans-serif; font-size: 11px; text-align: left; background-color: #d2cb58">Vyšší cca 170-175 cm, prostorově výraznější světlovláska</span>\r\n</p>\r\n<p>\r\novládá rituál na výrobu potravinových náhrad&nbsp;\r\n</p>\r\n<p>\r\nrituální magie III.\r\n</p>\r\n<p>\r\nkarabáč šábův III.\r\n</p>\r\n<p>\r\ntrvůrcův rituál III.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, '13307793607e51aaeeea2182abb7fd02a4a56c4ad8', 1, 4, 8, '13624723820db935a9b1184d94dbf8c67b8fce35c7', 0, 0, 0, 0),
