(150, 'Krista', 'Černá', '602344181', 1377690736, 51, '<p>\r\n<strong>\r\nZnámá kouzla:</strong> trojité ostří /psychický štít /podrobný scan / bariéra duše \r\n</p>\r\n<p>\r\nvelká zlá šéfová světlé megavýkonné operativy během nasazení v srpnu 2012\r\n</p>\r\n<p>\r\nvelká zlá šéfová světlé megavýkonné operativy během nasazení v srpnu 2013 \r\n</p>\r\n<p>\r\n<strong>scan 21.8. 2013</strong> - 3.kategorie\r\n</p>\r\n<p>\r\n<strong>osobní poznámka: </strong>Krista Černá je a) velice nevychovaná, drzá a sprostá a b) vůči temným velice agresivní, násilnická a bezskrupulózní. Starší příslušníci DH již mohou vědět, jak s ní jednat, mladším a nováčkům se doporučuje veliká obezřetnost, <em>být ve střehu a myslet</em>! Využije sebemenší procesní chybu a nejen, že vám ji dá sežrat, ale klidně vás kvůli ní i přizabije či zabije (jakmile bude jen trochu možné předpokládat, že jí to projde, a někdy ani to ne). V minulosti se nechala vyprovokovat žertem k užití hrubé a letální síly, při soudním procesu osvobozena <em>právě a jen kvůli tomu</em>, že byla &quot;vyprovokována&quot;. Takže bacha: rozhodně <strong>je </strong>nebezpečná.\r\n</p>\r\n', 0, 0, '1331803991a9fac8d38163e2fe3e4cd6db3341dd8b', 1, 3, 1, '135479684622d1e41c3662ffedc24d8a92cf609937', 0, 0, 0, 0),
(151, 'Karel', 'Vagner', '725939301', 1331161945, 27, '<p>\r\nKontaktoval pana Wolfa v operaci Autobus.\r\n</p>\r\n<p>\r\nPouhý obchodník, ale tvrdý.\r\n</p>\r\n<p>\r\nJde mu o byznys, ne o zájmy.\r\n</p>\r\n<p>\r\nObchodní spolupráce do budoucna možná.\r\n</p>\r\n<p>\r\nPoskytl informace o dalším článku akce Autobus.&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 4, 5, '', 0, 0, 0, 0),
(152, 'Paní', 'Červená', '', 1331213874, 32, '<p>\r\nJedna z teroristické buňky autobusové kauzy. Menší (cca 160 cm), vlasy střední délky hnědé barvy (kratší než na \r\nramena, ale o málo), výrazné tmavé \r\noči. byla spíše sportovně oblečená. trošku kulatější obličej. menší \r\nstřední prsa. maličko východní přízvuk.\r\n</p>\r\n<p>\r\nPobyt neznámý. \r\n</p>\r\n', 0, 0, '', 2, 0, 7, '', 0, 0, 0, 0),
(153, 'Paní', 'Růžová', '', 1331213981, 32, '<p>\r\nUpírka z autobusové kauzy, vyslýchaná nejprve inkvizicí, pak Světlými a pak Evou S. \r\n</p>\r\n<p>\r\nT. č. je na svobodě, protože Světlí nezvládli podat žalobu včas, a to ani po prodloužení lhůty.\r\n</p>\r\n', 0, 0, '', 2, 0, 5, '', 0, 0, 0, 0),
(154, 'Pan', 'Modrý', '774890218', 1331224272, 22, '<p>\r\nSilný mág, poslal přes Wagnera informaciu, što v Prage možno akciu provest.\r\n</p>\r\n<p>\r\n&quot;Muzete prijet do Prahy a realizovat svuj plan.&quot;&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 0, 2, '', 0, 0, 0, 0),
(155, 'Hamyd', 'Jasan', '607142513', 1332341073, 22, '<p>\r\nUmi čitat manuskript aqua, chocet ho najit, aby nasel Orakulum. Orakulum chocet, aby sebja pochopil. Pak chocet dat Inkvizici, aby ze sveta zmizelo. Kdyz my mu vysvetlili, kak inkvizicia fungujet, uz tolik nechatel jim dat.\r\n</p>\r\n<p>\r\nMa nejake spojeni s manuskriptom aqua - podle fotky pozna, ze stranka z manuskripta, katoruju necital.&nbsp;\r\n</p>\r\n<p>\r\nOn net taky, kak my, jego magie drugaja.&nbsp;\r\n</p>\r\n<p>\r\nOn mlady, no pusobi mimo kategorie.&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 0, 0, '', 0, 0, 0, 0),
