(179, 'Barbora', 'Křížová', '', 1353595829, 26, 'Byla adeptem Jehudy Liva ben Becaleva, velkého léčitele, který byl znám \r\nhlavně díky svým golemům. Dokázal s nimi manipulovat jinak než normální \r\nléčitelé umí.. O slečně Barboře existují záznamy z 16. stol., ale do 20. stol. toho moc není. Je ještě na seznamu Jiných, kteří se účastnili \r\n1. světové války. \r\n', 0, 0, '', 1, 2, 3, '', 0, 0, 0, 0),
(180, 'Sysoj', 'Psojič', '725939301', 1333995557, 32, '<p>\r\nTemný, zadržen na Anenském náměstí, když chtěl nelegálně načerpat 150 magů, aby mohl <strong>vyléčit </strong>své tři kamarády, taky Jiné, kteří byli v nemocnici.\r\n</p>\r\n<p>\r\nNechali jsme se tam zavézt a těch 150 magů jsem mu předala s tím, ať pošle dál, že my se o své staráme. A až bude DH potřebovat, s důvěrou se na Sysoje obrátíme. \r\n</p>\r\n<p>\r\nJinými slovy, může to být náš externí léčitel. \r\n</p>\r\n', 0, 0, '', 2, 5, 2, '', 0, 0, 0, 0),
