(192, 'Pavel', 'Krajčo', '606507885', 1344436640, 22, 'Na Vaclavaku ovlivnoval lidi, slunickovy, novy, vysvetleno, sto eto nevazmozno sdelat.\r\n', 0, 0, '1344436640db8ef61d2d0dab73a5cbbdd09b68f01a', 1, 6, 1, '', 0, 0, 0, 0),
(193, 'Protegon', ' ', '739202572', 1363105875, 38, '<ul>\r\n	<li>Bývalý šéf pražské Noční hlídky.</li>\r\n	<li>Před třemi třemi roky zabit v duelu Charistarchem</li>\r\n	<li>Působil ve White Fist, z které odešel</li>\r\n	<li>Čtvrt roku se nacházel v těle zaříkávačky Markéty Fejtové (<strong>trest</strong>/náhoda/<strong>zlomyslnost</strong>)</li>\r\n	<li>3.8. byl při rituálu na vyšehradském zřídle vrácen do svého těla, které Charistarch za úplatu zrekonstruoval</li>\r\n</ul>\r\n<ul>\r\n	<li>Pracoval na spojení schopností léčitele a mága, zaznamnány jsou velké úspěchy v oblasti práce s golemy apod.</li>\r\n	<li>Cíle jsou nejasné, několik přátel mu určitě zbylo, ale profesní vazby byly do značné míry zpřetrhány, takže v brzké době se z jeho strany žádných extrémních machinací, jako jsme zvyklí u ostatních Jiných mimo kategorie, asi obávat nemusíme. </li>\r\n	<li>Začíná aktivně podporovat Noční hlídku a pokouší se o její transformaci v nějaký funkční útvar.</li>\r\n</ul>\r\n', 0, 0, '13549108770b57c67a29aee1304655a4df8549841e', 1, 8, 1, '13546284539fb5f2ada4b2fc39c1e870e8a422d655', 0, 0, 0, 0),
(194, 'Veronika ', 'Šrámková', '', 1344430349, 28, 'Registrována\r\n', 0, 0, '1344430349f7401c28f931042cbc01ade6a244617f', 1, 6, 1, '', 0, 0, 0, 0),
(195, 'Lukáš', 'Růžička', '604845122', 1344436266, 22, 'Divnoj mag z Kafarny, dal tipa vědmě, što jego vědma Lukačovičová držela na Valčíkově 8 asi 6 godov.\r\n', 0, 0, '13444362653e639edf27c9cb0f09027139d68a7c4e', 1, 5, 1, '', 0, 0, 0, 0),
