(197, 'Tenebrus', 'Tenerbrus', '', 1344560334, 28, '<ul>\r\n	<li>Možná silnější, neprokázané</li>\r\n	<li>Silně turbulentní mág, hlásající asimilační tendence (poněmčení, pevné připoutání k rakousku-uhersku)</li>\r\n	<li>Rakokousko-uherští mágové byli s těmi českými ve sporu. Hlídky v tomto sporu nehráli roli a drželi se bokem (tedy aspoň DH)</li>\r\n	<li>Když začalo Tenebrovské hnutí dosahovat nebezpečné síly, byla učiněna dohoda o nezasahování adresovaná DH. Noční hlídka tedy eliminovala Tenebrovský nejužší kruh a DH jí nikterak nezabránila. Obecně se má za to, že tento krok umožnil oteplení vztahů a vytvoření míst, kde se Jiní mohou volně setkávat (elyseí). Pravidla elyseí, jsou stále platná a žádný pražský Jiný je neporušuje. </li>\r\n</ul>\r\n', 1, 0, '', 2, 1, 2, '', 0, 0, 0, 0),
(198, 'Jana', 'Černotská', '730105192', 1344636170, 32, '<p>\r\nVědma z hlášení o mrtvé Světlé na Vinici. Milenka pana Veselého (ne Pavla Veselého z NH).\r\n</p>\r\n<p>\r\nDluží nám službu. Nebo spíš život. \r\n</p>\r\n', 0, 0, '', 2, 5, 7, '', 0, 0, 0, 0),
