(201, 'Zuzana', 'Křenovská', '', 1344699669, 38, 'Šíléná vědma co jsme jí našli na Naměstí Svatopluka Čecha. &quot;Jdou&quot; po ní upíři. Do Bohnic jí dát nemůžeme, stejně by utekla a někomu ublížila.\r\n', 0, 0, '', 2, 5, 7, '', 0, 0, 0, 0),
