(204, 'Martin', 'Smutný', '774861910', 1377773877, 51, '<p>\r\n<strong>původní záznam: </strong>Od konce srpna 2012 Nejsvětlejší města Prahy. Pije zelenou a říká tomu &quot;vítr z oázy&quot;. Taková Schweinerei. Kovaný byrokrat, na všechno chce hlášení. Neumí lichotit tak, aby to znělo upřímně. Přijel z Iráku, kde strávil nějakých 40 let. Považuje za velmi mladé Jiné, kteří byli iniciováni před 60 lety. \r\n</p>\r\n<p>\r\n<strong>konec:</strong> Zle podříznut a ukřižován sourozenci <a href="readactrep.php?rid=168&amp;hidenotes=0&amp;truenames=0">Ermoliovými</a> na jaře 2013 u kostela na nám. Jiřího z Poděbrad. Patrně by to i býval přežil, leč asi se přitom i odhmotnil. Po něm nastoupila coby nejsvětlejší <a href="readperson.php?rid=133&amp;hidenotes=0">Lea Poláková</a>, což (tuto volbu) dodnes nikdo z temných nepochopil.\r\n</p>\r\n<p>\r\n<strong>technická:</strong> Konec Smutného kariéry poznamenala kuriózní situace. Když došlo k <a href="readcase.php?rid=48&amp;hidenotes=0">vytvoření inkvizičního tělesa IAS</a>, známého též jako &quot;defendoriát 2&quot;, vzdal se vedení NH, aby se součástí IASu mohl stát. Zda chtěl takto zatopit temným anebo naopak sabotovat činnost IASu, není přesně známo a uspokojivě doloženo. (On sám, pochopitelně, tvrdil v ústranní to druhé.) Když po úvodních jednáních začalo být jasné, že členové IASu zdaleka nebudou mít takové provomoci (jak žádala původní ustanovující vyhláška), Smutného počáteční nadšení poněkud ochladlo. Než se ovšem celá situace dořešila a Smutný stihl zaujmout definitivní stanovisko, učinili s ním krátký proces Ermoliovci (viz &quot;konec&quot;).\r\n</p>\r\n', 0, 0, '136259176567bcc8f1bfada11a712df12f608bd96f', 1, 3, 1, '1363297977296772a5c888fbc9235f142358af6aaa', 1, 0, 0, 0),
(205, 'Karel', 'Kraus', '', 1352731409, 22, 'Náš slavný analytik.\r\n', 0, 0, '13527314096188509c1d5e3285581d71762328f03a', 0, 0, 0, '', 0, 0, 0, 0),
(206, 'Hodinář', '', '', 1363350873, 45, '<p>\r\nPokud si jej přejete kontaktovat, obraťte se na Evu Schwarzkoppovou.\r\n</p>\r\n<p>\r\nČasovy mag&nbsp;\r\n</p>\r\n', 0, 0, '', 0, 0, 0, '', 0, 0, 1353261928, 32),
(207, 'Ondřej', 'Netušil', '732915290', 1377426143, 51, '<p>\r\nSíla ohně I nebo II\r\n</p>\r\n<p>\r\nElementální útok I \r\n</p>\r\n<em>scanován 24. 8. 2013</em>\r\n', 0, 0, '13542829141933504a913fdd39ec0bc236cf2bfc28', 1, 6, 3, '1362940108f1081ba34d395743af63aab8a074b27d', 0, 0, 1354226963, 47),
(208, 'Alejandro', 'Sforza', '608229026', 1354283602, 22, '<p>\r\nPrijechal na nadrazi Vrsovice.\r\nObchodnik se starozitnostmi.\r\n</p>\r\n<p>\r\nJego kontaktnica Eva Mašková.\r\n</p>\r\n<p>\r\nShani zděs pozustatky po Alexandrovi, pravděpodobno ochotny šlohnut všechno, co se mu do pazury nachomytnet.\r\n</p>\r\n<p>\r\nU nego polovina spiska od Alexandera, chočet vtaruju polovinu, ochotny ukazat svoju, kakda mi ukazeme vtaruju.\r\n</p>\r\n<p>\r\nDva goda tamu nazad, sto nekovo pomogol jim zděs najit nečego, informacije dodat - etot něgdo stale v Prage.\r\n</p>\r\n<p>\r\nK snidani pijet preslazene kafe.\r\n</p>\r\n<p>\r\nChocet nechat nocniky resit svoje pochuzky.\r\n</p>\r\n<p>\r\nOchotny k informacnym vymenam.&nbsp;\r\n</p>\r\n', 0, 0, '1354283142030d85e257d805ebd2b95ba75fe55c1e', 1, 5, 1, '', 0, 0, 1354228493, 22),
(209, 'Nina', 'Lettnerová', '608935931', 1355172137, 38, 'Doplnit.\r\n', 0, 0, '13543059406325dce271bdf2a0ee7318139ca6dfff', 2, 6, 7, '1355172137af39e057774699f8def338f9ea661d2c', 0, 0, 1354232432, 47),
(210, 'Markéta', 'Zíková', '723958140', 1354233226, 47, 'Moje bývalá kolegyně z Plzně, později se mnou pracovala i v Praze, na konci jara 2011 přeložena do Moskvy, v současné době je v Praze z pověření Zavulona. Pravděpodobně se nějakou dobu zdrží. Sakeena\r\n', 0, 0, '135423318701dd959465ba885606338a1f4ced39a3', 2, 4, 2, '', 0, 0, 1354232606, 47),
(211, 'Nela', 'Márová', '777691985', 1362227077, 55, 'Nová osoba v partě Adlérová, Lethold, Zelený.\r\n', 0, 0, '13542373716517f1eb9053e9fff824dfeb47481b8f', 1, 6, 3, '13622270772d161fc0d9c2f515e6355f1a6fd126ea', 0, 0, 1354237093, 38),
