(213, 'Světlana', 'Goroděcká', '739337882', 1363298179, 38, 'Velká bílá kouzelnice mimo kategorie, je tu pracovně a na &quot;tak dlouho, jak bude třeba&quot;...\r\n', 0, 0, '135428269584273cc3e504a3f2490b012995f09856', 1, 8, 1, '1363298179682303a77b92e10d4e5558d7f134ae94', 0, 0, 1354259551, 47),
(214, 'Scara', 'Dragonari', '731456081', 1354463687, 22, '<p>\r\nJedna ze dvou nejstarších Vladových potomků. Původně vegetariánka.\r\n</p>\r\n<p>\r\nNyní chce v Praze zkonsolidovat upíří komunitu. V tom jí DH rozodně míní vyjít vstříc. \r\n</p>\r\n<p>\r\nDále je i se svou rodinkou ochotna vypomáhat jako komando.\r\n</p>\r\n<p>\r\nUbyli ji nejaky vampiri na Miraku i s ostatnimi iz familie.&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 2, 5, '', 1, 0, 1354276854, 32),
(215, 'Adéle', 'Goosseus', '', 1354463630, 22, '<p>\r\nDruhý nejstarší Vladův potomek. Neumí dominantu (vyrozuměno z kontextu), což se dobře, neboť je příliš vznětlivá. Chce pomáhat své sestře Scaře v ovládnutí upíří pražské komunity.\r\n</p>\r\n<p>\r\nUbyli ji nejaky vampiri na Miraku i s ostatnimi iz familie.&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 2, 5, '', 1, 0, 1354276958, 32),
(216, 'J. R.', 'Daniels', '', 1354463653, 22, '<p>\r\nUpíří syn Scary Dragonari. Celkem patologicky je na ní závislý.\r\n</p>\r\n<p>\r\nUbyli jego nejaky vampiri na Miraku i s ostatnimi iz familie.&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 4, 5, '', 1, 0, 1354277010, 32),
(217, 'Nicolas', 'Piltouvr', '', 1354277069, 32, 'Upíří syn Adéle Goosseus.\r\n', 0, 0, '', 2, 4, 5, '', 0, 0, 1354277069, 32),
(218, 'Blanka', 'Svůdná', '', 1354278894, 38, '<p>\r\nPražská upírka, v noci 30.11. jsme ji našli v music klubu Beafeater na I.P.Pavlova s člověkem, licenci neměla ale prý se ani nechystala lovit. Člověk: Jan Jiřský, měli bychom zjistit zda žije.\r\n</p>\r\n<p>\r\nMá dost blbý jméno.&nbsp;\r\n</p>\r\n', 0, 0, '13542788667cbc43783c16ca9e2dd817233c8598dc', 2, 6, 5, '', 0, 0, 1354278866, 38),
(219, 'Eva', 'Mašková', '777803572', 1354284301, 22, 'Kontaktnica Sforzy, dodala jemu polovinu Alexanderova svitku.\r\n', 0, 0, '', 1, 5, 8, '', 0, 0, 1354284301, 22),
(220, 'Lukáš', 'Pokojný', '774558914', 1354287774, 38, '<p>\r\nVlkodlak co řádil u Divadla na Vinoradech. Světlí s ním vyjebali nedali mu náhrady a už to nevydržel.\r\n</p>\r\n<p>\r\nNepije vodku!&nbsp;\r\n</p>\r\n', 0, 0, '13542873100164dd7cd5bda58a32c700dc484bff0f', 2, 6, 6, '', 0, 0, 1354286932, 38),
(221, 'Vlcice', '', '', 1354288068, 22, '<p>\r\nVazmozno sto neexistujet, vazmozno sto da.\r\n</p>\r\n<p>\r\nEto ma byt kakajas drsnaja vlkodlacica novaja v Prage.\r\n</p>\r\n<p>\r\nZminoval ji Sforza, mozna kecal.&nbsp;\r\n</p>\r\n', 0, 0, '', 2, 0, 6, '', 0, 0, 1354288068, 22),
(222, 'Julie', 'LeBlanc', '773950227', 1354620336, 22, '<p>\r\nÚdajně návštěva rodiny, zdrží se po dobu maximálně jednoho týdne.\r\n</p>\r\n<p>\r\n&nbsp;Podle zpráv z bulvárního tisku, a toho co jsem zaslechl a uviděl u Millera s ni čeká koťata.&nbsp;\r\n</p>\r\n', 0, 0, '1354305676d36082ab7f82f9af78544ee013f83191', 1, 6, 1, '', 0, 0, 1354302255, 47),
(223, 'Igor', 'Herz', '721077749', 1364220361, 22, 'Barytoon.\r\n', 0, 0, '13544023720b51edd594d39a01ed1cff93250164ec', 2, 6, 6, '1354402372eda95ac945ae6e2b17b2e02f38aec6fd', 0, 0, 1354302991, 22),
(224, 'Ladislav Alexandr', 'Malinovskij', '602377699', 1354463554, 22, '<p>\r\nPřepadený vědmák ze Sladkovského nám., 30.11\r\n</p>\r\n<p>\r\nI krom tego zasrany zmrd pravdepodobno iz Thule, katoryj menja natrel Kladivom osudu i zapoklopil na Jiraku, ze ja zdrhal, az mi prasilo za fuseklami.&nbsp;\r\n</p>\r\n', 0, 0, '1354360344d6387e94ce75428cd323df864cfb2c26', 2, 2, 7, '135431234813537967eb949a3f4dc3493cef6458b0', 0, 0, 1354311904, 47),
(225, 'Jana', 'Lambertová', '774616400', 1354314089, 47, 'V Praze je z osobních důvodů, zůstane &quot;dokud nepominou její problémy&quot; prý ne déle než měsíc. Nepatří k pražské ani jiné NH, její sestra - dvojče je Temná, pracovala v DH Brno, prý přijede do Prahy dnes kolem půl jedné na Florenc - je to černý mág, 4.kategorie, Dana Lambertová. Ze strany Dany hrozí agrese vůči slečně Janě.\r\n', 0, 0, '', 1, 4, 1, '', 0, 0, 1354314089, 47),
