(248, 'Jan', 'Muttermuller', '605283658', 1386430049, 26, '<p>\r\nSabaka. Bystro begajet. <strong>(Standard)</strong>\r\n</p>\r\n<p>\r\nPřeklad: &quot;Pes. Běhá rychle.&quot; A je to pravda: běhá tak strašně, že utahá i šerý přízrak. Zajímavé je, že mágové NH si s ním doslova vytírají prdel a fakt na něj jako na psa volají a zacházejí s ním tak. Tak hrozně, že ani nejtemnější tak s nejmladšími štěňaty nejedná, ačkoliv by ze své pozice a síly klidně mohla. Mějte tuto skutečnost na paměti a pracujte s ní. Není z toho zrovna dvakrát šťastný. (Technická: on sám je přesvědčen, že když s ním účelově slušně jednáte, znamená to, že <em>&quot;si u temných vydobyl uznání&quot;</em>...) <strong>(Bambula)</strong>\r\n</p>\r\n', 0, 0, '1362511371dc28406e3e87473165016ba94883313a', 1, 5, 4, '', 0, 0, 1362511305, 22),
(249, 'Jakub', 'Jaňour', '608466842', 1362511487, 22, 'Nocnik.\r\n', 0, 0, '13625114873d3eb84c6daeaa08b26b8f227fc3d997', 1, 6, 1, '', 0, 0, 1362511437, 22),
(250, 'Anděla', 'Ondruchová', '731708058', 1386429828, 47, '<p>\r\nV Nocnom dozoru, na sezname. <strong>(Standard)</strong>\r\n</p>\r\n<p>\r\nObrateň - hyena. Malá, rychlá, výborná koordinace pohybů - pozor. Jedna z nejlepších, co jsem zatím v Praze viděl. <strong>(Bambula)</strong>\r\n</p>\r\n<p>\r\nCodename: Sysel <strong>(Gargamel)</strong>&nbsp;\r\n</p>\r\n', 0, 0, '1362591544cb9cf2d0321ee9cee6422e2ea40d1082', 1, 5, 4, '', 0, 0, 1362591441, 22),
(251, 'Žaneta', 'Skálová', '723709667', 1362591876, 22, 'Doplnit.\r\n', 0, 0, '1362591876595a45d21f3ea79007dafd18c269f99c', 1, 0, 0, '', 0, 0, 1362591812, 22),
(252, 'Tadeáš, Ateron', 'Vávra', '732547504', 1377711702, 51, '<p>\r\nSpecializacia i kategoria vazmozno nepresna.\r\n</p>\r\n<p>\r\nZpopelnění \r\n</p>\r\n<p>\r\n*** \r\n</p>\r\n<p>\r\n<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:PunctuationKerning/>\r\n<w:ValidateAgainstSchemas/>\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables/>\r\n<w:SnapToGridInCell/>\r\n<w:WrapTextWithPunct/>\r\n<w:UseAsianBreakRules/>\r\n<w:DontGrowAutofit/>\r\n</w:Compatibility>\r\n<w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n</w:WordDocument>\r\n</xml><![endif]-->\r\n</p>\r\n<p>\r\n<!--[if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState="false" LatentStyleCount="156">\r\n</w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:"Normální tabulka";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-parent:"";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:"Times New Roman";\r\nmso-ansi-language:#0400;\r\nmso-fareast-language:#0400;\r\nmso-bidi-language:#0400;}\r\n</style>\r\n<![endif]-->\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Na jaře 2013 provedli světlí *nějaký* rituál, v&nbsp;jehož důsledku se Tomáš\r\nVávra, původně zaříkávač 5. či 6. kategorie, stal zaříkávačem 2. kategorie.\r\nPodrobnosti nejsou známy, vyjma toho, že rituál, který Vávru vykopl nahoru,\r\nzároveň skopl dolů jiného světlého (mága).</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Krátce nato složil Tomáš Vávra, nově šerým jménem Ateron, ukrutnou přísahu,\r\njak se stane paladýní a bude hájit zájmy světla, dobra, cti a spravedlnosti <em>bla bla bla Baldur</em></span><em>&rsquo;s</em><em><span> Gate II hadr ric pic šalala...</span></em>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>V srpnu 2013 demonstruje Tomáš &bdquo;Ateron&ldquo; Vávra třeskutě obhajobu\r\nsvětla, dobra, cti a spravedlnosti tím, že <em>okrade</em>\r\ns&nbsp;užitím Spánku / Amnézie<em> 2 světlé\r\nzaříkávače</em> o <em>magickou hůlku</em>,\r\nkteroužto záležitost musí řešit <em>Denní\r\nhlídka</em> na čele s nejtemnější Evou S. <em>osobně.</em>\r\nRytíř světla úspěšně vstupuje do pražského povědomí coby <strong><em>rytíř Straka</em></strong> a stává se\r\nobětí &bdquo;masivní letákové kampaně&ldquo; vzešlé z&nbsp;popudu neznámého temného\r\nkreativce. (Aktuální <a href="readperson.php?rid=233&amp;hidenotes=0">zástupkyně nejsvětlejší</a> s&nbsp;jekotem deklaruje, že se jedná o\r\npodněcování <em>války světlých proti světlým</em>,\r\naby vzápětí zmlkla, když jí dojde, co že to vlastně řekla...)</span>&nbsp;\r\n<br />\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, '1362592079084c0f0deb15174a71e4825e43d0dc93', 1, 2, 8, '13625925583d718fb6988e027e9a824cb1ce3a6b2b', 0, 0, 1362592020, 22),
