(256, 'Tadeáš Rudolf', 'Nepil', '777866107', 1363187510, 47, '<p>\r\nupír, co se přišel poptat, jak to vypadá s licencema k lovu, náhrady už prařským upírům lezou krkem... prý on a jeho přátelé zvažují kvůli tomu žalobu na světlé. \r\n</p>\r\n<p>\r\n(jo, a vypadá dost jako Donaldův brácha Donald) \r\n</p>\r\n', 0, 0, '', 2, 4, 5, '', 0, 0, 1363187186, 47),
