(1, 'Akce kasino', 1329670460, 22, 'Zajistit golemy asi', 'Golemi zdelali mandaly. Adna prosla.\r\n', 'Adna mandala prosla, eto mozet byt problema.&nbsp;\r\n', '<blockquote style=&quot;font-family: Arial, Tahoma, Verdana, sans-serif; font-size: 12px&quot;>\r\n	<div>\r\n	Ja prisel do kasina, pomenjal amulet i pasmatrjel.<br />\r\n	Pozdeji ja igral poker, obral par svetlych o vstupni bonusy.<br />\r\n	Pak prisla opicarna, ze pry resit nejaku krasnuju obalku.<br />\r\n	Ja radeji igral poker.<br />\r\n	Pak dalsi opicarna - ze nekde golem.<br />\r\n	Ja radeji igral poker.<br />\r\n	Pak dalsi golem - uz nebylo kogo poslat, tak pajechal ja s Hradilom.<br />\r\n	S nami Marsik a Kovac.<br />\r\n	My pajechali tam, kde na mape golemu Ptakopysk.<br />\r\n	Tam v Seru golem ptakopysk a mandala na zemi.<br />\r\n	U ptakopyska zagada - bludiste. Resil Marsik, nevyresil. Golem zmizel, mandala rozsvitila.<strong>&nbsp;21:25</strong><br />\r\n	My pajechali tam, kde na mape Nepamatujuse.<br />\r\n	Tam golem a mandala.<br />\r\n	U golema zagada - bludiste.<br />\r\n	Resil Hradil, nevyresil. Kovac uzil amuleta Prach, golem rozpadl.&nbsp;<strong>22:02</strong><br />\r\n	Mandalu poflusali a rozmazali. Legrace.<br />\r\n	Pak my pajechali tam, kde na mape Humanoid.<br />\r\n	Tam golem Humanoid, cmaral mandalu.<br />\r\n	My cekali na Marsika, az sezene dalsi Prach.&nbsp;<strong>22:28</strong><br />\r\n	Prisel ozrala, rozsekal glavu. Volali zachranku, cekali. Marsik panikaril.<br />\r\n	Prach nesel, tak to rozprasil Hradil Prachem vlastnim.<br />\r\n	Mandalu taky nejak poslapali, rozpatlali.<br />\r\n	Pak ja jechal do kasina.<br />\r\n	Ja zkusil igrat poker, ale tam sama hovada, hazeli prachami, na hovno.<br />\r\n	Tak zabalil a sel domoj.\r\n	</div>\r\n</blockquote>\r\n', 0, 0, 2, 1, 0, '0', '0', '', ''),
(2, 'dadaaa', 1330172900, 35, 'hu', 'doplnittadadaaa\r\n', 'doplnit\r\n', 'doplnit\r\n', 0, 1, 0, 1, 0, '0', '0', '', ''),
(3, 'Oficiální hlášení z Incidentu Casino', 1330173048, 29, 'hlášení', '<span style="font-size: 12pt; font-family: ''Times New Roman''">Během tohoto incidentu\r\npravděpodobně léčitelka mimo kategorie vytvořila pět velmi nebezpečných golemů\r\nkteří na její příkaz po městě vytvořili pět mandal uzavírajících Vinohrady do\r\nobrazce pentagramu. Tyto mandaly&nbsp; měly s\r\nnejvětší praděpodobností sloužit k účelům provedení rituálu, jenž obě hlídky\r\npovažovali za nebezpečný, pročež se rozhodli proběhnutí rituálu zabránit.\r\nAktivována byla pouze jedna z pěti mandal, ostatní čtyři se podvedlo zničit a\r\njejich aktivaci zabránit</span>.\r\n', 'doplnit\r\n', '<p class=&quot;MsoNormal&quot;>\r\n<u style=&quot;background-color: white&quot;><span style=&quot;font-family: ''Times New Roman''&quot;>Začátek a konec zásahu/akce:</span></u><span style=&quot;background-color: white&quot; class=&quot;apple-converted-space&quot;><span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;</span></span><span style=&quot;background-color: white; font-family: ''Times New Roman''&quot;>přibližně od 20:00 CET do\r\n24:00 CET</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<u><span style=&quot;font-family: ''Times New Roman''&quot;>Velitel zásahu:</span></u><span class=&quot;apple-converted-space&quot;><span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;</span></span><span style=&quot;font-family: ''Times New Roman''&quot;>akce probíhala pod\r\nspolečným vedením Denní a Noční hlídky města Prahy, velitely jednotlivých\r\nzásahů byli představení Hlídek, nejsvětlejší P. Maršík a nejtemnější Alexander.</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<u><span style=&quot;font-family: ''Times New Roman''&quot;>Členové Noční hlídky:</span></u><span class=&quot;apple-converted-space&quot;><span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;</span></span><span style=&quot;font-family: ''Times New Roman''&quot;>předáno pro doplnění\r\nNoční hlídce Praha</span>\r\n</p>\r\n<span style=&quot;font-weight: normal&quot;><u>Členové Denní hlídky:</u><span class=&quot;apple-converted-space&quot;>&nbsp;</span>v první výjezdové skupině: Alexander,<br />\r\n</span><span style=&quot;font-weight: normal&quot;>Lilian L. Garratt, R. Novotný, v druhé výjezdové skupině: F. V. Ragulin</span>\r\n<pre>\r\n<u>Členové Denní hlídky:</u><span class=&quot;apple-converted-space&quot;>&nbsp;</span>v první výjezdové skupině: Alexander,\r\nLilian L. Garratt, R. Novotný, v druhé výjezdové skupině: F. V. Ragulin\r\n</pre>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<u><span style=&quot;font-family: ''Times New Roman''&quot;>Další Jiní a lidé:</span></u><span class=&quot;apple-converted-space&quot;><span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;</span></span><span style=&quot;font-family: ''Times New Roman''&quot;>v druhé výjezdové\r\nskupině: A. Hradil</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<u><span style=&quot;font-family: ''Times New Roman''&quot;>Informace z Analytického:</span></u><span class=&quot;apple-converted-space&quot;><span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;</span></span><span style=&quot;font-family: ''Times New Roman''&quot;>informace o\r\nřízených, naváděných golemech, jenž se periodicky přesouvali z bodu A do bodu\r\nB. Analytické oddělení poskytlo koordináty těchto přesunů s přibližnými\r\nčasovými informacemi.</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<span style=&quot;font-family: ''Times New Roman''&quot;>Ve chvíli, kdy byly zjištěny informace z analytického oddělení ohledně\r\ngolemů na území Prahy, členové Denní hlídky se rozhodli vyslat první operativní\r\nskupinu do terénu. V této zásahové skupině byli přítomni: nejtemnější\r\nAlexander, Lilian L. Garratt, Richard Novotný a dále dvě členky Noční hlídky -\r\nAndrea Kalle a Denisa Kuncová. Prvně se tento zásahový tým vydal směrem k\r\nprvním koordinátům na náměstí Jiřího z Poděbrad, v momentě kdy si však uvědomil\r\npravděpodobnou rychlost golema, rozhodl se zamířit k cílovému místu výskytu\r\ngolema a tam na něj vyčkat. Po cestě na Hlavní nádraží si však Alexander\r\nuvědomil zdravotní stav slečny Kuncové a s ohledy na její mobilní disfunkci jí\r\na slečně Kalle raději doporučil na místo dojet tramvajovým spojem. Členové\r\nDenní hlídky se dále pěšky vydali směrem k Vrchlického sadům.</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=&quot;apple-converted-space&quot;>&nbsp;</span></span><span style=&quot;font-family: ''Times New Roman''&quot;>Na tomto místě záhy spatřili majestátně\r\nvyhlížejícího golema, a mandalu vyhotovenou na zemi u golemových nohou. Golem\r\nnabízel hlídkařům k vyřešení hádanku - spletité bludiště. Úkolu tuto hádanku\r\nvyřešit se ujmul R. Novotný a zdárně dosáhl vyřešení logického problému. Poté,\r\nco členové Denní hlídky úspěšně zabránili aktivování této části rituálu,\r\npřesunuli se na další lokaci. Dvě členky Noční hlídky, které je v první části\r\nzásahu doprovázely byly odeslány zpět do Casina, jelikož jejich fyzické ani magické\r\nschopnosti neodpovídaly úrovni operativního zásahu. Následující lokace golema\r\nbyla ve Vršovicích. Zde nebylo možné z důvodu časové tísně řešit golemovu\r\nhádanku a tak byl golem rozprášen amuletem Prachu, zapůjčeného členkou Noční\r\nhlídky.</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=&quot;apple-converted-space&quot;>&nbsp;</span>Golema směřujícího do Tyršovy ulice\r\njeli zneškodnit pod vedením nejsvětlejšího P. Maršíka Filip V. Ragulin z Denní\r\nhlídky a pan Andrej Kováč z Noční hlídky. Asistoval jim též Aleš Hradil.\r\nBohužel nejsvětlejší Maršík nebyl schopen vyluštit hádanku ani přistoupit k\r\nvčasnému zničení golema. Následně se golemova mandala aktivovala.&nbsp;<span class=&quot;apple-converted-space&quot;>&nbsp;</span>Následně se tento tým přesnul k\r\ndalšímu golemovi, kterého po neúspěšném luštění hádanky Andrej Kováč rozprášil\r\nPrachem. Poslední golem, nalézající se u Prokopovi ulice, byl zničen obdobným\r\nzpůsobem.</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<span style=&quot;font-family: ''Times New Roman''&quot;>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=&quot;apple-converted-space&quot;>&nbsp;</span>Po návratu do Casina si Denní hlídka\r\ndefinitivně ověřila svou teorii, že všechni golemové byli svými trasami a\r\nmandalami rozmístěni do obrazce pentagramu se svým středem v okolí\r\nCasina.&nbsp;</span>\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\n<span style=&quot;font-family: ''Times New Roman''&quot;><!--[if !supportEmptyParas]-->&nbsp;<!--[endif]--></span>\r\n</p>\r\n', 0, 0, 2, 1, 1327791600, '20:00 CET', '24:00 CET', '3x Prach - 2x NH, 1x Hradil\r\n', 'Info z Londýna.\r\n'),
(4, '01', 1330263347, 42, 'Vyzvednutí Pacáka', 'Upír Tomáš Pacák vyzvednut a předán šéfovi.\r\n', 'Bílý mág Jonáš Ciprián možná &nbsp;mojí SPZ\r\n', 'Na místo setkání jsem dorazila cca s 20 minutovou rezervou, v tu dobu tam již čekal bílý mág 5.kategorie Jonáš Ciprián. Ve 12.05 jsem se setkala s panem Pacákem, dohodli jsme se, že jej dovezu za šéfem na florenc. Tak se stalo cca ve 12.30.\r\n', 0, 0, 2, 1, 1330210800, '0', '0', '', ''),
(5, 'Iniciace na Vyšehradě', 1330295847, 38, 'Dohlédnout na iniciaci', 'Na Vyšehradě se měla vyskytovat potenciální jiná, úkol byl dohlédnout na řádnou iniciaci.\r\n', '<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<strong><span style=&quot;font-size: 18pt&quot;>Je potřeba zjistit</span></strong>\r\n</p>\r\n<p style=&quot;margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<!--[if !supportLists]--><span style=&quot;font-size: 7.5pt&quot;>1.</span><!--[endif]--><span style=&quot;font-size: 7.5pt&quot;>Jak dopadla iniciace</span>\r\n</p>\r\n<p style=&quot;margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<!--[if !supportLists]--><span style=&quot;font-size: 7.5pt&quot;>2.</span><!--[endif]--><span style=&quot;font-size: 7.5pt&quot;>Proč jsou světlý tak blbí</span>\r\n</p>\r\n<p style=&quot;background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<strong><span style=&quot;font-size: 18pt&quot;>Zjištěná fakta&nbsp;&nbsp;</span></strong>\r\n</p>\r\n<p style=&quot;margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<!--[if !supportLists]--><span style=&quot;font-size: 10pt; font-family: Symbol&quot;>&middot;<span style=&quot;font-family: ''Times New Roman''; font-size: 7pt&quot;>&nbsp; </span></span><!--[endif]--><span style=&quot;font-size: 7.5pt&quot;>Maršík je debil</span>\r\n</p>\r\n<p style=&quot;margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<!--[if !supportLists]--><span style=&quot;font-size: 10pt; font-family: Symbol&quot;>&middot;<span style=&quot;font-family: ''Times New Roman''; font-size: 7pt&quot;>&nbsp; </span></span><!--[endif]--><span style=&quot;font-size: 7.5pt&quot;>Světlí neovládají základní pravidla slušného chování</span>\r\n</p>\r\n<p style=&quot;margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white&quot; class=&quot;MsoNormal&quot;>\r\n<!--[if !supportLists]--><span style=&quot;font-size: 10pt; font-family: Symbol&quot;>&middot;<span style=&quot;font-family: ''Times New Roman''; font-size: 7pt&quot;>&nbsp; </span></span><!--[endif]--><span style=&quot;font-size: 7.5pt&quot;>Jak naložit s&nbsp;tím že Maršík jen tak sesílá kouzla\r\nv&nbsp;realitě</span>\r\n</p>\r\n', '<span style=&quot;font-size: 7.5pt; line-height: 115%&quot;>Na Vyšehradě byla hlášena\r\npotenciální iniciace jiné. Dorazili jsme se Zbořilovou více než v&nbsp;čas. Po\r\nprozkoumaní okolí jsme narazili na 18 světlých, Markéta Fejtová, obrateň Viktor\r\na konečně zbývajících 16 pan Maršík. Po chvíli čekání jsme zpozorovali pár\r\ntemný jiný a neiniciovaná dívka. Jelikož se nedělo nic nelegálního, zmínění dva\r\nsi jen povídali, rozhodli jsme se do ničeho nezasahovat. Pár jsme chvíli\r\npozorovali a náš plán nezasahovat vcelku vycházel, než se do všeho začal\r\nmontovat pan Maršík a jeho zvěřinec. Obrateň chvíli slídil za párem načež byl\r\nvydán rozkaz. &nbsp;Údajný rozkaz pana Maršíka\r\nzněl: &bdquo;Nech to na mě.&ldquo; Načež se obrateň Viktor sebral a začal obtěžovat zmíněný\r\npár, asi nějaká tajná a nepochopitelná šifra, a nepřestali ani po mém\r\nupozornění. Po krátkém vyjednávaní světlých, za které by se nemusel stydět\r\nkdejaký příslušník mateřské školky, jsem se usnesly na tom, že bude světlým\r\nposkytnuta možnost o sdělení jejich pohledu na věc, ale jelikož jejich\r\npřesvědčivost byla hluboko pod bodem mrazu, nejsem přesvědčen o tom, že by\r\nzmíněná slečna s&nbsp;potenciálem v&nbsp;budoucnu přešla ke světlým. Věc která\r\nstojí za zmíku, světlí asi chtěli zapůsobit a ukázat neiniciované nějaké kouzlo.\r\nProto pan Maršík seslal Karabáč Šaabův, podotýkám v&nbsp;realitě, žádný člověk\r\nvšak přítomen. Vzali jsme si kontakt na jejího přítele, aby nám dal vědět\r\njestli a jak dopadla případná iniciace.</span>\r\n', 0, 0, 2, 1, 1330124400, '17:00', '18:30', '<p style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white" class="MsoNormal">\r\n<strong><span style="font-size: 12pt">Temní&nbsp;</span></strong>\r\n</p>\r\n<p style="margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white" class="MsoNormal">\r\n<!--[if !supportLists]--><span style="font-size: 10pt; font-family: Symbol">&middot;<span style="font-family: ''Times New Roman''; font-size: 7pt">&nbsp; </span></span><!--[endif]--><span style="font-size: 7.5pt">1x šero =&lt; 15magů (Hradil)&nbsp;</span>\r\n</p>\r\n<p style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white" class="MsoNormal">\r\n<strong><span style="font-size: 12pt">Světlí &nbsp;</span></strong>\r\n</p>\r\n<p style="margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white" class="MsoNormal">\r\n<!--[if !supportLists]--><span style="font-size: 10pt; font-family: Symbol">&middot;<span style="font-family: ''Times New Roman''; font-size: 7pt">&nbsp; </span></span><!--[endif]--><span style="font-size: 7.5pt">&nbsp;1x šero =&lt; 15magů (Maršík)</span>\r\n</p>\r\n<p style="margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white" class="MsoNormal">\r\n<!--[if !supportLists]--><span style="font-size: 10pt; font-family: Symbol">&middot;<span style="font-family: ''Times New Roman''; font-size: 7pt">&nbsp; </span></span><!--[endif]--><span style="font-size: 7.5pt">&nbsp;2xšero&nbsp; </span><span style="font-size: 7.5pt">=&lt; kolem 30 mag</span><span style="font-size: 7.5pt">ů\r\n(obrateň Viktor)</span>\r\n</p>\r\n<p style="margin-left: 47.5pt; text-indent: -18pt; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white" class="MsoNormal">\r\n<!--[if !supportLists]--><span style="font-size: 10pt; font-family: Symbol">&middot;<span style="font-family: ''Times New Roman''; font-size: 7pt">&nbsp; </span></span><!--[endif]--><span style="font-size: 7.5pt">&nbsp;1x Karabáč\r\nŠaabův 40 magů</span>\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Naše analytické programy ukazují pravděpodobnost emanace nového Jiného Světlého/Temného v oblasti Vyšehrad-vyhlídka. Zkontrolujte situaci, případně proveďte řádnou iniciaci Jiného.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Popis: Žena 19-23, hnědé vlasy, hnědé oči, 170cm, střední - štíhlá postava</span>\r\n'),
(6, 'Pivo, Velryba a BDSM', 1330303451, 26, 'Identifikovat a oslovit podezřelého. Zjistit co by to měl vědět. (použita metoda PPP, Pozorovat, Ptát se, Pít (Pivo))', '<p>\r\nKarel Husinecký přiklepl zakázku na magistrátě svému &quot;nejlepšímu kamarádovi&quot; Janu Zelenému.\r\n</p>\r\n<p>\r\nTaky jsem polil Mengeleho čajem. Beru to jako bonus.&nbsp;\r\n</p>\r\n', 'Konexe na Magistrátě v podobě pana Karla Husineckého. Další práce na případu.\r\n', '<p>\r\nSedíme si tak v Zulu a přemýšlíme kde budeme páchat zlo když nám rozjímání zkazí analytický se zprávou o podezřelé osobě někde blízko národky. Vyrážíme ve složení já, mé druhé já a Silvie. Na místo dorážíme včas a čekáme na našeho &quot;podezřelého&quot;. Po hodině čekání dorážejí podezřelí příslušníci noční hlídky. Z nudy je legitimujeme.\r\n</p>\r\n<p>\r\nNoční hlídkaři kotví ve Velrybě, kde se ukazuje že sedí i objekt našeho zájmu. Hrajeme to na jistotu a zveme dotyčného na pivo a odsuzujeme naše kamarády &quot;čajíčkáře&quot;. Při bodrém poplácání Mengeleho po zádech na sebe Mengele vyklápí svůj hrnek s čajem, jaká škoda.\r\n</p>\r\n<p>\r\nPřesouváme se blíže k baru a požíváme větší než malé množství piva. Vlezlé vyptávání se zvrhává ve vytrvalostní soutěž.\r\n</p>\r\n<p>\r\nSvětlí odpadají jako první (jak jinak). Následuje (k mému překvapení) moje parťačka jejíž odchod podezřelý komentuje něčím co si asi nechci pamatovat a zakončuje naprosto nečekaným &quot;Proč''s jí nebaliiil?&quot;\r\n</p>\r\n<p>\r\nZmateně kontruji &quot;A prrroč né tyy?&quot;&nbsp;\r\n</p>\r\n<p>\r\nRozhovor se dále točí kolem techniky střelby sarajevských dlužníků do hlav a konečně taky o magistrátě a Karlově kamarádu Johnnym. Potvrzuji si své podezření že Johnny je Jiný vlastním jménem Jan Zelený a víc z Karla už nedostanu.\r\n</p>\r\n<p>\r\nJsme vyhozeni z velryby.\r\n</p>\r\n<p>\r\nKarel odjíždí .. pryč.\r\n</p>\r\n<p>\r\nZjišťuji že mi během pobytu v útrobách Velryby 18x volal šéf. Potkávám se s ním a zbytkem trestné výpravy za pomstu mojí smrti na Karláku. Ujišťuji šéfa že mi nic není a nechávám si podržet svůj kufřík.\r\n</p>\r\n<p>\r\nUlevuji si v nejbliřším křoví.\r\n</p>\r\n<p>\r\nŠéf míří domů.&nbsp;\r\n</p>\r\n<p>\r\nJá mířím do ateliéru kde by měl být nějaký Zelený. Ateliér se ukazuje býti BDSM salonem a ne litografickým studiem jak jsem si z nějakého nepochopitelného důvodu myslel. Pan zelený není Zelený kterého hledám a navíc je světlý. (Na světlého volí zajímavé lokality.) V &quot;ateliéru&quot; je i slečna Adlerová. Oproti očekávání vytahuje několik kopií IQ a osobnostních testů místo jezdeckého bičíku. Podnapilí vyplňujeme testy.&nbsp;Výsledky prohlašujeme za neprůkazné a rozcházíme se ze společnosti korzetů, karabáčů a klecí každý na jinou stranu.\r\n</p>\r\n<p>\r\nZa velmi trudomyslných úvah trpně absolvuji cestu ze Smíchova na Vinohrady pěšky.\r\n</p>\r\n<p>\r\nJdu spát.\r\n</p>\r\n<p>\r\nSpím.\r\n</p>\r\n', 0, 0, 2, 1, 1330038000, '20:30', '4:00', 'blíže neurčené množství kvasnicového piva Břežany\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18px; background-color: #999999">Pravděpodobnostní linie ukazují na podnik Velryba (Opatovická 24). Kde se mezi 21. a 23. hodinou objeví podezřelý člověk. Nezjistili jsme, zda se jedná o Jiného.&nbsp;</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18px; background-color: #999999">Prosím, prozkoumejte o co se jedná.</span>\r\n'),
(7, 'Odchyt Jana Zeleného', 1330361009, 0, 'Kontaktovat Jana Zeleného na místě předpokládnaého výskytu', 'doplnit\r\n', 'doplnit\r\n', 'doplnit\r\n', 0, 0, 0, 1, 1330124400, '15:00', '22:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(8, 'Hledání Zeleného v metru', 1330361119, 26, 'Kontaktovaz Jana Zeleného na místě pravděpodobného výskytu', 'Potkali jsme Jana Zeleného na stanici metra jak hlásilo analytické. Vedli jsme s ním plodný rozhovor ze kterého jsme vypoklonkovali světlé a dozvěděli se o dalších Zeleného společnících.\r\n', 'doplnit\r\n', 'doplnit\r\n', 0, 1, 0, 1, 1330124400, '15:00', '22:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(9, 'První kontakt se Zeleným', 1330362019, 0, 'zjistit informace ', 'Byl navázán první kontakt s panem Janem Zeleným, upírem 6. kategorie, který zajišťuje jednu ze zakázek pro pražský Magistrát. Při svých pracovních jednáních se v ojedinělých případech dopouští Hypnotického pohledu, Denní hlídka však proti tomuto jednání nepodniká žádné kroky, jelikož ho nepovažuje za ilegální. Od Zeleného byly také zjištěny informace o dalším členu jejich společnosti - panu Pacákovi, se kterým byl později navázán kontakt.&nbsp;\r\n', 'možnost, že zakázky pro Magistrát slouží ke komlexnějšímu zájmu nějakého Jiného, který celou organizaci a firmu řídí. Přesto, že se vše jeví jako neškodné, není zatím možné vyloučit nebezpečnost celého počínání.&nbsp;\r\n', '<p>\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>S panem Novotným jsme dojeli na stanici metra Holešovice přibližně v 14:45. Rozhodli jsme se obcházet stanici metra, jelikož jsme si nebyli jistí, ve které části se bude náš upír vyskytovat. V průběhu jsme se setkali s týmem Noční hlídky - konkrétně se slečnou Markétou Feitovou, panem Millerem a jedním neznámým hlídkařem.&nbsp;\r\n</p>\r\n<p>\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Chvíli po třetí hodině jsme se setkali s upírem, kterého Richard identifikoval jako pana Zeleného. Následně jsme se společně s ním vydali do restaurace, abychom si mohli v klidu promluvit. V našich patách šel však neustále samozvaný a samojmenovaný &quot;pozorovatel&quot; Noční hlídky, pan Miller. Celý konvoj pronásledovala Feitová s nováčkem, jež se za námi velmi nápadně plížili.&nbsp;\r\n</p>\r\n<p>\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>V restauraci jsme se pokusili zapříst konverzaci se Zeleným, ten si však nepřál rozebírat osobní a pracovní věci v přítomnosti Světlého. Poté, co Richard několikrát slušně požádal Millera, aby odešel, začal jeho odchod urychlovat matematickým měřením příjmu tekutiny do krevního oběhu Světlých. Miller se rozloučil extrémně hrubým způsobem - užitím Scanu na Zeleného, který s tímto dopředu nesouhlasil a pociťoval to jako silné narušení svého soukromí.&nbsp;\r\n</p>\r\n<p>\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Když Miller konečně odešel, rozpovídal se pan Zelený o své pracovní zakázce - dodávce multifunkčních zařízení (interaktivních tabulích) a následném zaškolení personálu. Nastínil též v hrubých obrysech strukturu firmy, ve které pracuje - konkrétně nám řekl, že nad ním funguje pan Pacák, který má možnost ho kontaktovat a několikrát se s ním sešel. Svého třetího společníka Jan Zelený osobně nezná. Dále se Zelený přiznal, že několikrát užil hypnotického pohledu na úředníky Magistrátu. Kvůli tomu jsme mu nabídli ochranu a případné hájení před všetečnými Světlými.&nbsp;\r\n</p>\r\n<p>\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>K večeru jsme zavedli pana Zeleného do detašovaného pracoviště Denní hlídky, kde jsme ho představili Alexanderovi, který mu následně slíbil pomoc při integraci do světa Jiných, který je relativně nově iniciovanému Zelenému stále ještě dosti neznámý.&nbsp;&nbsp;\r\n</p>\r\n', 0, 0, 0, 1, 1330124400, '15:00', '17:00', 'nulová, nebylo použito žádných amuletů ani nebylo vstupováno do Šera. &nbsp;\r\n', 'Analytické informovalo o výskytu Jiného na stanici metra Holešovice. Udávalo, že se pravděpodobně jedná o upíra. Žádné další informace nebyly poskytnuty.&nbsp;\r\n'),
(10, 'Setkání s Janem Zeleným', 1330364014, 29, 'prošetřit výskyt Jiného na Holešovicích', 'Denní hlídka se setkala s panem Janem Zeleným, upírem 6. kategorie, který dodává zakázku multifunkčních zařízení pro pražský Magistrát. Pan Zelený při svých obchodních jednáních ojediněle náhodně využívá upírského Hypnotického pohledu, což Denní hlídka nepovažuje za ilegální a proti panu Zelenému v tomto ohledu nepodniká žádné kroky.&nbsp;\r\n', 'Zatím není možné vyloučit, že celá společnost, která spolupracuje s Magistrátem nejedná ve svém vlastním zájmu a že tento zájem není nebezpečný pro Denní hlídku a všechny Jiné. Přesto nic do této doby nenasvědčuje tomu, že by jednání pánů Zeleného, Maška a Pacáka bylo nějakou formou ohrožující.&nbsp;\r\n', '<p>\r\nS panem Novotným jsme chvíli před třetí hodinou dorazili na stanici metra Holešovice. Záhy jsme si všimli týmu Noční hlídky - školky vedené slečnou Feitovou. Její doprovod tvořil pan Miller a jeden nový neznámý hlídkař.&nbsp;\r\n</p>\r\n<p>\r\nChvilku po třetí hodině jsme se setkali s naším kontaktem, upírem kterého Richard identifikoval jako Jana Zeleného. Společně jsme se vydali do blízké restaurace, abychom si mohli v klidu promluvit. Světlý Miller, jenž se sám jmenoval pozorovatelem, nás okamžitě následoval a držel se nám neustále v patách. V pozadí se držela i slečna Feitová, která nás &quot;zcela nenápadně&quot; pronásledovala i se svým nováčkem.&nbsp;\r\n</p>\r\n<p>\r\nV restauraci jsme se pokusili zapříst s panem Zeleným, ten si však nepřál hovořit o svých osobních a pracovních záležitostech před vysoce nepřijemným Světlým. Richard se tedy pokoušel Millera taktně požádat o odchod, ten však na jakékoliv náznaky nereagoval. Richard tedy přistoupil k matematickému měření příjmu tekutin do krevního oběhu Světlých. Když se Miller konečně odhodlal k odchodu, rozloučil se nejapným a bezdůvodným použitím Scanu na pana Zeleného, který k tomuto nedal dopředu souhlas a pociťoval to jako silné narušení svého soukromí. \r\n</p>\r\n<p>\r\nPoté, co se Miller odporoučel, Zelený nás informoval o svém kontraktu s Magistrátem, pro který zprostředkovává instalaci multifunkčních zařízení (interaktivních tabulí) a následní školení personálu. Dále nás seznámil s fungováním společnosti, ve které pracuje. Sám má dva společníky - s jedním nikdy nekomunikoval, druhý, pan Pacák, ho informuje pokud to sám uzná za vhodné. Dozvěděli jsme se také, že Zelený občas ne zcela vědomě použije Hypnotického pohledu na úředníky Magistrátu. Sama Denní hlídka toto nemá zájem nikterakt trestat a naopak nabídla panu Zelenému, že ho případně ochrání před zbytečným šťouráním Noční hlídky.&nbsp;\r\n</p>\r\n<p>\r\nV podvečerních hodinách jsme zavedli pana Zeleného na detašované pracoviště Denní hlídky, kde jsme ho seznámili s Alexanderem, který se nabídl poměrně nově iniciovanému upírovi pomoci s porozuměním Dohody a celkovým seznámením se světem Jiných, který Zelenému ještě není přišliš známý.&nbsp;&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1267052400, '15:00', '16:00', 'nulová, nebylo užito žádných amuletů, stejně jako nebylo vstupováno do Šera.&nbsp;\r\n', 'Analytické oddělení informovalo o výskytu Jiného, pravděpodobně upíra, na stanici metra Holešovice. Další informace Analytické neposkytlo.&nbsp;\r\n'),
(11, 'Iniciace - Ďáblice', 1330378117, 38, 'Iniciovat jiného', 'V Ďáblicích bylo hlášeno neznámé ohrožení, nakonec se z toho vyklubala iniciace temného mága.\r\n', 'Nový hlídkař do party. Positivní je, že už teď nemá rád světlý.\r\n', 'Po tom co jsem dorazil na místo se dvěma světlými, co přistoupili do stejné tramvaje, jsem počkal na zbytek výjezdu. Po krátkém hlídkování jsme byli svědky iniciace temného mága. Usmažil dva lidi, kteří mu chtěli ublížit. Světlé jsme slušle poslali do pryč a jali se vysvětlovat nově iniciovanému co a jak. Zde musím vyzdvihnot diplomatický výkon Anee Mitford, která obratně uklidnila rozrušeného mága. Byly jsme pozváni k němu do bytu, kde proběhla obvyklá instruktáž o věcech Tmy, Světla a Velké Dohodě. Nasledoval odjezd do Nekropole k registraci a jelikož byl ze strany mága projeven zájem o práci v hlídce, tak i ke vstupnímu pohovoru.\r\n', 0, 0, 2, 1, 1330297200, '19:45', '21:30', '<p>\r\nTemní&nbsp;\r\n</p>\r\n<p>\r\nšero 2x\r\n</p>\r\n<p>\r\nSvětlí\r\n</p>\r\n<p>\r\nšero 2x&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Podle našich informací soudíme, že se v příštích třech hodinách uvolní velké množství síly v oblasti Kobylisy - Ďáblická.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Nic nenasvědčuje tomu, že by se jednalo o plánované užití síly, ale na přírodní anomálii je to příliš silné.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Doporučujeme maximální opatrnost a diskrténost. Oblast je hustě zalidněná.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Pravděpodobná je i nutnost úpravy paměti svědkům.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Nejsilnější výron energie přijde z těchto souřadnic: 50&deg;8''0.497&quot;N, 14&deg;28''42.661&quot;E</span>\r\n'),
(12, 'Pan Pacák, Pan Mareš', 1330438943, 29, 'získat informace', 'Pánové Zelený, Pacák a Mareš zajišťují tři různé zakázky pro Magistrát hlavního města Prahy. Každý z nich pro své obchodní zájmy občas využije upírského Hypnotického pohledu, Dohodu však neporušují. Z neznámých důvodů tyto zakázky či setkání těchto Jiných narušují pravděpodobnostní linie. DH se proto snaží dostat k nejvyššímu článku společnosti, která zaštiťuje Zeleného, Pacáka a Mareše.&nbsp;\r\n', 'možná se nám to všechno sesype na hlavu a nastane armagedon řízený magistrátními úředníky a upíry\r\n', '<p>\r\nV neděli se členové Denní hlídky (Alexander, Lilian L. Garratt, Ann Mitford, Richard Novotný) setkali s panem Pacákem. Pana Pacáka vyzvedla v Hrnčířích Ann Mitford a dovezla ho na Florenc, kde již čekali ostatní výše zmínění členové Denní hlídky. Pan Pacák se představil jakožto upír 6. kategorie, řádně registrovaný a dodržující Dohodu. Následně byl hovor zaveden na události okolo Magistrátu města Prahy. Pan Pacák je zodpovědný za zakázku digitalizace dokumentů pro Magistrát. I jemu se občas stane, že použije hypnotického pohledu na úředníky Magistrátu. Stejně jako panu Zelenému Denní hlídka nabídla možnost ochrany před šťouráním a persekucí Noční hlídky a také vzájemně výhodné přátelské vztahy. Pacák dále doplnil, že na zakázce pana Zeleného (interaktivních tabulích) se žádným způsobem nepodílí. Zná však třetího ze společníků - pana Mareše. S tím měl také v neděli schůzku ke které přizval DH.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nS panem Marešem, upírem 5. kategorie, se výše zmínění členové DH setkali v KFC na I. P. Pavlova. Zde se dozvěděli, že pan Mareš také zajišťuje jednu zakázku pro Magistrát - tentokrát rekonstrukci Lapidária na Výstavišti. Na zakátce však není nic podezřelého, jedná se o čistě svědskou záležitost. &nbsp;I pan Mareš výjmečně zhypnotizuje úředníky Magistrátu a tak i jemu nabídla DH ochranu, přátelství a případnou výměnu informací ohledně zakázek, které narušují Krausovi pravděpodobnostní linie.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330210800, '12:00', '14:00', 'nulová\r\n', 'Podařilo se nám vysledovat pohyb upíra, pravděpodobně 6-té kategorie jménem Tomáš Pacák. Je to ta osoba, o které hovořil předchozí kontakt jménem Zelený.<br />\r\nTomáš Pacák by se měl ve 12:00 vyskytovat poblíž kostelíku v obci Hrnčíře. Doporučuji naprostou diskrétnost.\r\n'),
(13, 'Energetické čerpání u kostela', 1330439888, 29, 'zjistit, zda-li je porušována Dohoda', 'Bílý mág 6. kategorie porušoval Dohodu energetickým čerpáním pozitivní energie. Byl svěřen NH k instruktáži a výchově.&nbsp;\r\n', 'pravděpodobně žádné, krom možnosti že Světlí zbodají výchovu svého mága a udělají z něj stejného idiota jako je většina členů NH&nbsp;\r\n', 'Analytické oddělení nám nahlásilo velké čerpání energie u kostela sv. Petra v ulici Biskupská poblíž Florence. Na místo se vydal Alexander, Richard a Garratt. Chvíli po příjezdu Denní hlídky na určenou lokaci se na místě zjevili &quot;pozorovatelé&quot; Noční hlídky - maskot Kuncová a Viktorie Tesařová. Po krátkém laškování Richarda s Maskotem se všichni Hlídkaři rozptýlili a svorně obcházeli kostel ve snaze vypátrat onoho energetického čerpače. Po přibližně hodině a půl si Garratt všimla podezřele vyhlížejícího muže a po jistotu rychle upozornila Richarda a Alexe. Alex se ujmul hovoru s dotyčným a zjistil, že se jedná o Světlého mága 6. kategorie, momentálně bez domova, který si zlepšuje náladu odčerpáváním pozitivní energie z lidí přítomných v kostele. Na toto neměl platnou licenci, stejně jako si nebyl vědom existence Hlídek a Dohody. Proto byl Alexanderem svěřen Noční hlíce k instruktáži a dostal za úkol se dostavitna přezkoušení a registraci v pondělí do detašovaného pracoviště Denní hlídky na Vinohrady.&nbsp;\r\n', 0, 0, 2, 1, 1330210800, '11:00', '12:30', 'nula, nula, nic.&nbsp;\r\n', 'Pomocí našich přístrojů jsme zjistili silný a hlavně periodicky se opakující úbytek energie u kostela Biskupská<br />\r\nKostel nese název Sv. Petra a čerpání zaznamenáváme již několik týdnů. Dochází k němu vždy v něděli mezi 11-12:30.<br />\r\nPrověřte legálnost čerpání energie, případně zajistěte dodržování Dohody.\r\n'),
(14, 'инициация темного иного', 1330465626, 41, 'выяснит что за дьявольщина происходит на кладбище в Дьяблицих', 'выброс энергии произошел в последствии инициации темного иного\r\n', '<p>\r\nновый сотрудник или просто иной симпатизирующий Дневному дозору\r\n</p>\r\n', 'В 18:55 я пришла на место сбора (улица Трухларска), правда не общего а частичного. Как и было запланировано в 19:15 собрались все те кто должен был собраться. От туда мы на машине(!) добрались до места (Кладбище Дьяблице), не без лишних кругов разумеется. Там мы встретились с еще одним нашим сотрудником и с двумя светлыми. В 20:00 мы увидели движение у кладбищенской ограды, когда мы добежали на место, там уже никого не было однако чувствовалось чье-то присутствие, мы с коллегой вошли в сумрак, и увидели абсолютно не понимающего что происходит человека. Коллега его проскандировал, это был только что инициированный темный маг. Тут в сумрак вошли светлые. Явно пытались произвести хорошее впечатление, в итоге вытянули его из сумрака. Сердечное им за это спасибо. Как только маг оказался вне сумрака Энн начала его весьма эффективно успокаивать. Светлые порывались утащить мага с собой, не вышло, тогда они сообщили что у него 180 минут на регистрацию. Энн убедила мага пригласить нас всех на чай, со светлыми мы попрощались. Дома у мага мы пили чай и кофе, ели сладкое, более опытные сотрудники проводили инструктаж. Маг проявил заинтересованность в работе на дневной дозор. Соответственно все поехали к Шефу знакомить, регистрировать и прочая.\r\n', 0, 0, 2, 1, 1330297200, '19:15', '21:30', '<p>\r\nДневной дозор\r\n</p>\r\n<p>\r\n&nbsp;1 уровень сумрака 2 человека\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;Светлые\r\n</p>\r\n<p>\r\n&nbsp;1 уровень сумрака 2 человека\r\n</p>\r\n', '<div class="field-text">\r\n<span style="line-height: 18px; background-color: #999999; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; color: #ffffff">Podle našich informací soudíme, že se v příštích třech hodinách uvolní velké množství síly v oblasti Kobylisy - Ďáblická.</span><br />\r\n<span style="line-height: 18px; background-color: #999999; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; color: #ffffff">Nic nenasvědčuje tomu, že by se jednalo o plánované užití síly, ale na přírodní anomálii je to příliš silné.</span><br />\r\n<span style="line-height: 18px; background-color: #999999; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; color: #ffffff">Doporučujeme maximální opatrnost a diskrténost. Oblast je hustě zalidněná.</span><br />\r\n<span style="line-height: 18px; background-color: #999999; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; color: #ffffff">Pravděpodobná je i nutnost úpravy paměti svědkům.</span><br />\r\n<span style="line-height: 18px; background-color: #999999; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; color: #ffffff">Nejsilnější výron energie přijde z těchto souřadnic: 50&deg;8''0.497&quot;N, 14&deg;28''42.661&quot;E</span> \r\n</div>\r\n'),
(15, 'Krmení vlkodlaka', 1330506982, 37, 'Krmení', '<p>\r\n- nakrmený, poučený a z toho nejhoršího venku vlkodlak\r\n</p>\r\n<p>\r\n- lehce jetý Viktor M&uuml;ller z NH \r\n</p>\r\n', 'Obvinění z napadení Jiného z NH\r\n', '<p>\r\nDovedli jsme do Necropolis poloapatického umírajícího vlkodlaka, kterého při iniciaci nikdo nepoučil o potřebě kousat do živého. Byl už v takovém stavu, že potřeboval trošku specifičtější věc. Doufali jsme, že se to v Necru vyřeší, ale protože tam seděl koryfej, bylo nezbytně nutné zajít si na procházku.\r\n</p>\r\n<p>\r\n&nbsp;Ačkoliv jsem si to nechtěla připouštět, začalo mi být zcela jasné, že ten chudák umře, pokud si nekousne do Jiného. A protože na procházku šel jako dohled obrateň... Vešli jsme do temného parku, měsíc nesvítil a milý Světlý začal používat IQ (k mé smůle), takže si zakástil Psychický štít. I tak se mi ho nakonec podařilo uspat a nechat zapomenout. Mírně jsem mu pustila žilou. Nikdy jsem neochutnala krev Jiného a musím říct, že je to jedinečný gastronomický zážitek. To aroma, ta síla, ta vůně a ta chuť. Moje chuťové pohárky ožily, jak se jeho krev rozplývala na jazyku... no, musela jsem většinu dát tomu vlkodlakovi (Tomáš Šedý) a zvládla jsem to a dokonce jsem Viktorovi (my jsme si začali tykat, víte) ani moc neublížila, ale tedy... jestli ho uvidím někdy potrhaného nebo pořezaného... tak... vlastně možná se nikdo nenechávejte moc říznout, já to určitě někdy rozdýchám ale... (dobrovolným dárcům se meze nekladou!!).\r\n</p>\r\n<p>\r\n&nbsp;No... když se probudil, dala jsem mu 20 magů, protože se cítil nesvůj a vyšiloval, že vůbec neví, co se dělo. Tak jsem se mu chtěla podívat na zorničky, jestli je nemá rozšířené, ale on se mi do očí přímo podívat nechtěl!&nbsp;\r\n</p>\r\n<p>\r\nV Zaanviho poutech se loví blbě, tak jsem tu holku ulovila já, ale její krev byla tak plytká po tom... no, vlkodlak se nasytil a už se mu zapnul mozek.\r\n</p>\r\n<p>\r\nNásledně v Necru mu byl dán rychlokurz Dohody - neser Temný, škoď nenápadně Světlým, nesežer svou milou (Jiná, Světlá) vyhýbej se Inkvizici, sem tam něco ulov, ale tak, aby tě nikdo neviděl (s povolením)...\r\n</p>\r\n<p>\r\nTaké byl poučen o tom, že na Moravě se vyskytli vlci, takže kdyby cokoliv, může si začít užívat tam.Někdo z DH mu dal na sebe číslo, kdyby se potřeboval vybrečet.\r\n</p>\r\n<p>\r\nKonec \r\n</p>\r\n', 0, 0, 2, 1, 1330383600, 'Někdy večer', 'O kousek později', '<p>\r\n1x šero\r\n</p>\r\n<p>\r\n1x dlaha\r\n</p>\r\n<p>\r\n2x opium\r\n</p>\r\n<p>\r\n1x amnézie\r\n</p>\r\n<p>\r\n20 magů \r\n</p>\r\n', 'Umírající vlkodlak z akce Romeo a Julie\r\n'),
(16, 'Upír na Roztylském náměstí', 1330590549, 0, 'prověřit situaci a případně zajistit agresora', 'Na náměstí se pohyboval prokletý upír 5. kategorie, velmi zmatený, ale nijak agresivní. Ujala se ho slečna Feitová z NH.\r\n', '<p>\r\nPodle síly prokletí se v Praze pohybuje velmi <strong>silný vědmák</strong>, ačkoli analytika tvrdí, že by neměl mít vyšší,než 2. kategorii.\r\n</p>\r\n<p>\r\nSlečna Feitová se chce pokusit upíra odeklít, s trochou štěstí ji u toho ten vystresovaný chudák třeba zabije. \r\n</p>\r\n', '<p>\r\nAnalytické oddělení nahlásilo výskyt potenciálně nebezpečného upíra na Roztylském náměstí mezi 21:00 a 22:00. Vzhledem k tomu, že prakticky nikdo z hlídkařů neměl čas, vyrazili jsme na akci ve složení šéf, Anne a já (Edita). Cestou šéfovi volal pan Maršík s tím, že má povolení Inkvizice poslat nám &quot;podporu&quot; v počtu 6-8 lidí, což se šéfovi samozřejmě nezdálo, ale Inkvizitor následně Maršíkova slova potvrdil,tak jsme to nechali být. Náměstí jsme nejprve objeli autem, abychom řádně obhlédli terén, přičemž jsme objevili dvě skupinky Světlých. Šéf si pak něco vyříkával se slečnou Feitovou,zatímco my jsme s Anne hlídkovaly kolem a Světlí se snažili o totéž. Po chvíli obcházení náměstí se přiřítila slečna Feitová s tím, že ho mají. Šéf už se tou dobou pohyboval v šeru, takže když Feitová upíra odvedla stranou, aby si s ním promluvila,šéf se držel poblíž a pak nám předal informace. Jednalo se o upíra 5.kategorie, velmi silně prokletého (přišel o 80% své síly) Slečna Feitová se s ním domluvila, že se má za ní zastavit druhý den štábu a pokusí se ho odeklít. \r\n</p>\r\n<p>\r\nZatím jsme stále hlídkovali kolem,protože jsme očekávali nějakou další komplikaci,ale když upír odjel busem č.118 směr Roztyly, zavolali jsme na analytické a zjistili, že tady už se nic dít nebude. Světlým jsme předvedli klamný manévr hlídkování v autě, nechali jsme je tam obcházet a vyrazili jsme zpět do města.\r\n</p>\r\n', 0, 0, 1, 1, 1330470000, 'cca 20:30', 'cca 21:30', '1xvstup do šera (šéf)\r\n', '<p>\r\nNaše programy zaznamenají zvláštní výkyv šera v oblasti Roztylského \r\nnáměstí. Pravděpodobný nový výskyt této změny je očekávaný na \r\n21:00-22:00. S největší pravděpodobností se jedná o upíra, avšak jeho \r\naura vypadá podivně.<br />\r\nPodobný signál jako u vlkodlaka, který se objevil v Riegrových sadech.<br />\r\nBuďte opatrní\r\n</p>\r\n<p>\r\nKraus \r\n</p>\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(17, 'Kladivo na čarodějnice', 1330624746, 22, 'Zajistit maga zabijaka temnych na Karlaku', '<p>\r\nSvetly mag Vincent Maly predcital na Karlaku lidem Kladivo na čarodějnice a hrimal proti upirom a takym vecem. Svetli ho zabasli, my byli u vyslecha, vyslech k nicemu, oni nas prizvu k pristimu se specialistom.\r\n</p>\r\n<p>\r\nJiří Ciprián slíbil při Světlu a Tmě, že my budeme přizvani k přištimu vyslechu.&nbsp;\r\n</p>\r\n', '<p>\r\nOni nas nepřizvu a Ciprián dostane po tlame.\r\n</p>\r\n<p>\r\nKdyž oni maga pusti, možno bude lovit upirov.\r\n</p>\r\n<p>\r\nDobro vědět, što Maršíkova zavislost začína kopat o pulnoci.&nbsp;\r\n</p>\r\n<p>\r\nCim vice budeme se ptat inkvizitora ne kdeco, tim spis pak bude prosazovat, ze my na to zeptat jich musime.&nbsp;\r\n</p>\r\n', '<p>\r\nNa Karláku ja setkal s Alexanderom a ženskými. My tam pogledáli, našli světlych - oni tam kak pěst na oko trčeli. Alexander s inkvizitorom cosi dojednal, pak zas inkvizitor zrušil. My pohledali, počekali. Když chlap dorazil, do lidi tam hustil, što mezi nami upíry a nutno chodit do kostela.\r\n</p>\r\n<p>\r\nMy čuměli, postavali, nic nezrobili. Světli jego sebráli. My za nimi šli, trapas. Zastavovali, huceli do nich, nakonec ja pozorovatel jel s nimi na štab. \r\n</p>\r\n<p>\r\nPo cestě mag tahal zeleno svitici kameny, s nimi na nas sahal, taroty tahal, ukazoval. Nemogl mluvit, světli cosi zakouzlili. V Kladivu na čarodějnice pořad ukazoval stranu 487 a 488, cosi o soudu.\r\n</p>\r\n<p>\r\nMy dojechali na světly štab, tam Maršik, jemu nastupoval absťak. Oni jego uložili (Maršika), pry ho při tom praštit musi.\r\n</p>\r\n<p>\r\nPak dělali vyslecha - kompletno neschopno, vyslecha dělal ja. No chlap (Vincent Maly) &nbsp;nic nepamatoval, samovolno inicioval a pak zamlženo. U nich nebylo specialisty na vyslecha, no my dogodli, že až budet, my budeme u dalšiho vyslecha. Jonaš Ciprian složil přisahu při světlu a tmě.\r\n</p>\r\n', 0, 0, 2, 1, 1330470000, '22:45', '0:18', 'NH: Příkaz či ovlivněni či tak něco 2x\r\n', '<div>\r\nPOZOR! máme tu příliš horlivého mága či zaříkávače, který se rozhodl svou práci brát možná až moc vážně. Ta špína&nbsp;\r\n</div>\r\n<div>\r\nloví nás Temné. Nečekejme až se mu podaří nějakého ulovit. Lepší by bylo ho pořádně skřípnout a ideálně to otlouct o ksicht světlým. Je to pěkná drzost, nechat ho jen tak pobíhat po Praze.\r\n</div>\r\n<div>\r\nSvětlí ho nesmí dostat, zametli by to pod koberec a za pár dnů bychom tu měli opakování.\r\n</div>\r\n<div>\r\nPravděpodobně se znovu objeví na Karlově náměstí u kašny kolem 23:00.\r\n</div>\r\n'),
(18, 'Souboj na náplavce', 1330643411, 42, 'Zjiistit kdo', 'Soukupová (světly mág 3.kategorie) vyzvala na souboj temnou Katku.\r\n', 'Minus jeden temný\r\n', '<p>\r\nNa místo jsme dorazili v menším předstihu ve složení:\r\n</p>\r\n<p>\r\nAnne Mitford (velitel zásahu)\r\n</p>\r\n<p>\r\nFilip Ragulin\r\n</p>\r\n<p>\r\nLi\r\n</p>\r\n<p>\r\nPřed našim přichodem na místě tajtrlíkovali světlí ve složení: Miller (imbecil, co neodpovídá na otázky), Sobotková a Černý, který byl podle Ragulina celou dobu v šeru.\r\n</p>\r\n<p>\r\nKklem desáté se objevily ty dvě trubky, které se nemohly dohodnout na tom, kdo vlastně koho podvedl. (volně přeloženo, temná evidentně měla něco s chlapem od té světlé a podle všeho ten dotyčný chlap nemohl vystát tu světlou a tak si to šel hodit). K souboji vyzývala světlá, která nakonec vyhrála.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330556400, '22.00', '22.15', '<p>\r\nDh:\r\n</p>\r\n<p>\r\n2x šero\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nNh:\r\n</p>\r\n<p>\r\n1x šero\r\n</p>\r\n<p>\r\n2x scan\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nTy dvě netuším&nbsp;\r\n</p>\r\n', 'Pravdepodobnostni linie naznačují souboj na náplavce. Doporučuji zkontrolovat něco mi na tom nesedí. Konflikt je očekáván ve 22:00\r\n'),
(19, 'Roztylské náměstí', 1330690402, 43, 'prověřit situaci a zajistit upíra', 'Na Roztylském náměstí se pohyboval silně prokletý upír. Byl velice zmatený, ale nijak agresivní. Ujala se ho slečna Feitová z NH (chudák chlap).\r\n', '<p>\r\nv Praze se pohybuje vlemi silný vědmák - prověřit\r\n</p>\r\n<p>\r\nFeitová chce upíra odeklínat, třeba ji při tom ten vystresovaný chudák zabije. \r\n</p>\r\n', 'Na akci jsme vyrazili ve složení šéf, Anne a já, protože nikdo jiný \r\nneměl čas. Cestou volal šéfovi Maršík, aby mu oznámil, že na místo \r\nposílá tým 6-8 lidí a že to prý má schválené od Inkvizitora. Šéfovi se \r\nto moc nezdálo, tak ještě volal Inkvizitorovi, který ale Maršíkova slova\r\npotvrdil, tak jsme to nechali. Na Roztylském náměstí jsme narazili na \r\nsedm Světlých pod vedením Markéty Feitové (legendy, který o ní kolovaly u\r\nnás v kanclu fakt nelhaly, ta ženská je chodící katastrofa). Chvíli \r\njsme hlídkovali kolem, když se Feitová přiřítila, že ho mají. Šéf už byl\r\ntou dobou v šeru, takže zatímco Feitová si vzala upíra stranou, držel \r\nse blízko a pak nám předal informace. My jsme s Anne a Světlými zatím \r\nhlídali okolí. Podle šéfa se jednalo o upíra 5. kategorie, velmi silně \r\nprokletého (přišel o 80% své síly). Feitová mu slíbila, že ho prokletí \r\nzkusí zbavit a pustila ho domů. Doufám, že cestou vyžral aspoň půlku \r\ntoho autobusu, co do něj nastoupil (č.118, směr Roztyly). Šéf pak ještě \r\nzavolala na analytické, jestli se tady bude ještě něco dít, a když jsme \r\nzjistili, že ne, předveldi jsme stále hlídkujícím Světlým klamný manévr s\r\nobhlížením terénu z auta a vrátili se zpátky do města.\r\n', 0, 0, 2, 1, 1330470000, 'cca 20:30', 'cca 21:30', '1x vstup do šera (šéf)\r\n', '<p>\r\nNaše programy zaznamenají zvláštní výkyv šera v oblasti Roztylského \r\nnáměstí. Pravděpodobný nový výskyt této změny je očekávaný na \r\n21:00-22:00. S největší pravděpodobností se jedná o upíra, avšak jeho \r\naura vypadá podivně.<br />\r\nPodobný signál jako u vlkodlaka, který se objevil v Riegrových sadech.<br />\r\nBuďte opatrní\r\n</p>\r\n<p>\r\n&nbsp;Kraus \r\n</p>\r\n'),
(20, 'Výslech u Mariánského obrazu', 1330778591, 38, 'dozor nad výslechem', 'Byl jsem přítomen &quot;výslechu&quot; světlého jiného, stálo to za houby.\r\n', 'těžko říct...\r\n', 'Když jsem přišel bylo mi oznámeno, že byla složená šerá přísaha o tom, že smíme být přítomni u výslechu, ale že výslech bude probíhat teplepaticky. Takže všechno co mi pak bylo řečeno, neberu jako 100% pravdivé. Onoho zaříkávače, či co to vlastně je zač, prý napadla upírka, on utekl a teď se chudáček trápí kvůli tomu, že upírka zabila někoho jiného. Zaříkávač potom začal zmatkovat, říkal že jsem temný tutíž nebezpečný, propadl se do šera a utekl, už jsme ho nedohnali. Závěrem bych chtěl říct, že pan Černý, který telepatický výslech usketečňoval, je argogatní kretén největšího kalibru.\r\n', 0, 0, 2, 2, 1328137200, '22:00', '23:00', '<p>\r\nDH\r\n</p>\r\n<p>\r\n1x šero\r\n</p>\r\n<p>\r\nNH\r\n</p>\r\n<p>\r\n2xšero\r\n</p>\r\n<p>\r\n1xtelepatické vyšetření&nbsp;\r\n</p>\r\n<p>\r\ndalší světlí\r\n</p>\r\n<p>\r\n1x šero&nbsp;\r\n</p>\r\n', '---- nic ----\r\n'),
(21, 'Upír na Letné', 1330786759, 0, 'prověřit a případně zneškodnit', 'Hrozně dlouho jsme po Letné a okolí naháněli upíra (pravděpodobně nafetovaného BM), zatímco Světlí se flákali.\r\n', 'nic mě nenapadá, až na to, že možná dostanu nějakou hnusnou infekci, jak mě ten šmejd pokousal na krku\r\n', 'Na akci jsme vyráželi z Necropolis ve složení Li, Sára, já a Annie jako šéf zásahu plus se k nám připojil šéf, že prý na nás bude dohlížet. Na místě se Anne ujala vedení a zatímco šéf kolem pobíhal v šeru, my jsme hlídkovali kolem kyvadla a na záda se nám lepili Světlí s řečmi typu: &quot;za pět minut to tu přebíráme&quot; a bla bla bla. Obcházeli jsme tam možná půl hodiny, když přišel šéf s tím, že se náš cíl podle analytiky přesunul na druhý konec Letenské pláně, k budově Expo 54 nebo kolik. Tak jsme setřásli Světlý, nechali je pobíhat u kyvadla a naskákali jsme do auta. Po chvíli hledání jsme budovu objevili a rozdělili jsme se. Já a Li jsme šli spodem, šéf se Sárou a Annie horem. Já a Li jsme měly smůlu. Na upíra jsme narazily jako první. Pokusila jsem se ho sejmout freezem a trojitým ostřím, ale nijak zvlášť ho to nezpomalilo, takže jsme obě dostaly slušně přes držku. A do mě si ten parchant dvakrát kousnul! (Do Li možná taky). Během pár minut u nás byl zbytek týmu a vydali jsme se upíra pronásledovat k Veletržnímu paláci (zatímco já jsem bojovala s hysterákem). Tam jsme ho taky nakonec dostali, Sára ho tentokrát zmrazila freezem a já ho dodělala dalším trojítým ostřím. Šéf toho šmejda potom zvednul, Li mu nasadila pouta a odvezli si ho na štáb k výslechu. Já jela domů, protože už jsem toho měla fakt plný zuby a stejně bych se nevešla do auta. Sára jela se mnou. Záznam z výslechu bude doplněn později, až se potkám se šéfem nebo s někým, kdo u toho byl.\r\n', 0, 0, 1, 1, 1330642800, 'cca 21:30', 'cca 23:15', '<p>\r\n5xvstup do šera u kyvadla (já, Sára, Anne, Li, šéf)\r\n</p>\r\n<p>\r\n2x vstup do šera u Expa (já, Li)\r\n</p>\r\n<p>\r\n1x freeze \r\n</p>\r\n<p>\r\n1x freeze hůlka\r\n</p>\r\n<p>\r\n2x trojité ostří\r\n</p>\r\n<p>\r\n1x síla ohně\r\n</p>\r\n<p>\r\n1x Záhvího pouta\r\n</p>\r\n<p>\r\n(aspoň co si pamatuju) \r\n</p>\r\n', 'Pravděpodobnostní linie mi ukazují čerpání magicke energie. Zdá se, že \r\nse jedná o středně upíra, nebo vlkodlaka. Jeho výskyt by měl v oblasti \r\nkyvadla v časovém rozmezi od 22:00 do 22:30.\r\n'),
(22, 'Kyvadlo', 1330787458, 43, 'prověřit a případně zneškodnit', 'Hrozně dlouho jsme naháněli upíra po Letné a okolí, zatímco Světlí se flákali.\r\n', 'nic mě nenapadá, až na to, že možná dostanu nějakou hnusnou infekci z toho, jak si do mě ten šmejd dvakrát kousnul\r\n', 'Na akci jsme vyrazili z Necropolis ve složení já, Li, Sára a Anne jako šéf zásahu plus jel s námi šéf, že prý na nás bude dohlížet. U kyvadla jsme se rozdělili a hlídkovali, Světlí se tam samozřejmě motali taky a prudili. Po asi půl hodině přišle šéf s tím, že podle analytiky se náš cíl přesunul na druhý konec letenské pláně k budově Expo 54 nebo 58 nebo kolik. Tak jsme se nenápadně zdejchli, nechali tam Světlušky korzovat a vyrazili jsme na druhou lokaci. Po chvíli hledání jsme inkriminovanou budovu našli a rozdělili se - já a Li jsme šli spodem, Anne, Sára a šéf to vzali vrchem. S Li jsme měly smůlu a toho hajzlíka zubatýho jsme narazily jako první. Okamžitě se transformoval a zaútočil. Zkusila jsem ho sejmout freezem a pak trojitým ostřím, ale ani jedno ho očividně nijak netrápilo, takže jsme s Li dostaly pěkně přes držku. Do mě si pak ještě dvakrát kousnul! (Do Li možná taky) Během pár minut u nás byl zbytek týmu a když jsme se oklepaly z nejhoršího, vydali jsme se pronásledovat upíra k Veletržnímu paláci, kde jsme ho taky dostali. Tentokrát nás organizoval šéf, protože Anne parkovala. Sára zastavila cíl freezem a já ho pak dodělala dalším trojitým ostřím. Šéf ho pak zvednul, Li mu nasadila Záhvího pouta, naložili ho do auta a odvezli na štáb k výslechu. Já jela domů, protože jsem toho měla fakt plný zuby, a stejně by s jeden z nás nevešel do auta. Sára jela se mnou. Záznam z výslechu a další detaily budou doplněny, až se potkám se šéfem.\r\n', 0, 0, 2, 1, 1330642800, 'cca 21:30', 'cca 23:15', '<p>\r\nminimálně 7x vstup do šera plus šéf ve druhý hladině\r\n</p>\r\n<p>\r\n2x freeze (z toho jednou hůlka)\r\n</p>\r\n<p>\r\n2x trojité ostří\r\n</p>\r\n<p>\r\n1x síla ohně\r\n</p>\r\n<p>\r\n1x Záhvího pouta \r\n</p>\r\n', 'Pravděpodobnostní linie mi ukazují čerpání magicke energie. Zdá se, že \r\nse jedná o středně upíra, nebo vlkodlaka. Jeho výskyt by měl v oblasti \r\nkyvadla v časovém rozmezi od 22:00 do 22:30.\r\n'),
(23, 'Jasnyj signal', 1330865101, 22, 'Zabit unosca autobusa', 'My pajechali na sraza s unoscom na Novych Butovicach a zabili jego.\r\n', 'Kak unosci nepoucisja, bude nutno zabit dalsich.\r\n', '<p>\r\nAlexander domluvil s unoscom, sto on bude cekat Hradil na Novych Butovicach. Na Jinonicach ja s Hradilom i Richardom potkali s Fouskem, v sumraku presunuli o stanicu dal a vystupili - dvojice na kazdom konci. My ocekavali, sto tam budut unosci, pripraveni, a bude bitka.\r\n</p>\r\n<p>\r\nUnosca u konca s Hradilom a Fouskom, ucitil jich v sumraku, vstupil do sumraku toze bez rozmysla. Rekl Hradilovi &quot;Tak jdeme.&quot;, otocilsja a odchazal. Hradil mu do zad nakuril kuzla a bylo po unoscovi. My odjechali.\r\n</p>\r\n<p>\r\nJeste tam pak vratili na kontrolu tela - to rozplynulo normalno.\r\n</p>\r\n<p>\r\nVsjo probeglo v sumraku, svedku zadnych net.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330729200, '23:00', '01:00', '<p>\r\n4x sumrak\r\n</p>\r\n<p>\r\n1x dyka iz sumraka\r\n</p>\r\n<p>\r\n2x cosi Hradilovo (trojitý ostří)\r\n</p>\r\n', 'Dogoda s unoscom.\r\n'),
(24, 'Podmínky únosců', 1330870252, 38, 'Zjistit co chtějí únosci', 'Dostali jsme informace kde si máme vyzvednout podmínky únosců.\r\n', 'Únosci jsou v háji, protože s teroristy se nevyjednává.\r\n', 'Na hřbitově na náměsatí U Lva jsme u hrobu rodiny Vobořilové našli podmínky. Skupina si říka svobodní upíři a cití svou nadřazenost vůči všem jiným. Prý zabijí všechny unesené děti pokud nebudou splněny jejich podmínky mezi které patří uznání jejich nadřazenosti, minimálně jedna povolená oběť denně a spoustu jiných žvástů. Dále bylo hlášeno že se vyskytovaly v OC Metropole na Zličíně, kde jsme vše prozkoumali a jelikož jsme nic nenašli, vrátili jsme se na štáb.\r\n', 0, 0, 2, 1, 1328223600, '15:45', '18:00', 'nic\r\n', '<div>\r\nZe systému dopravní policie jsem zjistil, že byl nalezen prázdný autobus na Slivenci v ulici K Autisu.\r\n</div>\r\n<div>\r\nZde jsou přesné souřadnice: http://maps.google.cz/?source=friendlin ... 10,+3/3%29\r\n</div>\r\n<div>\r\nV oblasti by se mohla vyskytovat policie, proto doporučuji přístup v Šeru.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nProhledejte oblast, zajistěte důkazy, případně zajistěte, aby byla udržována Dohoda (hlavně co se utajení týče)\r\n</div>\r\n'),
(25, 'Mela na Arbesově náměstí', 1330870534, 26, 'Zabránit konfliktu, ochránit temné', 'Dva světlí přišli na Arbesovo náměstí vzít spravedlnost do vlastních rukou. Selhali. Temný je živ a světlí jsou na útěku. Záminkou byl údajně autobus mrtvých dětí.\r\n', 'Eskalace konfliktu s radikálními světlými v Praze.\r\n', '<p>\r\nNa místo předpokládaného konfliktu jsem dorazil s malou časovou rezervou a tak jsem viděl přicházet všechny aktéry. Dorazila taky Noční hlídka v naprosto nepochopitelném počtu. Slečna Sivá mi nahlásila že jsou na místě jako tři pozorovatelé tak jsem jí musel opravit, protože já napočítal čtyři hlídkaře. Tvářila se velmi překvapeně a prohlásila že o tom čtvrtém nevěděla. Asi je chudáčky neučí ani počítat.\r\n</p>\r\n<p>\r\nSpolu se světlými na místo dorazil černý mág, pan Pistorius který byl středem konfliktu. Sedl si na lavičku a mírumilovně si užíval slunečného odpoledne. Chvíli po tom co se usadil dorazili dva světlí, kteří již od samého začátku vypadali, že přišli dělat problémy. Vyjadřovali se nelichotivě na adresu pana Pistoria (ten černý mág) a dále ve smyslu, že je potřeba vyrovnat vychýlenou rovnováhu. Také naznačovali, že by měl pan Pistorius mít něco společného sautobusem povražděných dětí.\r\n</p>\r\n<p>\r\nSnažil jsem se agresivním světlým domluvit a situaci uklidnit, dokonce i ze světlých vypadlo pár vět, ale nebylo to nic platné. Nejdříve to pan Pistorius schytal freezem. Nacez jsem durazne svetle varoval ze jestli udelaji neco dalsiho, budu nucen zakrocit. Meho varovani nedbali, a pan pistorius to od druheho ze svetlych agresoru schytal do zad elementalnim utokem, ktery ho poslal k zemi. Utocici mag se pote dal na utek.\r\n</p>\r\n<p>\r\nPokusil jsem se ho dostihnout, byl ale mrcha rychlejsi. Vratil jsem se na namesti kde uz samozrejme druha utocnice davno nebyla a vyzvedl jsem si od svetlych pana Pistoria. Svetlym jsem podepsal, ze slibuji ze jim umoznim byt u vyslechu pana Pistoria.\r\n</p>\r\n<p>\r\nPan Pistorius prijal pozvani k nam na stab kde jsme nad cajem chteli probrat jestli bude vyslech vubec nutny. Na stabu se mu ovsem pritizilo a jeste se nevzpamatoval. takze ani nemuzeme sepsat svedeckou vypoved ohledne kouzel co svetli pouzili v dobe denni hlidky a meli by proto na ne vydat zasahy.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330815600, '13:00', '14:00', '<p>\r\n<strong>Temní</strong>\r\n</p>\r\n<p>\r\n2x sero 15min=&lt;<span style="white-space: pre" class="Apple-tab-span">	</span>Novotný (30 mg)\r\n</p>\r\n<p>\r\n2x II. stit&nbsp;<span style="white-space: pre" class="Apple-tab-span">		</span>Novotný (32 mg)\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n<strong>Světlí</strong> &nbsp;\r\n</p>\r\n<p>\r\n1x Záhvího pouta (20 mg)\r\n</p>\r\n<p>\r\n1x Síla ohně<span style="white-space: pre" class="Apple-tab-span">	</span>(50 mg)&nbsp;\r\n</p>\r\n<p>\r\n1x Scan\r\n</p>\r\n<p>\r\n2x Šero<span style="white-space: pre" class="Apple-tab-span">	</span>(Feitová, Sivá)&nbsp;\r\n</p>\r\n', 'Zaznamenali jsme, že se těžiště energetické bilance přesouvá do oblasti arbesova náměstí.<br />\r\nZjišťujeme, že se jedná o střet dvou typů myšlení. Světlého a Temného. Konflikt hrozí vyhrocením až k násilí.<br />\r\nMám dojem,že si tam chtějí vyřídit nějací světlí účty s temnými. Dejte na ty temné pozor, bylo by mrzuté, když by něko z nás jen tak umřel.<br />\r\nPravděpodobná eskalace 13:00\r\n'),
(26, 'Antonín Zápotocký', 1330900190, 45, 'Zatknout bílého mága kvůli opakovaným nepovoleným zásahům', '<p>\r\nZatceni bíleho mága 3 kategorie pana Antonína zápotockého na zastávce Michelský les.&nbsp;Za odmítnutí výslechu a útoku na členy denní hlidky.&nbsp;\r\n</p>\r\n', '<p>\r\nSvělý si mohou stežovat, ale celou věc postupně odsouhlasili. Postupovali jsme velmi korektně.\r\n</p>\r\n<p>\r\nNutno poslat noční hlídce účet za odvoz jejich pozorovatele.&nbsp;\r\n</p>\r\n', '<p>\r\nDorazili jsme na urcene misto - michelský les. O chvíli později dorazila světlá hlídka. \r\n</p>\r\n<p>\r\nVyjasnili jsme si ze jsou ciste jen pozorovatelé.\r\n</p>\r\n<p>\r\nRozmístili jsme se na obě zastávky. \r\n</p>\r\n<p>\r\nPodezřelá osoba na zastávku nepřijela, ale přišla po svých. Světlý se &nbsp;ní dostali dříve.\r\n</p>\r\n<p>\r\nVyjasnil jsem si se světlým, že ještě 8 minut je naše jurisdikce. Poprosil jsem podezřelého aby se představil a podal vysvětlení co tu dělál. Odmítl vypovídat. Upozornil jsme ho, že je tu závažné podezření, že porušuje dohodu nedovoleným čerpaním. \r\n</p>\r\n<p>\r\nPotvrdil, že dohodu zná a odmítl opět vypovídat. Noční hlídka vše odkývala a snažila se sdržovat. \r\n</p>\r\n<p>\r\n&nbsp;Poučil jsem pána, že pokud nepodá vysvětlení budeme ho muset zatknout a předvést. Odmítl i to. \r\n</p>\r\n<p>\r\n&nbsp;Takto se mi ho podarilo vyprovokovat k tomu aby při zatýkání na nás zaútočil a vyzval nás na férový souboj. Pan Hradil ho porazil.\r\n</p>\r\n<p>\r\n&nbsp;Vse ukonceno v 21:58.\r\n</p>\r\n<p>\r\n&nbsp;Zatcený a pozorovatel od svetlých dopraveni na stab.&nbsp;&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330815600, '21:30', '22:05', '<p>\r\nAdam Koblížek - vstup do sera\r\n</p>\r\n<p>\r\nHradil - Hulka a Freez, vstup do sera\r\n</p>\r\n<p>\r\nSylvie - asi trosku sily....\r\n</p>\r\n', 'prosim o doplneni analiticke oddeleni....\r\n'),
(27, 'Antonín Zápotocký výslech', 1330900514, 45, 'vysvetlení deni na zastavce michelský les', '<p>\r\nAntonín Zápotocký\r\n</p>\r\n<p>\r\n3 kategorie, světlý mág\r\n</p>\r\n<p>\r\nu sebe pouze mobilni telefon bez zvlastnich sprav&nbsp;\r\n</p>\r\n<p>\r\nodmítl vypovýdat, poučen o moznych dopadech a opet odmitl vypovidat\r\n</p>\r\n<p>\r\nspolupráce nulová\r\n</p>\r\n<p>\r\nnemá poslední přání\r\n</p>\r\n<p>\r\nje blbej jak troky\r\n</p>\r\n<p>\r\nNa prime upozorneni v jakem pruseru je poslal doháje i svetle<span style="white-space: pre" class="Apple-tab-span">	</span>&nbsp;\r\n</p>\r\n', 'výslech telepaticky svetlym telepatem (napad Raskulina) v 21:45 na stavbu\r\n', 'doplnit\r\n', 0, 0, 2, 2, 1015196400, '22:30', '23:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(28, 'Vlkodlaci na Riegráči podruhé', 1330985715, 38, 'Vyřešit vlkodlaky', 'Podruhé hlášení vlkodlaci v Riegrových sadech. Ptřeba je nějak vyřešit.\r\n', 'Nevypadá to na nic zvláštního, dva vlkodlaci si nedali pozor.\r\n', 'Dorazil jsem na místo kde se hádali vlkodlaci. Jeden evidentně lovil když neměl a druhý už neměl nervy mu to vysvětlovat. První evidentně neuměl vstupovat do šera, pravděpodobně kvůli schyzofrenii. Druhý, jak už jsem řekl, ztratil nervy, propadl se do šera a transformoval se. Trochu toho prvního pocuchal, načež ho slečna Fejtová zmrazila, po krátkém dohadování jsme přišli k náám na štáb, kde proběhl výselch.Cestou zpět jsem uklidil tělo co tam nechali do šera.&nbsp;\r\n', 0, 0, 2, 1, 1330902000, '21:45', '22:15', '<p>\r\nDH\r\n</p>\r\n<p>\r\n1x šero\r\n</p>\r\n<p>\r\n1x frezze\r\n</p>\r\n<p>\r\n1xtrojité ostří&nbsp;\r\n</p>\r\n<p>\r\nNH\r\n</p>\r\n<p>\r\n3x šero\r\n</p>\r\n<p>\r\n1x transformace obrteně\r\n</p>\r\n<p>\r\n2x frezze&nbsp;\r\n</p>\r\n<p>\r\n1x závojíček&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Průšvih !</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Vypadá to, že se ti samí vlkodlací zase vydali na lov, dokonce to vypadá i na nějakou oběť.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Pravděpodobně k tomu dojde ve 22:00 na stejném místě jako před tím. Evidentně si jej zvolili jako loviště.</span>\r\n'),
(29, 'Pomstychtivec', 1330997341, 42, 'Sejít se s magorem, který vyhrožoval pomalou smrtí', 'Bolíto vyhrožuje likvidací Novotného\r\n', 'Snad žádné, jinak smrt Novotného\r\n', 'Dorazili jsme na setkání, kde uz byla banda světlušek, Bolíto a nějaká baba civilistka.\r\n<div>\r\nKdyž se Ragulin ujal slova, tak z bolíta začli padat kecy na téma, že Novotný zabil nějakou světlušku a že na něj chce podat buď žalobu inkvizici nebo jej zabít (souvislost s Arbesákem)\r\n</div>\r\n', 0, 0, 2, 1, 1330988400, '1.30', '2.00', '2.hladina šera Alexandr\r\n', 'info z analytického atd.\r\n'),
(30, 'Lov vlkodlaku v Riegraci', 1331052080, 22, 'Zkontrolovat ich', 'Dva vlkodlaki, jeden dementny, lovili v Riegracoch - povolenky meli.\r\n', 'Dementny vlkodlak nadela prusery.\r\n', '<p>\r\nMy prisli do Riegracu, tam potkali se svetlymi, paka takova jak materska skolka, tlamu drzet neumi, slyset ich pres pul parku.\r\n</p>\r\n<p>\r\nMy vlkodlaky hledali, potom my jich nasli. Tam dve mrtvoly rozsapane. My jim rekli, sto jich maji uklidit, tak uklidili. Licencie a registracie my zkontrolovali - v parjadke.\r\n</p>\r\n<p>\r\nMy rozlucili, svetli odtahli, my odesli.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330902000, '19:15', '20:15', '<p>\r\n2x amnezia Alex na svedka\r\n</p>\r\n<p>\r\nSvetli furt lezli do sumraka&nbsp;\r\n</p>\r\n', 'Podle pravěpodobnostních linií je očekáván lov Vlkodlaků či upírů v Riegerových Sadech. Buďte opatrní nevidím zde jak silní by mohli být. Čas výskytu je odhadován na 19:30.\r\n'),
(31, 'Upír na Vítkově', 1331052585, 42, 'Zajistit stopy', 'Krom světlušek nalezeno 5 symbolů\r\n', 'Světlí budou zase prudit kvůli lidským obětem\r\n', 'Koblížek šel po schodek a já v Šeru z opačného směru, dorazila jsem na místo trochu dřív než Adam. Potkala jsem dva světlé, hledala jsem stopy po útoky nebo magickou stopu, památkník jsem obešla třikrát a Adam našel první symbol, celkem jich tam bylo 5.\r\n', 0, 0, 2, 1, 1330988400, '15.45', '16.20', '1x Šero (Mitford)\r\n', '<div class="postbody" style="width: 668px; float: right; clear: both; padding: 0px; margin: 0px">\r\n<p style="margin-top: 0px; margin-right: 15em; margin-bottom: 0.6em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 5px; padding-left: 0px" class="author">\r\n<font class="Apple-style-span" color="#000000"><a style="direction: ltr; unicode-bidi: embed; padding: 0px; margin: 0px" href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=120#p120"><img style="border-width: 0px; padding: 0px; margin: 0px" src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target.gif" alt="Příspěvek" title="Příspěvek" width="11" height="9" /></a>od&nbsp;<span style="padding: 0px; margin: 0px"><a style="direction: ltr; unicode-bidi: embed; display: inline !important; padding: 0px !important; margin: 0px" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=2" class="username-coloured">admin</a></span>&nbsp;&raquo; úte 06. bře 2012 15:12:49</font>\r\n</p>\r\n<div class="content" style="padding-top: 0px; padding-right: 0px; padding-bottom: 1px; padding-left: 0px; min-height: 3em; overflow-x: hidden; overflow-y: hidden; margin: 0px">\r\nPrávě se k nám doneslo, že na Vítkově u památníku došlo k napadení pěti lidí upírem.<br />\r\nUrychleně vyražte na místo a zajistěte stopy.\r\n</div>\r\n<div id="sig120" class="signature" style="margin-top: 1.5em; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0.2em; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; clear: left; overflow-x: hidden; overflow-y: hidden; width: 668px">\r\n<span style="padding: 0px; margin: 0px">ANALYTIK Karel&nbsp;<a id="j6f1f5c6e0039852dab9406d2c6163747b" style="direction: ltr; unicode-bidi: embed; background-color: transparent; border-style: none; padding: 0px; margin: 0px" href="http://www.krausmagazin.cz/">Kraus</a></span><br />\r\n<br />\r\n<span style="padding: 0px; margin: 0px"><span style="padding: 0px; margin: 0px">ORG-Danaketh</span></span>\r\n</div>\r\n</div>\r\n<dl id="profile120" class="postprofile" style="margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; min-height: 80px; border-right-width: 1px; border-right-style: solid; border-right-color: #ffffff; width: 193px; float: left; display: inline; border-left-color: #ffffff; padding: 0px"></dl>\r\n'),
(32, 'Autobus pokračuje', 1331162046, 27, 'výslech pana Vagnera', '<p>\r\nSetkání s Karlem Vagnerem v baru na Sokolovské.\r\n</p>\r\n<p>\r\nposkytl informace o tom, že panu Wolfovi dal pokyn a možnost o tom, že je akce proveditelná, jistý pan Modrý (máme telefon)&nbsp;\r\n</p>\r\n', 'doplnit\r\n', 'doplnit\r\n', 1, 0, 2, 2, 1331074800, '22:00', '23:30', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(33, 'Obraten na Vystavisti', 1331201449, 22, 'Dohlednout, aby nesejmul lidi', 'Obraten ili bily mag mel utocit na lidi. Nezautocil, svetli ho odvedli.\r\n', 'Neznaju zadnych.\r\n', '<p>\r\nS Koblizkom tam prijechali, bokem pocekali. Svetli prijechali, celi prekvapeny byli, sto my do nich nejebali. Cekali, cekali. Pak svetli s nejakymi lidmi kecali, pak obraten dorazil s dalsim nocnim hlidkarom. Obchazeli, pokecali - a pak vypadli i s obratenom. Nikakyje utoky nekonaly.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331074800, '22:15', '23:15', 'Nicego.\r\n', '<div>\r\nJe to zvláštní, ale pravděpodobnostní linie mi tu vyhazují útok světlého na člověka. Dvakrát jsem to musel zkotrolovat. Prověřte to útok by měl proběhnout ve 22:30 na zastávce Výstaviště.\r\n</div>\r\n<div>\r\nSvětlý je mág, nebo bojový mág nižší kategorie.\r\n</div>\r\n'),
(34, 'Neplecha u Ocasu', 1331203447, 45, 'zajistit bileho maga', '<p>\r\nZadrzen&nbsp;\r\nOndrej Vorel, lečitel 5 kategorie za nepovolene leceni.\r\n</p>\r\n<p>\r\nobdrzena kompenzace za jeho pretupky 2x zasah 5 kategorie&nbsp;\r\n</p>\r\n', '<p>\r\nziskany 2 zasahy 5 kategorie\r\n</p>\r\n<p>\r\n&nbsp;nutno skontroloval jestli panu Ondreji Vorlovi nedali nejake dalsi povoleni na zasah pripadne ho proverit jestli sam nedela nepovolene zasahy&nbsp;\r\n</p>\r\n', '<p>\r\nNa miste potkana zastupkyne Krista Cerna z Nocni hlidky. Spolecne jsme prochazeli okolo sochy. Zhodnotil jsem ze to bude vypadat nenapadneji nez kdyz tam budeme okounet kazdy sam a navic nam oboum se spozdil doprovod.\r\n</p>\r\n<p>\r\n&nbsp;Na misto dorazil bily mag. Byl prekvapeny ze nas tu vidi. Predstavil jsem se mu a pozadal ho o vpredstaveni a ysvetleni co tu dela.\r\n</p>\r\n<p>\r\nOndrej Vorel, lečitel 5 kategorie.\r\n</p>\r\n<p>\r\nPlanoval zde nekomu pomoci, trochu ho povylecit. Dale dotycny vypovedel ze obcas magii pomaha lidem bezne a priznal ze na tyto zasahy nema povoleni.\r\n</p>\r\n<p>\r\nPozval jsem ho za malych protestu nocni hlidky k nam na stab abychom to sepsali, dali panaka a pobavili se o tom co dal.\r\n</p>\r\n<p>\r\nSouhlasil a za doprovodu &nbsp;svetlych jsme vyrazili na stab.&nbsp;\r\n</p>\r\n<p>\r\nTam pri vyslechu potvrdil to co nam rikal a presne priznal, ze provedl za posledni dva mesice 2 zasahy 5 kategoriie tedy kouzlo dlaha.\r\n</p>\r\n<p>\r\nSvetla hlidkarska tlumocila sve sevce slecne Faithove nasi zadost na kompenzaci za nepovolene zasahy, ktere pan Ondrej Vorel udelal. Po velmi hlasite odpovedi z telefonu &quot;to se snad posrali&quot; si telefon prevzal Ragulin a dohodl se sni na 2x zasazich 5 kategorie, ktere jsem pak dojel vyzvednout.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331074800, '18:45', '19:20', '0\r\n', 'Zaznamenali jsme nějakého Světlého který vyvíjí slabou magickou aktivitu Na Václavském náměsí u sochy svatého Václava. Zjistěte o co se jedná. Další aktivita je očekávána v 19:00.\r\n'),
(35, 'Rys cmucha', 1331208576, 22, 'Najit zmrda vlkodlaka, katoryj zabil Machackovu', 'Jicinsky pomogl cmuchat, vlkodlak odtahl telo k Apolinari na placek, tam sezral a odchodil do sumraka.\r\n', 'Dopad tezkeho kladiva na glavu toho zmetka.\r\n', 'S Jicinskym a Kovacom dorazili k Machackove, dvere vykopli, Jicinsky premenil a cmuchal. My ho vedli na voditku. Docmuchal k Apolinari, tam vedle porodnice takovy placek. Tam policejna paska, krvavo, bordel, Jicinsky vycmuchal, kde vlkodlak dozral. Pak odesel do sumraka, dal nevycmuchali, ani Kovac se skenom podrobnym nezjistil.\r\n', 0, 0, 2, 1, 1331074800, '18:00', '18:45', '<p>\r\n1 sumrak Ragulin, 40 mg Ragulin venoval Jicinskemu\r\n</p>\r\n<p>\r\n1 sumrak Kovac, 1 podrobny sken Kovac&nbsp;\r\n</p>\r\n', 'Drivejsi znalosti.\r\n'),
(36, 'Upírka v inkviziční vazbě', 1331211432, 32, 'Autobusová kauza', '<p>\r\nVýslech upírky, kterou zatkli Světlí a předali ji na pohlídání inkvizitorovi, který mi umožnil se s ní setkat.\r\n</p>\r\n<p>\r\nV následujících dnech Světlí zmeškali lhůtu na podání žaloby a upírka byla propuštěna. Uvidíme, jak si s ní poradí Druhá strana mince... \r\n</p>\r\n', '<p>\r\nUmenšení touhy po krvi autobusových teroristů od Druhé strany mince.\r\n</p>\r\n<p>\r\nZvýšení touhy inkvizitora si rvát vlasy nad blbostí svých bývalých Světlých krajanů.\r\n</p>\r\n<p>\r\nPlacatější čelo všech členů Denní hlídky, kteří o kauze byť jen slyšeli. \r\n</p>\r\n', '<p>\r\n- \r\nkam jste chtěli odvézt ty děti?\r\n</p>\r\n<p>\r\nJak chtěli, odvezli.\r\n</p>\r\n<p>\r\n- odvezli? šikulkové, gratuluji. jaká byla cílová destinace dovozu těch dětí? \r\n</p>\r\n<p>\r\nmně řekli letiště, kam dál... to věděl wolf, kterého jste\r\nvy hajzlové zabili.\r\n</p>\r\n<p>\r\n-&nbsp;\r\nty jsi měla dodat děcka, Wolf věděl, co dál. Jaká byla úloha toho \r\nzbytku?\r\n</p>\r\n<div class=&quot;wc&quot;>\r\nvšichni jsme dodávali děti, ale wolf věděl co dál\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- a z nedostatku dalších instrukcí vás nenapadlo nic \r\nlepšího než je zmasakrovat? ts, ts, ts, trochu plýtvání, ne?\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n<div class=&quot;wc&quot;>\r\ntohle byla instrukce.\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- zmasakrovat děti ještě před odletem byla instrukce? \r\n</div>\r\n<div class=&quot;wc&quot;>\r\n<div class=&quot;wc&quot;>\r\nprostě to od wolfa přišlo a wolf byl šéf. Tečka.\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n-&nbsp;\r\nkdy ta instrukce od Wolfa přišla?\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n<div class=&quot;wc&quot;>\r\npřišlo to kolem půl deváté\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- kdo další kromě Wolfa na tom s tebou pracoval? přijímal Wolf rozkazy od někoho dalšího? \r\n</div>\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;Neznala jsem je, říkali jsme si pan bílý, pan černý, \r\npaní červená, pan hnědý a paní růžová (proč jsem já jen musela být \r\nrůžová?)\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n-&nbsp;\r\nvšichni jste byli upíři?\r\n</div>\r\n<div class=&quot;wc&quot;>\r\nne všichni ne. Měli jsme tam vědmu.\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- Popiš mi tu vědmu, paní červenou. \r\n</div>\r\n<div class=&quot;wc&quot;>\r\n<div class=&quot;wc&quot;>\r\nmenší (cca 160 cm), vlasy střední délky hnědé barvy (kratší než na ramena, ale o málo), výrazné tmavé \r\noči. byla spíše sportovně oblečená. trošku kulatější obličej. menší střední prsa. maličko východní přízvuk.\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- na co se specializovala? \r\n</div>\r\n<div class=&quot;wc&quot;>\r\nnevím, nerozumím tomu. ale zabila bych ji, nebyla silná.\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- jaké barevné kódové označení měl Wolf a jak to, že jsi u něj znala \r\njméno?\r\n</div>\r\n<div class=&quot;wc&quot;>\r\nPan Černý.&nbsp;\r\nO wolfovi jsem se dozvěděla, když jste o něm mluvili vy a světlí\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n-&nbsp;\r\nstručně popiš i ty ostatní.\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n//popisy máme//\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n-&nbsp;\r\nměli jste nějaká kontaktní tel. čísla? mrtvé schránky? postup, co dělat,\r\nkdyž se něco pokazí? kde se sejít?\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;mrtvé schránky nemáme a mobily jsme rozšlapali ve chvíli, kdy to začalo jít \r\nšejdrem. //odpověď není zajímavá//\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n- &quot;um phre veritae communicato tarch&quot; - mluvila jsi po celou dobu našeho rozhovoru pravdu?\r\n</div>\r\n<div class=&quot;wc&quot;>\r\nAno. <br />\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n&nbsp;\r\n</div>\r\n&nbsp;\r\n</div>\r\n&nbsp;\r\n</div>\r\n<div class=&quot;wc&quot;>\r\n&nbsp;\r\n</div>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 2, 2, 1330988400, 'večer', 'večer', 'sérum pravdy, dlouhé noci u nyxu.\r\n', 'byla jsem zvědavá a požádala jsem inkvizitora, zda bych si nemohla také promluvit se zajatkyní, čemuž on obratem vyhověl a dokonce nás zanechal v soukromí.\r\n'),
(37, 'Útok Světlých v Zulu baru', 1331328389, 47, 'žádný - sedět s Charistarchem u kafe', 'Do Zulu vletěli 4 Světlí kreténi, s cílem napadnout a nejspíš zabít Charistarcha. A já to samozřejmě musela odnést taky...again.\r\n', '<p>\r\nžaloba od Světlých na nás nebo přímo na Charistarcha, protože dva z těch debilů zlikvidoval\r\n</p>\r\n<p>\r\ndalší nepokoje v ulicích od Druhé strany mince \r\n</p>\r\n', 'Původní plán na večer zahrnoval klidné posezení u kávy s Charistarchem, což se samozřjmě muselo zvrhnout, asi tyhle situace přitahuju. Každopádně, klidně jsme seděli a povídali, když jsme vycítili někoho v první hladině šera a vzápětí začala kolem létat kouzla, a rozhodně nic malého. (Betlémský oheň, například) Charistarch okamžitě skočil do šera, já ho prakticky okamžitě následovala. Hnali se k němu dva Světlí s karabáči Šaabovými v rukou, kolem to svištělo dalšími Betlémy a Firebally, Charistarch něco lámal, něco sesílal sám - a nechtějte po mě vědět, co to sakra bylo. Zatímco já na ty Světlý pitomce ječela, ať ve jménu Denní Hlídky okamžitě přestanou (jasně, zbytečná námaha, ale učiňme oficialitám zadost, že ano) Charistarch ty dva s karabáči sejmul Thanatosem. Já poslala na každého z těch zbývajících Trojité ostří, ale když mě trefil další fireball, už jsme to tak nějak neustála a všichni tři mi zmizeli v druhé hladině, ze které se po chvíli Charistarch vrátil a vlekl za sebou pěkně zmuchlané útočníky. Spoutal je, já se tak nějak sebrala z nejhoršího a volala naši operativu, pak jsem ty kretény oficiálně zatkla a zabavila hůlky s Betlémským ohněm, co se povalovaly kolem. Jako první na místo dorazila Noční Hlídka, jmenovitě Andrej Kováč, ale dozvěděl s ejenom, že ti dva jsou zatčeni Denní Hlídkou, s tím, že může být přítomen výslechu jako pozorovatel. Pár minut po něm dorazil Richard s nějakým nováčkem a Adlerovou v závěsu (mimochodem, co ta tam sakra dělala by mě taky zajímalo) a ještě nějaký Světlý, snad Šulc nebo tak nějak. Sebrali zatčené, sebrali Kováče a jeli na štáb vyslýchat, kam jsme později s Charisterchem dorazili také, podat svědecké výpovědi.\r\n', 0, 0, 2, 1, 1009839600, 'cca 19:00', 'konec útoku asi 19:30, konec výslechu těch blbů ně', 'viz svědecké výpovědi ze včerejška, teď už si to fakt nepamatuju...\r\n', 'info z analytického atd.\r\n'),
(38, 'Zahorska k magistratnym zakazkam', 1331382979, 22, 'Ovlivnene magistratne zakazky', '<p>\r\nZahorska tvrdit, sto ona davala na zakazky tipy ostatnym. Ostatne poznala v baru Necropolis, nejdriv Zelenego a ten seznamil s ostatnimi.&nbsp;\r\n</p>\r\n<p>\r\nJediny udajny motiv - zisk.&nbsp;\r\n</p>\r\n<p>\r\nNevazmozno, sto ona by gledala vsechny zakazky, tipovala, proverovala. Vazmozno, sto nekdo dalsyj.\r\n</p>\r\n', '<p>\r\nVazmozno, sto ona varujet nadrizene.\r\n</p>\r\n<p>\r\nU Garretove jeji nausnice, mozno pouzit pri ritualoch.&nbsp;\r\n</p>\r\n', 'Postupno vyslechli, ne nunzno podrobneho vypisa, navic u nas net.\r\n', 0, 0, 2, 2, 1332972000, '19:00', '20:00', 'Nada.\r\n', 'Vstupy z pripadu, od Pacaka, Maresa, Zelenego.\r\n'),
(39, 'Bordel na Malé Ohradě', 1331408336, 37, 'Pátrající vědmák', 'Vědmák pátral po svém bratrovi, kterého sebrala Odvrácená strana mince (dále jen OSM) jako neiniciovaný Jiný.\r\n', '<p>\r\nIniciovaný Jiný na Světlého, verbování armády OSM \r\n</p>\r\n', '<p>\r\nDorazili jsme na zastávku před Světlými a hledali stopy. Stopy byly špatně patrné, ale my byli odhodlaní. Bloumali jsme od zastávky Malá Ohrada k zastávce Bašteckého, Světlí tam běhali v šeru. Nakonec jsme našli vědmáka, který všude možně bloudil taky. \r\n</p>\r\n<p>\r\n&nbsp;Evidentně seslal pátrací kouzlo a šel v jeho stopách, to se táhlo zastávkami Malá ohrada, Bašteckého, Velká ohrada, Ohradské náměstí...&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;Vědmákovi byl před 14 dny unešen bratr Johny Kortéz, dvojče, neiniciovaný Jiný. Rodina Kortéz je bohatá na Jiné. O OSM se dozvěděl od svého strýčka knihovníka/knihkupce, ale jeho jméno sdělit nechtěl. Za propuštění si žádali smrt Temného vědmáka. \r\n</p>\r\n<p>\r\nVědmákovi jsem já, Silvie, dala na sebe číslo, kdyby se hnal do průseru, ať zavolá. \r\n</p>\r\n<p>\r\nBylo slíbeno, že se pokusíme Johnyho zachránit. Teď je pravděpodobně iniciovaný a člen OSM. \r\n</p>\r\n', 0, 0, 2, 1, 1331247600, '23:00', '0:10', '<p>\r\nSvětlí x krát šero\r\n</p>\r\n<p>\r\nTemní x krát trpělivost \r\n</p>\r\n', 'Jak tu tak do toho koukám, tak mi tu vyskakuje nějaký sání energie. \r\nVypadá to tak na 30-40 Mg z jednoho člověka. Mág nebo vědmák. <br />\r\n<br />\r\nBěžte se na to podívat. První sání mi to hlásí někdy kolem 23:00 na autobusové zastávce Nad malou Ohradou.<br />\r\nJe to jednosměrná zastávka, tak by to snad neměl být problém. <br />\r\n<br />\r\nKoordináty jsou: 50.040300, 14.340809<br />\r\nJestli se tam Světlí dostanou dřív, Udělají z toho aféru!\r\n'),
(40, 'Dva kohouti', 1331414755, 22, 'Uklidnit bitku temnych proti svetlym', 'Dva černý magi opičaci si chotěli dat přes hubu, němagicky, pěkno po staru, pěsti. Kdyby tam nebyly kamery, ja bych jim fandil. Tak my jich rozehnali - taky po staru, pod krkom a pod kolena.\r\n', 'Govada znovu potkaji a zase si přes držku daji.\r\n', 'Nočni zase jako banda děcek na mistě postavali, rvači jich posmotrili i utekli. Ja odvolal operaciu, pak my na dvakrat odešli, až i světlije konečně vypadli. Pak my vratili, na dva kohouty počekali a vyřešili, na dvě strany jich rozehnali.\r\n', 0, 0, 2, 1, 1331334000, '17:50', '19:00', 'Od nas ničego, světlyje furt do šera lezli.\r\n', '<div>\r\nKoukám do přístrojů a vybíhají mi tu Rychlé Šípy!\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nVypadá to na nějaké vyřizování účtů nebo boj o ulice v okolí Mariánského náměstí.&nbsp;\r\n</div>\r\n<div>\r\nJsou tam Světlí proti Temným, tak se na to dojděte podívat a případně pomozte!\r\n</div>\r\n'),
(41, 'Návrat k Malé Ohradě', 1331422144, 26, 'Usměrnit lovícího upíra', '<p>\r\nChycený upír 5. kategorie\r\n</p>\r\n<p>\r\nNasraní Světlí \r\n</p>\r\n', '<p>\r\nŽaloba na Silvii Krásnohorskou\r\n</p>\r\n<p>\r\nNervové zhroucení Viktora Millera \r\n</p>\r\n', '<p>\r\nHledali jsme lovícího upíra, našli jsme utíkajícího upíra, za kterým se hnali Světlí. Do zmatku jsem se snažila vložit řád, tak jsem utíkajícího Freezla. Pak jsem mu nabídla, že pokud se vrátí do normálu, postaví se za něj Denní hlídka a převezme vyjednávání. Což se stalo.\r\n</p>\r\n<p>\r\nU parkoviště jsme našli jedno tělo, na to měl licenci. Světlí ho obvinili z ataku na Viktora. Upír provolával &quot;maso&quot; a chvíli Viktora honil. Pak ale změnil směr. Zraněný byl jenom upír, nikoliv někdo z Hlídky.\r\n</p>\r\n<p>\r\nSvětlí ho chtěli k sobě na štáb, to jsme rezolutně odmítli. Nakonec nás dva z nich opustili a zůstal s námi Viktor.\r\n</p>\r\n<p>\r\nViktor nám mezi zastávkami Jiřího z Poděbrad a Náměstí Míru řekl, že ti dva nakonec za námi jedou a že na ně máme počkat. Tak upíra Fullbruck vtáhla do 2. hladiny šera a šlo se na štáb denní hlídky. My se trošku s Viktorem chytli, opanoval se, přilnul k telefonu a já zdrhla na štáb. \r\n</p>\r\n', 0, 0, 2, 1, 1015801200, '21:00', '22:30', '<p>\r\nSvětlí šero, proměny tygr a panter a kdoví, co zranilo upíra\r\n</p>\r\n<p>\r\nFullbruck 3x šero 1. hladina, 1x 2.hladina\r\n</p>\r\n<p>\r\nFullbruck 1x vtáhnutí do šera\r\n</p>\r\n<p>\r\nKrásnohorská 3x šero \r\n</p>\r\n', '&nbsp;\r\n<p class="author">\r\n<a href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=174#p174"><img src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target_unread.gif" alt="Nový příspěvek" title="Nový příspěvek" width="11" height="9" /></a>od <strong><a href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=60">Analytik_Asistent</a></strong> &raquo; sob 10. bře 2012 20:31:00 \r\n</p>\r\n<div class="content">\r\nJak jsem již psal na vaše náhradní přístroje, \r\nkolem deváté hodiny se na této lokaci: 50.043544,14.338356 objeví \r\nvyhládlý upír. Není to nic silného, ale má zálusk minimálně na tři lidi.\r\nOhlídejte je. Jeho, pokud možno zkrotťe. Nechcete přeci, aby se toho \r\nchytla Noční.\r\n</div>\r\n'),
(42, 'Nový přírůstek na Libuši', 1331495812, 37, 'Ukázat ', '<p>\r\nMladý vědmák 6. kategorie byl poučen a registrován Noční hlídkou\r\n</p>\r\n<p>\r\nZásah 7. kategorie - vysátí trochu člověka \r\n</p>\r\n', 'Docela chytrý a učení chtivý Temný mezi námi\r\n', '<p>\r\nVědmáka v 17:10 už dávno provázel Kováč a družně spolu hovořili. Poté ho registroval a s tím odešel a my si šli s ním sednout do hopsody. Tam jsme mu přečetli preambuli Dohody a zodpověděli dotazy.\r\n</p>\r\n<p>\r\nBaďurová ho iniciovala někdy v prosinci před Vánocemi. Místní ezoterička. Následně na to někdy zemřela, zjistit proč, takže prostě ho nepoučila, ale dala mu kroužek. Do kroužku se evidentně dá ukládat energie. Řekli jsme mu, že ho můžeme přihlásit do kurzů pro začátečníky temné mágy a vědmáky a že tam o tom kroužku má říct. Že ho tam naučí kouzla/formule a taky mu řeknou, co s tím kroužkem.\r\n</p>\r\n<p>\r\nPavel si s ním vyměnil kontakt a bylo mu řečeno, že když bude mít jakýkoliv dotaz/průser/problém, má ihned volat a použít nás jako právníky.\r\n</p>\r\n<p>\r\nKováč ho přistihl při nepovoleném čerpání energie do toho kroužku, ale nerozmazával to. Páč je to Kováč a ne idiot. \r\n</p>\r\n', 0, 0, 2, 1, 1331420400, '17:10', '17:30', 'nic\r\n', 'Na zastávce Libuš se dnes v uvedeném časovém intervalu bude pohybovat - \r\ndle linek - vcelku nezkušený vědmák. Odhadoval bych to tak na šestu \r\núroveň. Nejsem si jistý, zda je registrovaný.\r\n'),
(43, 'Upírka zlatokopka', 1331497801, 48, 'Zajistit upírka, co kradla ve zlatnictví v Dejvicích', 'Upírka 6. kategorie kradla v Šeru, byla důrazně napomenuta a poučena.Složila šerou přísahu, že mluvila pravdu a více nebude krást pomocí šera.\r\n', 'Poučená a ke konci lehce vystrašená upírka mezi námi.Složila šerou přísahu, více již nebude krásti přes Šero.\r\n', '<p>\r\nPřes šero jde, nezná meze,\r\n</p>\r\n<p>\r\ndo zlatnictví klidně vleze.\r\n</p>\r\n<p>\r\nPřede dveřmi však se leká,\r\n</p>\r\n<p>\r\ntam už Denní hlídka čeká.\r\n</p>\r\n<p>\r\nSpolečnou pak s nořní hlídkou,\r\n</p>\r\n<p>\r\nproskenovaná Prohlídkou,\r\n</p>\r\n<p>\r\njak opilá odpovídá,\r\n</p>\r\n<p>\r\npřesto odpovědi vydá.\r\n</p>\r\n<p>\r\nŽe prý loupeže ji baví.\r\n</p>\r\n<p>\r\nŠerým slibem všechno spraví.\r\n</p>\r\n<p>\r\nVíce už nic nevykrade,\r\n</p>\r\n<p>\r\npak se rychle do pryč hrabe.\r\n</p>\r\n<p>\r\nHlídky odvedli věc čistou,\r\n</p>\r\n<p>\r\nChelčic, Silva, Vesel s Kristou.\r\n</p>\r\n<p>\r\n&nbsp;Tak se příběh uzavírá,\r\n</p>\r\n<p>\r\notázka je, co víc zbývá.\r\n</p>\r\n<p>\r\nSnad pro všechny potěšení,\r\n</p>\r\n<p>\r\nhřísná došla napravení. \r\n</p>\r\n', 0, 0, 2, 1, 1331420400, '19:30', '20:30', 'Pravdivé vidění\r\n', 'Máme tu hlášené vyloupení zlatnictví: <a href="http://www.nelso.cz/cz/place/268123/" class="postlink">http://www.nelso.cz/cz/place/268123/</a><br />\r\nDle kamerových záznamů není nic vidět, jen mizí věci z vitrínek. Dojděte se na to podívat.<br />\r\nVypadá\r\nto jako práce nějakého ne moc inteligentního upíra. Podle \r\npravděpodobnostních linií se nezdá, že by to byl nějak extrémně silný \r\nupír. <br />\r\n<br />\r\nDle pravděpodobnostních linií se bude ochomýtat v této lokaci <br />\r\n<a href="http://mapy.cz/#x=14.399604&amp;y=50.099601&amp;z=16&amp;t=r&amp;q=na%20hut%C3%ADch%2C%20praha&amp;qp=10.866371_48.518401_17.254870_51.020822_6&amp;d=base_1663514_1&amp;rp=m&amp;m=9gxr3xY01egPkgYBLZUQgUnLvgR9HE" class="postlink">http://mapy.cz/#x=14.399604&amp;y=50.099601 ... gUnLvgR9HE</a><br />\r\n<br />\r\nPokuste se jí zachytit, než Vám zmizí v nějakém z baráků. Místo ukončení trasy je její pravděpodobné bydliště.\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(44, 'Zajištění světlé mágyně', 1331502293, 40, 'Zjistit co provádí Světlá na Národní třídě', 'Nově iniciovaná světlá mágyně 5. kategorie, jménem Eliška, se pohybovala po Národní třídě a nevědomky prováděla drobné zásahy - pravděpodobně remoralizace. Byla jí vysvětlena Dohoda, byla zaregistrována u Denní hlídky a ujali se jí Světlí.\r\n', 'Nejspíše žádné, je nepravděpodobné že by Světlá dále prováděla nepovolené zásahy, dohlíží na ni Noční hlídka a je registrovaná.\r\n', '<p>\r\nZadrželi jsme Světlou na Národní třídě, kde prováděla drobné zásahy, remoralizace, měnila nálady lidí apod. Mágyně byla až nepřirozeně veselá, až lehce bláznivá, ale podařilo se nám ji přesvědčit aby s námi v klidu šla do blízkého restauračního zařízení Nevinný bar. Tam jsme ji vyslechli a zjistili jsme, že je teprve asi dva týdny iniciovaná, k iniciaci došlo samovolně, do šera vstoupila těsně před tím než by ji srazilo auto. Od té doby cítila, že když s někým mluví, má schopnost zlepšovat lidem náladu a často toho využívala. Také se naučila kouzlo Amnézie a použila jej na svojí matku a kočku (obě byly pouze lehce zmatené). Kouzlo v daném restauračním zařízení nešťastnou náhodou použila také na Temnou hlídkařku Annu Trnkovou, což nebylo považováno za útok (Světlá nevěděla jak kouzlo funguje). \r\n</p>\r\n<p>\r\nSvětlé mágyni byla vysvětlena Dohoda (následně na štábu také přečtena), bylo jí objasněno fungování Hlídek a Světlí jí nabídli patronát (je možné že se jí ujme světlá léčitelka Viktorie). Poté s námi dobrovolně odjela na štáb, kvůli hlášenému zásahu jsme se ještě zastavili na Mariánském náměstí, kde ovšem za naší přítomnosti k žádnému incidentu nedošlo. Na štábu byla mágyně zaregistrována a poté propuštěna. \r\n</p>\r\n', 0, 0, 2, 1, 1331334000, '17:00', '18:40', '<p>\r\nTemní: 1x vstup do šera,1x Opium \r\n</p>\r\n', 'Informace z analytického (momentálně k nim nemám přístup).\r\n'),
(45, 'kokot(i) na strahove', 1331510751, 45, 'dozor pri akci svetly, zblobivy bily mag ', 'Kokot u svelych ve sklepe.<br />\r\nVsichni mokry jak slepice.<br />\r\n<p>\r\nSvetly akci nezvladli a museli jsme vysvetlovat dohodu a vse podstatne. &nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', '<p>\r\nSvetly zmokli kokoti\r\n</p>\r\n<p>\r\nBude treba asistovat pri vyslechu svetleho kokota. Svazano serou prisahou.\r\n</p>\r\n', '<p>\r\n&nbsp;Koblize, Midfordova, Richar - dorazili na Strahov.\r\n</p>\r\n<p>\r\nByli tam tri svetly. (jmena doplnim)\r\n</p>\r\n<p>\r\nNasledne prisel Kokot&nbsp;&nbsp;Antonín Lidmánek&nbsp;&nbsp;ktery neco delal u prostred parkoviste u sloupu.&nbsp;\r\n</p>\r\n<p>\r\nSvetly videli 5tkovy stit a posrali se strachy. Dotycny tam vylecil nejakou slecnu s rakovinou. Pry to takto dela uz pres pul roku. O dohode zarite nic nevedel a odmital prijmout svet jinych. Nutno dodat, ze svetly nedokazali mu nic vysvetlit a tak se toho ujala Midfordova, ale proste Antonín Lidmánek (ten svetly Kokot) nechapal nic a branil se jak mala skolacka znasilneni.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;Prselo a byla zima. Kokot stale nic nechapal. A bylo na nem videt ze bude chtit vzit kramle jakmile pritlacime. Jenze situaci ridili svetly a chteli si snim povidat. Coz bylo divne kdyz mluvila hlavne Midfordova. Ja jsem sel do sera a pripraven dotycneho uspat.\r\n</p>\r\n<p>\r\nKovac mi dal opravneni v pripade nutnosti dotycneho pacifikovat. Bohuzel mi taky oznamil ze jejich skupina snim nic nezmuze a nevedeji co s nim pokud se jim postavi.&nbsp;\r\n</p>\r\n<p>\r\nDotycneho jsme tlacili k tomu ze nasedne k Midfordove do auta, tam teplo, udelaji registraci a bude... Na stab ke svetlym se mu taky nechtelo. Svetly tam okounely jak kachny.\r\n</p>\r\n<p>\r\nDotycny konecne nasel koule a seslal na vsechny kolem Freez a ocesal stity a skocil do sera a jal se utikat.\r\n</p>\r\n<p>\r\nKoblizek zdatny to bezec v seru ho bez problemu dohnal a uspal driv nez on Koblizka zmrazil.\r\n</p>\r\n<p>\r\n&nbsp;Pak nalozen k Midfordove do auta vsichni az na chudaka Koblizka a odjeli (virtualni CP, pac &nbsp;to muselo zitra je do plzne a nekdy kolem ctvrtka se vratit) na stab svetlych. Jeste predtim uzavreli pri seru za nocni hlidku dohodu, ze minimalne jednoho z nas k vyslechu prizvou.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1330556400, '23:30', '00:10', '<p>\r\nKoblizek - 1x sero, 1x opium\r\n</p>\r\n<p>\r\nKokoto mag - 1x sero, 1x Freez 5 osob, 1x stit 5 urovne&nbsp;\r\n</p>\r\n<p>\r\nKovac - 2x sero&nbsp;\r\n</p>\r\n<p>\r\nSpousta sundanych stitu&nbsp;\r\n</p>\r\n<p>\r\nsvetly a nekdo z temnych sero&nbsp;\r\n</p>\r\n', '<a style="direction: ltr; unicode-bidi: embed; text-decoration: none; color: #ffffdf; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: #ffffef; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999; padding: 0px; margin: 0px" href="http://www.mapy.cz/#q=strahov%20praha&amp;x=14.389853&amp;y=50.078599&amp;z=17&amp;qp=12.912272_49.827011_13.007204_49.880063_12&amp;t=s&amp;d=user_14.389484%2C50.077909%2C" class="postlink">http://www.mapy.cz/#q=strahov%20praha&amp;x ... .077909%2C</a><span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">čtvrť%20Praha%206%2C%20Praha%2C%20okres%20Hlavní%20město%20Praha~%2B%2F-%20tady_1</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Na tomhle místě se bude v udanou dobu vyskytovat podivný léčitel, který nemá licenci na zásahy. Prozkoumejte to.</span>\r\n'),
(46, 'Otevírání magických zřídel', 1331565696, 26, 'doprovodit vědmáka, najít zřídla', 'Našli jsme na hlavním nádraží vědmáka, člena silviova bratrstva. Rozluštili jsme hádanky toho chromého slepce, našli místa která potřeboval a &quot;odemkli&quot; jsme zřídla energie kde se dají například snadněji nabíjet amulety.\r\n', 'Boj o zřídla. Nepředvídaná událost ke které je toto předehrou.\r\n', '<p>\r\nNa hlavním nádraží jsme vyzvedli vědmáka který se vyjadřoval jen v hádankách. Dovezli jsme ho na štáb a když už nás z něj začínala bolet hlava, zjistili jsme kam chce dovést. Do zahrady Kinských ke dřevěnému kostelu.\r\n</p>\r\n<p>\r\nOdtamtud jsme pokračovali postupně na Vyšehrad, Střelecký ostrov, Bezručovy sady, Hvězdu a Vítkov (kde jsem už nebyl).&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331334000, '15:00', '22:30', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'Na hlavním nádraží sedí už několik hodin podivná postava. Zdá se, že je to jakýsi vědmák.&nbsp;<br />\r\nSice se kolem něj nic neděje, ale šílí mi tu pravděpodobnostní linky!&nbsp;<br />\r\n<br />\r\nMůžete se na něj jít podívat? Měl by se nacházet zhruba někde okolo Burger Kingu.&nbsp;<br />\r\nSice tam už pár hodin sedí, ale to neznamená, že ho tam můžete něchat čekat.&nbsp;<br />\r\nVypadá to, že by Vám mohl hodně prospět!\r\n'),
(47, 'Výslech upíra', 1331580532, 38, 'zjistit co ví', 'Upír byl vyslechnut, bylo shledáno, že vše proběhlo legálně, načež byl propuštěn.\r\n', 'Žádné.\r\n', '<p>\r\n<strong>Jméno a příjmení?</strong>\r\n</p>\r\n<p>\r\nKarel Nový, seržant 9.mechanizovaná divize.\r\n</p>\r\n<p>\r\n<strong>Zařazení</strong>\r\n</p>\r\n<p>\r\nUpír 5. kategorie.\r\n</p>\r\n<p>\r\n<strong>Události co předcházely zatčení.</strong>\r\n</p>\r\n<p>\r\nDostal povolení, nakrmil se. Poté příšli světlí a nařkli ho z napadení. Situace se odehrála u hotelu Vulkán na Praze 5.\r\n</p>\r\n<p>\r\n<strong>I obět?</strong>\r\n</p>\r\n<p>\r\nByl stáhnut do šera, v autě. Tam by neměly kamery vidět.\r\n</p>\r\n<p>\r\n<strong>Po objevení nočního hlídkaře se dělo co?</strong>\r\n</p>\r\n<p>\r\nBránil se zatčení, protože to považoval za neopodstatněné, tranformoval se a stáhl se.\r\n</p>\r\n<p>\r\n<strong>Potom?</strong>\r\n</p>\r\n<p>\r\nObjevila se i &nbsp;Denní, noční hlídka zautočila trojitým ostřím, denní freezem.\r\n</p>\r\n<p>\r\n<strong>Dále?</strong>\r\n</p>\r\n<p>\r\nHlídky se dohadovaly, kdo ho zatkne. Na požádání DH se odtransformoval. Pan Miller v tranformaci vrčel na vyslýchaného, necítil se bezpečně.\r\n</p>\r\n<p>\r\nNásledovalo vystoupení ze šera. Ukázal licenci, zbavili se těla. Člen DH vyslýchaného vtáhl do druhé hladiny a utekli na štáb DH\r\n</p>\r\n<p>\r\n<strong><em>Konflikt ohledně zatknutí jsou kvůli přelomu jurisdikcí.</em></strong>\r\n</p>\r\n<p>\r\n<strong>Byl jste na lovu, prokázal jste se povolením, takže nevidím nic závažného.</strong>\r\n</p>\r\n<p>\r\n<strong><em>NH nemá námitek.</em></strong>\r\n</p>\r\n<p>\r\nCitíl jsem se dotčený, že jste mě nařkli ze zabití třech lidí místo jednoho.\r\n</p>\r\n<p>\r\n<strong>Pro DH je vše legálně a v pořádku. Takže je možnost vše uzavřít.</strong>\r\n</p>\r\n<p>\r\n<strong><em>Z hlediska NH nápodobně.</em></strong>&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;(Pan Maršík po výslechu omdlel, usnul nebo co se to vlatně stalo)\r\n</p>\r\n', 0, 0, 2, 2, 1331506800, '20:00', '20:30', 'veškerá žádná\r\n', '--------\r\n'),
(48, 'Bolíto to bolí', 1331632207, 22, 'Zastavit Bolíta od utoka na staba', 'Bolíto gledal Richarda, nenasel, gledal Alexandera, chatěl vyzvat, Alexander se uklidil domoj, Bolíto chotel na staba zautocit, nekogo tam zajmut, zabit, donutit Alexa k duelu. Andrej a Krista helfnuli, Bolito odvracen.\r\n', '<p>\r\nBolito to bude pazkusat znovu. Budet utocit na temnyje, na dozoristy. Nuzno jego vyresit - nejjednodussi Alex v duelu.\r\n</p>\r\n<p>\r\nOstuda, sto misto sefa nam prdel zachranuje Nocni.&nbsp;\r\n</p>\r\n', '<p>\r\nBolito volal menje, pak nasel v Zulu. Chotel sehnat Richarda, no ten ve Hvozdu. Tak chotel Alexandera, potomu sto nespokojeny s rozsudkom.\r\n</p>\r\n<p>\r\nJa pozvonil Alexandera, no Alex poslal do haje menja, sto ja magu Bolitovi dat na nego kontakta. Pak Bolito pozvonil Alexandera, no on mu to tipnul. Bolito nasrany vypadl.\r\n</p>\r\n<p>\r\nPak my nastesti dostali tipa od svetlych, sto Bolito miri na staba nasego a chocet ili Alexandera ili nekogo jinego. Ja pozvonil Alexandera, sto nuzno branit staba - no Alex mi to tipl.&nbsp;\r\n</p>\r\n<p>\r\nMy posbirali s Hradilom i Sakeenu, vyrazili branit staba. Ja pozvonil Andreja, on tam vyrazil s Kristu - byla jejich jurisdikcia a navic oni byli bliz. Na stabu v tu dobu tolko Eva, Chelcicky a Kaspar.&nbsp;\r\n</p>\r\n<p>\r\nKus od staba menja pozvonil Andrej, sto pred stabom cihal Bolito a ze jego presvedcili, ze ma vypadnut a nechat to byt. No varoval nas, sto on nekde v okoli. Bolita my potkali, Andrej a Krista byli na dohled. Bolito nezautocil, odesel.\r\n</p>\r\n<p>\r\nJa pakupil Andrejovi panaka na blagodarnost.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331593200, '22.00', '23:00', 'Vazmozno sto nicego.\r\n', 'Informacie od Bolita i od svetlych.\r\n'),
(49, 'Zpackana Vltavska', 1331727927, 22, 'Poresit suboj s Bolitom', 'Ve Stromovce glaseno velke cerpani, Alex pozval Bolita na Vltavsku, sto daju duela, Bolito dorazil i s Cernym a obratenom iz Pariza, zautocili, nekatoryje posekali, Alex zdrhl, oni taky. Na govno.\r\n', '<p>\r\nPozkusaju znovu a znovu.\r\n</p>\r\n<p>\r\nVazmozno ze Andrej ili Alfred budu chotet nagrady za leceni.\r\n</p>\r\n', '<p>\r\nDo Stromovky bylo glaseno cerpani bolsoje. No u nas byli informacie, sto ve Stromovke pruser veliky budet, navic informacie, sto Bolito chysta akciju. Tak my potkali dogromady u Vystavista a domluvili - Alex Bolita vyzve na duela, kak Bolito chotel.\r\n</p>\r\n<p>\r\nOni domluvilisja po telefone, sto za pul godiny na Vltavske.\r\n</p>\r\n<p>\r\nMy dojechali na Vltavsku, tam pocekali. Pozvali svetle (dorazil Andrej), potkali tam inkvizitora, tak jego taky prizvali, aby bylo vsechno cisto. Pak cekali.\r\n</p>\r\n<p>\r\nPak dorazil v sumraku Bolito i s Cernym a FRANTIKEM - obratenom iz Pariza. Rovnou zacali kouzla sesilat, ticho, spanek, betlemsky ohen. U Cernego dyka ze sera, u Bolita maguv mec. Zautocili na Alexa i na Silviju, Alex spustil snad vsechny amulety sveta, aby prezil, pak Bolito posekal i Chelcickego. Menje bylo dolzno za roh, aby mi bylo vazmozno kudly vytahnut. Mezitim Alex zdrhl, oni jego pronasledovali, no nebyli dost rychli. Alex vratilsja.&nbsp;\r\n</p>\r\n<p>\r\nCele posmotrel Kaspar i Andrej, vazmozny svedky.&nbsp;\r\n</p>\r\n<p>\r\nAndrej transferom zvedl zmlacenu Silviju.&nbsp;\r\n</p>\r\n<p>\r\nMy aury posbirali, ranene pobrali a vyrazili na staba. Po ceste zase potkali Bolita s Cernym, no vyhli se jim. Odjechali my smer stab, po ceste jeste resili vlkodlaky v Bezrucakoch.\r\n</p>\r\n<p>\r\nAlex na stab vykaslal, jel srustat domu s Garretovu. Ostatni srustali na stabu, pomogli svetlyje - Viktoria i Alfred.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331593200, '20:00', '21:30', '<p>\r\nNo tam takovy bordel, ze eto nevazmozno sledovat.\r\n</p>\r\n<p>\r\nByli od Cernego Bengalske ohne, v seru kdekdo, ja tahal kudlu. Mnogo.&nbsp;\r\n</p>\r\n', '<div>\r\nAnalyticke:&nbsp;\r\n</div>\r\n<div>\r\nPozor, hlásím velké čerpání energie v oblasti mostu ze stromovky na císařský ostrov (ul. Za elektrárnou)\r\n</div>\r\n<div>\r\nGPS: 50&deg;6''38.775&quot;N, 14&deg;25''4.810&quot;E\r\n</div>\r\n<div>\r\ndávejte bacha, mohlo to být pěkně nebezpečné\r\n</div>\r\n<div>\r\n&nbsp;\r\n</div>\r\n<div>\r\nNo u nas dalsije informacije od kontatkov.&nbsp;\r\n</div>\r\n'),
(50, 'čerpání na letné', 1331797301, 47, 'prověřit', 'Bolíto měl čerpat u Kyvadla, neukázal se, protože nás tam bylo moc...\r\n', '<p>\r\nBolíto si načerpá jinde\r\n</p>\r\n<p>\r\nVzhledem k tomu, že na mě má telefon, každou chvíli volá a očividně si rád povídá a těší se na &quot;intenzivnější&quot; rozhovor, půjde teď po mně \r\n</p>\r\n', 'Nejdřív se mi nedařilo dát dohromady tým, ale nakonec jsme ke kyvadlu vyrazili já a Chelčický, posléze se přidal i Koblížek. Od Maršíka jsem zjistila, že na akci vyráží i tým Světlých pod vedením Alfréda. Dorazili na místo dřív, tak jsem je upozornila ať nzasahují, pouze nenápadně pozorují a snažila se přimět tramvaj k ryhclejšímu pohybu, bez úspěchu. Cestou mi volal Bolíto, aby mě upozornil, že na Letné bude čerpat, cituji:&quot;kdyby náhodou Denní Hlídka chtěla plnit svou povinnost&quot;. Každopádně, když jsem dorazila ke kyvadlu, Světlí tam stáli vystavení jako ve výkladní skříni a velice &quot;nenápadně&quot; v chumlu hlídali... Přesně podle očekávání mi Bolíto pár minut nato zavolal, že se přesouvá jinam. Jinam znamenalo Strahov, kde podle analytiky měl načerpat asi 400 mg - došli jsme k závěru, že tam teda nejedem, i když se to Bolítovi nelíbilo. Nejspíš se mi ještě ozve a bude se chtít potkat, to mě skutečně těší...\r\n', 0, 0, 2, 1, 1331679600, 'cca 14:15', '14:45', 'nula nula nic\r\n', 'Je očekáváno velké čerpání energie u Kyvadla!\r\n'),
(51, 'Divnej Vlkodlak', 1331938105, 26, 'Zkontrolovat co dělá vlkodlak', 'Dlouho jsme hledali vlkodlaka. Nakonec jsme ho přeci jen našli okolo Vítkova. Zbili ho světlí hlídkaři co ho našli první. Vlkodlaka jsme posbírali a odvezli na štáb.\r\n', 'Vkodlak na štábu, neschopný výslechu. Světlí mu mohli něco šlohnout, protože byli na místě první.\r\n', 'Na šestou jsme vyrazili na Vítkov, kde jsme kvůli zmatkům na analytickém prolezli snad každou díru a tunel. Nakonec jsme konečně našli toho vlkodlaka ale už nad ním stáli Miler se Šulcem a tvářili se kysele. Vlkodlak před nimi začal utíkat, tak ho napadli, bránil se ale marně. Ubili ho a potom trochu dali dohromady. Vysypali všechny jeho věci a je možné, že si přivlastnili něco z jeho věcí. Vkodlaka nám přenechali a odešli. Silvie ještě poléčila Milera, protože by ho jinak musela sežrat.\r\n', 0, 0, 2, 1, 1331852400, '18:00', '19:30', '<p>\r\n<strong>Temní</strong>&nbsp;\r\n</p>\r\n<p>\r\n1x Dlaha (Silvie Krásnohorská) 20 magů\r\n</p>\r\n<p>\r\n<strong>Světlí&nbsp;</strong>\r\n</p>\r\n<p>\r\n1xDlaha\r\n</p>\r\n<p>\r\nX krát neurální úder\r\n</p>\r\n<p>\r\nněčim zvedli vlkodlaka&nbsp;\r\n</p>\r\n', 'Přístroje mi tu ukazují vklodlaka se zvláštní energetickou stopou. Skoro na stejném nístě jako včera. GPS50.0932739N, 14.4683981E. Zkontrolujte ho, ale buďte opatrní.\r\n'),
(52, 'Bili blazen', 1331943520, 45, 'zajistit bileho maga', '<p>\r\nBili mag 4 kategorie z Druhe strany mince, bratr Korteze, zajisten ve sklepe a ceka na dalsi vyslech. Lidska zena dostala dozivotni amnezii.&nbsp;\r\n</p>\r\n', '<p>\r\nVyslech zadrzeneho telepaticky, dat &quot;VCAS&quot; vedet svetlym....&nbsp;\r\n</p>\r\n<p>\r\nUplne vysosany Koblizek&nbsp;\r\n</p>\r\n', '<p>\r\nDorazili jsme na k psychiatricke lecebne v Bohnicich a v parku uvideli dve podezrele osoby.&nbsp;\r\n</p>\r\n<p>\r\nRozmistili jsme se ve stinech podel parku.\r\n</p>\r\n<p>\r\nZrozhovoru bylo jasne ze dotycny slecne odkryva kompletne svet jinych a bylo i zrejme, ze aby ji presvedcil udela prakticke ukazky.\r\n</p>\r\n<p>\r\n&nbsp;Anny oba zmrazila. \r\n</p>\r\n<p>\r\nProskenovali jsme typka:\r\n</p>\r\n<p>\r\nJohny Kortez, Světl mág 4. kategorie<br />\r\nU sebe mel semtex s dalkovym odpalovanim, mec a dopis s hadankami.\r\n</p>\r\n<p>\r\nJeste ze jsme ho zmrazili. Puvodne jsme chteli seslat na slecnu amnezii ale nebyli jsme si jisti, jestli by stacilo vymazat usek 15 minut. Tak jsme overili dostupnost licenci a Silvie mela zajistit ze slecna si nic uz pamatovat nebude a ze to nikomu nerekne.\r\n</p>\r\n<p>\r\n&nbsp;V té době už na místo dorazila světlá hlídka, Vladimir Kovac a ten obraten ve svetle bunde.\r\n</p>\r\n<p>\r\nV momente &nbsp;kdy rozmrzli Silvie usmala slecnu a ja se pokusil uspat Korteze. Kortez ignoroval spanek a rozbehl se pryc.&nbsp;\r\n</p>\r\n<p>\r\nZacal jsem bezet zanim a vstoupil do sera. I kdyz jsem stinochodec, tak dotycny v realite stale pelasil o sto sest. Hradil na nej seslal freez, ale ten tez nezaucinkoval.... divne... Dotycneho nejlepe poslat na vyzkumne oddeleni.\r\n</p>\r\n<p>\r\nDobehl jsem ho i tak seslal na nej spanek znovu. Tentokrat uz zaucinkoval.\r\n</p>\r\n<p>\r\nNalozili jsme ho do auta a prevezli na stab&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331938800, '21:05', '21:20', '<p>\r\n2x Freez Mitfordova\r\n</p>\r\n<p>\r\n1x Freez Hradil\r\n</p>\r\n<p>\r\n1x Sero Koblizek\r\n</p>\r\n<p>\r\n3x Opium Koblizek\r\n</p>\r\n<p>\r\n1x Opium Silvie\r\n</p>\r\n<p>\r\n1x Zahviho pouta Koblizek&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Vzhledem k tomu, jak mi tu trojčí pravděpodobnostní linie, se bude dnes večer kolem 21:15 pohybovat okolo Bohnické léčebny Světlý Jiný se svou NEJINOU průvodkyní. Je dost možné, že se jí pokusí nějak zmanipulovat. Zajistěte, aby se jí nic nestalo, a zjistěte, o koho přesně jde.&nbsp;</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Měl by se pohybovat zhruba na těchto souřadnicích 50.133250, 14.424005</span>\r\n'),
(53, 'Bili blazen vyslech', 1331975058, 45, 'Johny Kortez (Cortez)', '<p>\r\nJohny Kortez<br />\r\nsvetly mag 4 kategorie, cerstve iniciovany<br />\r\nclen druhe strany mince, nebyla mu vysvetlena dohoda a chce zabijet vsechny jak svetle tak temne\r\n</p>\r\n<p>\r\n&nbsp;Blazen, agresivni. Prenechan na telepaticky vyslech&nbsp;\r\n</p>\r\n', '<p>\r\nZjistit jestli neco vic nevi o basniccce na pergamenu co mel u sebe.\r\n</p>\r\n<p>\r\nZjistit kontakty na radikaly druhe strany mince\r\n</p>\r\n<p>\r\nKontaktován temný vědmák bratr Pedro Kortéze &nbsp;(silvie)\r\n</p>\r\n', '<p>\r\nJohny Kortez, mag 4 kategorie, svetlo\r\n</p>\r\n<p>\r\nMá bratra &nbsp;Pedra Korteze. Chce ho zabít.\r\n</p>\r\n<p>\r\nChce zabít všechny temné i světlé.\r\n</p>\r\n<p>\r\nSvětlý podle něj narušují morálku světa (temní prý taky, ale ti to mají v popisu práce)\r\n</p>\r\n<p>\r\nByl vycvicen druhou stranou mince. Nezna dohodu a po vysveleni ji odmita uznat.\r\n</p>\r\n<p>\r\nJe to blazen a fanatik. \r\n</p>\r\n<p>\r\nVelmi agresivni. Doporucuji dale vyslychat svazaneho - ruce, nohy. a posadit na nej vlkodlaka ci upira aby ho drzel.\r\n</p>\r\n<p>\r\n&nbsp;Po te co vylil na silvii kofolu jsme vyslech projistotu prerusili, aby ho nezabila na miste. Uspaneho jsme ho eskortovali do kobek.&nbsp;\r\n</p>\r\n', 0, 0, 2, 2, 1331938800, '21:55', '22:20', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(54, 'Donald a Donald (double trouble)', 1331995059, 47, 'podívat se, jak do sebe dva vlci řežou hlava nehlava', 'Donald (obrateň) se porval s bráchou Donaldem (vlkodlak). Prý čestný duel, spousta keců, atakdále...\r\n', '<p>\r\nzase nějaká ta žaloba od Světlejch - jebat je všechny do ucha...\r\n</p>\r\n<p>\r\nDonaldův brácha se nějakou dobu možná zdrží (vlkodlak 2. kategorie)\r\n</p>\r\n<p>\r\nnasranost přítomných denních hlídkařů \r\n</p>\r\n', 'Na akci jsme vyrazili ve složení já, Richard, Eva a Silvie. Ve Stromovce jsme se po chvíli rozdělili do dvojic, abychom efektivněji prohledali místa, kde se měl Donald vyskytovat. Mě a Evě se přilepili na paty Miller a Kuncová... Miller by se měl konečně propadnout někam do kanálu. Každopádně, když jsme Donalda uviděli, už na sebe s tím druhým řvali a pak zmizeli v šeru. Skočila jsem do šera taky, to už byli ti dva vzteklí čoklové v sobě, a chvíli jsem uvažovala o tom, že je nechám vzájemně si rozbít držku a budu jen koukat, jak to dopadne. Nakonec jsem je ale oba freezla, toho druhýho jsem proskenovala (vlkodlak, 2.kategorie, Donald MacGillavry)... Pokorou jsem je pak uvolnla z freezu a když začali bejt vzteklí a držkovat, tak jsme jim oběma nasadila Záhvího pouta. Ve výsledku jsem je ale nakonec pustila, protože nás ani jendoho fakt nebavilo se snima hádat a stejně bysme z nich na štábu nic nedostali. Ve výsledku se oba dva, poškrábaní a pokousaní, procházeli po Stromovce mezi lidma a šli an pivo...Hurá... A porvali se prej kvůli tomu, že se nepohodli kvůli nějakému Donaldovu výzkumu...Jo, a jestli si na mě Miller ještě jednou v budoucnu otevře hubu, tak ho do nějakýho kanálu propadnu osobně.\r\n', 0, 0, 2, 1, 1331938800, '13:30', 'cca 15:00', '<p>\r\n1x šero (Sakeena)\r\n</p>\r\n<p>\r\n2x freeze (Sakeena)<br />\r\n</p>\r\n<p>\r\n2x Záhvího pouta (Sakeena)\r\n</p>\r\n<p>\r\n2x Pokora (zboření freezu) (Sakeena)\r\n</p>\r\n<p>\r\n60mg energetická dotace pro Evu (Silvie) \r\n</p>\r\n', 'Hele, něco mi tu běhá...<br />\r\n<br />\r\nKolem jedné hodiny odpolední to vypadá, \r\nže se chce Donald (byl propuštěn z vazby) utkat s vlkodlakem na jedné z \r\ntěchto dvou souřadnic<br />\r\n<br />\r\n50.106846, 14.423150<br />\r\n<br />\r\n50.105944, 14.425800<br />\r\n<br />\r\nPodívejte se na to a dejte vědět, jak to dopadlo.info z analytického atd.\r\n'),
(55, 'Upír - Na Santince', 1331998529, 38, 'zadržet upíra', 'U zastávky Na Santince řádil upír. Pocuchal pár světlích načež byl zadržen.\r\n', 'Těžko říct.\r\n', '<p>\r\nKdyž jsme dorazili na místo, tak už upíra drželi v Zavího poutech světlý. Sami byli dost usmžení, jak jsem se dozvěděl od fireballů. Upír vypadal dost vyšinutý, to bude důvod proč zaútočil na světlý.\r\n</p>\r\n<p>\r\nPo krátkém dohadování jsme světlým jsaně vysvětlili, kdo si ho odvede na štáb.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331679600, '18:30', '19:00', '<p>\r\nTemní\r\n</p>\r\n<p>\r\nFireball - neznámo kolik\r\n</p>\r\n<p>\r\nDH\r\n</p>\r\n<p>\r\nnic\r\n</p>\r\n<p>\r\nNH\r\n</p>\r\n<p>\r\npotvrzené 1x šero\r\n</p>\r\n<p>\r\n2x šerá motlidba&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Z pravděpodobnostní linii my tu vychází lov nějakého slabšího upíra jeďte to zkontorlovat. Měl by se nacházet v okolí zasávky Na Santince.</span>\r\n'),
(56, 'Upír - NTK', 1331998909, 38, 'vyřešit upíra', 'Hlašený upír, nakonec se ani neukázal\r\n', 'Těžko říct\r\n', 'Dorazili jsme na místo, kde na nás čekali hlídkaři které jsme ani nečekali, takže nás tam bylo ve výsledku asi sedm, světlí na tom byli úplně stejně. Po značné době strávené na míste jsme se usnesli, že se upír takového počtu hlídkařů jistě všiml a proto nepřišel. Akci jsme tudíž odvolali.\r\n', 0, 0, 2, 1, 1331679600, '21:00', '21:50', '<p>\r\nDH\r\n</p>\r\n<p>\r\n2x šero\r\n</p>\r\n<p>\r\nNH\r\n</p>\r\n<p>\r\ntaky nějaké šero&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Zvláštní energetikou stopu upíra či vlkodlaka očekáváme ve 21:00 v okolí zastávky Želivského mělo by to být v okolí fontány. Dbejte zvýšené opatrnosti!</span>\r\n'),
(57, 'Rituál na Vyšehradě', 1331999914, 38, 'Přežít', '<p>\r\nRituál na vyvolání Protegona, velmi velké riziko příchodu White Fist a následného střetu. Nic naštěstí tak dramaticky neproběhlo.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', '<p>\r\nNo od toho že White Fist znovu sfanatizuje Protgeno, i když je teď o dost slabší, po to že se Protegon umoudřím a budeme ho moc použít jako prostředníka pro vyjednávání.\r\n</p>\r\n<p>\r\nNějaký průser z toho nešetrnýho sání. &nbsp;\r\n</p>\r\n', '<p>\r\nNa štábu proběhlo zbrojení takřka kolosálních rozměrů, vypadalo to skoro na pochod do války, čekali jsme White Fist, takže to bylo na místě. Proběhlo rozdělení do skupin, přiřazení ukolů. Před tím než jsme vyrazili, šlo několik hlídkařů dost nešetrně čerpat energii.\r\n</p>\r\n<p>\r\nDorazili jsem na místo a našli jsme si úkryt, kde jsme počkali na Charistrcha. Mezitím se kolem prohnal Donny. Zadželi jsme ho a zpoutali.\r\n</p>\r\n<p>\r\nKdyž Charistarch přišel, rozmístili se týmy na pozice a já jsem se jal připravovat vyvolávací kruh.&nbsp;\r\n</p>\r\n<p>\r\nJelikož byli na místě už i světlý, mohlo se začít s vyvoláváním. Fitová souhlasila že &quot;pomůže&quot; s vyvoláváním. Mezi tím se objevil Bolíto a několik jeho nohsledů. K boji nedošlo, jenom nějaké ostré rozhovory.\r\n</p>\r\n<p>\r\nVyvolání proběhlo úspěšně, Protegon se vrátil... do telá slečny Feitové. Světlý ani nepoděkovali.\r\n</p>\r\n<p>\r\nNásledovalo ještě hodně rozhovorů s Charistarchem, Bolítem, Svělými.\r\n</p>\r\n<p>\r\nKdyž jsme dorazili na štáb, vše jsme oslavili vodkou a okurčičkami.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331766000, '20:30', '23:00', '<p>\r\nTemní\r\n</p>\r\n<p>\r\nspoustukrát šero\r\n</p>\r\n<p>\r\nspoustukrát druhé šero\r\n</p>\r\n<p>\r\nzávího pouta\r\n</p>\r\n<p>\r\nrituál\r\n</p>\r\n<p>\r\nSvětlí\r\n</p>\r\n<p>\r\ntaky nějaké to šero&nbsp;\r\n</p>\r\n', 'Brainstormig na štábu\r\n'),
(58, 'Prokletá', 1332016787, 37, 'Odklít', 'Prokletá asistentka stavební firmy\r\n', '<p>\r\nMožné spojení s magistrátem\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', '<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:HyphenationZone>21</w:HyphenationZone>\r\n<w:PunctuationKerning/>\r\n<w:ValidateAgainstSchemas/>\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables/>\r\n<w:SnapToGridInCell/>\r\n<w:WrapTextWithPunct/>\r\n<w:UseAsianBreakRules/>\r\n<w:DontGrowAutofit/>\r\n</w:Compatibility>\r\n<w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n</w:WordDocument>\r\n</xml><![endif][if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState=&quot;false&quot; LatentStyleCount=&quot;156&quot;>\r\n</w:LatentStyles>\r\n</xml><![endif][if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:&quot;Normální tabulka&quot;;\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-parent:&quot;&quot;;\r\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\nmso-para-margin:0cm;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:#0400;\r\nmso-fareast-language:#0400;\r\nmso-bidi-language:#0400;}\r\n</style>\r\n<![endif]-->\r\n<p class=&quot;MsoNormal&quot;>\r\n<span>Sle</span>čna Cecílie Vranovská&hellip; bydlící pod zvonkem Lukačovičová před 14 dny ještě chodící s&nbsp;Tomášem.\r\nTomáš nechtěl děti&hellip; Slečna pracuje jako asistentka/sekretářka stavební firmy.\r\nNaposledy se nějak chytla se subdodavatelem. Vyhrožoval soudem apod. pak se to\r\nuhrálo na nějaký Status Quo.\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\n&nbsp;Špatně jí bylo týden, ale nějakou markantní událost PŘESNĚ\r\npřed týdnem si nepamatovala. Když mi šla dolů otevřít, vypadala jako člověk,\r\nkterý celý den nepil (nealko). Při dělání čaje už zase přepnula relativně do\r\nnormálu. A pak doběhla ke dveřím, pořádně je zamkla, pak běžela k&nbsp;balkonovým\r\ndveřím a říkala, že tam někdo je, že ho cítí. Zrovna když jsem ji uspala, šerem\r\nvešla Tafetová, Hradil a Tesařová a začalo se s&nbsp;odklínáním. To způsobil vědmák/vědma 5. kategorie.\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\n&nbsp;\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\nTo se podařilo (hoooray!) a ti tři zase zmizli šerem.\r\nNásledný scan ukázal, že je v&nbsp;pohodě.\r\n</p>\r\n', 0, 0, 2, 1, 1331938800, '19:30', '20:40', '<p>\r\n1x šero (Hradil, Garetová)\r\n</p>\r\n<p>\r\nodklínání&nbsp; (Garetová)\r\n</p>\r\n<p>\r\n7x opium (Krásnohorská)\r\n</p>\r\n<p>\r\n1 Freeze (Garetová) \r\n</p>\r\n<p>\r\nSvětlý&nbsp;\r\n</p>\r\n<p>\r\n2x šero (Tesařová) \r\n</p>\r\n', '<p class="author">\r\n<a href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=295#p295"><img src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target_unread.gif" alt="Nový příspěvek" title="Nový příspěvek" width="11" height="9" /></a>od <strong><a href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=60">Analytik_Asistent</a></strong> &raquo; sob 17. bře 2012 18:25:14 \r\n</p>\r\n<div class="content">\r\nZdravím, mám tu hlášku na prokletého člověka. Linie mi to vyhazují na adrese Valčíkova 8, Praha.<br />\r\nJe to zastávka autobusu Rokoska. Zvoňte na zvonek se jménem Lukačovičová. <br />\r\nJe u sebe doma. Podívejte se na ní a zjistěte, co se stalo.\r\n</div>\r\n'),
(59, 'Teambuilding', 1332036279, 22, 'Dostat sja na cerstvy vzduch', 'Bitka kompletna, vsichni nadseni, svetli ksichti protalhi.\r\n', '<p>\r\nSvetli tak nasrani, ze vazmozno podaji zalobu.\r\n</p>\r\n<p>\r\nTymovy duch pozvednuty.&nbsp;\r\n</p>\r\n', '<p>\r\nMy kvery posbirali a do Riegeracu vylezli. Silvia s Alexom pohadala, do ksichta mu to nasazela, Alex ji taky nesetril. Silvia Alexa na duela vyzvala - podminky: tymy sestavene z dozoristu, tri na tri na svetlene kvery. Ohromna junda.\r\n</p>\r\n<p>\r\nJeste par bitek jsme dali, pak konecno svetli dorazili, ksichty protazene. Alex odjechal, tak ja se Silviju pohadali a na duela vyzvali. Stejne podminky. Bitka jako svina. A do tego svetli okolo obchazeli, v seru, venku, cihali, sto se semele. Semleli jsme se my. Dali jeste odvetu.\r\n</p>\r\n<p>\r\nPak my svetlich vytahnut na bitku zkusili, ze maji tym postavit. Nekatorije, Miller jmenovito, zjevno by radi dali, ale Viktoria zatrhla. My do nich jeste chvili kerovali a pak to zabalili.\r\n</p>\r\n<p>\r\nPred barakom jeste prijechali svetli a skenovali Temnego. Pak odtahli.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1332025200, '01:00', '3:00', '<p>\r\nTemni&gt; 3x sero, 1x freeze\r\n</p>\r\n<p>\r\nSvetli&gt; n x sero\r\n</p>\r\n', 'Je treba si zablbnut, at z teho nezblbneme.\r\n'),
(60, 'Šifra mistra Kašpara', 1332080894, 48, 'Prozkoumat větší čerpání energie na Křižíkové', 'Dostali jsme echoo, že někdo čerpá příliš energie u azylového domu na křižíkové, tak jsme to jeli prošetřit. Nakonec se ukázalo, že to byl Kašpar a měl povolení. Case Closed.\r\n', 'Jestli chcete míít někdo oplétačky s Inkizicí, tak možné dopady doplňte do poznámek.&nbsp;\r\n', '<p>\r\nAť si říká, kdo chce, co chce,\r\n</p>\r\n<p>\r\nKašpar chlemtá bezdomovce.\r\n</p>\r\n<p>\r\nHlášeno je před Azylem,\r\n</p>\r\n<p>\r\nkdos tu šňupe velkým stylem.\r\n</p>\r\n<p>\r\nChelčický a Koblížek,\r\n</p>\r\n<p>\r\nna záhadu mají lék - \r\n</p>\r\n<p>\r\naniž uhnali si kýlu,\r\n</p>\r\n<p>\r\nAdam houkne do mobilu,\r\n</p>\r\n<p>\r\nzda to jeho práce není,\r\n</p>\r\n<p>\r\nSoudce dá své potvrzení.\r\n</p>\r\n<p>\r\nA tak končí se ta sága,\r\n</p>\r\n<p>\r\nnejde o krutého mága.\r\n</p>\r\n<p>\r\nHlídka se víc nestará,\r\n</p>\r\n<p>\r\nje tam aura Kašpara.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1331593200, '14:30', '16:00', 'Chelčícký - 1x Pravdivé vidění\r\n', 'Prověřit velké energické čerpání u azylového domu na křižíkové.\r\n'),
(61, 'cerpani bezrucovy sady', 1332192725, 52, 'kontrola', 'kontrola nepovoleneho ceprani. Na miste byli svetli a dva Jini. nebyla zjistena zadna ilegalni aktivita\r\n', 'Nic jsme nenasli, coz je podezrele. Neni mozne vyloucit, ze dve podezrele osoby chteli pachat {nebo jiz spachali} nekale aktivity.\r\n', 'Na miste jsme zjistili pritomnost dvou podezrelych osob a zastupce nocni hlidky. Podezrele osoby tvrdili, ze provadeji kontrolu magicke aktivity a vedecke mereni situace. Meli sebou zvlastni pristroje {blize nespecifikovano}. nocni hlidka provedla scanovani obou Slatkich.\r\n', 0, 0, 2, 1, 1332111600, '22:00', '22:30', '2x prvni sero\r\n', '<div class="topic-actions" style="margin-top: 0px; margin-right: 0px; margin-bottom: 3px; margin-left: 0px; height: auto; min-height: 28px; background-color: #333333; padding: 0px">\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Poblíž kostela u Kafárny na kus řeči je očekávano čerpání energie. čas je odhadován na 21:45-22:0</span>\r\n</div>\r\n'),
(62, 'Smith and Wesson', 1332231373, 47, 'prověřit a zajistit', 'Dva mágové prováděli nějaký pochybný rituál, při kterém si vyměnili těla a po němž si nepamatují posledních 20 let.\r\n', 'možná souvislost s Donaldem a jeho &quot;výzkumy&quot;??\r\n', '<p>\r\nNa místě jsme už narazili na Noční Hlídku, kterou jsme s úsměvem a máváním předjeli autem, ale dohnali nás, když jsme parkovali. Filip hned sprdnul Kuncovou, že je moc hlasitá (což byla) a řekl jí, ať se se svojí bandou drží dál od nás. Pak jsme s Filipem vyrazili dopředu a po krátkém obhlédnutí lokace jsme našli dva Jiné, provádějící jakýsi rituál. Filip vešel do šera, já ty dva jménem Denní Hlídky vyzvala, aby se legitimovali. Když nereagovali, oba dva jsem zajistila freezem a posléze Záhvího pouty. \r\n</p>\r\n<p>\r\nPodle prvního scanu se jednalo o dva mágy 3.kategorie, Světlého a Temného, oba nabité energií (analytika ještě vyhodila hlášení o sání energie v Kobylisích, později jsme zjistili, že to byla práce právě těchto pánů, jak jsme předpokládali) Vysvětlili nám, že tu chtějí provést rituál, kterým by si prohodili těla. Filip jim řekl, že pokud to chtějí dokončit, mají se vzájemně vyzvat na duel a jako podmínku duelu udat právě dokončení rituálu, což udělali.&nbsp; \r\n</p>\r\n<p>\r\nRituál proběhl úspěšně, oba pánoví se skutečně prohodili, ale byli velice zmatení, netušili, jak se dostali do Prahy, nepamatovali si, že by byli v těle toho druhého. Jejich poslední vzpomínka byla na nějakou hospodu v Karlových Varech před dvaceti lety. Rituál je taky připravil o tři kategorie, dál se projevovali jako šestky, svůj kategoriální vzestup si nepamatují, stejně jako cokoli dalšího z posledních 20ti let. \r\n</p>\r\n<p>\r\nOba pány si převzala NH a odvezla si je k sobě na štáb, my jsme pouze na místě zaregistrovali Světlého Adama Smithe,mága 6. kategorie. Temný se jmenuje Karel Wesson, taktéž mág 6. kategorie. Výslechu na štábu Světlých jsme se zúčastnili také, Eva se oběma pánům pohrabala v hlavě, ale nezjistila nic, jen potvrdila to jejich 20lété okno. \r\n</p>\r\n', 0, 0, 2, 1, 1332025200, 'cca 21:30', 'něco po 22.', '<p>\r\n1xšero (Ragulin)\r\n</p>\r\n<p>\r\n2x freeze\r\n</p>\r\n<p>\r\n2x pokora (rozbití freezu) \r\n</p>\r\n<p>\r\n2x Záhvího pouta \r\n</p>\r\n<p>\r\n2x scan \r\n</p>\r\n', 'Přístroje mi tu ukazují magickou aktivitu pravděpodobně dvou až tří mágů v okolí lokace 50.138013,14.403602 buďte opatrní jedná se zřejmě o konflikt\r\n'),
(63, 'Golem u NTK', 1332232946, 47, 'prověřit', 'Měli jsme prověřit napadení člověka, ve výsledku to skončilo napadením mě. Jinak se jednalo o Světlého mága s golemem.\r\n', '<p>\r\nžaloba na toho Světlého\r\n</p>\r\n<p>\r\nmožná z něj vytáhneme i něco dalšího, tvářil se, že má co tajit \r\n</p>\r\n<p>\r\nzjistit, kdo mu toho golema vyrobil \r\n</p>\r\n', 'Ve složení Li, Filip, Aleš a já jsme hlídkovali kolem NTK se Světlýma za zadkem. Na podezřelého narazili nejdřívě Světlí, ale kupodivu nám ho bez keců přenechali. Jednalo se o Světlého, bílého mága 4.kategorie, představil se jako Tomáš Pokorný. A jen tak mimochodem si s sebou v šeru vodil golema (hliněný, 3. kategorie). Dtyčného jsme sledovali, protože odmítl sdělit, co na místě dělá a nebyl přístupný jakékoli domluvě. Vzhledem k tomu, že pravděpodobnostní linky mluvily o možném napdení člověka &quot;něčím zvláštním&quot; (díky Krausi, příště napiš prostě golem =) ), nabídl Filip panu Pokornému několik možností, od šeré přísahy, že jeho golem nikoho nenapadne, pokud se pan Pokorný nebude potřebovat bránit, přes podání vysvětlení u nás až po zničení golema. Nic z toho se panu Pokornému nezamlouvalo, ještě méně se mu zamlouvala dle jeho názoru nedostatečná intervence NH, ale on toho Miler opravdu moc udělat nemohl, vzhledem k naší jurisdikci. Každopádně, po půlhodině panu Pokornému ruply nervy a golemovi přikázal, aby mě zabil (proč hned zabil, nestačilo by třeba - zastav ji nebo tak něco? já tyhle cvoky očividně přitahuju...) Golem nic moc udělat nestihl, protože hned vedle mě stál Aleš s připraveným prachem a zlikvidoval ho, zatímco já jsem zafreezovala a spoutala Pokorného. Miler jenom na jeho adresu pronesl něco ve smyslu, že si to zbytečně zkomplikoval a samozřejmě chtěl pozorovatele NH u výslechu. Pak jsme se vrátili na štáb a dali si vodku.\r\n', 0, 0, 2, 1, 1332111600, '20:30', '21:00', '<p>\r\n3x první šero (Ragulin, Sakeena, Hradil)\r\n</p>\r\n<p>\r\n1x prach amulet\r\n</p>\r\n<p>\r\n1x freeze\r\n</p>\r\n<p>\r\n1x Záhvího pouta \r\n</p>\r\n', 'Zvláštní křížení pravděpodobnostních linií v oblasti parčíku za NTK 50&deg;6''16.005&quot;N, 14&deg;23''28.580&quot;E.<br />\r\nVypadá to na napadení člověka něčím zvláštním. Na upíra to je moc spjaté s Šerem, vlkodlak to taky asi nebude.<br />\r\nChtělo by to prověřit.\r\n'),
(64, 'Vedmaki v dire', 1332339070, 22, 'Zjistit, co se deje v podzemi na Letne', 'Tri vedmy a jeden vedmak vyvolali ze sera &quot;tokena&quot;, vazmozno ze krok k Orakulu. Provedli lidsku obet. Licenciu meli - 2. kategoria.\r\n', '<p>\r\nVazmozno ze budu pokracovat, orakulum tahat.\r\n</p>\r\n<p>\r\nVazmozno ze Nocni bude zalovat, ze nas tam moc, no bylo domluveno.&nbsp;\r\n</p>\r\n', '<p>\r\nAnalyticke ukazovalo anomalie v podzemi na Letne. Uz dlouho pred vyjezdom Andrej Kovac z Nocnego, ze to asi Orakulum a kto ze ho sdelajet. V Duhovce sdelal Hamyd pro svetlych rituala, jesli eto Orakulum. Pry net, ale vazmozno suvislo.\r\n</p>\r\n<p>\r\nNa misto my prijechali v poctu nemalom - 7 dozoristov. Ja uz po ceste Andrejovi volal, bylo jejich vremja, sto my jen na pozorovani a pripadne pomoc, kak by byly prusery. No on kdyz nas tolko posmotrjel, tak i s Marsikom picovali. Tak my nechali potvrdit od koryfejky - zaridila Eva. Koryfejka skazala, sto kak budut obe strany saglasne, tak v parjadke. Ja presvedcil Andreja, ze choroso, kak u nas budu venku zalohy, dva tymy sdelal, adin dovnitr, adin venku. Andrej saglasny, jen jeste ja mu slibil, ze nebudeme resit ten ritual v Duhovce. Pak jeste dorazila Mitfordova, no tu ja uz musel vygodit. Ja znal, sto jeste v okoli Temny, a to uz by se svetlyje posrali.\r\n</p>\r\n<p>\r\nNo pak my do diry zalezli. Z nasich venku tri, vevnitr cetyre. Tam byli 3 vedmy i vedmak jeden, sdelali mocnego rituala s obeti. No nas bariera drzela. My resili barieru, no pomalu. Oni zatim rituala dokoncili, vyvolali z sere sto &quot;token&quot;.\r\n</p>\r\n<p>\r\nPakazali bumazku, Andrej do vedmaka jebal, bubaka sdelal. Marsik tupno cumel, nezasahoval. No ja jego sprasil, sto jemu bude vadit, kak ja s temi babami pokecam. On tupno cumel jeste chvili, pak se probudil a sel s nimi pozkusat govorit. No kak pitomec se choval, tak ja s babami, co uklizely, pogavaril, poradil, kontakty vymenil. Pak jeste vymenil s vedmakom. Potom ja ven doprovodil vedmu, co odnesla mrtvolu.\r\n</p>\r\n<p>\r\nJa tam jesco pentagram na zdi vyfotil, nejaky papir taky, a mrtvolu. Ocen choroso.&nbsp;\r\n</p>\r\n<p>\r\nPostupno vsichni ven vylezli, vedmy a vedmak odkraceli. Koblizek jesco skena provadel, no nic nenasel.\r\n</p>\r\n', 0, 0, 2, 1, 1332198000, '22:00', '23:30', '<p>\r\n2x sero, 1x pravdive videni, 1x podorbnego skena\r\n</p>\r\n<p>\r\nSvetli asi taky neco.&nbsp;\r\n</p>\r\n', 'Přístroje mi tu ukazují něco zvláštního. Myslím, že by se mohlo jednat o nějaký rituál, ale vážně netuším jaký. Zdá se že tam budou 3 až 5 osob ..hm, nejvyšší kategorií by měla být 3. Zaznamenávám zde zvláštní vlnění. Přijďte na to o co se jedná.Mimochodem zdá se, že se to bude odehrávat v podzemí, tak doufám, že se nebojíte trochu špíny.Souřadnice: 50.09421,14.415213\r\n'),
(65, 'Zrcadlo', 1332408596, 47, 'rozbít Zrcadlo', 'Přišli jsme, viděli jsme, rozbila jsem Zrcadlo, Temný umřel.\r\n', '<p>\r\nžaloba od Světlých\r\n</p>\r\n<p>\r\ndalší WF v Praze \r\n</p>\r\n', '<p>\r\nSice jsem tenhle večer měla mít volno, ale nevadí... Filip neměl lidi a potřeboval chytit dva kurýry se Zrcadlem. Nakonec to padlo na mě a na Temnýho.\r\n</p>\r\n<p>\r\nKurýry jsme odchytili na Míráku, odmítali se s námi bavit, tak jsem jim z 2.šera sebrala Zrcadlo a prostě ho rozflákala... Ooops, nešikovný ručičky. Temný to pak nějak nevydržel, úplně jsem to nepochopila a vystartoval po nich s karábačem, což si samozřejmě nenechali líbit a jeden z nich reagoval Betlémským ohněm a nevím čím ještě, každopádně, Temnýho zabili. Já s tím nestihla nic udělat, protože se pak zaměřili na mě. Jeden se mě ptal, jeslti budu taky útočit a když jsem řekla, že ne, vypadal, že mi dá pokoj, ale ten druhej se na mě vrhnul. Tak jsem ho odrazila, hodila po nich jedno trojitý ostří - a pak zdrhli. Já se vrátila na štáb, protože jsem fakt potřebovala vodku. \r\n</p>\r\n', 0, 0, 2, 1, 1332284400, 'cca 22:00', '22:30-45', '<p>\r\n2x první šero\r\n</p>\r\n<p>\r\n2x druhé šero\r\n</p>\r\n<p>\r\nKarabáč Šaabův\r\n</p>\r\n<p>\r\nZrcadlo&nbsp;\r\n</p>\r\n<p>\r\nTrojité ostří \r\n</p>\r\n', 'Na 4. nástupiště Hlavo nádraží dorazí ve 20:15 z Franice dva kurýří \r\nkteří si jedou pro zrcadlo. Zregistrujte je a zjistěte co jsou zač.\r\n'),
(66, 'Záchrana Noční hlídky', 1332505413, 37, 'Povzbudit kolegy', '<p>\r\nByla vodka Smirnof, lambrusko, slivovice Jelínek a Božkov hnus\r\n</p>\r\n<p>\r\nDH odvedla znamenitou práci a Ann socializovala Milera \r\n</p>\r\n', '<p>\r\nKocovina všech, co ochutnali Božkov vodku\r\n</p>\r\n<p>\r\nLepší vztahy s NH \r\n</p>\r\n<p>\r\nMiler dostane alergii na rtěnku \r\n</p>\r\n', '<p>\r\nVyrazili jsme pěšky z našeho štábu poté, co se Eva zhroutila do peřinek a Inkvizitorka prožila orgasmus na masážním křesle. Vedl nás hrdinný Ragulin s podporou jednoho Smirnofa. Dorazili jsme na štáb, Donny měl kecy, ale jakmila viděl bělostnou láhev pokrytou jinovatkou, neodolal.\r\n</p>\r\n<p>\r\nMluvili jsme s tím, co zbylo v Noční hlídce. Byli docela jetí, bylo jasné, že zábava se do našeho příchodu vůbec nekonala. Společenské prostory tiché, jenom Kalle tam dřímala... a tak jsme ji probudili... vytáhli sklenky, vodku a všechny je nahnali do jedné místnosti. Místy někteří odcházeli, ale nevadilo to, protože zbylo víc alkoholu. Ann zulíbala Milera tak, že si při drhnutí svého krku způsobil i drobné škrábnutí.\r\n</p>\r\n<p>\r\nKdyž jsme odcházeli, tak se nás Andrej pokusil zastavit. Marně, museli jsme jít už spát... protože nejsme jako Richard (ten už ji samozřejmě nemá) a nemáme 24 hodinovou šichtu. \r\n</p>\r\n', 0, 0, 2, 1, 1332457200, '0:01', '2:15', '<p>\r\nVodka Smirnof (DH)\r\n</p>\r\n<p>\r\nzmrzlá Vodka Božkov (NH)\r\n</p>\r\n<p>\r\nSlivovice Jelínek (NH)\r\n</p>\r\n<p>\r\nLambrusco (NH)\r\n</p>\r\n<p>\r\nSuchý chleba (NH)\r\n</p>\r\n<p>\r\nPomazánkové máslo (NH)\r\n</p>\r\n', 'Cítili jsme, že se cítí osaměle a na Analytický s***\r\n'),
(67, 'agresivni svetli', 1332515586, 41, 'zistit gdo čerpal energie a pode toho zareagovat.', '<p>\r\nPotkali svetliho, spoutali ho a šli psat slova na papirech-\r\n</p>\r\n', '<p>\r\nMožne dostaneme njaki zasah nižši kategorii\r\n</p>\r\n<p>\r\nPravdepodobna zaloba na Lii za kouzla mimo nasi jurisdikci.&nbsp;\r\n</p>\r\n', '<font size=&quot;2&quot;>\r\n<p>\r\nDojeli jsme na misto, potkali svetli, mezi tim Kobližek skočil do šra a vydal se na prochazku, pak čast hlidkaru šla do hospody mě poslali za Adamem. Vstoupila jsem do šera a šla ho hledat, nenašla, potkala neznameho jineho kteri na mě podezrele koukal. htela jsem s nim promluvit ale on začal utikat tak jsem ho honila, pak se on obratil a zautočil na mne s njakim nožem tak jsem ho frizla, pak hvilinku popremejšlila a uspala. pak pribehli ostatni ja jim vysvetlila situace, vystoupila zšera a šla čekat dokud oni vyreši mezi sebou formalni zaležitosti.\r\n</p>\r\n</font>\r\n', 0, 0, 2, 1, 1332370800, 'približne 22:30', 'približne 23:00', '<p>\r\nTemni:\r\n</p>\r\n<p>\r\nVice krat šero, prave videni, friiz, opium\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nsvetli:\r\n</p>\r\n<p>\r\nvice krat šero, pouta\r\n</p>\r\n', '<div class="content">\r\nPravděpodobnostní liniky mi tu naznačují nějakeho mága co saje energii z lidí v Rýgrovejch sadech. Pravděpodobný výskyt je ve 22:30 u restaurace Mlíkárna.\r\n</div>\r\n'),
(68, 'Registrace depresivního světlého', 1332548694, 26, 'registrovat jiného, nechat Noční udělat všechnu práci', 'Našli jsme světlého jiného, nechali Kováče udělat všechnu práci. Registrovali jsme ho a zase odjeli.\r\n', 'Depresivní světlý se odhmotní.\r\n', 'Dorazili jsme do baru. Našli světlého. Dorazil Kováč, začal do světlého hučet co je zač. Světlý strašně nadával a vyhrožoval, nakonec se registroval. Kováč ho spoutal, zrušil mu pár kouzel. Proskenoval ho.\r\n', 0, 0, 2, 1, 1332457200, '22:00', '23:15', '<p>\r\n<strong>Tma</strong>\r\n</p>\r\n<p>\r\nnic\r\n</p>\r\n<p>\r\n<strong>Světlo&nbsp;</strong>\r\n</p>\r\n<p>\r\n1x Trim Scan\r\n</p>\r\n<p>\r\n3x Záhvího pouta\r\n</p>\r\n<p>\r\n1x podrobný scan\r\n</p>\r\n<p>\r\n1x Um protikouzlo&nbsp;\r\n</p>\r\n', 'Přístroje mi tu právě zahlásily, že v Hardrock Baru (Sokolovská 551) je neregistrovaný Světlý asi 4.kateforie a není ve stavu, ve kterém by byl schopen se dostavit na štáb a nechat se zaregistrovat. Zdá se, že ve zvláštním psychickém stavu... obávám se, co by mohl udělat. Na místě se nachází právě ted, prosím jednejte rychle.\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(69, 'Léčitelka Křížová', 1332604149, 42, 'Golem u NTK', 'Popřela, že by věděla o zabití člověka Tomášem Pokorným.\r\n', '<p>\r\nVíme, kde sehnat hliněné golemy :)\r\n</p>\r\n<p>\r\nVazmozno, ze zdes ziskame nejake zasahy.&nbsp;\r\n</p>\r\n', '<p>\r\nSe slečnou Křížovou jsme se domluvily, že nás navštíví na štábu, kde nám poskytne informace o Pokorném a zároveň ho pomůže doléčit (záminka, aby k nám vůbec přišla).\r\n</p>\r\n<p>\r\nDovedla si s sebou dva hliněné golemy. Sdělila nám, že se s Pokorným znají už pár let. Dokonce, že pro něj dělala svého prvního golema.&nbsp;\r\n</p>\r\n<p>\r\nNa otázku, zda jsou členy nějakého společenství případně skupiny, odpověděla negativně. Netušila ani, že Pokorný chce golema využít k vraždě, původně ho prý chtěl na ochranu a léčení.\r\n</p>\r\n<p>\r\n<span class=&quot;Apple-style-span&quot;>Vzhledem k tomu, že Pokornému za to hrozí tribunál, Filip se pokusil jí přesvědčit o tom, že když se nějak dohodne se světlými, kteří od něj dali ruce pryč, může se žaloba stáhnout, samozřejmě výměnou za zásahy od NH.</span>\r\n</p>\r\n<p>\r\n<span class=&quot;Apple-style-span&quot;>Dle jejích slov by v Praze měly být pouze tři golemové její výroby-dva její a třetí Pokorného, který je ovšem zničený.&nbsp;</span>\r\n</p>\r\n', 0, 0, 2, 2, 1016924400, '16.30', '17.00', 'Sérum pravdy - Eva\r\n', '<p>\r\nÚkol od Ragulina (souvislost s případem golem u NTK)\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n'),
(73, 'Krádež tokenu vědmákům', 1332842018, 32, 'získat token', 'Hamid nám tu zabíjí, koho se mu zlíbí.Token, který odcizil, podle všeho předal jeho komplic Zelený hlídkaři Andrejovi Kováčovi, který token zničil (nebo to aspoň tvrdí).\r\n', 'Orákulum si přeje býti vyvoláno.\r\n', '<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:HyphenationZone>21</w:HyphenationZone>\r\n<w:DoNotOptimizeForBrowser/>\r\n</w:WordDocument>\r\n</xml><![endif]-->\r\n<!--\r\n/* Style Definitions */\r\np.MsoNormal, li.MsoNormal, div.MsoNormal\r\n{mso-style-parent:&quot;&quot;;\r\nmargin:0cm;\r\nmargin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;}\r\n@page Section1\r\n{size:612.0pt 792.0pt;\r\nmargin:70.85pt 70.85pt 70.85pt 70.85pt;\r\nmso-header-margin:35.4pt;\r\nmso-footer-margin:35.4pt;\r\nmso-paper-source:0;}\r\ndiv.Section1\r\n{page:Section1;}\r\n-->\r\n<p style=&quot;text-align: justify&quot; class=&quot;MsoNormal&quot;>\r\nDomluvila jsem se s&nbsp;vědmami z akce letenské kyvadlo, že se u nich v&nbsp;půl desáté večer zastavím. Doufala jsem, že\r\nz&nbsp;nich vymámím token určený k&nbsp;vyvolání Orákula, který si pod kyvadlem\r\nrituálně přitáhly ze šera.\r\n</p>\r\n<p style=&quot;text-align: justify&quot; class=&quot;MsoNormal&quot;>\r\nVzhledem k nabitému výjezdovému programu jsem požádala vědmu o posunutí naší schůzky, souhlasila. \r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 12pt; font-family: ''Times New Roman''&quot;>Krátce před půl desátou mi celá vyděšená volala, že se k&nbsp;nim někdo\r\nvlámal, vyhrožuje jim a&hellip; pak začala křičet, očividně se strhla magická bitka.\r\n</span>\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 12pt; font-family: ''Times New Roman''&quot;>Neprodleně jsme tam vyrazili. Jejich vědmáka jsme našli mrtvého ve\r\nsklepě, vycucaného z&nbsp;veškeré magické a životní energie, jeho dvě kolegyně\r\nnaprosto vyděšené, s&nbsp;napůl vypadanými a napůl šedivými vlasy. Telepatickým\r\nvyšetřením jsem zjistila, že Hamid Jasan spolu s Adlerovou a Zeleným vědmy\r\npřepadli a sebrali jim token a popisek k rituálu. Pak Hamid vycucal do mrtě\r\nvědmáka a dvě jeho kolegyně poslal o půl hodiny v&nbsp;čase. </span>\r\n</p>\r\n', 0, 0, 2, 1, 1332284400, '21:30', '22:30', '<p>\r\nPodrobný scan - Adam K.\r\n</p>\r\n<p>\r\nTelepatické vyšetření - Eva S. \r\n</p>\r\n<p>\r\nStrašlivé velké boom - Hamyd Jasan\r\n</p>\r\n<p>\r\nFreezy při magické bitce \r\n</p>\r\n', 'Smluvená schůzka s vědmáky na 21:30, odložena kvůli jiným záležitostem.\r\n'),
(70, 'Teroristi z Necropolis', 1332606973, 26, 'zkontrolovat cerpani energie, zneskodnit bomby, delat praci Nocni Hlidky', 'Z kontroly cerpani energie se vyklubalo likvidovani vybusnin po Praze. Situaci jsme zvladli, vsechno jsme zneskodnili, vybusniny jsme si az na vzorek pro Nocni nechali.\r\n', 'Nocni by v pripade totalniho zkratu uvazovani mohla drzkovat na nase zasahovani v jejich jurisdicki.\r\n', '<ul>\r\n	<li>\r\n	<p style=&quot;margin-bottom: 0cm&quot;>\r\n	<font face=&quot;Times New Roman, serif&quot;>kolem\r\n	treti ranni vyjezd do nekropole k cerpani 200 magu,</font><span style=&quot;font-family: ''Times New Roman'', serif&quot;>&nbsp;Charistarch jako externista</span>\r\n	</p>\r\n	</li>\r\n</ul>\r\n<ul>\r\n	<li>\r\n	<p style=&quot;margin-bottom: 0cm&quot;>\r\n	<font face=&quot;Times New Roman, serif&quot;>zjistujeme\r\n	ze &bdquo;cerpajici&ldquo; mají nacpane vybusninami dva z prazskych mostu a\r\n	jeden dům, v necru uz několik hodin vysedava Donald s Kuncovou a\r\n	tak jsou na miste první, moc ale nevi co s tema vyderacskejma\r\n	drzkama a tak musime na jejich zadost zasahnout, nejdriv uspavam a\r\n	mazu pamet jednomu cumilovi a pak Filip, predtim nez jsem si mohl\r\n	bejt jistej ze ty dva bezpecne a na jisto sundam, z druhy hladiny\r\n	sera porcuje toho blba s mobilem na kousky a toho druhyho freezujou\r\n	svetly.</font>\r\n	</p>\r\n	</li>\r\n	<li>\r\n	<p style=&quot;margin-bottom: 0cm&quot;>\r\n	<font face=&quot;Times New Roman, serif&quot;>Z\r\n	mobilu podle cisla nejdriv zjistujeme místo prvniho detonatoru,\r\n	Cechuv most, pak telepatickym vysetrenim od druheho Charistarch\r\n	zjistuje druhy most, Jiraskuv</font>\r\n	</p>\r\n	</li>\r\n	<li>\r\n	<p style=&quot;margin-bottom: 0cm&quot;>\r\n	<font face=&quot;Times New Roman, serif&quot;>jako\r\n	k prvnimu ale vyrazim k baraku naproti Necru, kde nachazim taky\r\n	bombu, tesne ji zneskodnuju</font>\r\n	</p>\r\n	</li>\r\n	<li>\r\n	<p style=&quot;margin-bottom: 0cm&quot;>\r\n	<font face=&quot;Times New Roman, serif&quot;>v\r\n	necru se vracim k nasim &bdquo;vytecnikum&ldquo; a odvadime je na stab\r\n	denní, nocni je asi nechce, nasleduje maraton po mostech a\r\n	zajistovani vybusnin, Filip upozornuje policii a spolecne se svým\r\n	ruskym prizvukem je presvedcuje ze se opravdu jedna o problem,\r\n	policie odklani od mostu dopravu, vybusniny zneskodnujeme a vetsinu\r\n	trhaviny si nakonec nechavame, Donnie musel uznat ze beze me to\r\n	nedaj a tak mi za nehtama uvizlo dost vybusniny provozovani\r\n	kamenolomu po cely rok</font>\r\n	</p>\r\n	</li>\r\n	<li>\r\n	<p style=&quot;margin-bottom: 0cm&quot;>\r\n	<font face=&quot;Times New Roman, serif&quot;>po\r\n	uspesnem vyjezdu jedeme zpet na vinohrady a posedet do hospody, v\r\n	hospode nemaji nic co by se dalo oznacit za vodku, piju pivo, Filip\r\n	s Anne nealko</font>\r\n	</p>\r\n	</li>\r\n</ul>\r\n', 0, 0, 2, 1, 1332543600, '3:20', '6:45', '<p>\r\n<strong>Denní</strong>\r\n</p>\r\n<p>\r\n2x 1.šero -Mitfordová\r\n</p>\r\n<p>\r\n3x 1.šero -Novotný\r\n</p>\r\n<p>\r\n4x 1.šero -Ragulin\r\n</p>\r\n<p>\r\n2x 2.šero -Ragulin\r\n</p>\r\n<p>\r\n1x Dýka z šera -Ragulin\r\n</p>\r\n<p>\r\n1x Krvácivé ostří -Ragulin\r\n</p>\r\n<p>\r\n1x Um opium -Novotný\r\n</p>\r\n<p>\r\n1x Amnesia -Novotný&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n<strong>Noční&nbsp;</strong>\r\n</p>\r\n<p>\r\n2x 1.šero -Donnie\r\n</p>\r\n<p>\r\n2x 1.šero -Kuncová\r\n</p>\r\n<p>\r\n1x Freeze&nbsp;\r\n</p>\r\n', 'Pozor pozor,<br />\r\nvím, že už je hodně pozdě a že asi většina z vás spí, nebo se opíjí do němoty nad nekonečnou hlídkařskou rutinou, ale právě jsem zaznamenal zvláštní energetické čerpání z našeho klubu Necropolis.<br />\r\nNecropolis je od doby, co jej Vlad Drákula označil za &quot;bezpečnou zónu pod jeho ochranou&quot;, a po tom, co přešel do vlastnictví naší hlídky, označován, za bezpečné místo pro setkávání Jiných z celé Prahy.<br />\r\nVe 3:00 jsem zaznamenal křížení pravděpodobnostních linií rudých, jak říjen na čase 3:20 právě v místě tohoto klubu. Čerpání je minimálně v hodnotě 200 jednotek, takže žádné drobné.<br />\r\nBylo by dobré, když byste tam vlítli a rychle a čistě případ vyřešili, než do toho začnou strkat čumák světlí. Jde o čest našeho klubu i o místo, které je společensky důležité pro všechny pražské Jiné.\r\n'),
(71, 'Cervena vedma', 1332783991, 22, 'Zjistit, o cem byli ti vampyri unosci', 'Londyn chotel decka, proto Cervena spojilas s vampyrami.\r\n', 'Londyn sdelajet dalsi provokacie.\r\n', '<div>\r\nES: Jméno?\r\n</div>\r\n<div>\r\nRČ: Petra. Mám jedinou ale podmínku, že budu vypovídat celou pravdu, ale slečna Fullbrooková u toho nebude. Bude co nejdál ode mě.\r\n</div>\r\n<div>\r\nFullbrooková po dohodě odchází.\r\n</div>\r\n<div>\r\nES: Spokojena?\r\n</div>\r\n<div>\r\nRČ: Ano. Požádala bych o ochranu vůči ní.\r\n</div>\r\n<div>\r\nES: Povedeme to v patrnosti. Důvod?\r\n</div>\r\n<div>\r\nRČ: Důvod? Obava o svůj vlastní život.\r\n</div>\r\n<div>\r\nES: Zařazení?\r\n</div>\r\n<div>\r\nRČ: Temná neregistrovaná vědma 5. kategorie\r\n</div>\r\n<div>\r\nES: Jste členkou nějaké oficiální organizované skupiny?\r\n</div>\r\n<div>\r\nRČ: Ne.\r\n</div>\r\n<div>\r\nES: Ani neoficiální organizované skupiny?\r\n</div>\r\n<div>\r\nRČ: Ne.\r\n</div>\r\n<div>\r\nES: Nemáte něco společného s kauzou únosu autobusu?\r\n</div>\r\n<div>\r\nRČ: Ano.\r\n</div>\r\n<div>\r\nES: S kým jste na této akci spolupracovala?\r\n</div>\r\n<div>\r\nRČ: S bandou upírů.\r\n</div>\r\n<div>\r\nES: S kolika?\r\n</div>\r\n<div>\r\nRČ: Se třemi.\r\n</div>\r\n<div>\r\nES: Jak se jmenovali nebo jak si říkali?\r\n</div>\r\n<div>\r\nRČ: Jsou to jen upíři, tak to pro mě nebylo podstatné.\r\n</div>\r\n<div>\r\nES: A co pro vás bylo podstatné?\r\n</div>\r\n<div>\r\nRČ: Sehnat třicet dětí a dopravit je do Londýna.\r\n</div>\r\n<div>\r\nES: Proč?\r\n</div>\r\n<div>\r\nRČ: Nevím, byla to moje zakázka.\r\n</div>\r\n<div>\r\nES: Spolupracovat s bandou upírů - vy, jako jediná vědma - jakou jste tam měla úlohu?\r\n</div>\r\n<div>\r\nRČ: Využívat bandu upírů a splnit zakázku.\r\n</div>\r\n<div>\r\nES: Kdo vám zadal zakázku?\r\n</div>\r\n<div>\r\nRČ: Nevím žádná jména. Bylo to anonymní, byl to někdo z Noční... ne, z Denní hlídky Londýn.\r\n</div>\r\n<div>\r\nES: Děláte to často?\r\n</div>\r\n<div>\r\nRČ: Ne.\r\n</div>\r\n<div>\r\nES: Proč jste vzala zrovna tohle?\r\n</div>\r\n<div>\r\nRČ: A vy byste to nevzala?\r\n</div>\r\n<div>\r\nES: Ne.\r\n</div>\r\n<div>\r\nRČ: Silně pochybuju. Byl to skutečně hezký počet volných licencí. A nejen to.\r\n</div>\r\n<div>\r\nES: Co dalšího?\r\n</div>\r\n<div>\r\nRČ: Všechno. ???\r\n</div>\r\n<div>\r\nES: Vy jste tam byla, když ty děti zemřely?\r\n</div>\r\n<div>\r\nRČ: Ano.\r\n</div>\r\n<div>\r\nES: Zabíjela jste je?\r\n</div>\r\n<div>\r\nRČ: Ne. V žádném případě.\r\n</div>\r\n<div>\r\nES: Proč si myslíte, že ten pokyn přišel, že se změnily plány.\r\n</div>\r\n<div>\r\nRČ: To nevím. Jeden z těch hlavních upírů snad nepodal hlášení, takže se ta druhá upírka zbláznila a zabila všechny. To nebylo podle plánu.\r\n</div>\r\n<div>\r\nES: Máte na své spolupracovníky ještě stále kontakty?\r\n</div>\r\n<div>\r\nRČ: Všichni jsou mrtví. Proto žádam o azyl. O ochranu.\r\n</div>\r\n<div>\r\nES: To půjde velmi těžko, vzhledem k tomu, čeho jste byla součástí.\r\n</div>\r\n<div>\r\nRČ: Já jsem nebyla součástí.\r\n</div>\r\n<div>\r\nES: Ne?\r\n</div>\r\n<div>\r\nRČ: Nespáchala jsem nic protizákonného.\r\n</div>\r\n<div>\r\nES: Ne.\r\n</div>\r\n<div>\r\nRČ: Já? Ne.\r\n</div>\r\n<div>\r\nES: A co takové menší napomáhání? Vypadá to dost blbě.\r\n</div>\r\n<div>\r\nRČ: Promiňte. Měla jsem prostě jenomo strach o svůj život.\r\n</div>\r\n<div>\r\nES: Vydírali vás?\r\n</div>\r\n<div>\r\nRČ: Pokud jste v situaci, kde je okolo vás několik upírů silnějších, než jste vy sám, tak z nic přirozeně máte strach.\r\n</div>\r\n<div>\r\nES: A i to vás nutilo tu zakázku vzít?\r\n</div>\r\n<div>\r\nRČ: Ne.\r\n</div>\r\n<div>\r\nES: A nutilo vás něco vzít tu zakázku?\r\n</div>\r\n<div>\r\nRČ: Vykonávala jsem práci pro Noční... Denní hlídku. Toť vše. Nic protizákonného. Je to práce.\r\n</div>\r\n<div>\r\nES: Jak se vaše skupina dávala dohromady.\r\n</div>\r\n<div>\r\nRČ: Vyhledala jsem je. Ano, přiznávám, bylo to riziko. Upíři jsou šílení. Obzlvášt ti slabí.\r\n</div>\r\n<div>\r\nS: Já jsem to přeslechla, jak se vaše skupina dávala dohromady?\r\n</div>\r\n<div>\r\nRČ: Ta skupina tady byla vždycky, pokud to nevíte. Já jsem jim pouze umožnila mě si vyhledat. A to je relativně malá skupina. Ale šikovná.\r\n</div>\r\n<div>\r\nES: Viděla jste, že by přijímali rozkazy ještě od někoho jiného nebo s někým jednali?\r\n</div>\r\n<div>\r\nRČ: Ne.\r\n</div>\r\n<div>\r\nES: Máte nějakou teorii, proč jste byla členkou té skupiny zrovna vy, vědma? Mezi samými upíry?\r\n</div>\r\n<div>\r\nRČ: Protože jsem je využila.\r\n</div>\r\n<div>\r\nES: Vy jste tomu velela?\r\n</div>\r\n<div>\r\nRČ: Ne. Měli cíle, já jsem měla taky. Tak jsme se prostě připletli do cesty. Proč ne. Protizákonné to není. Neasistoval jsem ničemu. Pouze jsem byla přítomna. Bohužel jsem nemohla nic udělat.\r\n</div>\r\n<div>\r\nES: Jaké jste měli rozdělení úkolů ve skupině, co se týče této mise s těmi dětmi.\r\n</div>\r\n<div>\r\nRČ: Já jsem nedělala nic.\r\n</div>\r\n<div>\r\nES: A jakým způsobem jste je měla tudíž dostat do Londýna, když jste nedělala nic?\r\n</div>\r\n<div>\r\nRČ: Upíři jenom potřebovali něco pro zastrašení.\r\n</div>\r\n<div>\r\nES: A to něco bylo co?\r\n</div>\r\n<div>\r\nRČ: To byly ty děti. Kdyby se ta jedna nezbláznila, tak by to dopadlo velmi mírumilovně.\r\n</div>\r\n<div>\r\nES: Takže jste neměla provádět nějaký rituál například. Nebo nemáte pocit, že byste tu zakázku získala pro nějaké své zvláštní schopnosti, možnosti?\r\n</div>\r\n<div>\r\nRČ: Motivy?\r\n</div>\r\n<div>\r\nES: Máte někdo nějaké otázky?\r\n</div>\r\n<div>\r\nS: Nevíte, za jakým účelem...\r\n</div>\r\n<div>\r\nRČ: Nevim.\r\n</div>\r\n<div>\r\nS: Chci se zeptat, za jakým účelem toto Londýn potřeboval.\r\n</div>\r\n<div>\r\nRČ: Nevim.\r\n</div>\r\n<div>\r\nS2: A máte to číslo, které vám volalo z Londýna?\r\n</div>\r\n<div>\r\nRČ: Bylo to blokované číslo.\r\n</div>\r\n<div>\r\nS2: Měl jste nějaké podrobnější specifikace obětí? Jestli to musí být všechno děti nebo další konkretizace? Nebo konkrétní autobus?\r\n</div>\r\n<div>\r\nRČ: 30 dětí do deseti let.\r\n</div>\r\n', 0, 0, 2, 2, 1331766000, '20:00', '22:00', '-\r\n', 'Chycena Cervena\r\n'),
(72, 'Krvavá Cesta', 1332784633, 37, 'jít ve stopách krve', 'Dělali jsme bordel a královsky se bavili na účet Světlých. Zároveň jsme si všichni tři vylepšili dovednost sebeovládání, protože jsme se celou dobu nesmáli.\r\n', '<p>\r\nNaštvaní Světlí\r\n</p>\r\n<p>\r\nŽaloby, žádosti o licence\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', '<p>\r\nRozhodli jsme se s Alexem, že si uděláme páteční po pracovní vycházku. Trochu nám to zhatilo analytické, které nás nahlásilo. Takže jsem se začala mít trochu strach, koho tam ze Světlých potkáme, protože když to hlásilo analytické nám...\r\n</p>\r\n<p>\r\n&nbsp;Takže se mnou šel Koblížek. A potkali jsme se se Sivou s Donym. Na Alexově cestě šel Viktor s Vincentem. Když Koblížek trochu znervózněl, rozhodli jsme se na ty dva počkat s tím, že já honím sebe samu a že je mi z toho trapně, ale že o té druhé linii nemám zdání, tak ať jdou se mnou. Mezitím jsem napsala Alexovi, ať si vymyslí nějakou výmluvu, proč jde sám. A jak jsem řekla, on udělal. Shodil si štít, hodil si na sebe firebally a přišel za námi. A tak jsme se všichni sešli a Alex začal kombinovat svou lež.\r\n</p>\r\n<p>\r\n&nbsp;Nakonec z toho vyplynul silný mág s betlémským ohněm buď v hůlce nebo že to umí s upírem, kterého ovládá. Světlým jsme pomáhali &nbsp;v jejich výmyslech, co to šlo. Dokonce mě Sivá seřvala, že jsem srab a že mám jít klidně domů. Povedlo se nám i vymluvit jim záměr jít se na to místo podívat. Takže jsme je nakonec bezpečně doprovodili tramvají z místa činu.\r\n</p>\r\n<p>\r\n&nbsp;Den na to si to prošli Světlí za světla&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1332457200, '22:15', '23:30', '<p>\r\n<strong><u>\r\nTemní&nbsp;\r\n</u></strong>\r\n</p>\r\n<p>\r\nšero xkrát\r\n</p>\r\n<p>\r\nfireball\r\n</p>\r\n<p>\r\nnahození štítu IV.\r\n</p>\r\n<p>\r\n<strong><u>\r\nSvětlí\r\n</u></strong>\r\n</p>\r\n<p>\r\npravdivé vidění \r\n</p>\r\n<p>\r\nšero xkrát&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Zdá se mi, že přístroje právě prožívají své poslední chvilky. Tiše, skoro nepozorovaně, mi tu vyplivly nějaké červené trasy upírů na lovu. Podle té barvy to vypadá, že zakousnou více než jednoho člověka. Jedna trasa vede z Folimanky na Karlovo náměstí a druhá jí jde naproti ze Staroměstské na Palackého náměstí podél Vltavy. Víc tu nevidím.</span>\r\n'),
(74, 'V rouše Evině', 1332873085, 48, 'Vytrénovat', 'O tohle nejde...\r\n', 'O tohle teď už taky nejde (a o to jde)...\r\n', '<p>\r\nMarně Eva zvedá činku,\r\n</p>\r\n<p>\r\ntrik se skrývá ve tréninku!\r\n</p>\r\n<p>\r\nA tak Silva s Rudlou smísí,\r\n</p>\r\n<p>\r\nsíly své - maj pro ni misi.\r\n</p>\r\n<p>\r\nSkryti v prvním, mlžném šeru,\r\n</p>\r\n<p>\r\nEva zafreezne příšeru.\r\n</p>\r\n<p>\r\nNad žitím se jí však smráká,\r\n</p>\r\n<p>\r\nvždyť je v drápech Rudy-dlaka!\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nEva rychle sílu sbírá,\r\n</p>\r\n<p>\r\nMráz stále drží upíra.\r\n</p>\r\n<p>\r\nA tak Eva zadoufá,\r\n</p>\r\n<p>\r\nže sundá i Rudolfa...\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nŽe by přece ňáká špína?\r\n</p>\r\n<p>\r\nKoukněte na Ragulina!\r\n</p>\r\n<p>\r\nKouzelnou svou dýku vrazí,\r\n</p>\r\n<p>\r\nSilvě v bok, tím ji rozmrazí.\r\n</p>\r\n<p>\r\nSpáry vzduchem proletí,\r\n</p>\r\n<p>\r\nsprška rudé perleti...\r\n</p>\r\n<p>\r\nEva toho obětí.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nPadá tiše, lehce k zemi,\r\n</p>\r\n<p>\r\nkráska mezi bestiemi.\r\n</p>\r\n<p>\r\nChladná, přechladná je zem,\r\n</p>\r\n<p>\r\nkrev jí třísní &nbsp;blůzky lem...\r\n</p>\r\n<p>\r\nTicho.\r\n</p>\r\n<p>\r\nTicho a nic více.\r\n</p>\r\n<p>\r\nZhasl život kouzelnice.\r\n</p>\r\n<p>\r\nŠero blíž a blíž se vkrádá,\r\n</p>\r\n<p>\r\nz drápů dvou stvůr stéká zrada...\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nNe, můj Světlý, tak to není,\r\n</p>\r\n<p>\r\nač chceš tohle zakončení,\r\n</p>\r\n<p>\r\npříběh, který jsem ti dal,\r\n</p>\r\n<p>\r\npřeci jen v pár bodech lhal.\r\n</p>\r\n<p>\r\nEva jest dál mezi námi,\r\n</p>\r\n<p>\r\nSilva zas v ní život vzmámí.\r\n</p>\r\n<p>\r\nKde vzít sílu? Kýho Šlaka!\r\n</p>\r\n<p>\r\nNa co máme Rysodlaka!\r\n</p>\r\n<p>\r\n....\r\n</p>\r\n<p>\r\nTak dej pozor, soku vnější.\r\n</p>\r\n<p>\r\nMáme Drsnou Nejtemnější.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1332712800, '22.00', '22.15', 'jedna cesta na metro a metrem (ale z Čerňáku!)\r\n', 'Inspirace Šerem :)\r\n'),
(75, 'Cviceni opicacke', 1333030747, 22, 'Trenovat do akcie', 'Treningu bylo nuzno - no my v Rigracoch potrenovali. Pak na leceni vazu Protegonku pouzili, i z tego byl maglajz bolsoj.\r\n', 'Natreni dozoristi na bilo.\r\n', '<p>\r\nNam bylo nuzno cviceni dalsigo, tak my vyrazili. Charistarch slibil leceni i zvedani, kak nuzno.\r\n</p>\r\n<p>\r\nNa tymy rozdelili, Richard vsechny zrezal. Poznatek - vlastni stit je chorosij neskutecno.\r\n</p>\r\n<p>\r\nPak Charistarch dal dozoristy dohromady i my arenu sdelali. Taky zajimavo.\r\n</p>\r\n<p>\r\nNo pak se eto pokazilo - dozoristi se z vazy Protegonky vylecili. Eva zkontrolovala Silvije glavu, tam pohled, kak Protegon eto vytvoril. Choroso. No pak dozoristi, katoryje popili (Adam, Silvija, Renatočka i Annie) zacali podivno chovat, pravdepodobno takova mala remoralizacija. No oni se katalyzovali a pak na stabe Charistarch s nimi sdelal psychopohovory. Ono vypadalo, ze sdelajet necego, sto nam nevazmozno, no nebyla pravda. Glavne mluvil, obcas spis skodu sdelal.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1332799200, '00:15', '03:00', 'Priblizno 1500 mg\r\n', 'My idjom trenovat.\r\n'),
(76, 'Protegona stale net', 1333034250, 22, 'Dvat bacha, kdyby necego slo sejdrom', 'Svetlije choteli Protegona, na Vysegrade sdelali rituala. Agresivno cumici Cornyj tam chotel porvatsja, no jemu nevyslo. Nevyslo ani Protegona. Tuhoj Šulc, škody nět.\r\n', '<p>\r\nNasrany Čornyj vazmožno sdělajet bordel.\r\n</p>\r\n<p>\r\nSvětlije pozkušatujt znovu a znovu poseru.\r\n</p>\r\n<p>\r\nLethold vazmozno sebja nasvacil.&nbsp;\r\n</p>\r\n', '<p>\r\nDve vyjezdovky pojechaly na Vysegrad, kde svetlije choteli s Protegonom sto sdelat. Oni do kruhu magickego dali Sulca a Feitovu a Albert sdelal rituala. Okolo mnogo svetlych postavalo, obrateni v promene, Cjornyj v sumraku, vsetky strasno hustyje. Abertovi pomagal Lethold i Iryme. Lethol pomogol Sulcovi do grobu, vypadalo kak soucast rituala. Pak tam svetli neco pokrikovali, resili, rituala u konce. Sulc tam zustal tuhy i nikogo eto nezajimalo, jen Silviju.\r\n</p>\r\n<p>\r\nPak jisco na sebja tam chvili cumeli my i svjetli i potom my odjechali.&nbsp;\r\n</p>\r\n', 0, 0, 2, 1, 1332885600, '0:00', '01:30', 'Taky kotla. Spousta sera, promeny, dyky, govadiny.\r\n', '<p>\r\nAnalyticke: Pravdepodobnostni linie naznacuji velky energetick vyboj v oblasti vysehradu. Cas 00:00 (pulnoc)\r\n</p>\r\n<p>\r\n+info od Milera pres Silviju, ze pajdot o Protegona a jich tam mnogo.\r\n</p>\r\n'),
(77, 'Vedmakovska kase ala Hamid', 1333129942, 45, 'prosetrit vyboje u vedmaku', '<p>\r\nvedmaci kase ve sklepse se rozplynula v seru\r\n</p>\r\n<p>\r\nziskali jsme amulet sila ohne a hulka s pavucinou\r\n</p>\r\n<p>\r\nvideo s dukayz proti Hamidovi Hasanovi\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', '<p>\r\n&nbsp;Hamid odzouzen Inkvizici stat se kasi...\r\n</p>\r\n<p>\r\n&nbsp;&nbsp;Vyloutovat byt pokud to nestihla uz mala vedma\r\n</p>\r\n', '<p>\r\nHlaseni o divne magicke aktivite na analytickem. Jeli jsme rychle na Rokosku... Dorazili jsme tam presne v 20:15 jak hlasilo analyticke. Nicmene casomag uz byl 10 minut pryc podle toho ze mrtvoly co jsme nasly ve sklepe byly uz nezvratne zabite...\r\n</p>\r\n<p>\r\n&nbsp;No ve skelpe hotovy masakr. Vedma mrtva, druha taky, nejaky kamos vedmak taky mrtvy (viz ty dve vedmak v dire)\r\n</p>\r\n<p>\r\n&nbsp;Jediny kdo prezil byla ta mala sukezni vedmicka. No zmatena a vydesena.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;Obrali jsme mrtvoli o co slo a proskenovali misto.\r\n</p>\r\n<p>\r\n&nbsp;Vedmicku jsme opiem uspali a jechali na staba\r\n</p>\r\n<p>\r\nCestou vedmicka dvakrat opiom znovu uspana aby byla ticho.\r\n</p>\r\n<p>\r\nVyslech vedmicky (viz eva) dopadl nijak blba jak puk... na to kolik ji je ji uz asi nekdo vy.... mozek z hlavy... holt vedma...\r\n</p>\r\n<p>\r\n&nbsp;Tedy vic jsme se dozvedeli z videa co se stalo.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;Delali dalsi token. Hamid prisel, zastavil cas, vzal jim kynzal a podrezal je.... Odesel viz video (u ragulina)\r\n</p>\r\n', 0, 0, 2, 1, 1332885600, '20:00', '22:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Přístroje právě potvrdily, že ve čtvrt na devět dojde k nějaké podivné události v ul. Valčíkova čp. 8.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Vypadá to na poměrně velké množství vyzářené energie v kombinaci s lehkými skoky v kauzalitě, ale to bude asi nesmysl a příliš citlivě kalibrovaný senzor. Poprosil bych vás, abyste dojeli na místo s sebrali mi nějaké vzorky k porovnání a lepší kalibraci celkového systému. Už mě to tu začíná unavovat.</span>\r\n'),
(78, 'Cesta do glubin inkvizitorovy blbosti', 1333131179, 22, 'Honit inkvizitorovi Potmechuta', 'Inkvizitor John Faraday chotel honit Ondreja Potmechuta, co mu utekl. Chvili jego honili, pak na nego vykaslali. No na vyzadani Milera my Potmechuta pod kyvadlom chytli a predali.\r\n', '<p>\r\nNasrany inkvizitor.&nbsp;\r\n</p>\r\n', 'doplnit\r\n', 0, 0, 2, 1, 1333058400, '21:30', '0:15', 'Sumraku mnogo, pravdive videni nekolikrat, adin podrobny sken, Rudolfova promena, freeze 8x, zrcadlo, 2. sumrak, Miler do 2. sumraka. Hafo.\r\n', 'Informace od tego inkvizitora, sto Potmechut nekde v okoli, i zadost o pomoc.\r\n'),
(79, 'Prokletá podruhé', 1333185740, 37, 'Dozjistit informace', '<p>\r\nDozjistili jsme informace a možná to přeci jenom bude napojené na magistrát. Ve hře jsou tři další firmy: Holcim, ASM s.r.o. a Higgs and Hill\r\n</p>\r\n<p>\r\nVše vypadá na impulz od ex-přítele Tomáše Řezáče (774 944 592)&nbsp;\r\n</p>\r\n', '<p>\r\nsouvislost s magistrátem\r\n</p>\r\n<p>\r\njedna definitivně rozešlá dvojice&nbsp;\r\n</p>\r\n', '<p>\r\nZašli jsme za ní s Koblížkem s tím, že Adam byl celou dobu v šeru. Cecílie Vranovská vypadala už v pořádku a v pohodě komunikovala.\r\n</p>\r\n<p>\r\n&nbsp;Klient stavební firmy byl subdodavatel Higgs and Hill a tuto firmu kupuje nějaký belgický gigant.\r\n</p>\r\n<p>\r\nDalší možností byl ex-přítel Tomáš Řezáč, se kterým se rozešla. On nechtěl děti (možné podezření, že je jiný) a ona velmi. 5 let byli spolu a teď se jí od rozchodu vůbec neozval (žije?!). Pracuje s HW &nbsp;pro ASM s.r.o.\r\n</p>\r\n<p>\r\nSamotná Cecílie Vranovská dělá pro Holcim. Podrobný scan neprokázal, že by CV byla potenciální Jiná.\r\n</p>\r\n', 0, 0, 2, 1, 1332799200, '21:00', '22.15', '<p>\r\nšero (koblížek)\r\n</p>\r\n<p>\r\npodrobný scan (koblížek)&nbsp;\r\n</p>\r\n', 'Predchozi vysetrovani.\r\n'),
(80, 'Temný na Anenském náměstí', 1334143076, 32, 'Zabránit nelegálnímu čerpání energie', 'Odchytili jsme na Anenském náměstí černého mága Sysoje, který umí léčit. Zavázali jsme si ho.\r\n', 'Je nám vděčný, bude nás léčit v případě potřeby + bude šířit slávu Denní hlídky dál.\r\n', '<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:HyphenationZone>21</w:HyphenationZone>\r\n<w:PunctuationKerning/>\r\n<w:ValidateAgainstSchemas/>\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables/>\r\n<w:SnapToGridInCell/>\r\n<w:WrapTextWithPunct/>\r\n<w:UseAsianBreakRules/>\r\n<w:DontGrowAutofit/>\r\n</w:Compatibility>\r\n<w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n</w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState=&quot;false&quot; LatentStyleCount=&quot;156&quot;>\r\n</w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:&quot;Normální tabulka&quot;;\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-parent:&quot;&quot;;\r\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\nmso-para-margin:0cm;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:#0400;\r\nmso-fareast-language:#0400;\r\nmso-bidi-language:#0400;}\r\n</style>\r\n<![endif]--><span style=&quot;font-size: 12pt; font-family: ''Times New Roman''&quot;>Spolu s Koblížkem, Mitfordovou a Trnkovou jsme\r\ndorazili na místo, kde už čekali Světlí &ndash; Miler, Poláková a šéfka výjezdu Sobotková. Rozdělili jsme se a začali pročesávat přilehlé okolí. Štěstí se\r\nusmálo na Adama, kterému se podařilo odchytit mladého černého mága, jenž se\r\npředstavil jako Sysoj Psojič. Na koho se štěstí naopak úplně neusmálo, byl\r\nMiler, který se nám s profesionální výdrží pletl pod ruce. Sysoj stihl vysát z&nbsp;kolemjdoucího\r\n20 magů, potřeboval, jak se přiznal, celkem 150, aby mohl vyléčit tři\r\nnemocné Jiné, již leželi v kritickém stavu v nemocnici. Zatímco Miler\r\nhysterčil, jak je možné, že u sebe Sysoj nemá registrační papíry (světe div se,\r\njá je s sebou jako dlouhodobý pražský rezident taky nenosím), pokoušela jsem se\r\nsituaci zahladit tak, abychom před tím Jiným civilistou nevypadali jako dvě\r\nparty neschopných rozhádaných šašků. Nakonec pomohla Annie, která Milera\r\nseřvala pod černou zem, a Sobotková, která si ho posléze odtáhla. Já jsem dala\r\nSysojovi nabídku: když nás zavede do té nemocnice a ukáže nám své tři přátele,\r\nklidně mu potřebnou energii předám a budu u toho, jak jsou léčeni. Až bude\r\nDenní hlídka něco potřebovat, s důvěrou se na něj obrátím. My se o své staráme\r\na je třeba, aby tuto zprávu šířil dál mezi Temné. Přijal.</span>\r\n', 0, 0, 2, 1, 1332630000, '20:35', '21:45', 'Energeticky nenáročné, pokud vím - kromě těch předaných 130 magů.\r\n', 'V oblasti Anenského náměstí zaznamenávám velké budoucí čerpání energie. \r\nPravděpodobně v řádech stovek jednotek. Nelze přesně určit kdo bude \r\nnapaden, ani kde k napadení dojde. Subjekt/y se pravděpodobně ještě \r\nnerozhodl, proto to není možné vidět v pravděpodobnostních linkách.<br />\r\nProveďte přezkoumání této situace a zamezte ztrátám na životech.\r\n'),
(81, 'asdůfl', 1344207460, 22, 'alkdf', 'doplnit\r\n', 'doplnit\r\n', 'doplnit\r\n', 0, 1, 0, 1, 1009839600, 'alkd', 'alsdkf', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(82, 'Šokující akce u zřídla', 1344273439, 38, 'Zjistit co se děje u zřídla na Hvězdě', 'Slepý vědmák šašil u zřídla na Hvězdě\r\n', '<p>\r\nHradil si musí koupit nový mobil protože nevydržel zásah bleskem.\r\n</p>\r\n<p>\r\nZavření zřídla na Hvězdě.\r\n</p>\r\n<p>\r\nDealování výživových náhrad světlým.&nbsp;\r\n</p>\r\n', 'Hlášená nějaká šaškárna byla hlášená u magického zřídla na Hvězdě. Když jsme s Koblížkem dorazili, všimli jsme si toho slepého vědmáka co na podzim zřídla otevíral. Nevypadal úplně ve formě. Adam v šeru vyděl opravdu VELKOU černou smršť. Pravděpodobně si myslel, že tam doplní energii. Mlel nějaký žvásty o Šankarovi a jak by si přál abychom dostali svitek, na kterém, jak jsme později zjistili byl návod na vyrábění výživových náhrad. Pak do něj prásknul blesk a přismahnul mě i s Adamem. Světlím jsme nakecali, že to byl normální člověk s malou smrští nad sebou. S námahou jsme se odebrali na štáb.\r\n', 0, 0, 1, 1, 1344204000, '17:00', '17:30', '<p>\r\n1x pravdivé vidění\r\n</p>\r\n<p>\r\njeden sakra velkej blesk&nbsp;\r\n</p>\r\n', '<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\n<br />\r\nZaznamenali jsme neočekávaný energetický výkyv u magického Zřídla na Hvězdě. Sice nepředpokládáme konflikt, ale ostupujte opatrně nedá se přesně určit o co se tam jedná. V každém případě to prověřte.\r\n</div>\r\n'),
(83, 'Shangri-la, aneb průser za dveřmi', 1344273730, 47, 'zabránit boji na neutrální půdě', 'Barman a jeho známá si &quot;přátelsky povídali&quot; za pomoci šeré dýky a elementálního útoku, ani se při tom neobtěžovali lézt do šera...\r\n', 'Porvou se někde znova... vědma se má sejít s někým dalším zítra v hospodě na Tiskárně v 6 večer\r\n', '<p>\r\nDo Shangri-ly jsme dorazili asi v pů třetí ve složení Sakeena, Aleš, Adam Koblížek a později se ještě připojil Rudolf Jičínský. Barmana jsem proskenovala - Karel Smutný, vědmák, 4. kategorie. Kolem čtvrt na čtyři se objevila vědma (po scanu Jana Polková, 4. kategorie) a Smutný s ní odešel ven před Shangri-lu. Sledovala jsem je v 1. šeru a poslouchala o čem se baví. Polková se snažila ze Smutného dostat informace o tom, kde je nějaká Bára, její kamarádka, údajně čerstvá Jiná. Prý našla její byt vypálený a zničený. V bytě (Bartoškova 2) se byli podívat Koblížek s Hradilem, našli symbol.&nbsp;\r\n</p>\r\n<p>\r\nKdyž Polková po Smutném vystartovala prvně, upozornila jsem ji, že porušuje Dohodu (nebyla v šeru) a že jestli si to chtějí vyřídit, tak v duelu. Nicméně, když jsem na chvíli odešla a nechala je tam s Koblížkem, šli po sobě znovu, tak je Koblížek uspal a já je následně spoutala, aby nedělali další bordel. \r\n</p>\r\n<p>\r\nVe výsledku jsme je nechali běžet s napomenutím, protože kde není žalobce není soudce a když napadený tvrdí, že napaden nebyl a že si tu dýku, co měl pod krkem jenom prohlížel, není moc co řešit. Zítra bude Polková na Tiskárně, rozhodně by se tam někdo z našich měl taky ukázat. \r\n</p>\r\n', 0, 0, 1, 1, 1344204000, '15:15', 'cca za hodinu', '<p>\r\nSakeena šero 1. a 2. hladina\r\n</p>\r\n<p>\r\nKoblížek šero 1. hladina\r\n</p>\r\n<p>\r\nHradil šero 2. hladina\r\n</p>\r\n<p>\r\nKoblížek 2x spánek\r\n</p>\r\n<p>\r\nSakeena 2x záhvího pouta\r\n</p>\r\n<p>\r\nscany \r\n</p>\r\n', '<div class="content">\r\n<a id="ha71609640" href="http://zeny.zoot.cz/krasa-a-zdravi">Zdravím</a> Vás,<br />\r\ntak jsem se vrátil z dovolené. Bylo to pěkné. Viděl jsem moře, palmy a spoustu drinků s deštníčkama.<br />\r\nHlavně\r\njsem neviděl, co vidím teď v počítači. Pravděpodobnostní linie mi \r\nnaznačují hypotetickou možnost konfliktu v oblasti elisea Shangri-la. \r\nPozor, neporušte neutrální půdu bojem.<br />\r\nPředpokládaný čas konfliktu 15:15minut<br />\r\n<br />\r\n<a id="h9852dab9406d2c6163747b" href="http://www.krausmagazin.cz/">Kraus</a>\r\n</div>\r\n'),
(84, 'Upír na náměstí 14.října', 1344274559, 60, 'Vyšetřit podezřelou osobu', 'Na náměstí byl oběven upír 4.kategorie jménem: .............. &nbsp; Dotyčný na oslovení reagoval přátelsky a osvětlil nám že zde čeká na převzetí jistého balíku Vlada Tepeš, od jistého (Koláček(Poláček))\r\n', 'balíček se nepředal?&nbsp;\r\n', 'přišlijsemnanáměstí, po chvilce se objevili světlí, pak přišel Koblížek, upíra jsem našli jak spěchá parkem, na oslovení byl vstřícný, ale opatrný, po odehnání noční hlídky jsem z něho dostali že spěchá převzí balíček pro jistého Vlada Tepeše, ale přítomnost nočníku ho ?vyděsila? tak že si chvilku poseděl na lavičce zřejmě čekající na balíček, ale pak spěšně odešel směr domov, nočník ho sledoval v šeru, a my jsem z povzdálí dohlédli aby se nic nepřihodilo... konce :)\r\n', 0, 0, 1, 1, 1344204000, '12:15', '13:00', '1. šero cca 2x\r\n', '<span style="background-color: #999999">ANALYTIKA: Právě mi jeden informátor dal zprávu, že se na Náměstí 14.řijna bude pohybovat podezřelá osoba. Mělo by to být chvíli po 12h. Chtělo by zjistit co tam hodlá dělat. Doufám, že to nebude nic vážného.</span>\r\n'),
(85, 'Čerpání na hlaváku', 1344275894, 26, 'zajistit stopy', 'Pozdní výjezd, zajištění magických stop.\r\n', 'Někdo se nasvačil a mz nevíme kdo.\r\n', 'Potkal jsem se s Adlerovou a Letholdem a jejich šeromobilem jsme vyrazili prozkoumat už poněkud vychladlou stopu na hlavní nádraží. Na místě jsme našli stopy po čerpání zhruba po 30ti jednotkách ze sedmi lidí, nadvakrát.\r\n', 0, 0, 1, 1, 1344117600, '00:00', '1:00', 'zilch\r\n', 'Přístroje mi tu právě vyhodily, že na hlavním nádraží proběhlo čerpání z\r\nvelkého počtu lidí. Mělo by se to odehrávat přibližně zde <a href="http://www.mapy.cz/s/4J3B" class="postlink">http://www.mapy.cz/s/4J3B</a><br />\r\n<br />\r\nProsím jednejte rychle, nejsme si jisti jak moc jsou lidé ohroženi na životě.\r\n'),
(86, 'Pyroman na Ostrovní', 1344276694, 47, 'prověřit a zajistit', 'Na Ostrovní hořel dům č.13, zajistili jsme symbol, pyroman už tam nebyl. Symbol NENÍ stejný jako ten v bytě zmizelé Báry.\r\n', '<p>\r\nDalší požáry.\r\n</p>\r\n<p>\r\nJe možné, že pachatele zajistili Světlí,mohli se tam dostat dřív, i když já brousila kolem už od cca 17:50 - zjistit \r\n</p>\r\n', 'doplnit\r\n', 0, 0, 1, 1, 1344204000, '18:00', '18:30', 'Sakeena 1. šero\r\n', 'Naši odborníci z Analytického odhalili serii podezřelých požárů. Zjistil\r\nsme, že požáry jsou doprovázeny slabou magickou aktivitou. Dle \r\npravděpodonostních linií se další požár odehraje v ulici Ostrovní. Podle\r\ntoho co víme o pyromanech je pravděpodobné, že požár bude pozorovat z \r\nblízkého okolí.\r\n'),
(87, 'Vlkodlak v Riegrových sadech', 1344287476, 61, 'zajistit vlkodlaka', 'Vlkodlak v Riegrových sadech\r\n', 'světlí se budou cítit ještě trapněji. :)\r\n', '<p style=&quot;margin-bottom: 0cm&quot;>\r\n<br />\r\n</p>\r\n<p style=&quot;margin-bottom: 0cm&quot;>\r\nDostali jsme hlášení, že v\r\nRiegrových sadech loví proměněný vlkodlak. Po chvíli jsme\r\nnarazili na skupinku světlých, kteří po 22. hodině nadšeně\r\npřevzali akci. Samozřejmě vlkodlaka nevypátrali.\r\n</p>\r\n<p style=&quot;margin-bottom: 0cm&quot;>\r\nVlkodlak v pořádku nalezen &ndash;\r\npřiběhl za námi, když jsme obhlíželi terén a volal, že to si\r\nsnad děláme srandu, že nám táámhle přes celej park přeběhl\r\nvlkodlak a nikdo s tím nic nedělá. Světlí nic netuší o tom, že\r\njim vlkodlak takřka proklouzl za zády, proměnil se zpět a my ho\r\ntímto vklidu vzali z místa a světlí se bez výsledku odebrali z\r\nmísta. &nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1344204000, '21:45', '22:30 cca', 'nepoužili jsme vůbec nic, Aleš Hradil se pohyboval v šeru, s ním i někteří ze 3 světlých.\r\n', '... dostali jsme info z analytického o tomto případu\r\n'),
(88, 'vysávání energie na Václavském námestí', 1344368364, 62, 'zajistit toho kdo vysává', 'Jan Černý nám odnesl před nosem podezřelou osobu.\r\n', 'rezepře mezi světlými a černými. únik energie\r\n', 'Při doražení na místo jsme hledali zbytky po zásahu (značky) žádné jsme nenašli. Pak jsme viděli osobu podezřelou než jsme k ní došli tak nám zmizela.<br />\r\nIgor řekl matru pravého vidění a po té co stále neviděl unosce ani osobu přešel do šera 1 kde viděl jak Jan Černý bere osobu z dohledu. Zmizeli rychle. Igor bez možnosti zásahu do jiné hladiny se vrátil zpátky. Nemohl osoby dále sledovat.\r\n', 0, 0, 1, 1, 1344290400, '20.30', '21:10', 'kouzla Pravé vidění, vstupy do Šera1 (IGOR)\r\n', 'info z analytického<br />\r\n<br />\r\nByli u toho Veronika v. a Petr Sariš (a pozorovatel Dub)<br />\r\n'),
(89, 'Chotkovy sady', 1344368668, 38, 'zjistit co se děje', 'Nic nebezpečného se nedělo, akorát kluci dělali problém.\r\n', 'všechno se zametlo vše je ok\r\n', '<p>\r\nKdyž jsme přijeli na místo, první co se stalo bylo že Podhorský sežral náhodnou kolemjdoucí. Seřval jsem ho a pokračovali jsme. V parku na sebe začali Obrtlík s Podhorským strašně řvát a narušovali celou akci. Oba jsem je zmrazil a dál jsem pokračoval sám. Narazil jsem na světlou, která evidentně trpěla silnou amnézií, nevěděla o sobě vůbec nic, ani co tam dělá. Chvilku jsem se sní bavil, v kapse měla zvláštní papír, později jsem zjistil, že to jsou nějaké alchymistické cancy. Jelikož to bylo jediné co na místě bylo zajímavé rozhodl jsem, že si to nechám. Když jsem si papír bral, světlá nehnula ani brvou... a dalších deset minut na to také ne.\r\n</p>\r\n<p>\r\nPapír jsem předal našim vědmákům, jednalo se o alchymistické značnky různých prvků. Asi nějaká starý způsob jak zapisovat recepty. V současné době by měl mít papír u sebe Petr Kučera.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1344290400, '13:30', '14:15', '<p>\r\n2x šero\r\n</p>\r\n<p>\r\n1x Um freeze 1x Aam freeze\r\n</p>\r\n<p>\r\n(1 šero a jeden freeze byl naprosto zbytečný kvůli Obrtlíkovi a Podhorskému )\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Právě jsem zaznamenal, že v oblasti Chotkových sadů se bude kolem 14h pohybovat světlá Jiná. Pravděpodobnostní linie mi tu taky vyhazují, že je s ní možná něco v nepořádku. Zjistěte co s ní je.</span>\r\n'),
(90, 'Kafárna Na Dolinách', 1344369237, 38, 'Neregistrovaná světlá, řešit', 'Světlá z Liberce, nějaká šmelinářka.\r\n', 'přítomnost rituálních pomůcek v Praze\r\n', 'Přišel jsem do Kafárny, kde jsem narazil na světlou, prý zrovna dorazila do Prahy a rovnou mi začala nabízet nějaký rituální předměty, jelikož jsem nevěděl co můžeme potřebaval, odkázal jsem jí ať se staví na štáb a dohodneme se. Uvidíme jestli dorazí.\r\n', 0, 0, 1, 1, 1344290400, '15:25', '15:35', 'nula nula prd\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Právě jsem dostal echo, že v kafárně (Na dolinách 1278/47) sedí neregistrovaná Světlá. Skočte ji prověřit. Měla by se tam vyskytovat kolem 15:25</span>\r\n'),
(91, 'Čerpání u kostela', 1344369772, 38, 'zastavit sání', 'Nová vědma nevědomky vysávala lidi.\r\n', 'nic velkého\r\n', 'U kostela jsme narazili na silně věřící jehovistku, čerstvě iniciovanou vědmu. Nevědomky vysávala lidi. Vysávala lidi, byla poučena o věci Velké dohody a následně jsme odešli.\r\n', 0, 0, 1, 1, 1344290400, '16:00', '17:00', '1x šero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Přístoje mi tu nahlásily, že u kostela sv.Petra (kousek od zast. Bílá labuť) proběhne čerpání energie. Skočte zjistit zda má dotyčný povolení.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Dneska je to jak na běžícím pásu,...</span>\r\n'),
(92, 'Mrtvá na Vinici', 1344443228, 47, 'prozkoumat místo činu', 'Našli jsme mrtvolu Světlé, 6.kategorie, bílý mág.\r\n', 'doplnit\r\n', 'V parku u zastávky tram. č.11 ležela mrtvola mladé blondýnky, na krku měla jasnou strangulační rýhu, která ale v šeru nepatrně zářila. Měla společenské šaty, takže včera večer evidentně někde byla nebo se někam chystala. V diáři kontakt na Medvídka byl v diáři telefon - 725 729 837, jinak žádné známé jméno nebo kontakt. Adresa zavražděné je Ondříčkova 6. Po zavolání na Medvídkovo číslo jsme zjistili, že je to manžel zesnulé, podle scanu člověk, o smrti manželky ví, po telefonu nebyl příliš ochotný se mnou mluvit. Byt jsme prohledali všeru, nic zvláštního jsme ale nenašli, Šrámková evidentně tajila, že je JIná a žila normální lidský život - manžel, dítě, práce...\r\n', 0, 0, 1, 1, 1344376800, '17:00', '18:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(93, 'Svobodní upíři znovu prudí', 1344457303, 38, 'pořešit svobodné upíry', 'Vrátili se nám svoboní upíři aby se pomstili za smrt kamaráda. Vymalovali jsme s nimi chodník.\r\n', 'Další nasraní svobodní upíři.\r\n', 'Kolem desáté se začali objevoat různé telefonáty, převážně mě a Filipovi o tom, že jsou tu nějací vyděrači, kteří se mnou chtějí mluvit, jinak prý vyvraždí dětské oddělení na Karlově náměstí. Střídavě probíhali rozhovory mezi námi, světlími a vyděrači. Vyděrače jsem po telefonu poslal do prdele s tim, že se s nimi nebudeme bavit. Po dalších pár telefonátech se světlími jsme se dohodli na srazu na Karláku, kde měli čekat vyděrači. Vyděrače jsme našli a zařídili a by už nikdy nikoho nevydírali.\r\n', 0, 0, 1, 1, 1344290400, '22:00', '00:00', '<p>\r\nDH&nbsp;\r\n</p>\r\n<p>\r\n2x šero&nbsp;\r\n</p>\r\n<p>\r\n2x II. šero\r\n</p>\r\n<p>\r\nDýka z šera\r\n</p>\r\n<p>\r\nPravdivé vidění&nbsp;\r\n</p>\r\n<p>\r\nBojová tranformace\r\n</p>\r\n<p>\r\nNH\r\n</p>\r\n<p>\r\n&nbsp;3x šero\r\n</p>\r\n<p>\r\npravdivé vidění&nbsp;\r\n</p>\r\n', 'nic\r\n'),
(94, 'čerpání u tržnice na vinohradech', 1344467942, 58, 'zajistit stopy', 'Zajistili jsme stopy a vyzjistili jednorázové čerpání za 180 mg. Jinak nic...\r\n', 'Někdo se slušně nacucal\r\n', 'Dorazili jsme na místo a prohledávali okolí. Po chvíli jsme našli energetickou stopu na rohu budovy tržnice. Po chvíli se objevila světlá hlídkařka, nejspíš pozorovatelka, která později očumovala i v šeru. Stopy jsme zajistili a vyrazili na štáb.\r\n', 0, 0, 1, 1, 1009839600, '9:20', '9:50', 'Čerpáno 9x20 mg, 2xšero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Právě jsem zaznamenal čerpání energie 9x20mg u Vinohradské tržnice na rohu ul.Slezské.Zajímavé, pravděpodobnostní linie mi ukazuji jistou souvislost s únosem světlé hlídkařky. Jděte to prověřit, třeba po sobě nechal nějaké stopy.</span>\r\n'),
(95, 'Lov na flóře', 1344467955, 26, 'pozorovat', 'Světlí mají tatrovku dlažebních kostek a kusů asfaltu. A upíra.\r\n', 'Upír to schytá za dva údajné fragy.\r\n', '<p>\r\nNa flóře byl hlášen upír na lovu. Vyrazili jsme tedy na čumendu, abychom něco okoukali od světlých.\r\n</p>\r\n<p>\r\nPo pár chvílích kdy nám obočí samým údivem neodputovalo div někam do zátylku jsme se dozvěděli že je zjevně v módě s sebou na výjezd brát výjezdovkuukrajinců s lopatama a nějakou tou zbíječkou. Výjezd světlých se pokusil ukrást několik šerých signatur po upírovi ukrást i s chodníkem. Podle všeho se k tomuto druhu vandalismu cítili oprávněni na základě prohlášení &quot;my jsme to našli první&quot;. Nakonec jsmezachránili alespoň tz ještě nerozkopané části chodníku. \r\n</p>\r\n<p>\r\nMálem bych zapomněl, upíra podezřelého ze dvou sežrání mají světlí, garantovali že budeme u výslechu. Nevidím to na nic složitého, pokud se jim mu to podaří přišít. \r\n</p>\r\n', 0, 0, 1, 1, 1344376800, '00:00', '00:30', '<p>\r\nsvětlí\r\n</p>\r\n<p>\r\nmin. 3xšero, 2xum. freeze\r\n</p>\r\n<p>\r\ntemní\r\n</p>\r\n<p>\r\nmin. 2xšero, 3x um. freeze \r\n</p>\r\n', '<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Pravděpodonostní linie my tu ukazují že v jedne z postranních uliček za obchodním centrem Flora se pohybuje upír, který má hlad. Nedokažu určit jestli už někoho vysál, nebo se k tomu chystá, ale odhadovaný počet obětí jsou přibližně tři. Pokud už není pozdě, zabrante mu v tom.</span>\r\n</p>\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(96, 'Pravděpodobná eutanasie', 1344468877, 58, 'Chytit eutanasistu', 'U polikliniky na Budějovické jsme zajistili stopy po magickém zásahu, nejspíš nepovolené magické eutanásii.\r\n', 'Dost možná někoho usmrtili než jsme stihli dorazit.\r\n', 'Na hlášku o plánované eutanasii jsme odpověděli okamžitým výjezdem. Místo jsme ohledali a po chvílí dorazila i NH. Resp. jeden člen. Ten se dlouho nezdržel a zase zmizel. Nakonec jsme našli na parkovišti za poliklinikou stopy magických zásahů, a to dvou Jiných. Zajistili jsme stopy a vyrazili na štáb.\r\n', 0, 0, 1, 1, 1344463200, '22:30', '23:10', '5xšero\r\n', '<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Pozor,</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">v oblati Praha 4, zast Budějovická (bližší místní určení po pravé straně, u parkoviště) se bude nacházet zvláštně smýšlející Jiný. Máme důvodné podezření, že dotyčný provádí nepovolenou eutanasii.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Zajistěte oč hergot jde. V poslední době v této nemocnici zemřelo mnohem více lidí, než je průměrné</span>\r\n'),
(97, 'Nic mi nemůžete, nejsem hlídkař', 1344520302, 38, 'Vysvětlit že můžeme', 'Vysvětlili jsme slečně Feitové, že můžeme.\r\n', 'Další návštěva, pokud se už nebude chovat slušně.\r\n', 'Přijeli jsme k Feitové domu a v šeru vlezli do bytu. Tam jsme jí řekli, že je zatčená a zabavujeme všechny magické předměty na přeskoumání. Následně jsme důkladně proskoumali celý byt, od vnitřků polštářu a sedaček, přes veškeré knihy, porcelán a skla konče omítkou a pojistkami. Nic jsme nenašli kontrband byl evidentně dobře schován, takže jsme poslali bandu dlaků, aby hledali pod parketami ve stěnách a podobně. Slečnu Feitovou jsme odvezli na štáb k výslechu. Věci jsme nechali v bezpečí u nás na štábu k jejich prozkoumání.\r\n', 0, 0, 1, 1, 1344463200, '11:00', '11:30', '<p>\r\n4x šero\r\n</p>\r\n<p>\r\n1x pravdivé vidění&nbsp;\r\n</p>\r\n', 'byla to naše iniciativa\r\n'),
(98, 'Mrtvá na Vinici - výslech manžela', 1344543417, 47, 'najít vraha', 'Šrámkovou zavraždil manžel na popud milenky, velmi pravděpodobně Jiné\r\n', 'týpka by mohly sežrat výčitky...policie na něj asi nepřijde a my s ním taky nic neuděláme\r\n', '<p>\r\nVyslýchaný: Martin Veselý, člověk, nar. 18.5. 1980, bytem Ondříčkova 6, Praha-Vinohrady\r\n</p>\r\n<p>\r\nPřišla jsem k Veselému do bytu, vydávala jsem se za pracovnici Útvaru pro zvláštní oběti, která vyšetřuje smrt jeho ženy. Pustil mě dál, nejdřív jsem se vyptávala normálně, manželku viděl naposledy ten den, kdy zemřela (7.8.), ne problémy neměli, poměr určitě taky neměla, ničeho zvláštního si nevšiml atakdále. Telepatický výslech nakonec ukázal něco úplně jiného, manželku zabil on, uškrtil ji provazem, který dostal od své milenky - Jana Černocká, 604 852 179. Řekla mu, že když Šrámkovou zabije tímhle provazem, bude to vypadat jako sebevražda, evidentně ho k té vraždě přesvědčila stylem &quot;zbav se manželky a budeme už jenom spolu&quot;. Zkusila jsme pakVeselého přesvědčit, aby se přiznal, s tím, že vím,že to udělal, ale ořád zapíral, tak jsem ho uspala, krátce se poradila s Evou, našla jsem mu v telefonu kontakt na Černockou, smazala mu paměť a vypadla jsem.&nbsp; \r\n</p>\r\n', 0, 0, 1, 2, 1344463200, '21:15', '21:30', 'Telepatický výslech, Opium, Amnesie\r\n', 'případ uškrcené Světlé mágyně\r\n'),
(99, 'Podivný rituál na střeleckém ostrově', 1344604611, 0, 'zabránit porušení dohody', 'Analitické nás informovalo o možné rituální aktivitě na Střeleckém ostrově. když jsme dorazili probíhal již rituál jehož cílem bylo pomocí lidské oběti vyvolat &quot;Token orákula&quot;. Rituál probíhal pod bariérou jak proti magii tak i proti fyzickému útoku navíc zde byla i Šerá Bestie chránící průběh riuálu.\r\n', 'destabilizace zřídla, vyvolání orákula\r\n', 'Na střelecký ostrov jsme dorazili cca v 23:48 kde již probíhal rituál za účelem vyvolat token orákula pomocí lidské oběti bohužel nebylo možné mu zabránit ze tří důvodů 1) ritůál byl chráněn bariérou 2) rituál dále chránila šerá bestie 3) neschopnost světlích šetřit s mag. energií to je také důvodem útěku vůdce vyvolávajících Eduarda Knora(mág 2-3 kategorie). Po skončení rituálu se bestie navrátila do šera a odešla, bariéra padla a my s podporou světlích začali chytat vyvolávače konečná bilance 3 mrtví, 1 zajmutý, 1 na útěku\r\n', 0, 0, 1, 1, 1344549600, '23:40', '00:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', '<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nPřístroje zaznamenaly předpokádaný výkyv ne 23:40 energie u zřídla na Střeleckém ostrově. Předpokládáme, že se jedná o blíže nespecifikovanou rituální magii. Pokuste se výkyv vyřešit takováto zátěž zřídla ho může destabilizovat.\r\n</div>\r\n'),
(100, 'Tomáš Zima', 1344611891, 47, 'vyšetřit únos Sobotkové a zabití Maršíka', 'Zima ochotně spolupracoval, máme podrobné info o tom, jak zabil Maršíka a proč a jak unesl Sobotkovou\r\n', 'Zimu má Protegon, ať si s ním asi dělá, co chce\r\n', 'VÝSLECH TOMÁ ZIMA <br />\r\n7.8. 2012, 17:30 <br />\r\n&nbsp;<br />\r\nvyslýchající: Eva Schwarzkoppová <br />\r\npozorovatel: Protegon <br />\r\nzapisovatel za DH: Sakeena <br />\r\nzapisovatel za NH: Karel Dub <br />\r\n&nbsp;<br />\r\n&nbsp;- můžete mi nějak rozumně vlastními slovy říct, co jste to vyváděl? <br />\r\n&nbsp;- mám začít od začátku? léta páně 1917-18 jsem se potkal s P.Maršikem v cizinecké legii, já už byl tehdy nízký důstojník, okamžitě jsem poznal, že je Světlý Jiný, dali jsme se dohromady, vysvětlil jsem mu některé věci, naučil jsem ho karabáč Šaabův, navázali jsme vzájemně přátelský vztah. Během jednoho průzkumu zapadlé vesnice se Maršík vydal prozkoumat kostel a odnesl z něj artefakt - Zřídlo magické moci Hvězda (odnesl pouze jednu polovinu, druhé si nevšiml, jedna polovina energii vyzařuje, druhá pohlcuje, Maršík byl nezkušený a nepoznal to, druhou polovinu jsem odnesl já) ten artefakt, spojen a funkční vytváří nějakou ochrannou bariéru, nevím přesně, jak to funguje. Všechny nalezené věci jsme museli hlásit, Maršík odmítl cokoli přiznat a artefakt magicky chránil. <br />\r\n&nbsp;- vyloučil jste možnost, že si M. nebyl vědom toho, že má u sebe cenný aktivní artefakt? <br />\r\n&nbsp;- o tom velice pochybuji <br />\r\n&nbsp;- takže z toho kostela on odnesl jednu část a vy druhou? <br />\r\n&nbsp;- ano <br />\r\n&nbsp;- a vám se nepodařilo ho přesvědčit aby tu svou část vydal? <br />\r\n&nbsp;- ne, nechtěl jsem vyhrocovat situaci, válka atd <br />\r\n&nbsp;- po válce jsem se vrátil do Čech a na celou věc jsem do nedávné doby zapomněl <br />\r\n&nbsp;- k jaké ideologii jste se hlásil? <br />\r\n&nbsp;- k jaké to bylo nejméně problematické. kdy zde byli komunisti, tvrdil jsem, že jsem taky komunista, abych nešel do vězení <br />\r\n&nbsp;- skončilo to tak, že jsem na celou věc zapomněl, žil jsem normální civilní život a teprve když sem před necelým rokem Maršík dorazil, vzpomněl jsem si a napadlo mě, že bych mohl artefakt spojit a dále využít. přemýlel jsem, jak ho oslovit, ale během podzimu a jara zde nebylo dost klidu, kdy jsem se pak dozvěděl, že odjel do lázní, jel jsem ho navštívit. zpočátku bylo vše v pořádku, ale když jsem po něm chtěl artefakt, začal být agresivní a připravil si karabáč Šaabův, vzal jsem to jako napadení, také jsem vytáhl karabáč aabův a v následném souboji Maršík zemřel. na místě jsem nic nenašel, zametl jsme po sobě stopy, byla to nešťastná náhoda ale nemám jak to dokázat <br />\r\n&nbsp;- naběhl vám na karabáč, rozumím... <br />\r\n&nbsp;- nemám proč lhát a vymýšlet si, říkám jak se to událo z mého pohledu <br />\r\n&nbsp;- proč jste ho nevyzval na duel? <br />\r\non tasil, já tasil, mě to připadalo jako vyzvání na duel. já si nepřipravuji zbraň, pokud ji nechci použít <br />\r\n&nbsp;- bud ji chcete použít v duelu nebo ji chcete použít k vradě <br />\r\n&nbsp;- jediný můj, poloviční, svědek, je moje svěřenkyně Veronika Vaňková, 4.kategorie, mág, byla za dveřmi. Narazil jsem na ni při procházkách na kraji Prahy a inicioval jsem ji, byl jsem její Patron <br />\r\n&nbsp;- kde se nachází teď? <br />\r\n&nbsp;- pokud se nepletu, pravděpodobně čeká na moje zavolání, jak budeme postupovat dnes večer <br />\r\n&nbsp;- ona neví o vašem zatčení? <br />\r\n&nbsp;- neví, nedostal jsem příležitost ji kontaktovat <br />\r\n&nbsp;- takže, při tragické nehodě, kdy na vás vytáhl karabáč, jste Maršíka zabil...a vy jste zjistil, že artefakt nemá u sebe...a pak jste udělal co? <br />\r\n&nbsp;- nějakou dobu jsem zde sledoval situaci, získal jsem pár informátorů a dospěl jsem k názoru, že dobrovolně mi artefakt nevydají a rozhodl jsem se k únosu a výměně unesené za artefakt <br />\r\n&nbsp;- takže, slečna Nikola byla první a jediná Jina,kterou jste unesl <br />\r\n&nbsp;- ano. nenapadl mě žádný jiný způsob jak tuto situaci vyřešit. možná by se nějaký našel, mě napadl tento <br />\r\n&nbsp;- proč chcete ty dvě části tak moc spojit? <br />\r\n&nbsp;- velmi mě zajímá, co bude výsledným efektem <br />\r\n&nbsp;- a kvůli tomu jste zabil Protegonova žáka, unesl členku Noční Hlídky... <br />\r\n&nbsp;- já ho nechtěl zabít...vytáhl karabáč, já vytáhl karabáč... <br />\r\n&nbsp;- pokud je to tak, jak říkáte, samozřejmě není pochyb o tom, že vás chtěl napadnout, ale byl to přece váš přítel <br />\r\n&nbsp;- v tu chvíli mi začal sprostě nadávat a ... <br />\r\n&nbsp;- možná ho trochu rozhodilo, že jste po něm požadoval druhou půlku Hvězdy <br />\r\n&nbsp;- nejprve se vyhýbal odpovědi, pak přiznal, že tam něco našel, že má tu druhou polovinu, navrhl jsem, at mi to dá, že to spojíme, on ale tvrdil, že je to jeho majetkem a nedá to z ruky...a tak jsme skončili tam, kde jsme skončili <br />\r\n&nbsp;- máte ještě něco na svou obhajobu, kromě &quot;byla to nehoda, ale nemám na to svědky&quot;? <br />\r\n&nbsp;- snail jsem zamaskovat všechny stopy po &quot;Jinosti&quot;...doted jsem žil slušný, civilní život, nikdy jsem nic takového neudělal. mým cílem nebylo nikoho ani zranit, natož zabít, to že k tomu takhle s pavlem dolo, je mi velmi líto. <br />\r\n&nbsp;- průběh únosu? <br />\r\n&nbsp;- zjistil jsem zhruba, kam hlídkaři z NH jezdili (prý tam žije ta Markéta, na kterou Pavel hrozně nadával) Palmovka, Heydukova ulice. no, tak jsem si tam na ně počíhal, abych měl jistotu že budu mít dost magie a že je tam přilákám, načerpal jsem ze 7 lidí po 20mg, potkal jsem tam dva Světlé, kteří vyšli z toho domu na Palmovce a říkali, že čekají na hlídkaře a pak jim šli naproti, tak jsem se začínal pakovat, že zmizím, ale v tu chvíli se naštěstí objevili ti tři hlídkaři, zřejmě se minuli, nalákal jsem je na to místo kde jsem čerpal, že jim ukážu licence, měl jsem nějaké zfalšované a v tu chvíli, kdy se zabývali papíry, moje komplicka zezadu zakouzila na všechny freeze, pak jsem v rychlém sledu já zakouzlil dva freezy na všechny, ty už prošly štíty, Nikolu jsem pak karabáčem z freezu dostal, Veronika ji spoutala Záhvího pouty a odvedli jsme si ji <br />\r\n&nbsp;- proč zrovna Nikolu? <br />\r\n&nbsp;- Pavel ji zmiňoval, vypadalo to jako nejlepší volba...Markétu jsem neunesl, protože už nebyla v Hlídce, potřeboval jsem hlídkařku. <br />\r\n&nbsp;- pak k nám do tramvaje přistoupil jeden ze Světlých, které jsem potkal před Palmovkou, nějaký Gabriel, ptal se jestli jsme někoho viděli (hlídkaře), řekl jsem že ne, on přikývl, spoutanou Nikolu vyignoroval a vystoupil <br />\r\n&nbsp;- pak jsem Nikolu měl u sebe doma, několikrát se pokusila utéct, byla velmi statečná, až mě překvapila, dneska už mi i tykala. <br />\r\n&nbsp;- říká se tomu stockholmský syndrom <br />\r\n&nbsp;- o tom pochybuji <br />\r\n&nbsp;- pak jste nás vlastně chytli u večeře...byli jsme se i procházet po pamětihodnostech po Praze, Národní třída, Hradčany...aby viděla něco nového <br />\r\n&nbsp;- Nikola tvrdila, že jste ji spoutal a útočil na ni Trojitým ostřím <br />\r\n&nbsp;- ano, to se stalo večer, kdy jsem tam nechal Nikolu samotnou s Veronikou, Nikola začala kouzlit, prý chtěla pouze scan a Veronika zpanikařila a použila Trojité ostří <br />\r\n&nbsp;- takže trojité ostří pouila Vaňková? <br />\r\n&nbsp;- ano...já jsem následně dvakrát použil balzám, abych Nikolu vyléčil...nabízel jsem Nikole, že ji naučím karabáč Šaabův <br />\r\n&nbsp;- kdy jste informoval NH, že máte slečnu Sobotkovou v držení a požadujete za ni Hvězdu? (Dub) <br />\r\n&nbsp;- včera večer, Viktor Miller tvrdil, že o takovém artefaktu neví a že se podívá ve skladech, tak jsem počkal další den, říkal jsme si, že kdy jsem čekal takovou dobu, tak už to vydržím...Jo, Nikola taky dostala na noc prášky na spaní, aby neutekla...jinak jsem se snažil, aby nedošla k úhoně, dnes už jsem ji ani nesvázal, protože se rozhodla chovat rozumně, občas trochu zazlobila, když jste přili, tak jsem jí nadával, že se pokouela schovat telefon. předání jsem plánoval v čajovně U 4 draků, ale NH o tom ještě nevěděla, těm jsem řekl Želivského <br />\r\n&nbsp;<br />\r\nKONEC VýSLECHU\r\n', 0, 0, 1, 2, 1344290400, '17:30', '18:30', 'nic\r\n', 'únos Nikoly Sobotkové\r\n'),
(101, 'Upír na pěst', 1344638605, 0, 'Očíhnout konflikt', 'Skupinka světlých potkala upíra, který vysával lidi na nábřeží a pokusila se mu v tom zabránit tak, že ho bez jakéhokoliv magického zásahu zbušili. Zpacifikovala je NH.\r\n', 'Máme tu guppu radikálních světlých (možná Druhá Strana) která dává upírům na držku.\r\n', '<p>\r\nDorazili jsme ve chvíli kdy už NH situaci řešila. Na místě byli tři světlí se sklony k násílí vůči všem temným a upír s monoklem. NH se s nima chvíli vybavovala, pak světlé pustila a upíra si vzali na výslech. Dle výpovědi trojice světlých totiž zabil, vysál a hodil člověka do řeky, což bylo proti jejich přesvědčení. Vyžádali jsme si kopii z výslechu as razili z akce.\r\n</p>\r\n<p>\r\nPozn.: Volknerová sabotuje akci. Během zásahu maří zajišťování informací, uráží vedoucího zásahu a neplní jeho pokyny.\r\n</p>\r\n', 0, 0, 0, 1, 1344636000, '23:00', '23:20', '1x šero\r\n', '<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Tak, mám pro vás další zprávy ohledně dnešní noci.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Tentokrát by u Podskalské celnici na Výtoni, měl proběhnout střet mezi jednotlivcem a menší skupinkou.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Zjistěte co tam zase provádějí, třeba je v ohrožení i našinec.</span>\r\n</p>\r\n<p>\r\n...&nbsp;\r\n</p>\r\n<p>\r\n<span style="background-color: #999999; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px">Zdá se, že pravdedopobnostní linie ukazují na jiné místo. Konflikt by se měl odehrát na nábřeží naproti zastávce Výtoň.</span>&nbsp;\r\n</p>\r\n'),
(102, 'Upír na nábřeží', 1344638703, 58, 'Očíhnout konflikt', 'Skupinka světlých potkala upíra, který vysával lidi na nábřeží a pokusila se mu v tom zabránit tak, že ho bez jakéhokoliv magického zásahu zbušili. Zpacifikovala je NH.\r\n', 'Máme tu guppu radikálních světlých (možná Druhá Strana) která dává upírům na držku.\r\n', '<p>\r\nDorazili jsme ve chvíli kdy už NH situaci řešila. Na místě byli tři světlí se sklony k násílí vůči všem temným a upír s monoklem. NH se s nima chvíli vybavovala, pak světlé pustila a upíra si vzali na výslech. Dle výpovědi trojice světlých totiž zabil, vysál a hodil člověka do řeky, což bylo proti jejich přesvědčení. Vyžádali jsme si kopii z výslechu as razili z akce.\r\n</p>\r\n<p>\r\nPozn.: Volknerová sabotuje akci. Během zásahu maří zajišťování informací, uráží vedoucího zásahu a neplní jeho pokyny.\r\n</p>\r\n', 0, 0, 1, 1, 1344636000, '23:00', '23:20', '1x šero\r\n', '<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Tak, mám pro vás další zprávy ohledně dnešní noci.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Tentokrát by u Podskalské celnici na Výtoni, měl proběhnout střet mezi jednotlivcem a menší skupinkou.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Zjistěte co tam zase provádějí, třeba je v ohrožení i našinec.</span>\r\n</p>\r\n<p>\r\n...&nbsp;\r\n</p>\r\n<p>\r\n<span style="background-color: #999999; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px">Zdá se, že pravdedopobnostní linie ukazují na jiné místo. Konflikt by se měl odehrát na nábřeží naproti zastávce Výtoň.</span>&nbsp;\r\n</p>\r\n'),
(103, 'Loupež v inkvizičním skladu', 1344683241, 26, 'pozorovat, zabránit loupeži', 'V době noční hlídky jsme vyrazili pozorovat, jak si poradí s lupiči v inkvizičním skladu.\r\n', 'Někdo se nakapsuje na náklady inkvizice (a opavdu se tak stalo, vladovci šlohli pohár duší) a bude dělat bordel (to ještě nevím co s tim hodlaj dělat)\r\n', 'Na Vyšehrad jsme dorazili koblihomobilem a já s obrtlíkem jsme se vydali na výzvědy. Byly jsme tam celkem včas, takže byla malá šance, že nám něco uteče. Na místě skladu jsme pak pozorovali pochůzkáře od světlých a viděli jsme odcházet vladovy blbouny. Asi půl hodiny jsme tam okolo šaškovali a plížili se všelijakým svinstvem, až nás to přestalo bavit a sešli jsme se se zbytkem výjezdu. Usoudili jsme, že to byli buď vladouni a nebo nikdo nic nešlohnul, což nám hlásila inkvizice a údajně neporušené úložiště. Až o den později jsme se dozvěděli že krádež opravdu proběhla a že vladouni šlohli pohár duší. (whatever it is)\r\n', 0, 0, 1, 1, 1344463200, '23:30', '1:00', '<p>\r\nNovotný 1xšero\r\n</p>\r\n<p>\r\nObrtlík 1xšero&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Předpokládána nebezpečná aktivita v inkvizicí zakázané oblasti úložiště neznámé relikvie 50&deg;3''49.816&quot;N, 14&deg;25''3.158&quot;E .Oblast je pouze přibližná. Tolerance je 100m.</span>\r\n'),
(104, 'Mistrovství v adekvátním zálohování', 1344685829, 26, 'pozorovat, zachraňovat situaci', 'Černé mágy-kopáče, jsme zpacifikovali a zase zachránili světlejm jejich bezcený zadnice. Ale byla to královská zábava. :)\r\n', 'Veselý už nebude chtít jezdit na výjezdy jako záloha.\r\n', '<p>\r\nZ vyšehradu jsme vyrazili k zahradě kinských kde byl hlášený nějaký budoucí pokus o vykopání nějaký mrtvoly. Museli jsme s sebou vzit ještě inkvizitora, protože je děsná vtěrka a asi už měl společnosti světlejch, se kterejma byl předtim, plný zuby. Naše tři údajné kopáče jsme potkali už u vchodu do zahrady, ale řekli jsme si, že bude veselejší nechat je začít kopat a pozorovat noční hlídku při tom, čemu říkají práce. \r\n</p>\r\n<p>\r\nVzali jsme to tedy téměř kolmo do kopce, abychom byli na vykopávkách první a po chvilce prolejzání okolního křoví jsme i našli ideální místečko kde čekat. Pak jsme na tý úzký pěšině stáli vedle sebe jak na hanbě, čuměli do tmy a pokuřovali.\r\n</p>\r\n<p>\r\nKdyž jsme zaslechli že se u hrobu Tenebra něco děje, šli jsme se podívat jak to tedy vypadá. U hrobu jsme našli výjezd světlých zamrzlý v rozličných polohách a rozpačitě přešlapující černé mágy (byli tři) potěžkávající krumpáče a lopaty. Ragulin se neudržel a dramaticky si zahulákal nějakou zbytečnost jako že nemají lézt do šera, jako by neviděl obecnou školu. zafungovalo to spolehlivě, mágové naskákali do šera jako jeden muž. Tak jsme tam skočili za nimi a během pár vteřin je zpacifikovali. dva si zdřímli a jednoho ragulin freezoval tak dlouho, až to vyšlo.\r\n</p>\r\n<p>\r\nPak jsme náhodou narazili na Veselého, který byl úplně mimo, tvrdil že je záloha a &nbsp;nevěděl že zbytek jeho výjezdu právě účikuje ve velice zajímavém sousoší. Nakonec jsme mu museli pomoct i s odmražením jeho kolegů. Zajatce jsme si rozdělili se světlejma 2:1 a odvezli jsme si toho svýho na štáb k výslechu.\r\n</p>\r\n<p>\r\nLethold který nakonec na místě zásahu okukoval situaci ještě s Adlerovou a Zeleným to komentoval slovy: &quot;Máte velice zajímavé operační postupy, noční hlídka se nehlásí vůbec a denní rusky.&quot;&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1344463200, '1:30', '2:15', '<p>\r\ntemní\r\n</p>\r\n<p>\r\nnepočítaně freezů\r\n</p>\r\n<p>\r\n1x trim opium\r\n</p>\r\n<p>\r\n1x um opium\r\n</p>\r\n<p>\r\n3x první šero\r\n</p>\r\n<p>\r\n1x druhý šero\r\n</p>\r\n<p>\r\n1x trim scan\r\n</p>\r\n<p>\r\nsvětlí\r\n</p>\r\n<p>\r\n3x záhvího pouta&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Pozor, máme tady porušení klatby u hrobu buřičského mága Tenebra.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Tenebrus byl pohřben blízko hladové zdi u kostela sv. Michala v&nbsp;</span><a id="f75fad86a19d775f55d6c" style="direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: none; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999; padding: 0px; margin: 0px" href="http://www.dumazahrada.cz/zahrada/">zahradě</a><span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">&nbsp;Kinských.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Zjistěte, kdo se pokouší manipulovat s těmito ostatky a zajistěte, aby se tak nedělo.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">Klatba: prohlášení, stavící manipulaci s danou věcí mimo toleranci NH (v tomto případě s podporou DH, protože Tenebrus hrubě ohrožoval&nbsp;</span><a id="ha71609640" style="direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: none; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999; padding: 0px; margin: 0px" href="http://zeny.zoot.cz/krasa-a-zdravi">zdravý</a><span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18px; background-color: #999999">&nbsp;vývoj českých zemí)</span>\r\n'),
(105, 'Okradená léčitelka', 1344689516, 47, 'prošetřit', 'přijeli jsme, vyslechli vystresovanou léčitelku, odjeli jsme\r\n', 'ty amulety a hůlky už se asi nikdy nenajdou... smůlička\r\n', '<p>\r\nVolala nám nějaká Markéta Kolínová (Světlá, léčitelka 4.kat) že se jí někdo vloupal do bytu a ukradl jí nějaké hůlky a amulety. Tak jsme se sebrali a dojeli k ní domů. Kolínová byla pěkně vystresovaná, vypověděla, že byla přes noc v nemocnici, a když se ráno vrátila, zdálo se í, že někdo manipuloval se zámkem, v bytě našla nepořádek, vyházené věci a zjistila, že jí chybí amulety a hůlky: \r\n</p>\r\n<p>\r\n2x hůlka Trojité ostří\r\n</p>\r\n<p>\r\n1x hůlka Prst smrti\r\n</p>\r\n<p>\r\nenerg.amulety: 3x80mg, 10x40mg \r\n</p>\r\n<p>\r\nPřed 14dny byla prý s kamarádkami v kavárně a bavily se tma o současné nebezpečné situaci v Praze, mluvila o tom, ž emá ty věci doma pro svou ochranu, prakticky kdokoli to mohlslyšet a přijít si pro ně. Jinak jsme nezajistili žádné magické stopy v šeru, jediná stopa,kteoru máme je přívěsek ve tvaru hada (na scanu nic zajímavého),který Kolínová v bytě našla. Sariš a Volknerová zkusí pátrací rituál a pokusíme se najít jak zloděje, tak amulety. \r\n</p>\r\n', 0, 0, 1, 1, 1344636000, '13:30', '14:30', '2xScan, 1. šero, Pravdivé vidění\r\n', 'telefonát od Kolínové\r\n'),
(106, 'Vrazdy ritualne na Starom gorode', 1344699370, 22, 'Pobegat za vampyrom', 'Vampyr, vazmozno sto Alex, sdelal vrazdy, vazmozno sto ritualne.\r\n', 'Kak eto byly vrazdy ritualne, vazmozno sto ritual necego sdelal.\r\n', '<p>\r\nPjervyje misto, na katoryje my dojechali, to Týnská 11, kde chlapik zgorel. My objevili otis v sumraku, katoryj vazmozno sto Alexa.\r\n</p>\r\n<p>\r\n&nbsp;Pak my pochodili ke Karolinu, gde mrtvola rozmlacena o sochu kamennu. Otisk samyj.\r\n</p>\r\n<p>\r\nNaslednyj byl utopenyj pod Cechovym mostom. Otisk samyj.&nbsp;\r\n</p>\r\n<p>\r\nPoslednyj u Spanelskej synagogy, vzduchom hozeny. Otisk samyj\r\n</p>\r\n<p>\r\nCetyre zivly. Vzdalenosti sdelajut Fibonacciho&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1344463200, '18:30', '21:00', 'Neznaju.\r\n', '<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Pozor, objevili jsme hořící mrtvolu &quot;U svobodných zednářů&quot;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Adresa: Týnská 11.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Vypravte se na místo a zajistěte důkazy, je pravděpodobné, že se jedná o chytře zastřený upíří lov.</span><br />\r\n<br />\r\n***\r\n</p>\r\n<p>\r\n&nbsp;<span style="background-color: #999999; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px">U kašny před před Karolinem (u kašny) byla právě nalezena mrtvola člověka nelidsky rozbitá o sochu.</span>\r\n</p>\r\n<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Vezměte si gumáky, protože policajti, co to našli tam solidně nazvraceli.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Je zřejmé, že toto není dílem obyčejného člověka, jen je potřeba zjistit, kdo to spáchal.</span>\r\n</p>\r\n<p>\r\n***\r\n</p>\r\n<p>\r\n&nbsp;<span style="background-color: #999999; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px">Objevena další mrtvola.</span>\r\n</p>\r\n<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Pod pilíři u Čechova mostu se nachází další mrtvý člověk. Pravděpodobně byl vyhozen z přístaviště č. 4 od z/od lodi Andante.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Je zvláštní, že dotyčnému ve vodě tak trošku plandá hlava a na krku má zřetelné kousance. Z dálky není možné zjistit, zda-li jsou upíří, či jen imitace. Příčinou smrti může být jak masivní ztráta krve, tak utonutí</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Má někdo nějakou teorii? Nepřipomíná vám to jeden román, odehrávající se ve Vatikánu?</span>\r\n</p>\r\n<p>\r\n***\r\n</p>\r\n<p>\r\n&nbsp;<span style="background-color: #999999; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px">Další mrtvý člověk,</span>\r\n</p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">denní hlídko, co děláte? Právě spadl z věže Španělské synagogy v Dušní ulici.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Tipněte si, co hlásí policejní důstojníci do vysílaček? &quot;mrtvola má prokousnutý krk.&quot;</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Já vám nevím, ale tímhle tempem nám tu nezbude moc lidí.</span>\r\n'),
(107, 'Jdou po mě jdou', 1344700779, 38, 'zařídit aby po ní nešli', 'Šílená vědma, poslali jsme ji k šílené zaříkávačce Feitové aby si spolu mohli povídat.\r\n', 'Šílené ženské&nbsp; se budou množit.\r\n', 'Naběhli jsme na náměstí s patřičnou pompézností a vysílačkami v rukou. Našli jsme šílenou vědmu která byla psychicky narušená a &quot;šli po ní upíři.&quot; S vypětím všech sil jsme jí dotáhli na štáb. Šoupli jsme jí k Feitové do sanatoria by jí tam nebylo samotné smutno.\r\n', 0, 0, 1, 1, 1344636000, '17:00', '17:45', '<p>\r\n3x um opium\r\n</p>\r\n<p>\r\n10x amnésie\r\n</p>\r\n<p>\r\n1x zhávího pouta\r\n</p>\r\n<p>\r\n1x um štít \r\n</p>\r\n', 'Máme zprávu, že v horní části  náměstí Svatopluka Čecha v parku se \r\npohybuje jiná, která se cítí být v ohrožení. Prověřte o co se jedná.\r\n'),
(108, 'senilní Rabi upgraduje golema', 1344707019, 26, 'vyzvednout Křížovou na uhelném trhu', 'Křížovou jsem vyzvedl na dohodnutém místě, ale chtěla jít hned telefonovat Rabimu Loevovi. Nakonec se tam přisral Charistarch a dopadlo to &quot;upgradováním&quot; golema, což je pravděpodobně nějaký pseudo-všeobsahující golem chránící celou prahu.\r\n', 'Charistarch nám před nosem udělal nějakou sviňárnu za kterou nás tu bude nahánět nasranej vlad, protože byla udajné mířená proti němu.\r\n', '<p>\r\nSešel jsem se s Křížovou na uhelném trhu podle dohody. Bavili jsme se o její dovolené v Jeruzalémě. Řekla že přivezla nějakej krám co souvisel s Rabiho fuchtlí která zamřela a Rabi jí od tý doby hledá v šeru. Křížová pak trvala na tom, že se jde přivolávat Rabi a tak jsme někde u synagogy na starym městě přivolávali Rabiho. Navíc se k tomu přisral Charistarch a tvářil se jako by nic. Navíc tam &quot;telefonování&quot; Rabimu přitáhlo ty světlý kokoty a Kraus zjevně šílí i z vlastního stínu, protože tam naší výjezdovku poslal taky. Nakonec se na to většina vybodla a s Rabim kterej nakonec fakt přišel a byl to fakt senilní blb tam zůstalo světlejch jen pár a pak já Křížová a Charistarch.\r\n</p>\r\n<p>\r\nRabi nějakou dobu žvanil jak sme všichni neschopný a nevzdělaný a pak se nějak dostal k tomu, že se jde překonfigurovávat nějakej hustodémonsky krutopřísnej golem na střeleckym ostrově. Tak jsme šli na střelák a tam jsme se dozvěděli že to má Vlada donutit odtáhnout z prahy. Tak jsem si řekl že by bylo fajn kdyby k tomu Vlad mohl taky něco říct a všichni s tim jak ovce souhlasili. Tak jsem Vladovi zavolal že se tam na něj něco chystá a pakse mi to podařilozdřet na tak dlouho, že to tam Vlad vážně stihnul (muj předpoklad, něco se tam začalo hemžit v šeru) ale nijak nezasáhl a nechal je to dodělat. Ccharistarch mi pak řekl, že to bzlzásah zhruba tak páté kategorie, tak budeme vymáhat od světlých zásah kategorie čtvrté, pro jistotu. Rabi si s Cahristarchem zamachrovali, něco co nevim co je a nic jsem necejtil údajně přenastavili v obraně prahy a rabi odtáhl do šera.\r\n</p>\r\n', 0, 0, 1, 1, 1344549600, '22:20', '1:30', 'nada\r\n', 'původně naše iniciativa\r\n'),
(109, 'duel', 1344710029, 61, 'sekundovat duel', 'Zima zabit Adlerovou\r\n', 'Zima pro nas bude delat.\r\n', 'Adlerová vyzvala na souboj Zimu, několika ranami krátkým mečem Zimu zabila. Vše bez magie. Tělo Zimy jsme převezli na štáb Denní hlídky.\r\n', 0, 0, 1, 1, 1009839600, '20.00', '20.30', '1x šero (přenášení mrtvého těla z místa duelu)\r\n', 'info z analytického \r\n'),
(110, 'Čerpání u NTK', 1344765009, 47, 'prověřit a zajistit', 'přišli jsme, viděli jsme, odešli jsme\r\n', 'možná umřou dva lidi...\r\n', 'U NTK nasával černý mág 4. kategorie Karel Majer, měl na to licenci 6. \r\nkategorie, tu jsme zkontrolovali a odešli jsme. Ten hajzlík si akorát \r\nvybral matku s dítětem, čímž mě značně znechutil...\r\n', 0, 0, 1, 1, 1344722400, '10:00', '10:10', '<p>\r\nSakeena 1x šero\r\n</p>\r\n<p>\r\nKoblížek 1x šero, 1x pravdivé vidění \r\n</p>\r\n', 'Právě mi to tu vyhodlo, že před budovou NTK bude provedeno magické \r\nčerpání. Nejsem si tím přesně jist, ale je možné že jedno už proběhlo, a\r\nmohlo to někoho ohrozit na životě.\r\n'),
(111, 'Zmatená vědmička, Sady Svatopluka Čecha', 1354238325, 38, 'pořešit zmatenou nově iniciovanou vědmu', 'V parku na Nám. Svatopluka Čecha pobíhala zmatená nedávno iniciovaná vědma. Zajistili jsme jí a vysvětlili vše potřebné.\r\n', 'Vypadá to, že nic neprovedla takže asi nic.\r\n', 'Přišli jsme viděli jsme vědmu, zabředli jsme do rozhovoru. Richard se snažil vysvětlit, o čem že ten náš svět ve skutečnosti je. Byla trochu natvrdlá, ale to je každej druhej při iniciaci. Nakonec jsme ji dostali na štáb kde se ji ujala Eva. Nasledující den se má dostavit a uvidí se co dál.\r\n', 0, 0, 1, 1, 1354143600, '23:50', '00:10', '2x 1. šero, skoro nic\r\n', 'Noc je sice ještě mladá, ale vypadá to, že \r\nnebude tak poklidná, jak bysme si přáli. Zaznamenali jsme, že v sadech \r\nSv.Čecha se bude vyskytovat zvýšená magická aktivita. Orientační časové \r\nrozmezí je 22:40 - 22:55.\r\n<div class="postbody">\r\n</div>\r\ninfo z analytického atd.\r\n'),
(112, 'Agresor na nám. Míru', 1354239788, 47, 'pozorovat', 'Prošli jsme se s Dimou na Mírák a kde nic tu nic\r\n', 'Světlí se tam pravděpodobně porvali, třeba to někdo z nich aspoň trochu schytal, my bohužel nevíme nic\r\n', 'Já a Dima jsme vyrazili jako pozorovatelé na hlášený incident na Míráku, dorazili jsme přesně ve 2:00, ale na místě už byl klid. Zavolala jsem na analytiku a bylo mi řečeno, ře na místě došlo k potyčce, ve které se angažovala NH. Tak jsme se vrátili zpátky.\r\n', 0, 0, 1, 1, 1354230000, '2:00', '2:20', 'nic\r\n', '<p style="margin: 0px 15em 0.6em 0px; padding: 0px 0px 5px; line-height: 1.2em; font-size: 10px; color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999" class="author">\r\n<a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=527#p527"><img style="margin: 0px; padding: 0px; border-width: 0px" src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target.gif" alt="Příspěvek" title="Příspěvek" width="11" height="9" /></a>od&nbsp;<strong style="margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong>&nbsp;&raquo; pát 30. lis 2012 1:27:20\r\n</p>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nLinie mi tady hlásí, že kolem druhé hodiny by se na náměstí Míru měl vyskytovat Jiný, který vykazuje v pravděpodobnosti agresivní chování. Buďte opatrní.\r\n</div>\r\n'),
(113, 'Svůdnice na večeři', 1354279097, 38, 'dát si pivo, omrknout upírku', 'Upírka s člověkem v klubu, bez licence, lovit prý neměla v úmyslu.\r\n', 'Třeba se neudržela a lovila, měli bychom zjistit, jestli ten člověk žije. (Jméno Jan Jiřský)\r\n', 'Přišli jsme, viděli jsme, dali si pivo, uspali člověka co tam s ní byl. Vyptali se jestli má licenci. Prý ne, ale je tu jen na rande a lovit nebude. Dostala doporučení ať se o nelicencovaném lovu nedozví světlí.\r\n', 0, 1, 0, 1, 1354230000, '0:40', '1:00', '2x scan 1xopium\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.1851863861084px; background-color: #999999">Linky právě zaznamenaly dvě osoby, jednu označují za potenciálně nebezpečou.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.1851863861084px; background-color: #999999">Vyplivlo mi to tu adresu &quot;Legerova 39&quot; a nějakej podnik v čase 0:40.</span>\r\n'),
(114, 'Svůdnice a večeře', 1354279201, 38, 'dát si pivo, omrknout upírku', 'Upírka s člověkem v klubu, bez licence, lovit prý neměla v úmyslu.\r\n', 'Třeba se neudržela a lovila, měli bychom zjistit, jestli ten člověk žije. (Jméno Jan Jiřský)\r\n', 'Přišli jsme, viděli jsme, dali si pivo, uspali člověka co tam s ní byl. Vyptali se jestli má licenci. Prý ne, ale je tu jen na rande a lovit nebude. Dostala doporučení ať se o nelicencovaném lovu nedozví světlí.\r\n', 0, 0, 1, 1, 1354230000, '0:40', '1:00', '2x scan 1xopium\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.1851863861084px; background-color: #999999">Linky právě zaznamenaly dvě osoby, jednu označují za potenciálně nebezpečou.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.1851863861084px; background-color: #999999">Vyplivlo mi to tu adresu &quot;Legerova 39&quot; a nějakej podnik v čase 0:40.</span>\r\n'),
(115, 'Sforza na nadrazi', 1354282453, 22, 'Zjistit kto eto', 'Prijechal kfetar se starozitnosmi Sforza, svetli jego doprovodili, ma tu sraza se svojim kontaktom.\r\n', 'Vazmozno ze s nim budu nejake ksefty.\r\n', '<p>\r\nMy prijechali, zaregistrovali, odjechali. Svetlije byli tam toze, cetyre jich bylo, dva skoro novije.\r\n</p>\r\n<p>\r\nSforza tam mel sraza s kontakticou - patrno ta cerpajici od Fidlovacky.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354143600, '23:40', '23:55', 'Nicevo.\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">Hele tohle je zvláštní, linky ukazují Jiného, který míří na Nádraží Vršovice, ale co&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">to je zač nejsem schopen odhadovat. Ani co tam chce, ale ukazuje to kolonku&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">&quot;potenciálně důležité&quot;.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">Čas protnutí linek mi to hlásí T=-40 minut</span>\r\n'),
(116, 'Sforzovic ksefty', 1354285499, 22, 'Vyslechnut rozgovor Sforzy i jego kontaktnice', 'Ve vtarom sumraku vyslechnuti, pak pogovoreno s nimi. Miller jest durak.\r\n', '<p>\r\nMiller do guli nakopany s ocasom do riti zarazenym.\r\n</p>\r\n<p>\r\nVazmozno ze nejake ksefty se Sforzom.&nbsp;\r\n</p>\r\n', '<p>\r\nNa miste byli uze svetlyje - Miller s nejakym novym. Kagda Sforza s kontaktnicou dorazil, Ragulin na ne prilepilsja ve vtarom sumraku i paslusal. Renatocka s Adamom mezitim svetlych do riti posilali, az bylo dolzno Millera prikazom odeslat. Predtim slusno vysvetlili, ze do tego nemaji se plest, jenom ze vazmozno ve vtarom sumraku paslusat.<br />\r\nGovorili o ruznych vjecech. Sforza zdes shanit poschovavane Alexoviny. Maškova mu donesla kus svitka, vypada kak popis necego gde neco najit i necego s tim sdelat. Potrebuje vtaroj kus.\r\n</p>\r\n<p>\r\nKagda Miller ili negdo drugy ze svetlych Sforzovi napraskal SMSku, ze jego nekdo paslusajet, Ragulin ze sumraku vylezl i normalno s nimi pokecal.\r\n</p>\r\n<p>\r\nSforza skazal, sto kak preneseme vtaruj kus svitka, pakazet svoj kus za pakazani nasego. U menja trosky jego svitka, vapjervych bych pazkusal dat dohromady, kak sezeneme vtaroj kus.\r\n</p>\r\n<p>\r\nZminovali toze nejaku Vlcicu, pravdepodobno vlkodlaci eso, katoryje zacina projevovatsja.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354230000, '11:00', '12:00', 'Vtaroj sumrak pul godiny, dva skeny.\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">Pravděpodobnostní linky mi tu ukazují určité předání informací a schůzku, která se&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">bude konat každou chvíli (11:00) na adrese &quot;Na Zámecké 597/11&quot;.</span>\r\n'),
(117, 'Výhrůžný dopis', 1354286866, 47, '...', 'přišel nám výhrůžný pamflet, podle pravopisu soudím nejspíš na vlkodlaka nebo podobnou verbež, NH obdržela totéž\r\n', 'mohly by z toho být problémy, určitě se najde pár blbců, který si ho poslechnou a vezmou jeho názory za své, uvidíme...\r\n', '<p>\r\nTEXT DOPISU:\r\n</p>\r\n<p>\r\nMilá Dení i Noční Hlídko,\r\n</p>\r\n<p>\r\nJděte doprdele. Už mě nebaví dodržovat ty vaše zákony a pořád prosit o žrádlo a další mylosti. Stejně jako mě serete tim co tady v Práglu vivádíte. Ste normální?\r\n</p>\r\n<p>\r\nNež se nakrknete, řeknu všem Jiným v Práglu i lidem, že ste děsný kreténi, který neuměj ani ohlídat vlastní lidi a chtěj kontrolovat celou Prahu.\r\n</p>\r\n<p>\r\nA nic s tim neuděláte a budete to mít.\r\n</p>\r\n<p>\r\nNASERTE SI!!! \r\n</p>\r\n<p>\r\nL.B. \r\n</p>\r\n', 0, 0, 1, 1, 1354230000, '15:35', '15:40', 'nic\r\n', 'nic\r\n'),
(118, 'Dlak u divadla na Vinohradech', 1354288058, 38, 'drapnout dlaka', 'Dlak, oběť, útok, frezze, amnésie\r\n', 'Natapetování světlušek\r\n', 'Přišli jsme viděli jsme světlušky, tak jsme šli šikanovat jejich obratně Česílka. Po chvíli přešlapování jsem viděl podezřelou osobu, jal jsem se jí sledovat. Po pár krocích se na ní vyřítil dlak, dal jí dvě šlupy, sám schytal frezze. Když se uklidnil, odvezli jsme ho na štáb aby si mohl postěžovat. Večer nám pomůže tapetovat světlý.\r\n', 0, 0, 1, 1, 1354230000, '15:00', '15:30', '2x scan 1xfrezze 1x šerá dýka 1x amnézie plus nějáké to šero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">V ulici Římská mi tu ukazuje hrozící napadení člověka nějakým asi rozdivočelým vlkodlakem. Rychle tam, bude tam za půl hodiny.</span>\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(119, 'Přepadení na Sladkovského nám.', 1354311691, 47, 'vyšetřit, zajistit', 'Našl jsme zmláceného vědmáka, kterého přepadl vlkodlak a obral ho o amulety\r\n', 'vlkodlak se může pokusit amulety prodat nebo přepadne někoho dalšího, máme jeho symbol, takže ho můžee případně vyhmátnout\r\n', 'Na výjezd jsem vyrazila s Igorem Vandrovcem a Igorem Herzem, jeli jsme autem, takže jsme na místě byli poměrně ryhle. Našli jsme zmláceného vědmáka - Ladislav Alexandr Malinovskij, 2.kategorie, napřed se trochu cukal, uzavíral se mi před scanem, ale pak povolil. Byl dost zřízenej, moc si toho nepamatuje. Nedaleko od místa přepadení bydlí v hotelu, přicestoval do Prahy dnes, vlkodlak ho přepadl, když se šel projít. Schytal pár ran do hlavy, takže nebyl schopen dodat soupis ukradených amuletů, pamatuje si jen, že měl nějaký přívěšek na krku. Stihl zakouzlit asi jeden Shock, není si jistý, symbol máme. V Praze má v plán zůstat pár dní, možná nás ještě zkontaktuje. Pana Malinovského jsme nakonec odeslali ke Světlým na registraci a na léčení.\r\n', 0, 0, 1, 1, 1354230000, '21:40', '22:30', '<p>\r\n2x vstup do šera (Sakeena, Igor Herz)\r\n</p>\r\n<p>\r\n1x proměna\r\n</p>\r\n<p>\r\n2x scan&nbsp;\r\n</p>\r\n', '<p style="margin: 0px 15em 0.6em 0px; padding: 0px 0px 5px; line-height: 1.2em; font-size: 10px; color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999" class="author">\r\nod&nbsp;<strong style="margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=64">org_Bara</a></strong>&nbsp;&raquo; pát 30. lis 2012 21:38:11\r\n</p>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nNa Sladkovského náměstí by mělo dojít během chvíle k napadení Jiného. Nejsem si jistý, jestli boj už proběhl, ale nevypadá to dobře. Možná, že je v ohrožení našinec.\r\n</div>\r\n'),
(120, 'Napadení jedna báseň', 1354321911, 45, 'proverit napadeni cloveka jinym', '<p>\r\nZatkli jsme obratene 6 kategorie Marek Stizny, spolu s pozorovatelkou Sivou odvezli na vyslech na stab.\r\n</p>\r\n<p>\r\nPo ceste na stab Siva nedbala trech vyzev a debatovala se zatcenym. Koblizek ji pomoci kouzla prikaz donutil mlcet.&nbsp;\r\n</p>\r\n', '<p>\r\nSiva si bude stezovat\r\n</p>\r\n<p>\r\nZadrzeneho nutne vyslechnout&nbsp;\r\n</p>\r\n', '<p>\r\nDojeli jsme na misto. Koblizek sel vyslechnout podezreleho Marka Stizneho. Dotycny pil pivo a byl ve velmi divne nalade. Po chvili dorazila vyjezdovka svetlych. Podezrely doznal ze v prilehlem sadu roztrhal cloveka. Neznal ho, udelal to aby si ulevil od stresu, libilo se mu to.&nbsp;\r\n</p>\r\n<p>\r\nSpolupracoval a souhalsil s vyslechem na stabu.\r\n</p>\r\n<p>\r\nPo ceste jsme snim nezavazne s Richardem konverzovali a utesovali ho ze to se u vlkodlaku stava porad a da se stim dobre zit, jen je treba mit na takoveto cinny povoleni. Snazili jsme se z neho jeste pred vyslechem zjistit nejaka voditka k tomu jestli je to jeho prvni obet ci je to seriovy vrah.\r\n</p>\r\n<p>\r\n&nbsp;Siva nam stale skakala do reci a marila nase snahy o zjisteni skutecnosti. Po tretim upozorneni ji Koblizek pomoci prikazu donutil mlcet.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354316400, '14:10', '14:30', 'jeden prikaz\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Na místě GPS souřadnic: 50&deg;4''8.077&quot;N, 14&deg;26''8.578&quot;E došlo k napadení člověka. Je to ale nějaké zvláštní. Zkuste to prověřit a dejte vědět o co jde. Pachatel se tam z neznámého důvodu stále zdržuje.</span>\r\n'),
(121, 'Napadení jedna báseň vyslech', 1354322516, 45, 'Marek Stizny', '<p>\r\nVyslech vraha Marka Stizneho, ktery se doznal k zabiti cloveka. Bohuzel se i pres krizovou intervenci Sive odhmotnil.&nbsp;\r\n</p>\r\n', 'Siva je nasrana na Koblizka. Podat stiznost na Sivou ze prerusovala vyslech a nedrzela se role pozorovatele.\r\n', '<p>\r\nDorazili jsme na stab. Bohuzel Sive prave skoncil prikaz mlceni.\r\n</p>\r\n<p>\r\nOpet mela tendence kecat do vyslechu.&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;Stizny popsal jak predchoziho vecera mel spatnou naladu a dal si dva panaky. Mel black out pri nemz se promenil a rozsapal cloveka. K rozumu prisel pri zacatku trhani cloveka na kusy, ale byl to pro nej velmi prijemny pocit a tudiz pokracoval.&nbsp;\r\n</p>\r\n<p>\r\nPo te ho chytlo spatne svedomi a opet se uchylil k alkoholu. Dale Stizny pripustil, ze kdyby jsme ho neprijeli zatknout, tak by nejspise zabil dalsiho cloveka.\r\n</p>\r\n<p>\r\nDale poukazal na to ze uz pet let se snazit smirit stim ze je jiny a nedari se mu to. Prohodil par slove se Sivou, kteraz je taktez obraten . Tedy polozil ji &nbsp;nejake otazky. Na ktere jsme ji nechali odpovedet. \r\n</p>\r\n<p>\r\nPak si Sakeena vsimla ze se dotycny rozplyva. Sakeena dovolila Sive, aby mu zkusila pomoct... Bohuzel se dotycny pod tihou svych hrichu odhmotnil.&nbsp;\r\n</p>\r\n', 0, 0, 1, 2, 1354316400, '14:40', '14:50', '0\r\n', 'Zatceny z vyslechu\r\n'),
(122, 'Vrazda u Charlese Andre Josepha Maria de Gaullea 1', 1354373014, 66, 'Zjisteni stavu veci', 'Prosetreni podezrele civilni vrazdy s podezrenim na ucast min. jednoho Jineho.\r\n', 'N/A\r\n', '<p>\r\nHlidkari Hradil (vedeni zasahu) a Herz dorazili na misto vysetrovani (kde jiz pusobil nejaky mestak), a prohledali misto cinu. \r\n</p>\r\n<p>\r\n-Nenalezeny zadne magicke stopy.\r\n</p>\r\n<p>\r\n-Zajisteny zesnuleho nakupni seznam spolecne s rozpisem schuzek (<em>zde doplnit</em>)&nbsp;\r\n</p>\r\n<p>\r\nPredbezny odhad udalosti - Neznamy Jiny pachatel vstoupil v seru do bytu Pavla &quot;Měďi&quot; Maleho, tohoto zmasakroval v realite v koupelne, a nasledne zmrtveneho odklidil opet pres sero (nenalezeny stopy fyzickeho naruseni objektu/svedek pred dvermi bytu po celou dobu vrazdy).\r\n</p>\r\n', 0, 0, 1, 1, 1354316400, '14:00', '14:30', 'Nic\r\n', 'info z analytického\r\n'),
(123, 'Bitka na štvanici', 1354376298, 65, 'zajistit místo činu, stopy, etc.', 'Na cípu štvanice, se dle analytiků sthrla magická bytka, tak sme tam jeli sebrat zbytky.\r\n', '??\r\n', '<p>\r\nPřijeli sme s igorem na štvanici, šli sme v šeru, všude byla krev, stopy, symboli, etc. Po chvíli přišla noční hlídka v počtu čtyř osob. Hned sme je za to vypíčovali, tak se začali hrozně omlouvat a dva teda vycouvali, mno zkoušej to furt asi no. Světlí byli důrazně upozorněni, že nemají pořizovat žádné záznami, pokud něco budou chtít mají se obrátit oficiální cestou na naší hlídku. Načež světlí obrateň nějak šel a pořídil fotku igorova symbolu. Tak sme je znova vypíčovali a řekli, že se to bude řešit přes jejich šéfa, tak sklopili uši a utekli. Mno a pak sme šli pryč.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nP.S. po příjezdu na štáb, bylo zjištěno, že tam koblih někoho zbil :-) takže pohoda&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354316400, '14.00', '15.30', '2 vstupy, jedna transformace, jeden scan\r\n', 'Magická bitka, jeden mrtvý, kouzla\r\n'),
(124, 'Vražda (K Žižkovu 4) ', 1354387534, 47, 'vyyšetřit, zajistit svědky', 'Na místě se pořezali dva Jiní v realitě, viděl to člověk = průser\r\n', 'podle mě žádné, všechno je čistě vyřešeno\r\n', '<p>\r\nNa místě jsem zajistila člověka, slečnu Kláru Tyršovou, která mi poněkud otřeseně popsala, co se stalo, v domnění, že pracuju pro zvláštní policejní oddělení. Podle jejího svědectví tam přišel starší týpek s krásnou slečnou, vysokou blondýnkou a začali si to tam s klidem rozdávat, načež se objevila nějaká černovlasá &quot;fúrie&quot;, začala křičet a nadávat chlapovi, ž eji zradil. Blondýnka utekla a týpek začal utíkat na druhou stranu, při tom tam porběhla nějaká kouzla a &quot;fúrie&quot; z chlápka udělala sochu... Zajímalo by mě jak, možná jen nějaký lepší freeze, neměli jsme moc času to řešit.\r\n</p>\r\n<p>\r\nPůvodní lán vymyzat svědkovi paměť by neměl efekt, poněvadž k události došlo před příliš dlouhou dobou, tudíž jsme se rozodli slečny zbavit a s jejím souhlasem (po nakecání, že existují paraelní dimenze, díky kterým se dějou tyhle divný případy, tudíž s jejím vlastně nadšeným souhlasem) jsem ji vtáhla do šera. Problem solved, bez jediné magické stopy.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354316400, '11:55', '12:30', '2x šero (Koblížek, Sakeena)\r\n', '<p style="margin: 0px 15em 0.6em 0px; padding: 0px 0px 5px; line-height: 1.2em; font-size: 10px; color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999" class="author">\r\nod&nbsp;<strong style="margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong>&nbsp;&raquo; sob 01. pro 2012 11:52:27\r\n</p>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nMáme tu hlášeno nelegální užití magie a pravděpodobnou smrt dvou osob na adrese K Žižkovu 851/4. Nutno prozkoumat, dle kamery tam zůstalo několik svědků a mohl by to být veliký problém.\r\n</div>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\n&nbsp;\r\n</div>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\n&nbsp;<span style="color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 10px; line-height: 1.2em">od</span><span style="color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 10px; line-height: 1.2em">&nbsp;</span><strong style="color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 10px; line-height: 1.2em; margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong><span style="color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 10px; line-height: 1.2em">&nbsp;</span><span style="color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 10px; line-height: 1.2em">&raquo; sob 01. pro 2012 12:25:00</span>\r\n</div>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nTak teď mi to na stejné adrese vyhodilo: Velice podivné úmrtí člověka, okolnosti nejasné.\r\n</div>\r\n'),
(125, 'Sání/ovlivňování na Bělehradské', 1354397194, 51, 'prověřit', 'Temný mág III. kategorie Václav Novák (vypadal jako Mortimer a má přesně stejnej telefon 739 699 906) chlastal (po padesáti letech konec služby u pardubické hlídky) a sál. A byl hrozně roztomilej. Tak jsme mu pogratulovali, vysvětlil, aby dál už jen chlastal, a ne sál, protože za chvíli začíná čas světlých a k tomu jsou pár bloků odsud, což nám slíbil a udělal, a odjeli. Řek nám, že sme moc správný kucí. O kousek dál jsme projeli kolem marně pátrajících světlých (těch z Fidlovačky, viz). Juchej.\r\n', 'pokud světlí nenajdou symboly a jeho současně, tak asi žádné\r\n', 'viz výše\r\n', 0, 0, 1, 1, 1354316400, '21:4o', '21:50', 'nula nula nic\r\n', '<p style="margin: 0px 15em 0.6em 0px; padding: 0px 0px 5px; line-height: 1.2em; font-size: 10px; color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999" class="author">\r\nod&nbsp;<strong style="margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong>&nbsp;&raquo; sob 01. pro 2012 21:29:35\r\n</p>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nMám tu na linkách nějakého drzouna. Pohybuje se směrem z Náměstí bratří synků po Bělehradské ulici. Vypadá to tu jako by krok po kroku ovlivňoval po cestě lidi a sál energii. Si neuvědomuje, co to dělá za průsery?<br />\r\n<br />\r\nZvládnete ho nějak po té ulici konfrontovat?\r\n</div>\r\n<div id="sig642" class="signature" style="margin: 1.5em 0px 0px; padding: 0.2em 0px 0px; font-size: 1.1em; border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; clear: left; line-height: 15px; overflow: hidden; width: 668.7833251953125px; color: #333333; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999">\r\nPro Vás, chalani, Váš milý, skvělý a informovaný analytik<br />\r\nJarek Takemaly<br />\r\n<br />\r\nkdyby něco, zavolejte, že nesete tabák na číslo 776 386 659\r\n</div>\r\n'),
(126, 'Přepadení u Fidlovačky', 1354398352, 51, 'prověřit', '<p>\r\nU Fidlovačky (divadlo, Nusle) dva temní\r\n</p>\r\n<p>\r\nDavid Málek 607 903 809 upír V\r\n</p>\r\n<p>\r\nIva Krdlická 736 255 768 vědma\r\n</p>\r\n<p>\r\nmlátili - pěstí, žádné porušení dohody - bílou pizdu Lambertovou a to kvůli své kamarádce, její temné sestře. Rázně jsme je napomenuli, pizdě řekli, aby si zašla na policii, upíra později odvezli na štáb, kde se v klidu domluvil s Evou S. Za světlé dva pozorovatelé, vedl Jakub Hradecký 721 091 257.\r\n</p>\r\n<p>\r\nDodatek: upír je blbec. Já mu řekl, že NEjede na výslech, Eva S. mu řekla, že to NEní výslech, pak mu zavolali světlí a on jim řekl, že byl... na výslechu. Komu není rady, tomu asi soud.\r\n</p>\r\n', 'zpočátku to vypadalo, že nic, ale asi si to pokazí hloupostí\r\n', 'viz výše\r\n', 0, 0, 1, 1, 1354316400, '21.20', '21:30', 'viz výše\r\n', '<p style="margin: 0px 15em 0.6em 0px; padding: 0px 0px 5px; line-height: 1.2em; font-size: 10px; color: #efefef; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999" class="author">\r\nod&nbsp;<strong style="margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong>&nbsp;&raquo; sob 01. pro 2012 20:50:12\r\n</p>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff; background-color: #999999">\r\nLinie ukazují napadení Jiného v čase 21:20 u divadla na Fidlovačce.\r\n</div>\r\n<div id="sig639" class="signature" style="margin: 1.5em 0px 0px; padding: 0.2em 0px 0px; font-size: 1.1em; border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; clear: left; line-height: 15px; overflow: hidden; width: 668.7833251953125px; color: #333333; font-family: Verdana, Helvetica, Arial, sans-serif; background-color: #999999">\r\nPro Vás, chalani, Váš milý, skvělý a informovaný analytik<br />\r\nJarek Takemaly<br />\r\n<br />\r\nkdyby něco, zavolejte, že nesete tabák na číslo 776 386 659\r\n</div>\r\n'),
(127, 'Duševně labilní jiný na náměstí Míru', 1354401701, 68, 'Zjistit, co se mu stalo', '<span style="white-space: pre" class="Apple-tab-span">		</span>\r\n', 'Možné oběti\r\n', '<div>\r\n<br />\r\n</div>\r\n<div>\r\nPo prijezdu na misto vidime, ze ho tam jiz hleda nocni hlidka.Otec Matous Maxvell a Jakub Hradecky. Podezrely po chvili nalezen na schodech kostela, tresouci, zmateny a dezorientovany. Scanem zjisteno Jakub Kavka, lecitel, 5. kategorie. Mluvi o vysati nekolika lidi, ze jim nechtel ublizit a nevi proc to udelal. Jicinsky v seru zjistuje pripadne viditelne prokleti aj. Z podezreleho se nakonec podarilo dostat misto cinu, zde nalezen symbol nasmerovany na obytny dum - vysati 8 osob.\r\n</div>\r\n<div>\r\nPo konzultaci s vedenim podezrely odveden na vyslech na stab DH. Otec Maxwell z NH pritomen u vyslechu. Vysledek vyslechu - &nbsp;zasah 4. kategorie.&nbsp;\r\n</div>\r\n', 0, 0, 1, 1, 1354316400, '20:20', '21:00', 'vstup do sera, scan\r\n', 'info z analytického atd.\r\n'),
(128, 'Čerpání na Náměstí Míru a Vítězném náměstí + rituály na Hradčanské a v Šárce u hřbitova', 1354412156, 26, 'omrknout terén, zajistit symbol, zjistit spojitosti', 'pravděpodobně vědmák/zaříkávač (léčitel?) čerpal po praze a pak udělal dva rituály, zvláštní bylo, že byly vertikálně nakreslené\r\n', 'někdo se nacucal, zarituálil a prošlo mu to, zkusí to znovu\r\n', '<p>\r\nna nám. Míru jsem hledal místo čerpání, po konzultaci s analytickým oddělením jsem našel otisk aury na vedlejších schodech kostela, následoval přesun na Vítězné náměstí, kde se potvrdilo, že sosá pořád jede na ten samý\r\n</p>\r\n<p>\r\nstejnému pachateli přisuzujeme i provedení rituálu na Hradčanské a v Divoké Šárce, jistotu nemáme, rituální obrazce a otisk aury se nepodařilo u rituálů zjistit\r\n</p>\r\n<p>\r\npachatel pravděpodobně čerpal ještě na několika dalších místech&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354230000, '14:00', '14:30', 'nada\r\n', '<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 19px; background-color: #999999">Došlo k dalšímu čerpání, linie vypovídají o stejném pachateli.<br />\r\n</span><span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 19px; background-color: #999999">A je to blízko, saje vám přímo pod nosem na náměstí Míru.</span>\r\n</p>\r\n'),
(129, 'Světlušky u kafárny', 1354441359, 59, 'zjistit co vyváděj', 'světlušky si vyrazili dělat rituál ke kafárně\r\n', 'světlušky najdou co z ní zbylo\r\n', 'Na místo jsme dorazili o cca čtvrthodiny předem a zaujali pozorovatelskou pozici opodál. V daný čas dorozila skupinka jiných (dva zaříkávači/léčitelé a Dub). &nbsp;Nechali jsme je zahájit rituál a vydali se k nim po chvíli pozorování jsem zjistil že jde o &quot;Silvův myšlenkový rituál&quot; a to II stupně (ve zkratce jde o rituál kdy se dotyčný &quot;ptá&quot; šera na danou otázku). Oznámili nám že se snaží touto cestou přijít na stopu ztracené manželky. Co zjistili nám odmítli říct že prý až se Nejsmutnější rozhodne ja s informacemi naloží.\r\n', 0, 0, 1, 1, 1354316400, '1:45', '2:30', 'Silvův myšlenkový rituál cca 250 mg, Hradilovo šero\r\n', '<div id="p659" class="post bg2" style="margin: 0px 0px 10px; padding: 0px 10px; background-color: #999999; color: #ffffff; font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 10px; background-position: 100% 0px; background-repeat: no-repeat no-repeat">\r\n<div class="inner" style="margin: 0px; padding: 0px">\r\n<div class="postbody" style="margin: 0px; padding: 0px; line-height: 1.48em; color: #333333; width: 668.7833251953125px; float: right; clear: both">\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff">\r\nTak tu mám provádění nějakého rituálu na zřídle u Kafárny.<br />\r\n<br />\r\nJe to někdo z našich?\r\n</div>\r\n<div id="sig659" class="signature" style="margin: 1.5em 0px 0px; padding: 0.2em 0px 0px; font-size: 1.1em; border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; clear: left; line-height: 15px; overflow: hidden; width: 668.7833251953125px">\r\nPro Vás, chalani, Váš milý, skvělý a informovaný analytik<br />\r\nJarek Takemaly<br />\r\n<br />\r\nkdyby něco, zavolejte, že nesete tabák na číslo 776 386 659\r\n</div>\r\n</div>\r\n<dl id="profile659" class="postprofile" style="margin: 5px 0px 10px; padding: 0px; min-height: 80px; border-right-width: 1px; border-right-style: solid; border-right-color: #ffffff; width: 193.60000610351563px; float: left; display: inline; border-left-color: #ffffff"><dt style="margin: 0px 0px 0px 8px; padding: 0px; line-height: 1.2em"><span style="margin: 0px; padding: 0px; font-size: 12px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #105289; text-decoration: initial; font-weight: bold" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></span>&nbsp;<br />\r\n</dt><dd style="margin: 0px 0px 0px 8px; padding: 0px; line-height: 1.2em"></dd><dd style="margin: 0px 0px 0px 8px; padding: 0px; line-height: 1.2em"><strong style="margin: 0px; padding: 0px; color: #efefef">Příspěvky:</strong>&nbsp;84</dd><dd style="margin: 0px 0px 0px 8px; padding: 0px; line-height: 1.2em"><strong style="margin: 0px; padding: 0px; color: #efefef">Registrován:</strong>&nbsp;čtv 08. lis 2012 19:29:09</dd><dd style="margin: 0px 0px 0px 8px; padding: 0px; line-height: 1.2em">\r\n<ul class="profile-icons" style="margin: 0px; padding: 10px 0px 0px; list-style: none">\r\n	<li class="pm-icon" style="margin: 0px 6px 3px 0px; padding: 0px; background-image: url(''http://www.prazskahlidka.cz/forum/style.php?id=2&amp;lang=cs''); float: left; background-position: 0px 100%; background-repeat: no-repeat no-repeat"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #105289; text-decoration: initial; background-image: url(''http://www.prazskahlidka.cz/forum/style.php?id=2&amp;lang=cs''); display: block; width: 0px; height: 0px; font-weight: bold; background-position: 0px 0px; background-repeat: no-repeat no-repeat" href="http://www.prazskahlidka.cz/forum/ucp.php?i=pm&amp;mode=compose&amp;action=quotepo