ground-image: url(''http://www.prazskahlidka.cz/forum/style.php?id=2&amp;lang=cs''); float: left; background-position: 0px 100%; background-repeat: no-repeat no-repeat"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial; background-image: url(''http://www.prazskahlidka.cz/forum/style.php?id=2&amp;lang=cs''); display: block; width: 0px; height: 0px; background-position: 0px 0px; background-repeat: no-repeat no-repeat" href="http://www.prazskahlidka.cz/forum/report.php?f=3&amp;p=660" title="Ohlásit tento příspěvek"></a></li>\r\n	<li class="quote-icon" style="margin: 0px 0px 0px 10px; padding: 0px; background-image: url(''http://www.prazskahlidka.cz/forum/style.php?id=2&amp;lang=cs''); float: left; background-position: 0px 100%; background-repeat: no-repeat no-repeat"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial; background-image: url(''http://www.prazskahlidka.cz/forum/style.php?id=2&amp;lang=cs''); display: block; width: 0px; height: 0px; background-position: 0px 0px; background-repeat: no-repeat no-repeat" href="http://www.prazskahlidka.cz/forum/posting.php?mode=quote&amp;f=3&amp;p=660" title="Odpovědět s&nbsp;citací"></a></li>\r\n</ul>\r\n<p style="margin: 0px 15em 0.6em 0px; padding: 0px 0px 5px; line-height: 1.2em; font-size: 1em; color: #efefef" class="author">\r\n<a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=660#p660"><img style="margin: 0px; padding: 0px; border-width: 0px" src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target.gif" alt="Příspěvek" title="Příspěvek" width="11" height="9" /></a>od&nbsp;<strong style="margin: 0px; padding: 0px"><a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial" href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong>&nbsp;&raquo; ned 02. pro 2012 1:06:14\r\n</p>\r\n<div class="content" style="margin: 0px; padding: 0px 0px 1px; min-height: 3em; overflow: hidden; line-height: 1.4em; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 1.3em; color: #ffffff">\r\nLinky zaostřují čas provedení kolem druhé hodiny.\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n'),
(130, 'Lidi si hrajou na vědmy', 1354449582, 59, 'dojet na místo a zjistit co a jak', 'dorazili sme na místo zkouknuli &quot;rituál&quot; a iniciaci<span style="white-space: pre" class="Apple-tab-span">	</span>&nbsp;a&nbsp;jeli zpátky\r\n', '<p>\r\nsvětlušky mohou získat novou hlídkařku\r\n</p>\r\n<p>\r\njarek tachemaly má přístorje na h***o&nbsp;\r\n</p>\r\n', 'Dorazili jsme na určené místo a čekali po chvilce se objevila parta světlometů vedená šprckodlakem a skryli jsme se všichni do šera, po cca 15 minutách dorazila trojice lidí resp. dvou lidí a jedné potenciální jiné. Nechali jsme je zahájit &quot;rituál&quot; a pozorovali, z mé pozice vědmáka to bylo velmi úsměvné. Rituál skončil samovolnou iniciací té potenciální jiné je z ní světlá zaříkávačka/léčitelka. Světlušky si jí teda vzali do parády.&nbsp;\r\n', 0, 0, 1, 1, 1354402800, '4:00', '5:00', 'mockrát šero, 2x amnézie\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Tak tohle je velice zvláštní. Linky mi tu vyhazují, že kolem 4:00 na souřadnicích 50&deg;3''23.155&quot;N, 14&deg;27''6.595&quot;E bude probíhat určitý rituál, který se absolutně vymyká běžným parametrům.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Doporučuji opatrnost a spíše se nejdříve ujistit z povzdálí o co půjde, než se nějak angažujete.</span>\r\n'),
(131, 'sportovní lovy', 1354462094, 47, 'zadržet', 'dva kreténi upír s vlkodlakem se vsadili o to, kdo stihne zabít víc lidí...\r\n', 'Nejake nasledky lovu, ktere jsme nenasli.\r\n', 'S Koblížkem jsme se prošli po ulici Na příkopech, odchytili tam ty dva idioty - vlkodlačice 4.kat a upíra 4.kat. Už stihli pár lidí sejmout a kolem se motali světlušky, takže jsme je naložili do auta a vypadli jsme. V aute nás napadli, dost se to mlelo, Koblížek za volantem v provozu - museli jsme je zabít. Ne, že by si to nezasloužili.\r\n', 0, 0, 1, 1, 1354316400, '12:50', '13:30', '<p>\r\nšero (nevím kolikrát) Sakeena, Koblížek\r\n</p>\r\n<p>\r\n2xspánek - Koblížek\r\n</p>\r\n<p>\r\nZáhvího pouta - Sakeena\r\n</p>\r\n<p>\r\nKouzlení v autě, šero, tam si to nepamatuju.&nbsp;\r\n</p>\r\n<p>\r\nŠerá dýka - Koblížek\r\n</p>\r\n<p>\r\nmožná ještě něco dalšího&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">A sakra, tohle bude průser. Linie mi tu hlásí, že se právě upír s vlkodlakem chystají k něčemu jako závodu, kdo vysaje v centru více lidí.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Jejich odhadovaná trasa je z Můstku, ulicí Na příkopě k Prašné bráně, pak Celetnou na Staroměstské náměstí, Pařážskou k řece a pak podél nábřeží k Rudolfinu.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.200000762939453px; background-color: #999999">Dle časovače, kterej se tu už dva dny snažím naistalovat vyrazí z Můstku odhadem v 12:50.</span>\r\n'),
(132, 'Zavody Sforzove', 1354464380, 22, 'Pazjistit, sto tam slucitsja.', 'Sforza tam setkalsja s Danu Lambertovu, zjevno sebja znali, Sforza byl dost vztekly, ze ji zdes potkava. Dohodlis na kakomsi suboju dlouhodobem, pravidla kak obvyko.\r\n', 'Sforza i Lambertova budu zdes v Prage nejake prusery sdelat.\r\n', '<p>\r\nMy na misto dorazili ctvrt godiny predom, no svetlyje uze taky tam.\r\n</p>\r\n<p>\r\nKoblizek svetlyje opicaky i s hrabemi zahanel slusno i oni vicemene posusali.\r\n</p>\r\n<p>\r\nPak dorazil Sforza i Lambertova, pohadalisja i domluvilis na vyzve kakesi, zjevno uze eto sdelali.\r\n</p>\r\n<p>\r\nPak se rozesli.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1354402800, '16:00', '16:20', 'Neco sumraku, neco pravidvego videni, neco skena.\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.727272033691406px; line-height: 18.196969985961914px; background-color: #999999">Ukazuje mi to tady na setkání dvou Jiných v okolí nádraží Vršovice kolem 16:00.</span>\r\n'),
(133, 'Rolničky, rolničky aneb hrozný hlad trápí nás', 1354530887, 51, 'a) využít licence, jejichž propadnutí se blíží, a b) nasrat světlé, avšak zcela v mezích legality', '<p>\r\nJak sám název napovídá, již nějaký čas hlídkař Jičínský řešil, co s licencí, která mu koncem roku vyprší. (Ano, onen stále dokola omílaný debilní zvyk světlých vypisovat je prudce dočasně.) (A přiznejme si, že volná, tzn. bez udání osoby, licence na zásah 4. kategorie se jen tak nepovaluje na ulici a svou cenu rozhodně má, i na trhu.) Vše bohužel selhalo: světlí odmítli prodloužit anebo navrhovali potupné podmínky, vhodný neiniciovaný na výrobu lykantropa se nenašel, obchodník s artefakty prodal světlým své falsum (Karolinský kříž) a zmizel z Prahy... Až v neděli v podvečer přišel spásný nápad: bude se pít, tedy sát magická energie a to hrubě a hustě. A HODNĚ.\r\n</p>\r\n<p>\r\nNa spanilou jízdu vyrazilo komando ve složení <em>viz osoby -1 Koblížek </em>a metelice započala. První pití Novotný u Kafárny (200 magů á 5x40 z 5ti lidí). Druhé Hradil na rohu Slovenské a Francouzské (totéž). Třetí ke komandu se připojivší Koblížek na rohu Varšavské a Záhřebské (totéž). A čtvrté opět Novotný a to sice přímo za rohem od štábu světlých a na křižovatce Belgické a Záhřebské (totéž).\r\n</p>\r\n<p>\r\nZa zpěvu srdečné tradiční vánoční písně <em>Rolničký, rolničký / dál to neumim!</em> a <a href="http://www.youtube.com/watch?v=FQg7yy7JdPg" target="_blank">pohádkové</a> <em>Hrozný hlad / trápí nás / hrozný hlad / trápí nás </em>a rozpustilého popíjení vodky jsme míjeli zuřivě vybíhající pátrací komanda světlých a zcela opilecky debilně odpovídali na jejich dotazy, kde-že-to-probíhá-to-hrozné-sání... Je velice zajímavé, že ani při pohledu na naše (jinak to vážně nazvat nemohu) stupidně vytlemené ksichty jim to nedocházelo. Došlo to až <a href="readperson.php?rid=66&amp;hidenotes=0">Milerovi</a> (bod pro oberlajtnanta), kterého zuřivý výraz vystřídal při pohledu na Jičínského licenci výraz zcela mrtvičný, protože si uvědomil, že ve vesmíru celičkatém zastaviti nás jak nemá... <em>A nějakou chvíli to vypadalo, že se rozmýšlí, zda skočí pod vlak anebo na nás. Nakonec se přeci jen pokusil škrtit kolegu Koblížka, ovšem pracovník DH Hradil drzého útočníka v čase naší služby proškolil (toliko) Freezem - velkomyslné, není-liž pravda? Je ovšem nutné v rámci objektivity připustit, že kolega Koblížek Milerovi vysloveně s**l do obličeje, když mu na dotazy &quot;Co to děláte? Co to, sakra, děláte?&quot; s úsměvem od ucha k uchu odpovídal: &quot;My jenom plníme přání nejsvětlejšího&quot;.</em>\r\n</p>\r\n<p>\r\nGrandiózní finále odehrávalo se před štábem světlé, tzn. Noční, hlídky, kde nás obstoupili prakticky už všichni, včetně šéfa v papučkách. Ten ječel cosi o spoustách mrtvých, zničených, nešťastných a o tom, jak na nejtemnější bude požadovat 800vky magů, a podobné nepříčetnosti, také o Inkvizici, takže jsme mu strčili to blbé lejstro.\r\n</p>\r\n<p>\r\nHned na to se kolega Hradil se zájmem optal, co teď, když jsme využili tu Jičínského licenci 4. kategorie, má on dělat s tou svou kategorie 3, jejíž platnost rovněž brzy skončí, a to už světlí vypadali jako klub zdrcených japanofilních fanynek při zprávě o úmrtí <a href="http://www.youtube.com/watch?v=lqot4XT59II" target="_blank">Gora, bílého psa</a>.\r\n</p>\r\n<p>\r\nVrátili jsme se na štáb a - zcela oprávněně, to si nekriticky připusťme - jsme se stali hrdiny a nekorunovanými králi letošního klání o zlobody... Až nám je velení na Nový rok zresetuje, budeme se muset vážně zamyslet, co s tou Hradilovou licencí...\r\n</p>\r\n<p>\r\n<em>Rolničký, rolničký / dál to neumim!</em> \r\n</p>\r\n', 'Světlí budou šílet. A taky šíleli. Vypadali na mrtvici a že je vomejou. Kromě toho bude muset nejtemnější Eva S. řešit věci s nejsvětlejším, ale vypadala, že tentokrát jí to zase tak moc vadit nebude :-)\r\n', 'viz výše\r\n', 0, 0, 1, 1, 1354402800, '16:30', '18:00', 'různá kouzla během cesty, avšak &quot;náročnost&quot; bych tomu v tomto případě zrovna neříkal :-)\r\n', 'licence 4. kategorie, jejíž propadnutí se blíží (konec roku 2012)\r\n'),
(134, 'Léčba u milosrdných', 1354560802, 38, 'drapnou léčitele', 'zas nám tu někdo léčil...\r\n', 'nahradit vyléčené nemocnými\r\n', 'Vyrazili jsme na výjezd. Bohužel jsme na místo dorazli pozdě kvůli bloudění. Na místě jsme našli už jen pár symbolů, evidentně je někdo zanechal při léčení. Symoly jsme zaznamenaly a plynule jsme přešli k jinému výjezdu.\r\n', 0, 0, 1, 1, 1354316400, '17:30', '18:00', 'nic\r\n', '...\r\n'),
(135, 'Alexův odkaz', 1354644774, 38, 'sebrat co Alex rozházel', 'Alex poslal mail, s tim jak je stršně hustej a vůbec. V hádankové formě jsme dostali pět míst. Vybrat se podařilo jedno.\r\n', 'těžko říct co sebrali světlí, možná mají nové informace\r\n', '<p>\r\nZačali jsme objíždět místa se Sakeenou. V Riegrových sadech nic nebylo, ale vůbec to nevipadalo,že tam někdo kopal, tak těžko říct. Na Hlavním Nádraží jsme byli pozdě, tak jsem alespoň nastražil falešnou zprávu, kdyby přišel někdo po nás. Pak jsme se rozdělili. Já jel do Nuslí na Nám. Gen. Kultvarše. Tam jsem našel papír s emailem a heslem. Zase jsem nastražil falešný papír, jak jsem se dozvěděl vybrali si ho později světlí. Jak pořídila Sakeena v Shangrile nevim. Páté místo jsme nerozluštili.\r\n</p>\r\n<address>\r\nObsah mailu:<br />\r\nNic moc zajímavýho... tohle jsem našel na nám. Gen. Kultvarše<br />\r\n</address>\r\n<address>\r\n&nbsp;</address>\r\n<address>\r\n<span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>Dnes jsme myslel, že se opravdu neudržím smíchy. Na podzim roku 2011 vyšla aktualizace Barcelonského indexu, seznamu nejnebezpečnějších jiných v Evropě, který vydává Noční hlídka města Paříž. A hle, jméno Alexandr tam bylo také,&nbsp;<a id=&quot;pdbe991ba104f815209f210a35112cce6f3668b&quot; style=&quot;margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial&quot; href=&quot;http://www.jenzeny.cz/moda/zdravi-a-krasa&quot;>krásné</a>&nbsp;šesté místo, dokonce hned za osobnostma globálně známýma jako je Charistarch, Vandragaron a i takový Zavulon. Takže od 15.11.2011 jsem nejnebezpečnější upír v Evropě. Ha, Dracula se může jít klouzat a zase spát...</span><br />\r\n<span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\nTady je, co se mi dostalo do ruky:<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\nBarcelonský Index<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\nVedení Noční hlídky na mezinárodním evropském sjezdu v Barceloně dne 15.11. 2011 ustanovilo aktualizovaný seznam vlivných Temných pohybujících se na území Evropy. Tyto Jiné v tomto dokumentu hodnotí jako globální hrozbu pro rovnováhu nejen v Evropě, ale i celém světě. Je nanejvýš žádoucí omezit vliv těchto osob na celkové dění. Pro celou noční hlídku by mělo být prioritou na tyto osoby dohlížet a v případě možnosti se pokusit o jejich eliminaci (samozřejmě v rámcích Dohody).<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n1. Zavulon &ndash; Mág, Prastarý - Moskva<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n2. Charistarch &ndash; Mág, Velký - Praha<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n3. Vandragaron &ndash; Mág, Velký - Londýn<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n4. Taviskaron &ndash; Mág, Mimo Kategorie - Kyjev<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n5. Tarviel &ndash; Vědma, Mimo Kategorie	- Mnichov<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n6. Alexandr &ndash; Nejvyšší upír - Praha<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n7. Uma Schlaif &ndash; Vědma, 1. kategorie - Atény<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n8. Renata Lehotská &ndash; Mág, 2. Kategorie - Praha<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n9. Pablo Fetuttio &ndash; Nejvyšší upír - Turín<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n10. Edvin Laszlo &ndash; Nejvyší Upír - Gdaňsk<br />\r\n</span><span style=&quot;margin: 0px; padding: 0px; font-style: italic&quot;>\r\n11. Sonia Henie &ndash; Mág, 1. Kategorie - Mnichov</span></address>\r\n<address>\r\n<a style=&quot;margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; color: #ffffdf; text-decoration: initial; background-image: url(''http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_back_top.gif''); width: 11px; height: 11px; display: block; float: right; overflow: hidden; letter-spacing: 1000px; text-indent: 11px; background-position: 0% 0%; background-repeat: no-repeat no-repeat&quot; href=&quot;http://www.prazskahlidka.cz/forum/viewtopic.php?f=3&amp;t=251&amp;sid=a46763e27391b55eefc03dc94c63d194#wrap&quot; title=&quot;Nahoru&quot; class=&quot;top&quot;>Nahoru</a>&nbsp;</address>\r\n', 0, 0, 1, 1, 1354402800, '?', '?', 'nula nula nic\r\n', 'info z analytického atd.\r\n'),
(136, 'Mariáš je vážná věc', 1354645603, 38, 'Zastavit rvačku', 'Dva dlaci se servali, bez proměny takže vše ok\r\n', 'už si spolu nikdy nezahrajou mariáš\r\n', 'Přijeli jsme na místo, vyskočili z auta, řekli světlým, že jich je tu moc. Prošli jsme se po náměstí, načež jsme viděli, jak si dvě individua dávají do držky, čistě po lidsku. Vlítli jsme mezi ně, prý se servali, protože jeden druhýho obral v mariáši. Když nad tím teď přemýšlím tak mi lhali, protože mariáš se hraji ve třech nebo čtyřech, ne ve dvou. Každopádně jsme každého poslali na opačnou stranu a šli jsme domů.\r\n', 0, 0, 1, 1, 1354489200, '16:10', '16:30', 'šero, freeze, šerá dýka, scany\r\n', '<span style="background-color: #999999">Tak mi to tu ještě hlásí, že v 16:10 se pravděpodobně porvou dva agresivní Jiní na náměstí generála Kutlvašra.</span>\r\n'),
(137, 'Vražda? na hlaváku', 1354724018, 51, 'zjistit, zahladit', '<p>\r\nNení moc co: na uvedeném místě jsme našli: cákance od krve a kus papíru. (Někdo tam asi někoho sežral bo co a papír asi někomu vypad z kapsy.) Kus papíru odkazoval na ulici <a href="readactrep.php?rid=122&amp;hidenotes=0&amp;truenames=0">Charlese Andre Josepha Maria de Gaullea 1</a> a skvrny nebylo nutné nijak řešit, protože parčík (do kterýho mě v létě a v sandálích <strong>nikdo </strong>nedostane) je plnej hoven, stříkaček, jehel, rozdrcenejch skleněnejch ampulí a střepů a hlavně volezlejch bezďáků a fetek v posledním stádiu rozkladu. Popsané <em>exempláře</em> již z podstaty svého stavu musí mít halušky prakticky nepřetržitě, takže by jim nic divného nepřišlo ani na tom, kdyby se jim přímo před očima zhmotnil čaroděj ze země Oz, a i kdyby přišlo a i kdyby to zkusily někomu vyprávět, nikdo jim to neuvěří. Nadto u většiny z nich si souvislý a srozumitelný projev dokáži představit jen s velkým úsilím. Takže vážně nebylo moc co zahlazovat.\r\n</p>\r\n<p>\r\nPS: nikdy tam neposílejte samotné mladší hlídkařky, pokud jim nechcete dopřát trocha nevyžádaného a hodně nehygienického sexu a nádavkem dáreček v podobě AIDS, hepatitidy a dobrého půltuctu kožních chorob, plísní a lišejí. \r\n</p>\r\n', '<p>\r\nDalší průser, který se odehraje u Charlese Andre Josepha Maria de Gaullea 1 - a taky odehrál, jak už dnes víme.\r\n</p>\r\n', 'viz výše\r\n', 0, 0, 1, 1, 1354316400, '13:00', '13:20', 'nula nula nic\r\n', '<a href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=623&amp;sid=931f37c7e91446cd31e1c967d2988350#p623"><img src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target_unread.gif" alt="Unread post" title="Unread post" width="11" height="9" /></a>by <strong><a href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=64&amp;sid=931f37c7e91446cd31e1c967d2988350">org_Bara</a></strong> &raquo; Sat 01. Dec 2012 12:39:05 \r\n<div class="postbody">\r\n<div class="content">\r\nDostal jsem echo, že priblizne v techto místech <a href="http://mapy.cz/s/5MLR" class="postlink">http://mapy.cz/s/5MLR</a>\r\ndošlo k násilné interakci, pravdepodobne bez pouzití magie. Není mi \r\nznámo co se tam konkretně stalo, ale nevypada to na nic ruzoveho. Na \r\nmístě se pohybují civilisti, chtělo by to zahladitm, aby do toho \r\nnestourali fizlove.\r\n</div>\r\n</div>\r\n'),
(138, 'Vladovci kaput', 1354732804, 26, 'posbírat zbytky', 'upíři se měli střetnout na IP Pavlova, upíry jsem odklonil na mírák, tak se vyvraždili\r\n', 'v praze bude mezi upíry zase bezvládí a bordel\r\n', '<p>\r\nAnalytický vyplivlo, že se servou upíři na Pavláku a asi do toho budou nějak zapletení Vladovci. Zavolal jsem tedy vladovcům a ukázalo se, že mají podle nich dohodnutou normální schůzku. Varoval jsem je před hrozícím nebezpečím a doporučil jsem jim schůku přesunout, aby je nerušili světlí.\r\n</p>\r\n<p>\r\nSchůzku přesunuli na náměstí Míru, ale stejně se navzájem s upírama, se kterýma se sešli, vyvraždili. Zbytky jsme uklidili s filipem a šli to zapít na štáb.\r\n</p>\r\n', 0, 0, 1, 1, 1354662000, '12:30', '13:00', 'zilch\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">ilý hlídkaři,</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">náš nový software, který jsme museli nainstalovat vzhledem k narůstající problematice s agresivitou upírů. hlásí červenou!</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Vypadá to,že pár upírů se rozhodlo si to rozdat &quot;v pravé poledne&quot; u KFC na IPP. Nejsme zatím schopní zjistit proč, vypadá to,že tím místem se protínají i pravděpodobnosti někoho z Vladovic.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.800000190734863px; line-height: 18.200000762939453px; background-color: #999999">Klaďte důraz na bezpečí obyčejných lidí!</span>\r\n'),
(139, 'Příjezd Světlany Goroděcké', 1354955350, 47, 'zaregistrovat', 'Přijela Světlá čůza z Moskvy\r\n', '<p>\r\nmoc nevíme, co tu chce, pravděpodobne bude jen pozorovat, ale je otázka, co pak poví v Moskvě Geserovi... \r\n</p>\r\n<p>\r\nza pár hodin se zhroutím z nevyspání\r\n</p>\r\n', 'Po šichtě a párty jsem přijela domů asi v 6 ráno, ještě zkontrolovala analytiku - já blbec =) a zjistila, že má v 7:37 přijet na nádraží Holešovice nějaká vysoce postavená Světlá. Tak jsem vzdala jakékoli pokusy o spánek a vyrazila na místo. Na nástupišti jsem stepovala asi deset-patnáct minut před příjezdem vlaku, těsně na čas dorazil samotný Nejsvětlejší s Nikolou Sobotkovou - ty jejich ksichty, když mě viděli, mi za všechnu únavu a nevyspalost rozhodně stály. Z jejich rozhovoru jsem párkrát zaslechla jméno Světlana a tím pádem jsem měla dost jasno, kdo asi přijede. Geser jí taky mohl dát aspoň na letadlo. Každopádně, skutečně přijela velká Světlá kouzelnice Světlana Nazarovová, nyní Goroděcká. Tak jsem ji rovnou sbalila a i se Světluškama odtáhla na štáb na registraci. Slušně a korektně, samozřejmě =)\r\n', 0, 0, 1, 1, 1354230000, '7:30', '8:30', 'nic\r\n', 'Pravděpodobnostní linky hlásí příjezd významné osoby na nádraží \r\nHolešovice v čase 7:37. Nejsem teď schopen určit, o koho se jedná, ale \r\nukazuje to na velké zvíře.\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(140, 'Agresor u Břevnovského kláštera', 1362187555, 69, 'Pozorovat/zajistit', 'Po nasem prijezdu nocni hlidka zajistila vlkodlaka a byl proveden na miste vyslech. &nbsp;\r\n', '<p>\r\nVlčice podle všeho sílí, přidávájí se k ní další vlkodlaci\r\n</p>\r\n<p>\r\ndalší&nbsp;<span style=&quot;font-size: 10pt&quot;>podobné případy&nbsp;</span>\r\n</p>\r\n<p>\r\nměli bychom se více zaměřit na &quot;pokusy&quot;, které údajně na vlklodlacích a upírech provádějí Světlí&nbsp;\r\n</p>\r\n', '<p>\r\nNaše skupina (Sakeena, Igor, Václav) dorazila na místo zároveň s výjezdovkou NH vedenou naším oblíbeným obrateněm Milerem. (V baretu vskutku nepřehlédnutelný). Vzhledem k tomu, že akce probíhala v jejich jurisdikci, drželi jsme se vzadu a ukázněně pozorovali. Já jsem byla v šeru o něco blíž, než kluci a adekvátní záloha Světlých, kterému teď nemůžu přijít na jméno, ale úspěšně ho zaměstnávali, aby moc neprudil.\r\n</p>\r\n<p>\r\nBěhem několika málo minut na Světlé zaútočil vlkodlak, načež se na něj vrhli, chlapec zřejmě došel k závěru, že je jich moc a zacal zdrhat, tak jsem ho freezla. Miler ho následně z freezu vysekal a znovu se na něj s Kristou Černou vrhli a umlátili ho skoro do bezvědomí. Ještě předtím se mě Miler se zcela vážnou tváří zeptal, jestli dokážu vlkodlaka zvednout, když ho zabije. What the hell...?\r\n</p>\r\n<p>\r\nKaždopádně, za nějakou chvíli se zraněný vlkodlak přestal pokoušet o odpor (napomohly tomu i Záhvího pouta, opět ode mě) a když jsem mu dala pár cigaret a chovala se aspoň trochu přátelsky, začal mluvit. Pro jistotu jsem ho ale ještě projela telepatických výslechem, všechno s výslovným svolením Milera, jako šéfa výjezdu, takže jestli budou kvůli některému z mých kouzel držkovat, pošleme je do háje.&nbsp;\r\n</p>\r\n<p>\r\nJmenuje se František Zemánek, vlkodlak 4.,možná 3. kategorie, scan byl dost nejasný, nejdřív jsem si myslela jestli v sobě nemá Blue Mountain nebo nějaký jiný svinstvo, ale podle všeho ne. Na místo ho poslal jeho šéf, nějaký &quot;Robík&quot; Sekera, kvůli &quot;iniciační zkoušce&quot;. Zkrátka, měl dokázat jak moc je velkej a drsnej, aby se posunul výše v hierarchii smečky a měl za úkol zabít hlídkaře. Moc hezký.\r\n</p>\r\n<p>\r\nS &quot;Robíkem&quot; víděl asi čtyři další vlkodlaky, může jich ale být mnohem víc, fungujou tak trochu jako malá mafie - vloupačky, loupeže, vraždy, vydírání... &nbsp;A všechno to směřuje k jeidnému cíli - k Vlčici. O té samozřejmě tenhle nýmand nevěděl nic. Dál se zmínil, že se s nimi jednou pohybovala nějaká Jiná &quot;divná a naškrobená, nejspíš čarodějka&quot; - možná spojitost s vědmou z případu unesené manželky světlého zaříkávače. Ke skupině kolem Sekery se přidal někdy v průběhu minulého roku, nejspíš koncem jara, sám si není jistý.\r\n</p>\r\n<p>\r\nDalší zajímavá věc: během zatýkání Krista pronesla něco ve smyslu &quot;vlkodlak na pokusy, to se bude hodit&quot; a pak se to snažila dost špatně zamluvit, ale Zemánek se toho chytil, že prý se o těchto &quot;pokusech&quot; mezi vlkodlaky povídá po hospodách a že by tak dost nerad dopadnul taky. Podle těch řečí a pravidla &quot;na každém šprochu pravdy trochu&quot; se Světlušky snaží přijít na způsob, jak přenést vlkodlačí a upíří regeneraci na ostatní Jiné.&nbsp;\r\n</p>\r\n<p>\r\nA poslední, nejvíc haluzní záležtost, Zemánka v tom parku napadlo hejno agresivních kachen. Ano, kachen. Kdybych to neviděla v jeho hlavě při telepatickém výslechu, nevěřila bych tomu. Ovšem rybníček ani kachny na něm nevykazovali nic zvláštního =)\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>co mu Světlí přišijou: napadení hlídkaře/hlídkařů, zabití člověka před dvěma týdny (zmínil se během výslechu a určitě jich bylo víc) a pobíhání v realitě v proměně&nbsp;</span>\r\n</p>\r\n', 0, 0, 1, 1, 1362178800, '0.30', '1.30', 'Sakeena: 1x šero, 1x freeze, 1x Záhvího pouta, 1x telepatický výslech\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; font-size: 12.7273px; line-height: 18.196px; background-color: #999999">Hola lidi, zrovna mi tu skáče něco o agresivním chování a potenciálním napadení&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; font-size: 12.7273px; line-height: 18.196px; background-color: #999999">Jiných v okolí jezírek u Břevnovského kláštera. Čas to ukazuje 0:30.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; font-size: 12.7273px; line-height: 18.196px; background-color: #999999">To stíháte, koukal jsme vám na spoje, máte dost času.&nbsp;</span><img style="margin: 0px; padding: 0px; border-width: 0px; color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; font-size: 12.7273px; line-height: 18.196px; background-color: #999999" src="http://www.prazskahlidka.cz/forum/images/smilies/icon_e_wink.gif" alt=";)" title="Mrknutí" />\r\n'),
(141, 'Střet v parku pod Korábem', 1362227421, 55, 'Zjistit stav, poprípadě zabránit střetu', 'Střet mezi temnými a světlými. Jeden zabitý.\r\n', 'xxx\r\n', '<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:TrackMoves/>\r\n<w:TrackFormatting/>\r\n<w:HyphenationZone>21</w:HyphenationZone>\r\n<w:PunctuationKerning/>\r\n<w:ValidateAgainstSchemas/>\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:DoNotPromoteQF/>\r\n<w:LidThemeOther>CS</w:LidThemeOther>\r\n<w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n<w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables/>\r\n<w:SnapToGridInCell/>\r\n<w:WrapTextWithPunct/>\r\n<w:UseAsianBreakRules/>\r\n<w:DontGrowAutofit/>\r\n<w:SplitPgBreakAndParaMark/>\r\n<w:DontVertAlignCellWithSp/>\r\n<w:DontBreakConstrainedForcedTables/>\r\n<w:DontVertAlignInTxbx/>\r\n<w:Word11KerningPairs/>\r\n<w:CachedColBalance/>\r\n</w:Compatibility>\r\n<w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n<m:mathPr>\r\n<m:mathFont m:val=&quot;Cambria Math&quot;/>\r\n<m:brkBin m:val=&quot;before&quot;/>\r\n<m:brkBinSub m:val=&quot;--&quot;/>\r\n<m:smallFrac m:val=&quot;off&quot;/>\r\n<m:dispDef/>\r\n<m:lMargin m:val=&quot;0&quot;/>\r\n<m:rMargin m:val=&quot;0&quot;/>\r\n<m:defJc m:val=&quot;centerGroup&quot;/>\r\n<m:wrapIndent m:val=&quot;1440&quot;/>\r\n<m:intLim m:val=&quot;subSup&quot;/>\r\n<m:naryLim m:val=&quot;undOvr&quot;/>\r\n</m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p class=&quot;MsoNormal&quot;>\r\nProběhl střet mezi třemi temnými (Pavel Hrubý, Michal\r\nŠrubrt, Oto Král) a dvěma světlými (Aleš Číh, František Běhoun). Tento střet\r\npřežili všichni až na jednoho světlého jménem Aleš Číh. Dle výpovědí všech\r\npřeživších měli všichni v důsledku boje velmi vážná zranění, pod jejichž vlivem\r\nupadli do mdlob. Poté co přišli k vědomí, zjistili, že jejich zranění, až na\r\nzranění Aleše Číha, byla vyléčena. Tělo Aleše Číha evidentně neslo více\r\nzranění, než kolik jich obdržel během boje, důsledkem čehož zemřel.\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\nJeden z účastníků vypovídal, že se na krátký čas probudil a\r\nzahlédl mladou dívku s černými vlasy, která se skláněla nad těly zraněných - pravděpodobně\r\nje léčila. Zaslechl také křik, který patřil jeho příteli Aleši Číhovi.\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\nNa místě byl nalezen symbol.\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\nVýjezd dorazil až po boji. \r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\n&nbsp;\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\nPavel Hrubý - upír 5.kat.<br />\r\nMichal Šrubrt - upír 5.kat<br />\r\nOto Král - vědmák 4.kat\r\n</p>\r\n<p class=&quot;MsoNormal&quot;>\r\nAleš Číh - zaříkávač 4.kat.<br />\r\nFrantišek Běhoun - obraten 4.kat.\r\n</p>\r\n<!--[if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState=&quot;false&quot; DefUnhideWhenUsed=&quot;true&quot;\r\nDefSemiHidden=&quot;true&quot; DefQFormat=&quot;false&quot; DefPriority=&quot;99&quot;\r\nLatentStyleCount=&quot;267&quot;>\r\n<w:LsdException Locked=&quot;false&quot; Priority=&quot;0&quot; SemiHidden=&quot;false&quot;\r\nUnhideWhenUsed=&quot;false&quot; QFormat=&quot;true&quot; Name=&quot;Normal&quot;/>\r\n<w:LsdException Locked=&quot;false&quot; Priority=&quot;9&quot; SemiHidden=&quot;false&quot;\r\nUnhideWhenUsed=&quot;false&quot; QFormat=&quot;true&quot; Name=&quot;heading 1&quot;/>\r\n<w:LsdException Locked=&quot;false&quot; Priority=&quot;9&quot; QFormat=&quot;true&quot; Name=&quot;heading 2&quot;/>\r\n<w:LsdException Locked=&quot;false&quot; Priority=&quot;9&quot; QFormat=&quot;true&quot; Name=&quot;heading 3&quot;/>\r\n<w:LsdException Locked=&quot;false&quot; Priority=&quot;9&quot; QFormat=&quot;true&quot; Name=&quot;heading 4&quot;/>\r\n<w:LsdException Locked=&quot;false&quot; Priority=&quot;9&quot; QFormat=