rent:&quot;&quot;;\r\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\nmso-para-margin-top:0cm;\r\nmso-para-margin-right:0cm;\r\nmso-para-margin-bottom:10.0pt;\r\nmso-para-margin-left:0cm;\r\nline-height:115%;\r\nmso-pagination:widow-orphan;\r\nfont-size:11.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]-->\r\n', 0, 0, 1, 1, 1209074400, '15h', '16h', 'zadné\r\n', 'info z analytického atd.\r\n'),
(142, 'Potenciální Jiní v Botanické zahradě', 1362423730, 47, 'pozorovat, zabránit konfliktu', 'v Botance se pohádali dva mladí potenciální Jiní o LICENCE! \r\n', 'máme tu někoho, kdo může ohrozit tajemství Jiných\r\n', '<p>\r\nDo botanické zahrady jsem dorazila z našich jako první, a narazila jsem na čtyři Světlé plus Adlerovou, kteří se tam slunili na lavičce na cestě vedoucí přímo k altánu, kde mělo dojít k hlášenému incidentu. Světlé jsem vykázala do patřičných mezí jako pozorovatele, ale postupně se ještě namnožili a ve výsledku jich tam bylo pět nebo šest, dost dobře nechápu, proč.\r\n</p>\r\n<p>\r\nNa místě se setkali dva potenciální Jiní (oba jsem scanovala), Aneta Radová a Pavel Čížek, Radová Čížka seřvala, že jí nepřinesl slíbenou licenci a ať ji kouká donést zítra.Líbilo se mi, jak byla od rány, takže jsem se na ni zaměřila a odchytila si ji pod botanickou zahradou.&nbsp;\r\n</p>\r\n<p>\r\nTvářila jsem se jako Jiná, co vyslechla jejich rozhovor o licencích, podařilo se mi jakž takž získat její důvěru (taky jsem jí předvedla hrozně cool trik aneb vstupy do šera, baví mě, jak to ty nový vždycky dostane =D), mám na ni kontakt a půjdeme nejspíš zítra na kafe. Někdo jí prozradil, že existují lidé, kteří jsou &quot;extra&quot; a že ona k nim patří taky a sháněla licenci k iniciaci. Řekla jsem jí, že za další informace bych to možná zvládla zařídit. Uvidíme, co z ní dál vypadne, ale myslím, že má rozhodně blíž ke Tmě a že by se nám v Hlídce mohla hodit.\r\n</p>\r\n', 0, 0, 1, 1, 1362351600, '16:30', '17:00', '<p>\r\nSakeena: 2x Scan, 3x šero \r\n</p>\r\n<p>\r\nAleš Hradil: šero, asi 2x \r\n</p>\r\n', 'Ukazuje mi to tady nějaké velké emoční vypětí.<br />\r\nMísto jsem určil někde v Botanické zahradě na Albertově, pravděpodobně v okolí <br />\r\naltánu.<br />\r\nČas výskytu dotyčných osob je cca 16:30.<br />\r\nUkazuje mi to tady i na možnost otevřeného konfliktu.\r\n'),
(143, 'Malý rituál u Milosrdných sester', 1362497682, 69, 'Přesvědčit se, jestli má p. Lilek povolení a pozorovat rituál', 'Výjez k &quot;ozdravnému&quot; rituálu který prováděl p. Lilek, aby p. Rožmitál přežil noc v nemocnici.\r\n', 'p. Rožmitál by měl přežít noc\r\n', '<p>\r\nPo 2 vraždách z minulé noci proběhl ještě jeden útok, ale jeho oběť přežila. Je jím p. Rožmitál, neregistrovaný Jiný, zaříkávač 6. kategorie. Po odpoledním setkání s p. Lilkem, jsme se dozvěděli, že může provést léčebný rituál, aby pacient přežil noc a byl schopen výslechu. Za to však žádal 3 zásahy 6. kategorie (což nedostal)\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Termín a místo rituálu bylo stanoveno v nemocnici u Milosrdných sester u Pražského hradu. Jelikož byl prováděn v době, kdy měla šichtu Noční hlídka, byli jsme vysláni jako pozorovatelé, abychom se ujistili, zda-li je rituál prováděn s náležitým oprávněním. Na místo jsme dorazili dříve než Světlý, takže byl čas se porozhlédnout. Nic zajímavého. Nakonec dorazili. Pozdě, ale přece. Na místě nám bylo řečeno, že p. Lilek povolení na rituál nemá. Následovalo několika minutové dohadování o tom, kdo, kdy, kde, jak atd... může a nemůže provádět rituály. Nakonec jsme světlým předložili 2 návrhy. Buď rituál proběhne bez povolení, ale poté p. Lilka odvezeme k nám na štáb, nebo nám bude poskytnut jeden zásah 6. kategorie. Přistoupili na druhou variantu. Poté začal rituál, během kterého se už nic nedělo.</span>\r\n</p>\r\n', 0, 0, 1, 1, 1362351600, '20:30', '21:30', 'jeden vstup do šera&nbsp;\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Přibližně za hodinu proběhne někdě mezi malostranskym náměstím a Nemocnici Milosrdných sester menší rituál. Nejde o nic velkeho, bude mit tak 100 až 200mg. Když budu vědět neco vice, dam vědět.</span>\r\n'),
(144, 'Durak na Jiraku', 1362509894, 22, 'Zametat po vysavacovi', 'Na Jiraku megavysavac, nicego po nem nezbylo.\r\n', 'Az jego chytim, hadicu mu zauzlujem.\r\n', 'Prichadili na Jiraka, tam kompletno nicego, jen otisk aury iz sani.\r\n', 0, 0, 1, 1, 1362438000, '19:10', '19:30', 'nicego\r\n', '<div>\r\nPOZOR!\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nObrovské energetické čerpání přímo na schodech kostela Nejsvětějšího Srdce Páně, na náměstí Jiřího z Poděbrad.\r\n</div>\r\n<div>\r\nVypadá to na opravdu velké množství cca 32 osob naráz... odhadem 400 Mg.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nPravděpodobně v důsledku tohoto jednání bylo několikrát užita magie k zahlazení stop u smrtelníků.\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nOkamžitě vyražte na místo a prošetřete situaci\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n<div>\r\nKraus\r\n</div>\r\n'),
(145, 'Jednání s léčitelem', 1362510342, 38, 'vyzjistit věci od léčitele', 'Jednali jsme s léčitelem pracujícím u milosrdných sester, abychom zjistili info o případu Evžena Rožmitála.\r\n', 'brzy soudit\r\n', 'Sjednal jsem schůzku s Jiřím Lilkem, lékařem a léčitelem od milosrdných sester. Kolem brouzdali světlí. Zjistili jsme že Evžen Rožmitál leží na jipce v již zmíněné nemocnici. Nabídl nám že by mohl Rožmitála vyléčit, chtěl sehnat suroviny a požadoval si tři zásahy 6. kategorie. Byl poslán do pryč.\r\n', 0, 0, 1, 1, 1362351600, '15:30', '16:15', 'nic\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Mám tu pro vás nějaké informace: ten z případu jedna leží v nemocnici &quot;U milosrdných sester&quot;. Mám tu údaje, že se v této nemocnici často pohybuji Jiný, léčitel Jiří Lilek (máme ho v záznamech od podzimu, kdy jste ho snad potkali). Pokud by jste ho ztratili, našel jsme na něj telefon 603 478 777, snad je aktuální.</span>\r\n'),
(146, 'Brutalista', 1362511064, 38, 'zajistit vše kolem', 'Na místě byl nalezen světlý zaříkávač úplně od krve, jeho výpověď zněla podezřele tak jsem ho odvedl na štáb k výslechu.\r\n', 'těžko říct\r\n', 'Došel jsem na místo a našel zaříkaváče od hlavy k patě zalitého krví. Měl však jen zlomenou ruku, což bylo divné. Prý našel mrtvého člověka, chtěl ho ošetři a v tu chvíli na něj zaútočil vlkodlak. Nikde nebyl ani jeden symbol, druhá divná věc. Vzal jsem ho na výslech pod sérem pravdy. Přizváni byli i světlí.\r\n', 0, 0, 1, 1, 1362438000, '14:30', '15:15', 'šero, šerá dýka\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Linie mi tu ukazují pravděpodobnost poměrně brutální vraždy na souřadnicích 50.033315 / 14.4714730.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Čas to ukazuje na 14:30. Buďte raději přesní (překlad: nebuďte tam o hodinu dřív&nbsp;</span><img style="margin: 0px; padding: 0px; border-width: 0px; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999" src="http://www.prazskahlidka.cz/forum/images/smilies/icon_e_smile.gif" alt=":)" title="Úsměv" /><span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">.</span>\r\n'),
(147, 'Rituál u zřídla v Bezručových sadech', 1362516036, 69, 'Zjistit co se u zřídla v Bezručových sadech', 'Přítomnost u rituálu a následné vyjebání ze strany Noční hlídky\r\n', 'Žaloba?\r\n', '<p>\r\nAnalytické oddělení nás informovalo o rituálu u zřídla v Bezručových sadech. Po příjezdu na místo jsme byli svědky Noční hlídky jak přihlíží rituálu p. Mortise. Nereagovali na oslovení ohledně identifikace, počty převišovaly povolení a byli velmi nekonzistentní ohledně toho, jestli jsou zde za hlídku, nebo jenom jako soukromé osoby. Každou chvíli měnili výpovědi o tom co vlastně dělají a jestli jsou tam jako hlídka či nikoli.&nbsp;\r\n</p>\r\n<p>\r\nDohromady bylo napočítáno přibližně 6 členů Noční hlídky a p. Mortis, který prováděl rituál. Ignorovali upozornění ohledně legitimace. Po několika minutách rituál zkončil, p. Mortis ukázal povolení na provedení rituálu adekvátní úrovně a poté se rozešli. &nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1362438000, '20:20', '21:00', 'jeden vstup do šera\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Na zřídle v Bezručových sadech se pravděpodobně chystá rituál, nespadající do klasického vzorce Prahy.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Nejdná se o krizovou situaci, ale bylo by dobré situaci prošetřit.</span>\r\n'),
(148, 'Mocinky velke cerpani u Ruduolfina muck', 1362589806, 45, 'zjistit a teple mazat', '<p>\r\nPrijeli videli vymazali a servali Mullera<span style="font-size: 10pt">&nbsp;</span>\r\n</p>\r\n', 'debil bude prudit a sat dal\r\n', '<p>\r\nJel jsem se Sarou a sourozenci k mistu kde se kdysi vyvolal Rabi. Navstivili jsme v ramci exkurze po praze bordel u Rudolfina co tam nekdo udelal. Vymazali jsme civilistum pamet. Flamelove mi stim velmi pomohli. Pak dorazili svetly a tak jsme jim to hodili na triko a odjeli.\r\n</p>\r\n<p>\r\nNikoho jsme nevideli i kdyz Flamel svetlym tvrdil neco jineho.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1362438000, '21:50', '22:10', '<p>\r\n10x prikaz\r\n</p>\r\n<p>\r\n20x Amnezie\r\n</p>\r\n<p>\r\nSvetly taky bambilion kouzel&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Pozor,</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">opět hodně velké čerpání energie.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Je postižených skoro 50 osob. Toto čerpání v místě Mánesova mostu způsobilo velkou autohavárii.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Okamžitě vyražte na místo a řešte situaci.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Pravděpodobná míra energetického čerpání je cca 500 Mg</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Kraus</span>\r\n'),
(149, 'Zátah na laboratoř', 1362608858, 38, 'zjistit skutečnost o laboratoři', 'Prohledali jsme nelagální laboratoř.\r\n', 'už nebudou mít kde dělat pokusy na vlkodlacích\r\n', 'Přijeli jsme na místo údajné laboratoře. Na místě nebyl nikdo kdo by nás vpustil, tak jmse se museli přes bariéru probít. Na místě jsme skutečně nalezli laboratoř, seznam zajištěných důkazů bude dodán později. Na cestě pryč jsme potkali výjezdovku světlých, které jsme vysvětlili oč se jednalo.\r\n', 0, 0, 1, 1, 1362524400, '20:00', '20:30', 'šerá dýka, psychycký štít, šero\r\n', 'Predchozi patrani, informace z ruznych zdroju.\r\n'),
(150, 'Rituál na Vyšehradě (zřídlo)', 1362691419, 69, 'Zjistit co se děje', 'Zjistit co se děje\r\n', 'asi nic\r\n', 'Po zprávě od analytického byl vyslán výjez na místo rituálu. Na místě bylo 6 členů noční hlídky, ale jeden z nich se po chvíli odpojil. Členi denní hlídky byli 4, ale během rituálu jenom 2. Po příjezdu na místo noční hlídka chvíli okouněla a nic nedělali a po chvíli se připravili provést rituál. Rituál byl pravděpodobně &quot;zjiš''tovací&quot;, 2. úrovně. Po lehké slovní konfrontaci rituál zkočil a výjezd se vrátil zpět na štáb.\r\n', 0, 0, 1, 1, 1362610800, '21:00', '21:45', 'nic\r\n', 'Ukazuje mi to tady potenciální pravděpodobnost nějakého rituálu v čase 21:00 na některém ze zřídel.\r\n'),
(151, 'Svetla bariera', 1362760064, 45, 'Zjisteni stavu veci', 'Mezi minulym patkem a sobotou udelala pry svetlana barieru na stabu svetlych. Danakhet rikat ze o tom nemaji tusaka...srat na to\r\n', 'Mozna ziskat zasah ci vykazat svetlanu z prahy\r\n', 'Hlidkar hradecky me informoval ze bariera na stabu svetlych byla pry vytvorena svetlanou gorodeckou minuly tyden v patek ci sobotu...&nbsp;\r\n<div>\r\nMozno k tomu patri mandaly co byly nalezeny za stabem svetlych\r\n</div>\r\n<div>\r\nBariera pry dava dmg 5 magicky pokud se nekdo pokusi projit bez povoleni.&nbsp;\r\n</div>\r\n', 0, 0, 1, 1, 1362697200, '1723', '1724', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(152, 'Svetla abarierajovne v c', 1362760332, 45, 'Zjisteni stavu veci', 'Mezi minulym patkem a sobotou udelala pry svetlana barieru na stabu svetlych.&nbsp;\r\n', 'Mozna ziskat zasah ci vykazat svetlanu z prahy\r\n', 'Hlidkar hradecky me informoval ze bariera na stabu svetlych byla pry vytvorena svetlanou gorodeckou minuly tyden v patek ci sobotu...&nbsp;\r\n<div>\r\nMozno k tomu patri mandaly co byly nalezeny za stabem svetlych\r\n</div>\r\n<div>\r\nBariera pry dava dmg 5 magicky pokud se nekdo pokusi projit bez povoleni.&nbsp;\r\n</div>\r\n', 0, 0, 1, 1, 1362697200, '1723', '1724', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(153, 'Vlkodlak okusovacnyj', 1362766296, 22, 'Okukovat mrtvoly', 'Vlkodlak sezral dvoch delnikov.\r\n', 'Bude zrat dal a povesime jego za chlupate kule.\r\n', 'My prijechali na misto, tam dve okousane mrtvoly delnikov, jinak nicego. Kamery zadne, svedkov net.\r\n', 0, 0, 1, 1, 1362697200, '17:30', '18:30', '2x sero\r\n', 'Právě mě to tady ukázalo smrt dvou lidí na křižovatce ulic Apolinářská a Viničná.\r\n'),
(154, 'Průser u Kinských', 1362782595, 38, 'měl se dít rituál, nestal se', 'Měl se dít rituál, neděl se žádný a ještě nám sebrali václava\r\n', 'sejmeme ty zmrdy\r\n', 'Přiběhli jsme do zahrad Kinských. Rozdělili jsme se, což beru jako svojí závažnou chybu. Když jsem za chvilku viděl skupinu jiných, která táhla našeho Václava. Řekl jsem jim ať vystoupí z šera. Freezly Václava a vystoupili. Václava jsem z freezu dostal šerou dýkou. Následně se strhla bitka, Venca koupil nějaké firebally, já jsem rozsekal tři upíry, že se dle mého názoru nemohly zvednou, ale zvedli se. Když jsem se vrátil na místo původního konflitku, ležel tam Pavel, Dub a nad nima stála Anděla. Zkoušli jsme Václava najít, ale marně. Koblih nás vyzvedl a jeli jsme na štáb. Pak mi zavolal jeden z únosců. Jeli jsme si vytvednout vencu. Nechali nám ho tam. Dovezli jsme ho na štáb. Vyřídíme si to s nima později.\r\n', 0, 0, 1, 1, 1362697200, '21:00', '21:30', 'moc moc byla bitka\r\n', 'info z analytického atd.\r\n'),
(155, 'Zlý rituál', 1362845943, 47, 'zajistit, přípdne přerušit', 'přijeli jsme, našli jsme symboly, odjeli jsme\r\n', 'who knows, o tom rituálu prakticky nic nevíme...\r\n', 'Na místo jsme vyrazili ve složení Sakeena, Koblížek, Dima, Rudolf. Cestou jsme viděli Kristu Černou, já a Rudolf jsme pak na zastávce Otakarova našli její symbol, pak jsme na určeném místě našli symboly z rituálu.\r\n', 0, 0, 1, 1, 1362783600, '16:30', '17:00', 'nic\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 12.7273px; line-height: 18.196px; background-color: #999999">Právě probíhá nějaký zlý rituál na souřadnicích: 50&deg;3''58.600&quot;N, 14&deg;26''28.917&quot;E</span>\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(156, 'Dva nerozumní ve stromocvce', 1362939104, 38, 'něco se mělo dít', 'Sebrali jsme dva světlé trouby, kteří kérovali.\r\n', 'uvidíme\r\n', 'Dorazili, jsme na místo. Nic moc se nedělo, narazili jsme akorát na dva civily, kteří se ukázali jako největší problém. Byli vyzvání, aby opustili místo zásahu hlídk, a to pakovaně. Když ani, na několikátou výzvu neuposlechli. Byl jeden z nich pro výstrahu uspán. Jeho společník i nadále odmítal opustit místo a ještě k tomu začal kouzlit. Koblížek vzhledem k bezpečnosti své i ostaních, zpacifikoval kouzlícího mága. Světlý projevili přání, aby toto konání přežil, mi jsme jim vyhověli, i přes to, že na nás mág kouzlil. Udržovali ho při životě, než jsme se střeli s Kristou Černou z NH, která ho z toho kompletně dostala. Následoval výslech.\r\n', 0, 0, 1, 1, 1362870000, '17:30', '18/:30', 'šero, druhé šera, šeré dýky, freeze, zahvího pouta, světlí opakovaně síla ohně + transfer.\r\n', 'Vyhazuje mi to tady, že na souřadnicích 50&deg;6''22.107&quot;N, 14&deg;25''12.715&quot;E se pohybují <br />\r\nnějací Jiní a kontinuálně manipulují se silou v malých, ale násobných dávkách.<br />\r\nUkazuje mi to čas cca 17:30\r\n'),
(157, 'Inicializace Jiné Petřín', 1362947132, 69, 'Zajistit a zjistit co se děje', 'Zajištěna potencionální jiná\r\n', 'Přestup na temnou stranu... :)\r\n', 'Po příjezdu jsme na místě potkali Kristu Černou a Maxvela, kterí se spolu s nějakou světlou bavili s cílovou osobou. Černá se odpojila uplně na začátku, takže z Noční hlídky tam zbyl jenom Maxvel. Po dlouhém rozhovoru a ujití několika set metrů, byl Maxvel, přes několikateré upozorňování bohužel zpacifikován. Zjistilo se, že neinicializovaná je její sestra a že nejsou úplně ve shodě se svými názory. Toho jsme využili my a pomalu jí ukazovali, ke které straně více inklinuje. Po několika stech metrech usoudila, že ví jaká je její strana. Konec výjezdu a následný návrat na štáb\r\n', 0, 0, 1, 1, 1362870000, '17:45', '19:00', 'tak 4x šero \r\n', 'Ukazuje mi to tu na pravděpodobnou násilnou Iniciaci na 50&deg;4''59.238&quot;N, 14&deg;24''6.236&quot;E, pravděpodobný čas 17:45.\r\n'),
(158, 'Jáma a Kyvadlo', 1362996663, 68, 'zabránit možné smrti jiného', 'Světlá blbka ztratila amulet...tak jsme jí ho našli.\r\n', 'nic zásadního mě nenapadá\r\n', '<p>\r\nPřijeli jsme na místo a rozhlíželi se kolem. Po chvíli jsme potkali obrateňovou světlušku v transformaci pobíhající s baterkou. Noční výjezd stál pod kyvadlem a s nimi napadená slečna. Vypadá to, že jsme útočníka v tomto počtu vyplašili. Slečna jen ztratila amulet s nějakým štítem. Ten byl po chvíli hledání nalezen v křoví. Slečnu odvezli na štáb noční, byla docela v šoku. A my vyrazili zpět na štáb.&nbsp;\r\n</p>\r\n<p>\r\n<em>slečna byla Světlá, mágyně, 6.kat, Julie (příjmení doplnim, brnknu Světlým) Sakeena.</em> \r\n</p>\r\n', 0, 0, 1, 1, 1362870000, '21:50', '22:20', '2x vstup do šera\r\n', 'V čase cca 21:50-22:10 mi to tu hlásí možnou smrt Jiného mezi Kyvadlem na Letné a restaurací na Baště.\r\n'),
(159, 'Velké problémy?', 1362998336, 68, 'Zjistit, co se děje ', 'Nebudu to dělat!!!!!!!!!!\r\n', 'doplnit\r\n', '<p>\r\nS Igorem jsme přijeli na místo. Našli jsme prázdný piedestal po soše. Dle instrukcí jsem prohledala zámecké schody v šeru, okolo podstavce také a okolí katedrály též. Systematicky jsme ta místa prošli asi 5x a &nbsp;nenašli jsme vůbec nic. Ani velký počet NH, ani stopy po psychyckých kouzlech. Byla tam miliarda turistů. Takže zde zbyteček aury nevydržel ani 3 minuty.... Solidně jsme zmokli, takže po dohodě s Ragulinem jsme se odebrali na štáb...\r\n</p>\r\n<p>\r\nDle infa z analytického světlí přijeli dřív, takže je možné, že tam něco našli a důkladně za sebou zametli.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1362783600, '12:40', '15:00', '3x vstup do šera\r\n', 'info z analytického atd.\r\n'),
(160, 'Pozorování kurýrní činnosti na rohu ulic Na Bojišti a Ke Karlovu', 1363173901, 26, 'pozorovat', 'Bedna na štábu, Novotný napadený, Krista zchlazena v kanále\r\n', 'Krista bude smrdět, Zažalujeme Kristu za napadení, Krista půjde bručet\r\n', '<p>\r\nPodle rozkazu jsme s Igorem a mojí bednou dorazili na roh ulic Na Bojišti a Ke Karlovu a pozorovali co se stane. První co se stalo bylo, že dorazila Krista Černá a dělala všechno pro to, aby v našich očích NH klesla až na samotné dno. Důležitě prohlásila že zasahuje a chtěla se mi hrabat v bedně. Trošku jsem se zdráhal, ale službu konající hlídkař je službu konající hlídkař i přesto, že ostatním hlídkařům dělá jen ostudu.\r\n</p>\r\n<p>\r\nKristu jsme tedy nechali bednu proskenovat velkým skenem, nic nenašla. Následně jsme Kristu nechali bednu otevřít, nic nenašla. Po jejím heroickém vypětí a pár špatných vtipech jsme si s Igorem zapálili a dál čekali, co se stane.&nbsp;\r\n</p>\r\n<p>\r\nDorazil Česílko. Došly cigarety, připozdívalo se. Vypadalo to, že se už nic neudá a že si z nás analytici asi krutě vystřelili a chtěli nás potrápit Kristinou přítomností. Vzal jsem tedy svojí bednu, vstoupil do šera aby mi cesta rychleji ubíhala a vydal se směrem na štáb. V ten moment ovšem přišel naprosto nevyprovokovaný útok od Kristy. Napadla mě dvěma Freezy seslanými VELMI ležérně drženými hůlkami. (Poznámka pro denní hlídkaře co to čtou: Jestli vás uvidím takhle držet hůlku, tak vám zlomím tu ruku kterou tu hůlku [ne]držíte). Napadení jsem se bránil mnohem humánnějším Opiem.\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Abych předešel další agresi ze strany Kristy Černé, proti které bych se už musel bránit smrtícími prostředky, poprosil jsem Igora aby dotyčnou umístil do ústí městské kanalizace pod litinovou mříž, která šla zvednout pouze v proměně. Zabránili jsme tak ztrátám na životech, které by jistě nastaly, pokud by Krista pokračovala ve svém šílenství.</span>\r\n</p>\r\n<p>\r\nPo Kristině zpacifikování jsem se vydal realitou směrem na štáb, její útok mi sebral chuť na pobyt v šeru. Po cestě jsem ještě potkal Sysla a pana Inkvizitora Koryfeje Trachtu s doprovodem. Se všemi jsem se slušně pozdravil a pokračoval i s bednou přes magistrálu, I.P. Pavlova, Náměstí Míru, Vinohradské divadlo a Vinohradskou na štáb Denní Hlídky.\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Později jsem se od Igora ještě dozvěděl, že nad kanalizační mříž s Kristou ještě pro jistotu dotlačil auto.&nbsp;</span>\r\n</p>\r\n', 0, 0, 1, 1, 1363042800, '21:00', '22:30', '<p>\r\nNH\r\n</p>\r\n<p>\r\nČerná - 1x Pravdivé vidění, 1x podrobný Scan, 1x nějaké další dvojkové kouzlo, 2x Freeze z Hůlky\r\n</p>\r\n<p>\r\nDH\r\n</p>\r\n<p>\r\nNovotný - &nbsp;1x Bariéra duše, 2x vstup do 1. šera, 1x Um-Opium\r\n</p>\r\n<p>\r\nHerz - 1xvstup do 1. šera, 1x proměna&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Mám tu nějakou divnou aktivitu, vypadá to, že v nejbližích chvílích bude odněkud&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">vyrážet skupina kurýrů. Povedlo se mi chytit jejich pravděpodobné úseky. Prověříte&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">to?</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Mělo by to být někdy v čase 21:30 - 22:00</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">ukazované trasy jsou:</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">50.432649N, 14&deg;25''8.752&quot;E - 50.0754803N, 14.4292192E</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">50.0709967N, 14.4192250E - 50.0732836N, 14.4269672E</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">50.0688678N, 14.4325256E - 50.0740056N, 14.4329681E</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">50.0719269N, 14.4477214E - 50.0748722N, 14.4373319E</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">50.0687558N, 14.4298858E - 50.0744992N, 14.4291050E</span>\r\n'),
(161, 'Vypálený rybník.', 1363191278, 48, 'Prošetřit vraždu obrateňky Slanečkové u Rudolfova rybníka', '<p>\r\nKdosi sejmul obratníka\r\n</p>\r\n<p>\r\nprý že kdesi u rybníka.\r\n</p>\r\n<p>\r\nTak Chelčický (prima chlap)\r\n</p>\r\n<p>\r\nzjistí, kdože je ten srab.\r\n</p>\r\n<p>\r\nZpoza pásky policie\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">čouhaj údy (člověk blije).</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Možná byla krev a mlíko...</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Teď má tak na rakvi víko.</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Koukám kolem, na zem dolů,</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">pátrám, pátrám po symbolu.</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Pak ho do systému vrazím...</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">jasně, ten nám v Sisu schází.</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Z toho jak tu kosti trčí,</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">tipnu si na symbol vlčí.</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">A s grácií, jako prelát,</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">řeknu &quot;Nebudu to dělat!&quot;</span>\r\n</p>\r\n', '<p>\r\nNajdeme si toho vraha,\r\n</p>\r\n<p>\r\nmuhahahahahahaha,\r\n</p>\r\n<p>\r\na pak bude prostě tuhý,\r\n</p>\r\n<p>\r\nmu....\r\n</p>\r\n<p>\r\n....\r\n</p>\r\n<p>\r\nhihihihihi.&nbsp;\r\n</p>\r\n', '<p>\r\nMrkněte se, lidi krásní,\r\n</p>\r\n<p>\r\nvšecko je to v mojí básni.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1363129200, 'Na začátku', 'Na konci', '<p>\r\nBáseň, ta vám napoví...\r\n</p>\r\n<p>\r\nŽe jsem kouzlil kulový.&nbsp;\r\n</p>\r\n', '<p>\r\nJako skoro u všeho,\r\n</p>\r\n<p>\r\ninfo z analytického.&nbsp;\r\n</p>\r\n'),
(162, 'Krauter - napadení na Újezdě', 1363258889, 51, 'Krauter, vlkodlak napadl vědmáka na Újezdě', '<p>\r\nPodle jeho vlastních slov je Krauterův (Graubnerův jak jsem jeho jméno pochopil já) příběh tento: nějakých pár dní tomu nazpátek, co ho kontaktoval <a href="readperson.php?rid=241&amp;hidenotes=0">Robík Sekera</a> a vyzval ho &quot;přidej se k nám&quot;. (E-mailem.) Krauter odmítl. Načež Sekera se 3 - 4 dalšíma kumpánama Krautera přepadl při lovu na jeho lovišti, šeredně zřídil a loviště mu sebral. Když se pak Krauter další dny (2 - 3) dával dohromady, zjistil navíc, že mu někdo krade náhrady (které prý pravidelně dostával kurýrem domů). Takže když vylezl konečně z domu, šilhal hlady, <em>a proto</em> napadl toho vědmáka, kterého náhodně potkal.\r\n</p>\r\n<p>\r\nKrauter dále uvádí, že žije v souladu s dohodou, všechno má a dělá legálně a chce jen zpátky své loviště, své náhrady a svůj klid. Situaci s Robíkem jsem mu vysvětlil, slíbil spolupracovat.\r\n</p>\r\n<p>\r\nNázor: to, že vlastní licenci na loviště a dostává pravidelně náhrady kurýrem domů (a nakonec i to, že v databázi ho zatím nemáme), zdá se potvrzovati Krauterovu tezi &quot;já dodržuju dohodu&quot;.\r\n</p>\r\n<p>\r\nPopis Sekery: asi 185 cm vysoký, &quot;udělaná vazba&quot;, zrzek, &quot;vychlastanej hlas&quot;. \r\n</p>\r\n<p>\r\nU &quot;výslechu&quot; - ono to spíš bylo &quot;poslecheneme si tvé vyprávění&quot; - byli dále Igor a Dima. \r\n</p>\r\n<p>\r\n<strong>Krautner/Graubner: </strong>608918945 (od Aleše Hradila)\r\n</p>\r\n', '<p>\r\nKrauter si zabere zpátky své loviště a my přitom konečně nachytáme Sekeru a spol?\r\n</p>\r\n<p>\r\nNáhrady teď dočasně budou posílat Krauterovi k nám a on si k nám na štáb pro ně bude chodit. \r\n</p>\r\n', 'viz výše\r\n', 0, 0, 1, 2, 1363129200, '20:30', '20:45', 'nic\r\n', 'Hradilův telefonát\r\n'),
(163, 'Kurýr Pod Karlovem - Rumunská', 1363288881, 69, 'Zjistit a nejlépe zajistit zásilku', 'Zjistit a nejlépe zajistit zásilku\r\n', 'Budeme mít/nebudeme mít\r\n', 'Po podrobném prozkoumání trasy kterou měl kurýr absolvovat, jsme zastavili na tram. zastávce Pod Karlovem. Po chvíli přišli 2 světlé (Sobotková a Malenová). Koblížek mi řekl, abych šel (Václav) k nim jako pozorovatel a on zajede níže a bude hlídat situaci zespodu. Po chvíli se kurýr ukázal a byl světými zadržen. Dorazil Koblížek, ale nezasahovali jsme, protože jsme fungovali jako pozorovatelé, ale byli jsme připraveni, kdyby se něco posralo. Naštěstí se tak nestalo, a protože nás Ragulin zavolal jinam, odjeli jsme a nechali je tam i s kurýrem. Po asi 10ti minutách jsme se u nich zastavili ještě jednou (odchytli je na cestě směrem na Synkáč) a zeptali se kurýra, kam měl zásilku odnést. Poté jsme odjeli na štáb.\r\n', 0, 0, 1, 1, 1363042800, '21:30', '22:00', 'nic\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; line-height: 18.1875px; background-color: #999999">Mám tu nějakou divnou aktivitu, vypadá to, že v nejbližích chvílích bude odněkud&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; line-height: 18.1875px; background-color: #999999">vyrážet skupina kurýrů. Povedlo se mi chytit jejich pravděpodobné úseky. Prověříte&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; line-height: 18.1875px; background-color: #999999">to?</span>\r\n'),
(173, 'Bitka na Vítkově', 1363871869, 26, 'zjistit, co se děje', 'S Koblihem a Silvou jsme zachránili světlíčkům jejich bezcenný zadky. Zajali jsme vědmu co prováděla Silvův myšlenkův rituál.\r\n', 'světlý můžou prudit, že jsme jim vyfoukli svědka v jejich jurisdikci\r\n', 'Se Silvou a koblihem jsme dorazili na Vítkov od voejnského muzea. Našli jsme výjezdovku NH a Vědmu a nějakýho dalšího kašpara nad dokončenym rituálem. NH to zase zbodala a ocitla se pod palbou. Útočnící měli štíty třetí úrovně a bariéry duše, jeden měl zakouzlenou i diamantovou duši. Vědmu jsme zpacifikovali, týpek zdrhnul. Vědma je unás ve sklepě, živíme jí vodkou a okurčičkama.\r\n', 0, 0, 1, 1, 1362783600, '12:00', '1:00', '<p>\r\nNH\r\n</p>\r\n<p>\r\nnespoutaný plamen 3x, 3x 1. šero\r\n</p>\r\n<p>\r\nDH\r\n</p>\r\n<p>\r\n1x psychický nápor, 2x trim opium, 1x trim neurální úder&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; line-height: 18.1875px; background-color: #999999">Mám tu další pokus o nějaký poměrně silný rituál (přes 200 magů) na zřídle na&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; line-height: 18.1875px; background-color: #999999">Vítkově, který se má uskutečnit okolo půlnoci.</span>\r\n'),
(164, 'Kurýr na I.P.Pavlova - rest. U Graafů', 1363289491, 47, 'zachytit zásilku', 'zásilku máme\r\n', '...\r\n', '<p>\r\nS Filipem jsme dorazili na IPP, kde jsme se rozdělili, já hlídala restauraci u Graafů, on s epřesunul o pár metrů dále k hotelu Da Vinci. Krátce na to se objevila NH, a to ve složení Anděla Ondruchová a Jakub Jaňour. Krátce před desátou se objevil i očekávaný kurýr. Toho jsem v šeru zastavila a proskenovala (ějaký Kachlička, vědmák 6. kategorie), měl u sebe dvě freezovací hůlky a obálku.\r\n</p>\r\n<p>\r\nSledovali jsme ho na poštu, a obálku jsme zabavili, když odešel. Členové NH si zásilku vyfotili a originál přenechali mě.\r\n</p>\r\n', 0, 0, 1, 1, 1363042800, '21:30', '22:00', 'Sakeena &nbsp;- šero půl hodiny\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Mám tu nějakou divnou aktivitu, vypadá to, že v nejbližích chvílích bude odněkud&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">vyrážet skupina kurýrů. Povedlo se mi chytit jejich pravděpodobné úseky. Prověříte&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">to?</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Mělo by to být někdy v čase 21:30 - 22:00</span>\r\n'),
(165, 'Krauter - napadení na Újezdu na místě', 1363296803, 69, 'zjistit kdo koho napadl', 'Zjistit co se na místě mělo stát\r\n', '...\r\n', 'Po příjezdu na místo jsme potkali hlídku světlých, kteří fungovali jako pozorovatelé, ale později se podíleli na zadržení pachatele. Po ohledání místa jsme zaslechli křik a viděli jsme prchajícího Jiného, před vlkodlakem. Po zpacifikování vlkodlaka (kterého se účastnila i Černá) jsme vyslechli oběť. Bylo nám řečeno, že byl &quot;prostě napaden, když se procházel po Petříně&quot;. Vlkodlak se představil jako p. Graubner a říkal, že ho vyhnal z jeho loviště (Sekera? upravit Hradilem) a teď musí lovit jinde. Byl v dost zuboženém stavu a dost hladový. Po zpacifikování jsme oba dva odvezli na štáb, kam s námi jela i Krista Černá. Následoval výslech.\r\n', 0, 0, 1, 1, 1363215600, '18:45', '19:00', 'několikrát freez, záhvího pouta, šero, opium a další věci...\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Linie mi napovídají, že cca na 50&deg;4''54.551&quot;N, 14&deg;24''14.194&quot;E (pak na Újezdě) dojde&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">napadení Jiného. Vypadá to na poměrně silného agresora, dejte si raději pozor.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Čas napadení se ukazuje někdy kolem 18:45.</span>\r\n'),
(166, 'Zmálcení u Grébovky', 1363369593, 38, 'Zjistit, co se stalo', 'Asi se nám objevil Malinovksý\r\n', 'problémy\r\n', 'Přišli jsme na místo, našli jsme dva seřezané světlé. Byli dost na kaši. Prý kopali pro Sforzu &quot;poklad&quot;. Vykopali nějaké vlasy a hadry, rozdělené do igelitových sáčků. Myslím, že to mohlo být něco po Alexovi, třeba sbírka osobních předmětů. Prý je seřezal vysoký, šedovlasý a německy mluvící muž. Myslím, že se jednalo o Malinovského, protože jsme poblíž našli jeho symboly. Světlý nenašli ani symbol, ani nevědí o koho by mohlo jít.\r\n', 0, 0, 1, 1, 1363129200, '23:00', '0:00', 'šero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; line-height: 18.1875px; background-color: #999999">Právě dochází ke střetu dvou slabších a jednoho silného Jiného na souřadnicích 50&deg;4''12.242&quot;N, 14&deg;26''49.862&quot;E. Naznačuje mi to, že alespoň někteří z účastníků se na tom místě kdovíproč stále zdržují.</span>\r\n'),
(167, 'Sladká světlá', 1363381092, 38, 'zabánit blbosti', 'máme mít zásah 7.kategorie, dohlídnout ať dojde\r\n', '---\r\n', 'Na místě byla světlá, která dělala pátrací rituál po klukovi, který se jí už den neozval. Strašně dojemný příběh. Každopádně světlý jít prý vypíší povolení, takže máme recipročně dostat také jedno. Jinak nuda.\r\n', 0, 0, 1, 1, 1363302000, '21:15', '20:45', 'šero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Ukazuje mi to zde nějakého citově nestabilního Jiného na 50&deg;4''39.463&quot;N,&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">14&deg;29''24.333&quot;E, který se chystá provádět nějakou hloupost v 20:15.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Pomůžete mu?</span>\r\n'),
(168, 'Ermoliovi na Vyšehradě', 1363455400, 47, 'zjistit, o co jde', 'V Praze se objevili mimokategoriální hovada, kteří si myslí, že jim to tu patří.\r\n', 'Buď my zabijem je nebo oni nás...\r\n', '<p>\r\nAnalytika nahlásila čerpání a rituál na Všehradě. Narazili jsme jsme tam na hromadu Temných (tuším, že jich bylo šest) které vedl nějaký Matthiass von blablabla Ermoli. Všichni byli vysocí Jiná, jeden z nich se mi představil jako michla Holoubek, vědmák 1.kategorie, zaměstnanec pana Ermoliho. Ermoliho doprovázela ještě jeho sestra Andrea, neuvěřitelně arogantní kráva.\r\n</p>\r\n<p>\r\nErmoliovi pokračovali z Vyšehradu na náplavku a odtamtud směrem k Palackému náměstí. Já jsem hledala na Vyšehradě stopy rituálu, Ermoliho skupinku sledovali Krista s Milerem. Když jsem se k nim dostala, sdělili mi, že je Ermoliovi \r\n</p>\r\n<p>\r\nPo chvíli s ee připojili ještě Černá s Milerem z NH, kteří dále sledovali Ermoliho skupinu, zatímco já jsem hledala po Vyšehradě stopy rituálu.Když jsem se k nim pak na náplavce připojila, bylo mi řečeno, že Ermoli a jeho skupina napadli a oni se radši stáhli. Za Ermoliovými se po náplavce táhla šňůra čerpání, a to dost velkých... Ermoliovi Světlé napadli, když po nich chtěli povolení na ty zásahy.\r\n</p>\r\n<p>\r\nNa náplavce jsme se potklai s Koblihem a Sárou a přesunuli jsme se na zřídlo do zahrady Kinských, kde Ermoliovi provedli rituál, kterým převedli energii zřídla na sebe. Tam snimi přímo jednal Koblih. \r\n</p>\r\n', 0, 0, 1, 1, 1363388400, '15:20', 'něco po 17.', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'šero\r\n'),
(169, 'Napadení světlého', 1363544557, 72, 'Prověřit napadení světlého.', 'Světlý obraten napadl světlého zaříkávače, kvůli vraždě.Morální msta?\r\n', 'doplnit\r\n', '<p>\r\nPřed severním vstupem do galerie harfa na Českomoravské napaden světlý zaříkáváč světlým obratněm. Koblížek s Richardem je zastavili, obratně uspali. Po výslechu jsme se dozvěděli, že zaříkáváč seděl na Pankráci za vraždu člověka v sebeobraně a chybou systému byl při amnestii propuštěn. Světlý obraten byl ve vezení dozorcem a posleze se rozhodl vykonat morální mstu na světlém zaříkávači. JIná konfrontace neproběhla.<br />\r\nPo dohodě se světlími pozorovateli jsme nakonec oba vyměnili za upíry, které světlí drželi za vysávání lidí?<br />\r\nTito upíři nakonec kontaktovali zpět Filipa s informacemi ohledně výkyvu a změny nálad lidí v Praze.<br />\r\n<br />\r\n</p>\r\n', 0, 0, 1, 1, 1363474800, '15:30', '16:00', 'Šero 1. hladiny, Opium\r\n', 'Linie mi ukazují, že v obchodním centru Galerie Harfa dojde k napadení světlého <br />\r\nJiného. Povedlo se mi specifikovat místo na přízemní podlaží poblíž severních vstupů.<br />\r\nČas mi tu vyskakuje na 15:30.\r\n'),
(170, 'Výslech vědmy od Ermoliových', 1363548221, 47, 'mimokategoriální zmrdi', 'během bitky s Ermoliovými Dima s Vaškem zajali jejich vědmu a dovedli ji na štáb\r\n', '...\r\n', '<p>\r\nVědma, I.kategorie, Christine Morris\r\n</p>\r\n<p>\r\ns Ermoliovými funguje pár týdnů, využívali ji k provádění některých rituálů (například rituál prokletí na Vyšehradě, oběť je Světlana Goroděcká)\r\n</p>\r\n<p>\r\nneřekla nám prakticky nic nového, Ermoliovi chtějí Prahu pro sebe, jsou to dva mimokategoriální mágové, chtějí Protegona, protože kdysi zabil jejich bratra\r\n</p>\r\n<p>\r\nAndrea Ermoli je podle ní psychopat a vražedkyně \r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 1, 2, 1363388400, '..', '..', '<p>\r\nKoblížek - palečnice\r\n</p>\r\n<p>\r\nSakeena - Telepatický výslech, Palečnice \r\n</p>\r\n', 'info z analytického atd.\r\n'),
(171, 'Upír na Vysočanské', 1363709621, 38, 'řešit napadení', 'jeden mrtvý upír\r\n', '...<span style=&quot;white-space: pre&quot; class=&quot;Apple-tab-span&quot;>	</span>\r\n', 'Dojel jsem na místo, potkal jsem Vávru z NH. V šeru jsme zahlédli postavu. Nedaleko ležela vysátá mrtvola. Šli jsme za upírem pro vysvětlení. Upír mi to vysvětlil dvěma ranami do štítu. Já ho naporcoval šerou dýkou, Vávra naporcované kousky rozmetal dvěma prsty smrti z hůlky. Nasledovalo zpopelnění upíra i oběti. Světlým se toto moc hezky energeticky prodražilo.\r\n', 0, 0, 1, 1, 1363647600, '16:30', '16:40', '<p>\r\nDH - šero, šerá dýka\r\n</p>\r\n<p>\r\nNH - 2x prst smrti, 2x šero, 2x zpopelnění&nbsp;\r\n</p>\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'',''Trebuchet MS'',Verdana,Helvetica,Arial,sans-serif; font-size: 13.3333px; line-height: 18.1944px; background-color: #999999">Ukazuje mi to tu na náměstí OSN (Vysočanská) nějakého řádícího Jiného, střední síly. Měl by začít řádit do 15ti minut, ale vypadá to, že se na tom náměstí plánuje docela dlouho zdržet. něco se ho asi dotklo.</span>\r\n'),
(172, 'Vyslech sefa kuryrni sluzby', 1363800350, 45, 'podezrele zasilky', 'O nicem nevi. Objednatel neznami. Mozno ho se prihlasi o ochranu pred objednavatelom.\r\n', 'Budeme ho chranit a mozno chytneme objednavatele\r\n', '<p>\r\nVyslechu se ucastnila Alice Malinovska.\r\n</p>\r\n<p>\r\nVyslichany, jednatel spolecnosti Libor Lysek, lecistel, 3 kategorie\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nObjednavatel zasilek se predstavil jako Horacio.<br />\r\nStredni postava, delsi rovne vlasy svetle\r\n</p>\r\n<p>\r\nPodle vyslichaneho mozno temny a upir (jak na to prisel netusim)\r\n</p>\r\n<p>\r\nObjedvatel si vyzadal ruzne typy kuryru, ale bylo jedno kterou trasu ktery kuryr pujde a kterou depesi ponese.<br />\r\nPlatil lidskymi penezi. Kvuli neobviklosti zasilky si pan Lysek vyzadal priplatek.\r\n</p>\r\n<p>\r\nVizualni indetifikace vyloucila Malinovskeho, Sforzu a jine male krpate zmrdy, u Nestora rikal ze mozna, ale v bistru dost spatna fotka nestor.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nSERUM PRAVDY se souhlasem vyslichaneho:\r\n</p>\r\n<p>\r\nZATAJIL JSTE NECO OHLEDNE IDENTYTY PACHATELE? NE<br />\r\nZATAJIL JSTE NECO O POVAZE DORUCENI ZASILEK? NE<br />\r\nVEDEL JSTE O RIZIKU ZAPOJENI HLIDEK? NE\r\n</p>\r\n', 0, 0, 1, 2, 1363647600, '20:00', '20:30', 'serumn pravdy (koblizek\r\n', 'bordel kolem kuryru\r\n'),
(174, 'Schůzka v čajovně u Ipáku', 1363887976, 69, 'Zjistit co se děje', 'chůzka\r\n', '???\r\n', 'Po příchodu na místo jsme se potkali se dvěma světlými. Poté jsme dostali pozvání od vedlejšího stolu od někoho, kdo se představil jako Rufus. Řekl, že má vzkaz od paní Blanche, že se chce zítra sejít ohledně řešení situace kolem pražských upírů. Také uvedl, že ví, kde je schovaný Wágner (jeden z těch dvou či co) a že vše je otázkou domluvy. Schůzka proběhne zítra v odpoledních hodinách a mají tam dorazit šéfové každé hlídky a jeden doprovod. Pakliže nebude moct dorazit šéf, tak nějaká kompetentní osoba.\r\n', 0, 0, 1, 1, 1363820400, '16:05', '16:20', 'nic\r\n', '...\r\n'),
(175, 'Dlaci ve Františkánské zahradě', 1363895634, 38, 'krájet', 'tři mrtví dlaci\r\n', '...\r\n', 'Přišel jsem do Františkánské zahrady. Chvíli jsem chodil kolem až na mě najednou vyskočili tři vlkodlaci. Všichni 4. kategorie a ovládali šerý boj, trochu nepříjemné. Výsledek je takovýto, oni tři mrtví dva jsem zabil já, jednoho světlí. Jelikož jsem neměl nějaký elegantní způsob jak je uklidit, vyřezal jsem jim na záda azbukou duraky, aby to vypadalo jako mafiánské vyřizování účtů.\r\n', 0, 0, 1, 1, 1363820400, '18:30', '18:45', '<p>\r\n2x řetězový blesk, 2. šero, šerá dýky, postižení, trojité ostří\r\n</p>\r\n<p>\r\nsvětlí nevim \r\n</p>\r\n', 'Ukazuje mi to tady tři zabité lidi v okolí Václavského náměstí, povedlo se mi <br />\r\nútočníky vystopovat v 18:30 ve Františkánských zahradách.\r\n'),
(176, 'nelegální lov na Palačáku', 1363899462, 69, 'Zjistit co se děje', 'zjistit co se děje ohledně údajného nelegálního lovu<span style="white-space: pre" class="Apple-tab-span">	</span>\r\n', 'jsou to srabi...\r\n', 'Po příjezdu na místo jsme potkali 3 upíry v transofrmaci, kteří před námi hnedka utekli. Bohužel se rozdělili a ztratili se nám. Každopádně to byli nějaký hovna, protože šli lovit ve skupině, aby neměli strach, že je oběť zmáltí kabelkou. Na místě 3 mrtví lidé.\r\n', 0, 0, 1, 1, 1363820400, '20:40', '21:15', '2x šero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">V nejbližších chvílích to vypadá, že v okolí Palackého náměstí a parku u něj bude někdo lovit. Vypadá to, jako by byl naštvaný a není jisté jak to je s jeho licencí.</span>\r\n'),
(177, 'Mrtvej polda - vyslech svetlych', 1364071260, 45, 'zabiti dvou lidi na vyjezdu v case denni hlidky', '<p>\r\nVladimir Kovac bezduvodne rozsekal trojitym ostrim a dykou cloveka - slecnu aniz by ona cokoliv agresivne udelala.<br />\r\nSvetly neskenovali a posrali to. \r\n</p>\r\n', '<p>\r\nOdhmotneni Kovace ci Netusila pokud se jim spravne vysvetli co udelali.<br />\r\nZaloba jak svin.\r\n</p>\r\n', '<p>\r\nVypoved Vladimir KOVAC<br />\r\nPri prijezdu na akci mel cca 30mg.<br />\r\n<br />\r\n-dorazili na místo určení a vyčkávali jestli nedorazi DH.<br />\r\n-v čas co udalo analytické se rozhodli projít okolí, jelikož nepotkali DH a dole v podchodu nekoho slyseli<br />\r\n-nasli dva sprejeri kluk a holka, zacali snimi konverzovat a bavili se snimi o tom co tam sprejuji. Sprejeri se jich pak ptali jestlioni nejsou policajti coz dementovali. Bavili se snimi cca 2 minuty.<br />\r\n- Kluk prestal sprejovat a divaje se na Netusila prohlasil, ze je nejaky divny a polil ho svecenou vodou, nasledne se na nej vrhnul a zacali se prat<br />\r\n- Vladimir vypalil z poradace nachystane trojite ostri a nasledne prekvapenou divku sel dorazit dykou, nez divka stihla vytahnout svou dyku (neboji sotva bytahla) byla mrtva.<br />\r\n-proskenovali mrtvoli a zjistili ze jsou to lide<br />\r\n-mrtvoli chteli na miste nechat nebo nevedeli jak se jich zbavit<br />\r\n-pak situaci prevzala DH - cca 3 minuty po incidentu\r\n</p>\r\n<p>\r\n&nbsp;<br />\r\nVypoved Ondřej NETUSIL, pri prejezdu mel 100mg a ten den transfer nepouzil\r\n</p>\r\n<p>\r\n-Dorazili na misto<br />\r\n-pozorovali a postavali cca nad mistem nasledneho cinnu 5-10&nbsp; minut<br />\r\n-věděli že dole někdo je, včas co udalo analyticke vyrazili dolu a potkali sprejery Kluka a Holku<br />\r\n- zacali se snimi bavit o sprejovani<br />\r\n- nasledne Kluk prohlasil neco o svecene vode postrilkal ME a i kdyz jsem rekl CO BLBNES tak se na me vrhnul a zacali jsme se pretlacovat<br />\r\n- pry neco rikal holce ale nerozumel jsem co<br />\r\n- holka vytahla na Vladimira kudlu<br />\r\n- Vladimir seslan na Holku trojite ostri<br />\r\n- Kluk na me vytahl kudlu, shodil mi stit a porezal me, zvladl jsem zakouzlit jen Elementalni utok I a trikrat jsem do kluka prastil. Pak ho zezadu dykou dorazil Kovac. Ja jsem prednim porad ustupoval.<br />\r\n- pak jsme je prohledali, niceho zvlastniho u sebe nemeli, nic jsme jim nezvali \r\n</p>\r\n<p>\r\n-----------------------------------------------------------\r\n</p>\r\n<p>\r\nDoplnujici otazky:\r\n</p>\r\n<p>\r\nUmite nejaka jina koula nez co jste pouzili a mohli vyresit situaci?\r\n</p>\r\n<p>\r\nKOVAC - Freez - duvod nepouziti, nechtel plytvat energii, mel ji malo a trojite ostri mel nachystano v poradaci<br />\r\nNETUSIL - telekineze - v boji pod udery nezvladl seslat\r\n</p>\r\n<p>\r\nProc jste si nevzal od kolegy energii kdyz jste byl na vyjezdu?<br />\r\nKOVAC - S transferem velmi sestrime nechteli jsme plytvat\r\n</p>\r\n<p>\r\nCo bylo na sprejerech podezreleho?<br />\r\nByly na miste, ktere oznacilo analyticke, ze by se tu mohlo neco stat.\r\n</p>\r\n<p>\r\nProc dotycne predem neproskenovali?<br />\r\nNechteli jsme plytvat energii a bylo by to neslusne.\r\n</p>\r\n<p>\r\nPo trojitem ostri a pripadne dalsi rane, dal jste HOLCE sanci se vzdat?<br />\r\nKOVAC: Ne, bal jsem se ze kdyby byla magem tak by mohla na me neco zakouzlit. Nechtel jsem ji dat sanci.\r\n</p>\r\n<p>\r\nNezkusili jste treba utect do sera ci se stahnout? <br />\r\nKOVAC nemel jsem dost energie, abych byl v seru dlouho<br />\r\nNETUSIL ustupoval jse, ale v ramci pretahovani ci souboje me to nenapadlo  \r\n</p>\r\n<p>\r\nChteli by jste neco k vyslechu dodat?<br />\r\nKOVAC: Kdyby jsme byli vedeli ze jsou to lide, probehlo by to cele jinak<br />\r\nJak by jste neco takoveho mohli dopredu vedet?<br />\r\nKOVAC: Kdyby jsme je proskenovali\r\n</p>\r\n<p>\r\n----------------------------------------------------------------------------------------\r\n</p>\r\n<p>\r\nSERUM PRAVDY KOVAC<br />\r\nNa holku jste zautocil aniz by z jeji strany vzesla jakakoliv agrese? ANO<br />\r\nVědeli jste vy nebo kolega o pritomnosti DH pred incidentem? NE<br />\r\nVzali jste neco tem dvoum po incidentu? NE \r\n</p>\r\n<p>\r\nSERUM PRAVDY NETUSIL<br />\r\nVyprovokovalo ty dva zabite lidi neco z vaseho ci kolegova rozhovoru snimi? NE<br />\r\nMyslite si ze bylo nutne je zabit? NEVIM<br />\r\nZatajil jste neco ohledne tohotoincidentu pri vyslechu? NE\r\n</p>\r\n', 0, 0, 1, 2, 1363993200, '20:30', '21:20', '<p>\r\nKovac - trojite ostri z poradace<br />\r\nNetusil - Elementarni utok\r\n</p>\r\n', '<h2><a href="http://www.prazskahlidka.cz/forum/viewtopic.php?f=3&amp;t=447">Mrtvej polda - </a></h2>\r\n<p>\r\n<a href="http://www.prazskahlidka.cz/forum/viewtopic.php?f=3&amp;t=447">http://www.prazskahlidka.cz/forum/viewtopic.php?f=3&amp;t=447<br />\r\n</a>\r\n</p>\r\n'),
(178, 'Mrtvej polda', 1364075354, 69, 'Zjistit co se stalo ', 'Na místě nalezeny 2 mrtvoly lidí a 2 živé světlé\r\n', 'trest pro světlé?\r\n', 'Po příjezdu, jsme oblídli místo a poté našli místo činu. Na místě byli 2 mrtvoly lidí a u nich 2 světlý. Světlý řekli, že na ně bezdůvodně zaůtočili a že se bránili. Přesto je zabili. Asi by byl jiný způsob, jak je zpacifikovat, ale to je asi v tu chvíli nenapadlo. Po ohledání mrtovl jsme sbalili světlé a odvezli je na štáb k výslechu (viz hlášení). Po našem odjezdu na místě zůstali další naši hlídkaři a zbavili se mrtvol. \r\n', 0, 0, 1, 1, 1363993200, '19:20', '19:40', '5x šero\r\n', '<ul class="profile-icons">\r\n	<li class="report-icon"></li>\r\n	<li class="quote-icon"></li>\r\n</ul>\r\n<p class="author">\r\n<a href="http://www.prazskahlidka.cz/forum/viewtopic.php?p=1153#p1153"><img src="http://www.prazskahlidka.cz/forum/styles/dark_revil/imageset/icon_post_target.gif" alt="Příspěvek" title="Příspěvek" width="11" height="9" /></a>od <strong><a href="http://www.prazskahlidka.cz/forum/memberlist.php?mode=viewprofile&amp;u=110">ORG_draken</a></strong> &raquo; sob 23. bře 2013 18:43:19 \r\n</p>\r\n<div class="content">\r\nPřed chvílí jsem si všiml, že na parkovišti na štvanici byl zabit Jiný, pan Rudolf <br />\r\nVondráček.<br />\r\nZajímavé na tom je, že ho tu máme (měli jsme) registrovaného jako upíra 7. kategorie.<br />\r\nPovedlo se mi vypátrat, že byl zaměstnán u PČR, která před chvilkou tělo odvezla.<br />\r\n<br />\r\nCo Vás bude asi zajímat je, že pravděpodobní pachatelé se zdržují v okolí souřadnic <br />\r\n50&deg;5''33.385&quot;N, 14&deg;26''13.396&quot;E. Čas mi to ukazuje na 19:20.\r\n</div>\r\n'),
(179, 'Vlkodlačí lov na blbou licenci na Letný', 1364143667, 26, 'předejít obětem na životech (achjoo)', 'uspali jsme dva vlkodlaky, než stihli někoho sežrat, měli licenci koupenou na internetu, navíc vlkodlaci údajně mohou lovit jen na lovištích, takže ta licence by se nedal uplatnit, nicméně byla pravá\r\n', 'nakopeme do koulí toho, co prodává licence na internetu\r\n', 'Se sárou jsme vyrazili na Letnou k Hanavskému pavilonu. Narazili jsme na dva vlkodlaky v proměně, který proběhli okolo a vrhli se na prvního náhodnýho kolemjdoucího.Než do něj stačili zatnout drápy tak jsem je uspal. Za NH se tam objevila Krista a Miler. Vlkodlaky jsme jim dali k vyslechu. Pozdeji se vlkodlaci ozvali- ze je NH v poradku propustila.\r\n', 0, 0, 1, 1, 1364079600, '14:00', '14:30', '<p>\r\nNH\r\n</p>\r\n<p>\r\n2x 1.šero 2x um scan \r\n</p>\r\n<p>\r\nDH\r\n</p>\r\n<p>\r\n2x trim opium\r\n</p>\r\n<p>\r\n2x 1. šero \r\n</p>\r\n', 'Linky mi tu ukazují na nějaký lov a pravděpodobně mrtvého člověka u \r\nHavanského pavilonu na Letné. Čas to hlásí nějak kolem 14:00. <br />\r\nDejte si pozor na další zbytečné mrtvé..\r\n'),
(180, 'Zajistit Jiného podle zatykače', 1364226749, 69, 'Chytit ho a dotáhnout k vyýslechu', 'chyceno, odveženo\r\n', 'to se uvidí, až promluví\r\n', 'Po příjezdu na nádraží jsme chvíli čekali, potkali se s dvěma světlýma hlídkařema. Po příjezdu byl cíl zadržen a po domluvě byl ještě s jedním světlým (Vávra) odvezen na štáb. Tam sme ho chtěli vyslechnout, ale neodpovídal na žádné otázky a říkal, že chce mluvit jenom s někým z Noční hlídky, tak sme ho strčili do báně a Vávra odešel.\r\n', 0, 0, 1, 1, 1364166000, '16:00', '16:30', '4x šero, 1x scan\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Mám tu příjezd Jiného na Masarykovo nádraží v čase 16:01 vlakem od Milovic.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Vypadá to, že se jedná o Andreje Sazela, světlého, na kterého byl vydán minulý týden zatykač za vraždu nějakého upíra.&nbsp;</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Odhadované linky dále ukazují, že se dotyčný bude přesouvat na Karlínské náměstí, kde mi to hlásí nějakou magickou aktivitu.</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Máme lidi, abychom toho vraha upírů zadrželi?</span>\r\n'),
(181, 'Sabbat', 1364227992, 45, 'zjist co a jak', '<p>\r\nNa miste vedma 6. kategorie Dominika Sacka, neni registrovana, vtahla do sera dva lidi. Jeden znich umrel a druha se stala zarikavackou 7 kategorie pevne verici v satana. \r\n</p>\r\n', 'Svetla satanistka co tu bude pachat svetle rytualy ve jmenu belzebuba\r\n', '<p>\r\nDorazili jsme na misto. Prijechala svetla vyjezdovka...<br />\r\nDole vydeli divadlo a pak typek umrel a holka objevila sero.<br />\r\n<br />\r\nVedma byla sfetovana az hruza. Svetly ji zatkli. Pak zacala Nejmrlinkovatejsi zhasinat svicky ve tvaru pentagramu. Vedma kterou nikdo nehlidal a neprosacoval ji. Vytahla dyku a v afektu se vrhla na Nejmrlinkovatejsi. Pakrat ji rizla pod krkem, ale bohuzel neprorazila jeji stit.\r\n</p>\r\n<p>\r\nMiller ji pritlacil na zed a dal nuz pod krk. Uklidnil jsem situaci.&nbsp;\r\n</p>\r\n<p>\r\nDomluvili jsme se ze vezmu obe holciny na stab svetlycha krista nebo miller pujdou pesky. Dimu jsem odeslal zpatky na stab.\r\n</p>\r\n<p>\r\nNajednou svetli dostali hlaseni o necem na vysehrade a najednou jsem tam zustal s nejmrlinkatouvejsi, zarikavackou a jeji mistrini vedmou spoutanou sam.&nbsp;\r\n</p>\r\n<p>\r\nKdyby nebyl nouzovy stav kvuli padu bariery...celou situaci bych si velmi vychutnal. Ale takto jsem pomohl... Jinak by jsme tam byli jeste dnes.\r\n</p>\r\n<p>\r\nNakonec jsem musel i vedmu uspat spankem, pac ta svetovana krava nechtela vystoupit z meho auta....\r\n</p>\r\n<p>\r\nVyslechli jsme ji ale blabolila furt o satanovi. Svetly zjistitli ze neregistrovana. Po vystrizliveni z drog nebyl videt rozdil. Furt mlela o satanovi. Nechat u svetlych tyden a jestli ji nezazaluji tak bude volna...\r\n</p>\r\n<p>\r\nZarikavccku svetly poucili o dohode a ona ji rekla ze at jdou doprdele ze veri v satana pana jejiho a stim se snimi rozloucila. \r\n</p>\r\n', 0, 0, 1, 1, 1363993200, '23:00', '24:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'Na adrese Jana Masaryka 19 (ne, není to úkryt Romana Wágnera, ale \r\nskautská klubovna) začne v 23:00 (přesně) nějaký podivný obřad. Ukazuje \r\nmi to tady na vliv nějakého Jiného. Doporučuji prošetřit a pozorovat o \r\nco se bude jednat.\r\n'),
(182, 'Napadení v Karlíně', 1364324973, 69, 'Zajistit Jiného co napadá lidi', 'Zajištěno, odvezeno\r\n', 'noviny přes čumák...\r\n', 'Po příjezdu na místo jsme potkali hlídku světlých. Na místě zadržen vlkodlak, co honil pošťáky a trhal jim kalhoty. Po domluvě byl odvezen na štáb (spolu s Vávrou) a domluveno mu, že bude odvezen do sanatoria, kde bude spoustu pošťáků a kalhot...\r\n', 0, 0, 1, 1, 1364252400, '19:50', '20:00', '2x příkaz, nějaký šero, scan\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Hele lidi, tak tady mám další pecku: na Karlínském náměstí mi to ukazuje nějaký pokus o napadení člověka a něčeho dalšího v čase 19:50. Díval bych se po něčem podezřelém hlavně v parku či u silnice.</span>\r\n'),
(183, 'Kontinuální magie - vyslech', 1364330928, 45, 'Milan Šváb (špendlík)', '<p>\r\nPana Švába zarikava 5. kategorie vydírají dva Vlkodlaci je možné, že jsou od Vlčice...\r\n</p>\r\n<p>\r\nVe stredu sledovat jeh adresu a chytit je Sobeslavska 31\r\n</p>\r\n', '<p>\r\nChyceni dva vlkodlaci co vydira typka\r\n</p>\r\n<p>\r\ntypek se da tapetovat o zasahy u svetlych \r\n</p>\r\n', '<p>\r\nV nedeli vecer prisli na nezvanu navstevu k panu Svabovi domu (Sobeslavska 31) dva vlkodlaci. Nemyti, spinavy, smradlavy necivilizovani... ziji mimo civilizaci.<br />\r\nChteji po nem, aby jim nasel kost nenarozeneho sedmeho syna. Zkusil takovy artefakt hledat na Olsanech pomoci velkeho scanu. Pokud jim ho ve stredu nedoda vypali mu dum. \r\n</p>\r\n<p>\r\nSeslal na Olsanech 5x velky scan, nasal z lidi 3x15mg\r\n</p>\r\n<p>\r\nVlkodlaky blize identifikovat nezvladl.\r\n</p>\r\n<p>\r\nSERUM PRAVDY:<br />\r\nREKL JSI PRAVDU O SVEM VZTAHU S VLKODLAKY? ano<br />\r\nNASEL JSI TU KOST? ne<br />\r\nREKL JSI NAM CELOU PRAVDU O TOM CO PO TOBE CHTELI VLKODLACI? ano<br />\r\nZATAJIL JSI NECO CO BY POMOHLO IDENTIFIKOVAT TY DVA VLKODLAKY? ne<br />\r\nMAS RODINU? ano<br />\r\nMAS BLIZSI INFORMACE K PREDANI NEZ JSI REKL? ne \r\n</p>\r\n', 0, 0, 1, 2, 1364252400, '21:15', '21:35', '2x serumn pravdy\r\n', 'info z analytického atd.\r\n'),
(184, 'Další vražda', 1364489566, 65, 'Jako zjistit vo co de', 'Byli tam dva vampýri, co lovili na povolenku. Něco tam nelicovalo, tak sme ich chočeli sbalit. Ve finale utekli, patamužto měli hulky s freezama.\r\n', 'asi nic moc. Kromě takovyho postuchovani s dozoristama, to bylo koser.\r\n', 'Prisli sme tam s Bobkem, oni začali zdrhat. Tak sme si je našli, oni ukazali povolenky. Přišla Sobotková, neco nelicovalo, tak sme ich sbalili. Cestou zpatky zafreezovali Bobka a Sobotkovou a utekli. Ja byl pozadu pac ja menil. Tak ja zmenil eščo raz, že ich paskušam chytit. No oni se vraceli okolo me a ja do nich skočil zpoza stromu, myslim, ze si pustili do gati celkem. Nandal sem ji hrozny veci, ale zmrazili me toze z hulky a utekli (tady nas jako pravidlovo oprcali, to ja vam zkazal)\r\n', 0, 0, 1, 1, 1364338800, '18.15', 'cca 20.00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(185, 'Výjezd k upírovi co loví', 1364498792, 69, 'Zjistit co se děje', 'Eva trochu vytytala posledního přeživšího Vladova potomka.\r\n', 'Pan Nicolas už nebude svou chybu opakovat.\r\n', 'Po přijezdu na místo sme potkali 2 světlé hlídkařky a upíra, který na místě lovil. Na lov měl povolení, ale neprobíhal přes vábničku. Dohodli jsme se, že se večer zastaví na štábu DH a podá vysvětlení.\r\n', 0, 0, 1, 1, 1364425200, '19:15', '19:45', 'asi 3x šero\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Hele lidi, tak další. Cca za 30 min mi to ukazuje zabitého člověka (nejspíše lovící upír) na adrese Matoušova 5. Snad se Vám ho povede chytit. Jinak mi linky říkají, že zamíří po tomto hrůzném činu do podniku &quot;Věstonický Venouš&quot;.</span>\r\n');
INSERT INTO `nw_reports` (`id`, `label`, `datum`, `iduser`, `task`, `summary`, `impacts`, `details`, `secret`, `deleted`, `status`, `type`, `adatum`, `start`, `end`, `energy`, `inputs`) VALUES
(186, 'Vlčí rodina', 1364549948, 38, 'zastavit lov', 'Vlkodlaci lovili, aby oslavoly úplněk a vlčici a vůbec\r\n', 'vlčice už zase\r\n', 'Dorazili jsme na místo, a už z dálky jsme slyšely vytí. Našli jsme tři mrtvoly. Pokračovali jsme až jsme narazili na vlkodlačí rodinku. Samozřejmě se strhla bitka, kterou jsme vyhrály. Rozdělili jsme si je dva a dva. Já jel s NH k nim na štáb. Jejich neschopnost vyslýchat mě donutila abych se do toho vložil sám. Povídali nějaké kecy o Vlčici. Jak slyší její volání jak to od ní všichni šeredně schytají, blablabla. Nakonec jsem z nch dokázal dostat něco jako postup jak si jí zavolat. Přišlo mi že si to trochu tahaly z paty.\r\n', 0, 0, 1, 1, 1364338800, '21:00', '23:00', 'boj, nevim\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.19444465637207px; background-color: #999999">inky mi tady ukazují, že kolem 21:00 se v okolí Šlechtovy restaurace (ve Stromovce&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.19444465637207px; background-color: #999999">někde tady 50&deg;6''17.171&quot;N, 14&deg;25''3.310&quot;E) schyluje k nějakému střetu, nebezpečí a mám&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.19444465637207px; background-color: #999999">tu i nějaké mrtvé lidi. Postupujte opatrně, vygooglil jsme si, že tam v té chvíli má&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.19444465637207px; background-color: #999999">probíhat nějaká fireshow a bude tam asi dost lidí, kteří nemrznou jako já tady na&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.19444465637207px; background-color: #999999">analytickém, když se nám tu vyplo topení v tomto krásném jarním počasí.</span><br />\r\n<br />\r\n<a style="margin: 0px; padding: 0px; direction: ltr; unicode-bidi: embed; text-decoration: none; color: #ffffdf; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: #ffffef; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; font-size: 13.333333969116211px; line-height: 18.19444465637207px; background-color: #999999" href="http://fireshow.cz/zonglovani/fullmoon-fire-27-3-stromovka" class="postlink">http://fireshow.cz/zonglovani/fullmoon- ... -stromovka</a>\r\n'),
(187, 'Výjezd na upíří porovnávání dešvorců', 1364728785, 26, 'pozorovat, zabránit násilí', 'Upiri party, souteze, porovnávání dešvorců a další trapnosti. V obecenstvu závody v obracení očí v sloup a kousání se nudou.\r\n', 'Okultní a diplomatická divize budou mít ve směrnicích: Upíří párty? Zapálit! Uhasit! Zaorat! Posolit!\r\n', '<p>\r\nPozdě v noci jsme vyrazili na upíří párty o který jsme tušili celej večer, ale pravděpodobnostní linie ji okázale ignorovaly až zhruba do dvou do rána. Nalitý jak dělo kromě řidiče jsme vyrazili na kontrol párty. Dokonce se nám podařilo vyschýzovat světlý tak, že na nás poslušně asi dvace minut čekali na místě, než zaklepali na dveře.\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Otevřel nějakj upíří šampón a nějakej golem, kterýho jsem si všiml, vyrobil ten samej zmetek, co zabezpečil tu prázdnou krabici co jsme zabavili sekerovcům ve Stromovce. a že prej nás zvou na upíří olympiádu .. mno pár z nás, kdo se chtěl účastnit. Nakonec jsme se tam poskládali +/- všichni. Taková malá zatuchlá kobka .. party hard .. jo jo .. . Následovalo to nejhorší co jsem zatim ve hlídce zažil. Takový trumfování se v trapnosti bych si ztěží do tý doby dokázal představit. Po několika hodinách soutěží v zírání, víření pláštěm, pití náhrad na efekt a já nevim jakejch dalších píčovin jsme se zase rozešli. Mezi tim mi ragulin po telefonu několikrát zakázal všechny ty debilní upíří trapky zapálit a odejít středem .. Dimovi se dokonce podařilo nějak komunikovat s upírama a utužovat vztahy.</span>\r\n</p>\r\n', 0, 0, 1, 1, 1364684400, '2:00', '5:00', 'magie nic, nápor na příčetnost: úroveň obtížnosti &quot;šachy s Ctulhu za hlasitého předčítání necronomiconu ve svahilštine se simultánním překladem do morseovky&quot;\r\n', 'už nevim, chci na to zapomenout ...\r\n'),
(188, 'Iniciace problémek', 1364744861, 45, 'vyresit', '<p>\r\nTemny mag Antoni Folta (6k) a vlkodlak Josef Vomacka (6k) iniciovali vedmaka Petra Krize (6k)\r\n</p>\r\n', 'nicego\r\n', '<p>\r\nDorazili jsme na misto kde se svetly hlidkari navazely bezduvodne do dvou temnych a jednoho neiniciovaneho cloveka. Po kratke diskuzi se snima Kruha rozhodl jit na pivo. Svetly pri zmince jdeme na pivo vzali kramle.\r\n</p>\r\n<p>\r\nNechali jsme temne aby typka dostatecne vyhecovali na iniciaci, jen v jedne chvili Richard vysvetlil Foltovi, at nepouziva telekinezi a kouzla... Museli jsme vymazat 8 lidi.&nbsp;\r\n</p>\r\n<p>\r\nDobra vec se podarila vedmak iniciovan. Poucili jsme je at ho zpravi o dohode. Vezmou ke svetlym na stab a k nam se nekdy stavi an vodku a pokec s nejtemnejsi pokud ji budou chtit poznat. \r\n</p>\r\n', 0, 0, 1, 1, 1364684400, '14:28', '15:00', '<p>\r\n8x amnezie 8mg\r\n</p>\r\n<p>\r\n2x vstup do sera\r\n</p>\r\n<p>\r\n4x trim scan \r\n</p>\r\n', 'Chlapi a ženské, mám tu nějakou mírnou magickou aktivitu na 50&deg;4''14.661&quot;N, <br />\r\n14&deg;27''15.214&quot;E v čase 13:45. Vypadá to na nějaké třasořitky, ale přesto bych to <br />\r\nzkontroloval.\r\n'),
(189, 'kurýr ve Stromovce', 1364746506, 69, 'zajistit kurýra', '<p>\r\nbitka jak cip\r\n</p>\r\n<p>\r\nŠtábní kočky mají novou krabici jako prolézačku.&nbsp;\r\n</p>\r\n', 'Sekera je svině\r\n', 'Po příjezdu na místo sme našli kurýra (člověk), který měl zásilku pro Sekeru. Tak jsme ho nechali, aby jí doručil na místo kam měl jít. Na místě byl Sekera. Po předání zásilky na nás zaůtočil spolu s 5ti vlkodlaky a dvěma vědmákama. Vzduchem lítalo uplně všechno, oheň, chlupy, blesky, všechno. Po bitce a oživení a oléčení padlých Sekera utekl a my sme vzali zásilku (velmi zabezpečená, navíc v ní byl - dle očekávání - pouze výsměšný vzkaz). Poté odjezd na štáb.\r\n', 0, 0, 1, 1, 1364684400, '19:30', '21:00', 'uplně všechno a hodně\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Lidi tohle je asi vážné, linky mi tady ukazují předání nějaké zásilky někde ve Stromovce kolem osmé hodiny. Nedokážu určit přesné místo, ale povedlo se mi zachytit samostatného kurýra na 50&deg;6''26.020&quot;N, 14&deg;23''55.388&quot;E v čase 19:30.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Dejte si nejspíše pozor, hlásím mi to po Stromovce několik Jiných až středních sil a potenciálně agresivní chování, proto se mi to asi povedlo zachytit, jinak bych si toho nevšiml.</span>\r\n'),
(190, 'zajištění napadeného člověka', 1364746953, 69, 'najít a zachránit', 'znova gang maldistvých\r\n', 'děti by se měly lépa vychovávat\r\n', 'Po příjezdu na místo sme našli zmláceného člověka, kterému jsme zavolali sanitku. Poté nás z kolemjedoucího auta napadli nějaký výrostci. Proběhlo několik kouzel a poté odjeli. Jeden z nich byl ten výrostek, kterého sme potkali na hřbitově včera.&nbsp;\r\n', 0, 0, 1, 1, 1364684400, '17:45', '18:18', 'nějaký příkazy a zrcadla\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Lidi, ukazuje mi to tady napadení člověka nejistého rozsahu na 50&deg;5''2.422&quot;N, 14&deg;26''31.459&quot;E v čase cca 17:45 a potenciální napadení Jiným. Prověříme to?</span>\r\n'),
(191, 'Experimentální rituál-Vyšehrad', 1376925986, 72, 'Prozkoumat, kdo si ', '<p>\r\nTemný vědmák, jenž vědomě při rituálu zabil civilisty, přijel před 2 dny, neregistrován.&nbsp;\r\n</p>\r\n<p>\r\nUdajně chtěl baterku prodat komukoliv kdo se nabídne. &nbsp;\r\n</p>\r\n', 'Prozrazení světa jiných, magické následky, pokud by se rituál povedl?\r\n', '<p>\r\nSe Sakeenou jsme přijeli na Vyšehrad kvuli oznámení o experimentálním rituálu. Po proběhnutí jsme zjistili, že podezřelého již zadrželi světlí, Sakeena po kontaktování Christy dohodla pozorovatele u výslechu.\r\n</p>\r\n<p>\r\nNa štábu světlích jsem čekala pul hodinu, než se vrátili, posléze jsem se snažila s Viktorii domluvit převoz zadrženého k nám.\r\n</p>\r\n<p>\r\nNásledně mi Christa oznámila, že mám podezřelého vyslechnout přímo u nich, že to Eva schválila. \r\n</p>\r\n<p>\r\nVýslech nám prozradil, že jde o temného vědmáka III.kategorie, jenž vědomě zabil lidi v rituálu při dobíjení 80 mg baterky.\r\n</p>\r\n<p>\r\nJednalo se tedy o vědomou vraždu, zadrženého si nechali světlí ve sklepě.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1376863200, '15:15', '16:00', '0\r\n', 'info z analytického atd.\r\n'),
(192, 'Magicka aktivita-strossmayerovo náměstí', 1376943244, 72, 'prověřit situaci', 'Dva světlí napadli jednoho temneho mága, udajně jim za války zabil rodinu.\r\n', 'Prozrazení světa jiných\r\n', '<p>\r\nNa strossmayerově náměstí se vyskytoval jiný temný mág, jenž byl napaden dvěma světlími. \r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Po chycení a odvezení na štáb světlých bylo zjištěno, že temný mág pracoval pro SS, udajně pro Tulle, dělající pod donucením pokusy na jinych i lidech.&uml;</span>\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Dva světli tvrdili, že jim v rusku zabil rodinu při vybírání vhodných subjektu pro pokusy pro Tulle.</span>\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Celý případ měl dohru již dnes, bližší info Eva nebo Sakeena.</span>\r\n</p>\r\n<p>\r\n<span style=&quot;font-size: 10pt&quot;>Prosím koblížka o doplnění osob, jak temého mága, tak světlích, dělal si poznámky u výslechu.&nbsp;</span>\r\n</p>\r\n', 0, 0, 1, 1, 1376776800, '23:00', '24:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(193, 'Praštěná léčitelka', 1376951266, 47, 'pozorovat světlušky při práci', 'praštěná léčitelka nelegálně léčila a vykřikovala cosi o konci světa\r\n', '...\r\n', '<p>\r\nU Všeobecné nemocnice na Karláku Světlí zadrželi léčitleku III. kategorie, když bez povolenky provedla kouzlo II. úrovně. U výslechu uvedla, že tak zachránila tři lidi, kteří by jinak zemřeli na rakovinu a že je jí jedno, co s ní uděláme, protože stejně přijde konec světa a ona a spousta dalších umře - to prý viděla v pravděpodobnostních linkách. Světlí nám za její kouzlení vydali zásah 5,kategorie.\r\n</p>\r\n<p>\r\nLéčitelka pijela z Mnichova (původně je z Británie) a měla pokračovat dále do Varšavy, očividně jí ale přišlo jako dobrej nápad si tady u nás v Praze trochu zaléčit... =/ \r\n</p>\r\n', 0, 0, 1, 1, 1376863200, '22:45', '23:30', '<p>\r\nSakeena II.šero\r\n</p>\r\n<p>\r\nHradil II.šero, plus asi scan \r\n</p>\r\n', 'Pro službu konající hlídku.<br />\r\nVážení službukonající,<br />\r\nmáme tady narušení pravděpodobnostních linií magickým způsobem v oblasti Nemocnice na Karlaku.<br />\r\nJe pravděpodobné, že se bude jednat o standardní výjezd<br />\r\nProzatím nejsou známy konkrétní detaily, pokud se situace vyjasní, ihned hlášení aktualizuji.<br />\r\n<br />\r\nTomaš Kraus Analytické oddělení.\r\n'),
(194, 'Thule na Strossmayeráku', 1376988834, 47, 'pozorovat světlušky při práci', 'dva Světlí mágové napadli Temného mága (Thule)\r\n', 'možné dopady, když se objeví Thule? Průsery, průsery a ještě jednou průsery...\r\n', '<p>\r\nNa Strossmayerovo náměstí jsme dorazili o něco dříve než Světlí, takže jsme se v klidu rozmístili a čekali jsme. Krátce potom, co partička světlušek dorazila, došlo k potyčce před kostelem sv. Antonína, dva Světlí tam napřed slovně a pak i fyzicky napadli jednoho Temného, který v reakci na to vyvolal Karabáč a začal se bránit. To už zasahovala NH, dva Světlí se dali na útěk, my jsme se Sárou a s Nočníma vyběhli za nimi, Koblih a Krista Černá zůstali s tím Temným. Alice Malenová zadržela jednoho z útočníků, druhého pronásledoval Miler, my jsme se spolu s Alicí vrátili ke kostelu. Po chvíli se objevil Miler s druhým zadrženým a vydali jsme se ke Světlým naštáb na výslech. Hlášení z výslechu doplní Koblížek.\r\n</p>\r\n<p>\r\nTemný byl nějaký Karl von Ansgar, mág III. kategorie, údajně na přátelské návštěvě svého známého Fritze. Posléze vyšlo najevo, že jde o nám známého Fritze Renkopfa - Thule = průser.\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 0, 1, 1, 1, 1376776800, '22:00', '23:00', '<p>\r\nSakeena II. šero, scan\r\n</p>\r\n<p>\r\nSára II. šero\r\n</p>\r\n<p>\r\nKoblížek I. šero \r\n</p>\r\n', 'Vážení službukonající,<br />\r\nmáme tady lehké narušení pravděpodobnostních linií magickým způsobem v oblasti Strossmayerova náměstí.<br />\r\nJe pravděpodobné, že se bude jednat o rizikový výjezd, proto se připravte.<br />\r\nProzatím nejsou známy konkrétní detaily, pokud se situace vyjasní, ihned hlášení aktualizuji.<br />\r\n<br />\r\nKarel Kraus out\r\n'),
(195, 'Bezručovy sady', 1377010945, 72, 'Pozorovat zásah', 'Sání temného mága Sergeje Ivanoviče,200mg, v první hladině šera.\r\n', 'Zabítí světlích, ovlivnění světa jiných sáním 200mg\r\n', 'DOPLNIT\r\n', 0, 0, 1, 1, 1376949600, '00:15', '1:00', '<p>\r\nMuller: Hradba tisíce čepeli\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Světlí: Záhvího pouta, obraten v proměně.</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Temní: Nic</span>\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">&nbsp;</span>\r\n</p>\r\n', '<p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Vážení službukonající,</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">máme tady narušení pravděpodobnostních linií Nejspíše se jedná o extrémní čerpání energie v oblasti Bezručových sadů.</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Linie naznačují velmi velký stupeň nebezpečí doporučuji maximální opatrnost.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Tomaš Kraus Analytické oddělení.</span>\r\n</p>\r\n<p>\r\n&nbsp;---------------------\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Doplnění: dnešní depeše z Londyna:</span>\r\n</p>\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Pro službu konajícího důstojníka.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Přišla urgentní depeše z Minské denní hlídky.&nbsp;</span><br />\r\n<br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Vážení přátele ,naše zdroje vypátrali že ve vašem městě se skrývá nebezpečný zločinec Sergej Ivanovič, temný mág první kategorie , bývalí zástupce šéfa Denní hlídky města Minsk.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Dostali jsme zatím neověřené informace které naznačují že jmenovaný v současné době jedná s noční hlídkou města Prahy.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Je potřeba jmenovaného okamžitě, neutralizovat a předat Londýnské denní hlídce k vyšetřování.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">S přátelskými pozdravy Fjodor Petrovič Plenčak.</span><br />\r\n<p>\r\n<span style="background-color: #999999; color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; font-size: 10pt">Tomaš Kraus Analytické oddělení.</span><span style="font-size: 10pt">&nbsp;</span>\r\n</p>\r\n'),
(197, 'Kurýři na Florenci', 1377256029, 47, 'zadržet zásilku', 'Maike upozornila na kurýry, kurýři přijeli, narazili jsme tam navíc na Letholda se Sergejem, věc byla zdárně vyřešena\r\n', 'doplnit\r\n', 'Na Florenci jsem narazila na Letholda se Sergejem Ivanovičem, kteří tam řešili nějaké soukromé záležitosti. Během toho, co jsem s nimi hovořila, zadržel Koblížek dva kurýry - vlkodlačici a černého mága, oba 5. kategorie, nicméně zásilka byla prázdná. Nejspíš si z nás zase někdo dělá srandu, jako na jaře...\r\n', 1, 0, 1, 1, 1377208800, '23:00', '23:30', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(198, 'Poker', 1377258295, 47, 'zahrát si informace a amulety', 'Ríša si byl zahrát poker\r\n', '...\r\n', '<p>\r\nInformace, které přinesl:\r\n</p>\r\n<p>\r\nV Praze je dost možná několik špionů Inkvizice. Lethold je jen šašek\r\n</p>\r\n<p>\r\nThule operuje v Praze.\r\n</p>\r\n<p>\r\nThule v Koreji začalo novou práci.\r\n</p>\r\n<p>\r\nThule rozjíždí větší akci. Malinovskij měl v Praze důležitý kontakt.\r\n</p>\r\n<p>\r\nNěkdo krade děti narozené v keltský svátek. Pro nějaký rituál.\r\n</p>\r\n<p>\r\nPo světě je zvýšená poptávka po dětech Beltinu (narozených na Beltine 12/13)\r\n</p>\r\n<p>\r\nNa trhu je zájem o novorozeňata narozená o Beltinu.\r\n</p>\r\n<p>\r\nRituál Richarda Novotného neproběhl správně, sabotoval ho někdo z jeho lidí uvnitř.\r\n</p>\r\n<p>\r\nSpousta lidí najednou stojí o spolupráci s doktorem Zeleným.\r\n</p>\r\n<p>\r\nProblém s vlkodlaky způsobili dva Světlí - obrateň a zaříkávačka.\r\n</p>\r\n<p>\r\nŘíká se, že DH včera (21.8.) kryla vlkodlaky. \r\n</p>\r\n<p>\r\nTradicionalisti... Aspoň ti Temní to mají spočítané. Velkošéf DH se upíše i ďáblu, aby byla hlídka jen jeho.\r\n</p>\r\n<p>\r\nNoční Hlídka má k dispozici Betlémský oheň.\r\n</p>\r\n<p>\r\nRagulin je nakažený a infekční.\r\n</p>\r\n<p>\r\nDrákulova krev zmizela a je k nenalezení.\r\n</p>\r\n<p>\r\nKarlos dokáže opatřit zajímavé hračky.\r\n</p>\r\n<p>\r\nAspoň, že tu ještě po ulicích neteče krev, jako jinde.\r\n</p>\r\n<p>\r\nZahraniční skupina intervenuje do stavebních rekonstrukčních zakázek pražského magistrátu. Dělal na tom i nějaký Johan Klubstav, kterýho nějaký našinec zabil ve Švédsku.\r\n</p>\r\n<p>\r\nChystá se slušně rozsáhlá emigrace nižších Temných ze střední Evropy. Je tu moc světlo.\r\n</p>\r\n<p>\r\nLéčitelská akademie chce uvalit reformu na léčitele mimo spolek.\r\n</p>\r\n<p>\r\nPřemýšlíte nad proroctvím. Víte, kdo z vás za to může? Je vám všem velmi blízký, ale přitom vzdálený. Nikdy neřekne nic, co hned pomůže.\r\n</p>\r\n<p>\r\nVrány letí, poušť za sebou mají. Jen oheň dokáže vše zvrátit. Ne každý umí v šeru krátit(?). \r\n</p>\r\n<p>\r\nPokud vrány na útěk se dají, neprchají před dravci, ale před následky samotnými. Prach jsme...\r\n</p>\r\n<p>\r\nObálka se zoubky v Praze schovaná jest. Ten, kdo nalezne ji, velké vědomosti pánem se může stát... \r\n</p>\r\n', 0, 0, 0, 1, 1377208800, '22:00', '00:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n'),
(196, 'Žitná ulice', 1377011222, 72, 'Pozorovat zásah', 'Temný mág jenž ser bavil na Žitné.<span style="white-space: pre" class="Apple-tab-span">		</span>\r\n', 'Prozrazení světa jiných<span style=&quot;white-space: pre&quot; class=&quot;Apple-tab-span&quot;>	</span>\r\n', '<p>\r\nPo Žitné ulici se promnádoval mág 4 kategorie a jen tak do vzduchu si čaroval příkazy.\r\n</p>\r\n<p>\r\nHlásil, že bude konec světa, světli si jej odvedli.\r\n</p>\r\n<p>\r\nVíce doplní Richard. - Mág byl temný 4. kategorie specializovaný na psychickou magii. Měl vize konce světa a rozhodl se si to před koncem světa pořádně užít, proto ty příkazy. Obávám se, že světlí ho nechají shnít u nich v cele, protože nemá povolení k zásahům a my je za něj nechceme vydat. Nicméně bych se za něj přimluvil a pokud možno ho vykoupil, protože zdaleka není tak nepříčetný jak se tvářil. Jinak u světlých byla nuda, že by jí mohli vyvážet. .. Takže výslech ani moc neprobíhal, protože tam měli na výslech ještě nějakou světlou s podobnými vizemi.<span style=&quot;font-size: 10pt&quot;>&nbsp;</span>\r\n</p>\r\n<p>\r\nPodobnost s případem na Karlově náměstí.<span style=&quot;white-space: pre&quot; class=&quot;Apple-tab-span&quot;>	</span>&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1376863200, '23:00', '24:00', '0\r\n', '<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Linie naznačují že v oblasti žitné ulice dojde k magickým fluktuacím.Bylo by skvělé kdyby to někdo prověřil.&nbsp;</span><br />\r\n<span style="color: #ffffff; font-family: ''Lucida Grande'', ''Trebuchet MS'', Verdana, Helvetica, Arial, sans-serif; line-height: 18.1875px; background-color: #999999">Tomaš Kraus Analytické oddělení.</span>\r\n'),
(199, 'Rituál Jinonice', 1377361024, 47, 'prověřit', 'Svělí kouske od stanice metra Jinonice prováděli totemický rituál \r\n', '<p>\r\nwho knows, prý to bylo něco experimentálního, já se v tom nevyznám, POláková plácala něco o tom, že zkouší, co všechno si může předkreslit\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 'Přijeli jsme na Jinonice, korzoval tam Miler s Černou. Dle našich informací (ze štábu Světlých) tam měl probíhat nabíjecí rituál, nicméně Miler s Černou tvrdili, že tam rozhodně oni nic neprovádějí a že ten rituál hledají taky. Nicméně, když jsme to tam s Maike obešly (já ve druhém šeru) našly jsme Polákovou, jak si v rohu provádí rituál. údajně experimentální, o kterém neví, co to udělá, nicméně při bližším prozkoumání se jednalo o totemický rituál. Vzhledem k tomu, že neměli povolenku, jsem rituál přerušila a vrátili jsme se na štáb.\r\n', 0, 0, 1, 1, 1377295200, '0:50', '2:00', '<p>\r\nSakeena II.šero, scan\r\n</p>\r\n<p>\r\nKoblížek, Maike I.šero \r\n</p>\r\n', 'Drazí hlídkaři<br />\r\nV pravděpodobnostních liniich se mi objevují podivné \r\nfluktuace které naznařují rozrušení šera - Bylo by ideálni kdyby jste to\r\nprověřily. Pravděpodobně se jedná o nějakou světlou čertovinu. <br />\r\nTomáš Kraus Analitické\r\n'),
(200, 'Stenata na Bezrucakoch', 1377362805, 22, 'Omrknut ritual', 'Nocniky sdelali talisman, hulku i baterku. My jim trochu na glavu nasrali.\r\n', 'Vazmozno, sto budu nasraty a budu nam kopat do ritualu, no pravdepodobno nemaji gule na eto.\r\n', 'My prichadili tam s vodku, posadilis, popijeli. Pak dorazili Sobotkova, Netusil i Krisova. My jich sprasili, sto oni sdelajut tam. Skazali, sto baterku i talismana. Zacali cmarat, Gradil mlsno po ritualoch i civave jejich pokukoval, Netusil mu skazal, sto nemajet na to ani myslet. Eto provokacija, katoruju Gradil potrestal spankom, knirom i picu na cele. Pak ja vsimls, sto Krisova sdelajet nespoutany plamen do hulky. Potomu sto oni neskazali, ze etot sdelajut, ja svicku suke zhasl. Byla smutna, skazala, sto eto si budet pamatovat. Tak ji Gradil pamet smazal. Ostatnim taky, i my odesli.\r\n', 0, 0, 1, 1, 1377208800, '3:30', '4:00', 'II. sumrak Ragulina, 3 amnezie, 1 spanek\r\n', '<div>\r\nDalší magická fluktuace na zřídle v bezručových sadech.\r\n</div>\r\n<div>\r\nPravděpodobně Světlí... a pak že noc je časem temných\r\n</div>\r\n'),
(201, 'Léčba AIDS', 1377381389, 38, 'zjistit cosi o rituálu', 'rituál se nekonal možmá bude\r\n', 'léčba čehokoliv\r\n', 'Na místě byli dva léčitelé, co chtěli spáchat rituál co by měl vyléčit aids. Podle toho co říkali by se stim dala celosvětově vyléčit jakákoliv nemoc. Viktorie to s nima chtěla nejdřív probrat, tak se rituál odložil na neurčito.\r\n', 0, 0, 1, 1, 1377295200, '23:00', '23:15', 'nějaqký šero\r\n', 'info z analytického atd.\r\n'),
(202, 'Mrtvola u žižkovské věže', 1377390142, 68, 'zjistit, co se děje', 'doplnit\r\n', 'doplnit\r\n', 'Přijeli jsme na místo, našli symbol a krev. Na místě byla policie - lidská. V šeru jsme slyšeli, že ji bodli do ledvin a krku nožem. Na místě činu měla na krku řetízek, ale po převozu na pitevnu už ne, což je zvláštní. Všem civislistům okolo tvrdili, že je vše v pořádku.\r\n', 0, 0, 0, 1, 1377381600, '0:15', '0:50', '3x vstup do šera - 3 osoby<span style="white-space: pre" class="Apple-tab-span">			</span>\r\n', 'info z analytického atd.\r\n'),
(203, 'Výslech Jakuba Krčmáře', 1377438436, 38, 'získat informace o zabité sestře', 'Vyslechli jsme Jakuba Krčmáře\r\n', 'Prý velká řežba já si nemyslím.\r\n', '<p>\r\nJakub Krčmář o své sestře vypověděl. Naposledy s ní mluvil kolem třetí, měla domluvený sraz s překupníkem přes amulety. Překupníkovo jméno neznáme, ale má se jednat o běžnou osobu, prý s ním dřív nebyl jediný problém. Krčmář si myslí, že on to nebyl. Při akci včerejší den jsem zjistil, že mrtvole zmizel řetízek, podle Krčmáře ho sebrala NH, scavengers. Řetízek byl nemagický, když byl Krčmář na NH pro řetízek, vrácen mu nebyl.\r\n</p>\r\n<p>\r\nDál mluvil o současné náladě světlých, běžný světlý se prý bojí temných. Prý se to vyostřilo po změně dohody. Jestli jsem to pochopil správně tak světlým mimo jiné vadí to, že hodně tlačíme na NH, nechápu co je na tom divného. Obává se, že jedno napadení světlého temným by mohlo rozpoutat neblahé a vewlké věci. \r\n</p>\r\n', 0, 0, 1, 2, 1377381600, '15:15', '15:30', 'nic\r\n', 'dohodnutý výslek\r\n'),
(204, 'Karluv most', 1386462252, 75, 'souboj temneho a svetleho, temny ma jasnou prevahu', 'Hlaseni z analytickeho o souboje temneho a svetleho na Karlove moste. Par zamilovanych. Ona Lisa Lungren, &nbsp;svetla 6.kategorie, nahle zjistila ze chodi s temnym (Olaf Anderson, mag 3.kategorie). Vypalila na nej ohen a odhmotnila se.\r\n', '<div>\r\nNebyli pri utoku v Seru. Mozne dopady eliminovany amnesii okruhu 50-ti lidi temer ihned po zasahu.&nbsp;\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n', 'Na konci karlova mostu se strhla kratka hadka zeny a muze. Ona vystrelila na muze fireball. Kricela: &quot;Jak jsi mi to mohl udelat!&quot;. Poodstoupila a odhmotnila se. Muz se zhroutil u zabradli mostu a narikal. On se jmenuje Olaf Anderson a ona byla jeho zakyne na prirodovedne universite v Malmu ve Svedsku. Chodili spolu dlouhou dobu, a on pred ni dokazal skryvat svou temnotu. Znicehonic na prochazce prahou zjistila, ze je temny a neunesla to. Kdyz jsme zacali vyslech, prisla NH. Vse probehlo v poradku. Vyslechli jsme ho a NH take. Pote jsme odesli.\r\n', 0, 0, 1, 1, 1386370800, '19:30', '20:00', '1x &nbsp;scan, 1x tri amnesie na 50 lidi, 3x sero\r\n', 'Na Karlove moste dojde ke stretu Svetleho a Temneho.&nbsp;\r\n'),
(205, 'Experimentální rituál na Vítkově', 1386500718, 75, 'Zaznamenat symboly a rituální kruhy, ktere patri k ritualu.', 'Vyzva od analytickeho oddeleni o experimentalnim ritualu na Vitkove. DH dorazila, ale zadne obrazce z ritualu nenasla. Jen par jednotlivych symbolu DH jiz z drivejsi doby. Mozne obrazce ve snehu na prave strane u pamatniku a par symbolu u schodiste. Doprovod vykladace na Vitkov a na stab DH.\r\n', '<div>\r\nZadne nejsou znamy, pokud slo o jiny vrch. Udajne dle vykladace muze mit spatny dopad pro celou Evropu.&nbsp;\r\n</div>\r\n<div>\r\n<br />\r\n</div>\r\n', 'Vyrazili jsme zkontrolovat na Vitkov, po hlasce z analytickeho, experimentalni riual. V polovine cesty nam volal vykladac Andy, ze mel videni o nejakem straslivem mrazivem vichru na vrchu Vitkov, ktery je zbusoben nejakym ritualem a muze to spatne dopadnout pro Evropu. Pockali jsme na nej a doprovodili ho nahoru.Vedeli jsme, ze podle hlaseni z analytickeho nemuzeme ritual jiz stihnout - vyrazili jsme pozde. Okolo pamatniku ani na kopci jsme nic a nikoho nevideli. Jen par symbolu rozesetych kolem hlavniho schodiste &nbsp;vedouciho na prostranstvi pod sochou Zizky. Vykladac se snazil vzpomenout na vizi, ktera ho hnala na tento kopec. Po nekolikerem obehnuti pamatniku jsme nasli nejake cary a vyslapane kruhy ve snehu na pravo od sochy. Nebyl moc zretelny. Vyfotili a zaznamenali jsme udajny ritualni obrazec ve snehu a symboly u schodiste. Pote jsme Andyho proskenovali - je to 6.kategorie, temny, jmeno Andy, vykladac. Pri ceste na stab DH rekl Andy, ze to mel byt vrch sv.krize, jeho vize nebyla prilis jasna. DH jiz na Parukarce (vrch sv.krize) byla a situaci tam vzniklou zajistila.\r\n', 0, 0, 1, 1, 1386370800, '21:00', '22:00', '1x Scan aam\r\n', '<div>\r\n<br />\r\n</div>\r\n<div>\r\nExperimentalni ritual na Vikove.&nbsp;\r\n</div>\r\n'),
(206, 'Nově iniciovaný jiný v šeru na Hlavním nádraží', 1386527620, 74, 'Vytáhnout léčitelka z šera a zjistit o koho se jedná', '<p style="margin-bottom: 0cm">\r\nVýjezdová skupina Denní hlídky\r\nnašla na základě hlášení nového Jiného na Hlavním nádraží,\r\nza přítomnosti 2 členů Noční hlídky kteří s ním nadále\r\njednali pouze v šeru byl Sakeenou z šera vytáhnut, na místě\r\nzapsán Noční hlídkou a odvezen na štáb Denní hlídky. Na štábu\r\nzaregistrován, poučen a propuštěn.\r\n</p>\r\n', '<p style=&quot;margin-bottom: 0cm&quot;>\r\nŽádné, Jiný je nyní zaregistrován,\r\nchová se rozumě a nepředpokládají se jakékoliv potíže.\r\n</p>\r\n', '<p style=&quot;margin-bottom: 0cm&quot;>\r\nVýjezdová skupina Denní hlídky\r\nvyjela na základě hlášení analitického oddělení na Hlavní\r\nnádr. k vyřešení nového Jiného uvězněného v šeru. V parku\r\npřed budovou nádraží Sakeena vstoupila do druhé úrovně šera,\r\nostatní o chvíli později do první. Dotyčný se měl nacházet\r\nněkde kolem prodejny Luxor, objevili jsme ho asi po půl minutě od\r\nvstupu do budovy. V té době u něj již stáli dva členové Noční\r\nhlídky a ještě stále v šeru se ho pokoušeli vyslýchat. Sakeena\r\npřešla na první úroveň a k dotyčnému začala mluvit. Téměř\r\nihned ho z šera vytáhla, čímž se novému Jinému značně\r\nulevilo...Jiný byl Pan Sovák, temný, vykladač 7. kategorie. Do\r\nšera se dostal po nepříjemné události která pro něj byla\r\nosobní a nechtěl ji sdělit, jen naznačil že teoreticky se\r\nmomentálně nachází venku. Sakeena venku začala hledat, po chvíli\r\nnásledovaná členem Noční hlídky. Asi po 3 minutách se vrátili\r\ns tím, že venku nikdo podezřelý není. Po krátkém rozhovoru\r\nmezi zástupci hlídek došla Noční hlídka k rozhodnutí že\r\nnového Jiného stačí zapsat si na místě a dále tak pokračoval\r\ns námi na štáb. Po příjezdu byl občerstven a byly mu vysvětleny\r\nzáklady světa Jiných jako co je to šero, Jiní, dohoda a hlídky.&nbsp;\r\n</p>\r\n', 0, 0, 1, 1, 1386374400, 'cca 17:00', '17:20', '<p style="margin-bottom: 0cm">\r\nZa Denní hlídku, 4x vstup do šera,\r\nnásledný výstup z šera + vytažení nového Jiného\r\n</p>\r\n', '<p style="margin-bottom: 0cm">\r\nNa Hlavním nádraží u obchodu Luxor\r\nse nachází nově iniciovaný Jiný v šeru a potřebuje vytáhnout.\r\n</p>\r\n'),
(207, 'Jinožravý upír na Karláku', 1386584337, 47, 'pozorovat, případně zajistit', 'Upír údajně napadl Světlé (z mého pohledu mu spíš oni dopřáli svou oblíbenou cikánskou férovku), byl zadržen, vyslechnut a ve výsledku jsme si ho odvezli my\r\n', '<p>\r\nodvykačka bude drsná \r\n</p>\r\n', '<p>\r\nS Richardem a Rudolfem jsme dorazili na Karlák, kde se měl pohybovat upír, lovící Jiné. Narazili jsme tam na minimálně osmičlenný výjezd NH (všechny ty ksichty si fakt nepamatuju), který nebohého upíra jako obvykle napřed zabil a pak se teprve začali dohadovat, co s ním. Do debaty na téma &quot;já bych ho nechal/a chcípnout&quot; a &quot;já na to nemám energii&quot; jsme vstoupili a dokopali Kristu k tomu, aby upírovi dala Transfer. Proběhl základní výslech, pokračování bylo 8.12. \r\n</p>\r\n<p>\r\nNáš závisláček se jmenuje Václav Polák, 4.kategorie, ani nepochází z Prahy, Jiným je cca tři roky, jak dlouho pije krev Jiných si ani sám pořádně nepamatuje, nicméně poprvé k tomu došlo náhodou při souboji. Aby byl vůbec schopen koherentně vypovídat, dala jsem mu napít trochu vlastní krve, načež se ukázalo, že pán je poměrně rozumný. Vzhledem k tomu, že na něj Světlí neměli absolutně nic, co by jim dávalo právo ho zadržet, jsme si nakonec pana Poláka odvezli k nám, abychom mu pomohli s jeho závislostí a postarali se, že nebude pro nikoho hrozbou. \r\n</p>\r\n', 0, 0, 1, 1, 1386370800, '23:30', '00:00', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'Podle všeho se na Karlově náměstí, ta strana od když stojíte na ipaku \r\ntak vpravo, bude pohybovat hladový upír. Dostal jsem echo že by se mělo \r\njednat o upíra, který se živí krví Jiných, což je dost ekl. Dejte si \r\nbacha at mu neskocite do pasti.<br />\r\n<br />\r\nKrausová\r\n'),
(208, 'Vivisekce vlkodlaka na parukářce', 1389020131, 26, 'pozorovat, kouřit, usmívat se', 'Rentrop vykuchal vlkodlaka. Světlí naštvaně poskakovali okolo jako parta krysaříků.\r\n', 'doplnit\r\n', 'doplnit\r\n', 0, 0, 0, 1, 1377295200, '4:30', '5:15', 'kouzla, vstupy do Šera, amulety, artefakty\r\n', 'info z analytického atd.\r\n');
