(22, 'Standard', '84.EcnambulA', 81, 1411328836, 0, 1, '', 0, '<h4><font face="Cambria, serif">Povoleni k nadpocetnemu zasahu</font></h4>\r\n<p>\r\nspecial do 31.3.2015 - utraceno\r\n</p>\r\n<p>\r\n1. kat do 1.12.2013\r\n</p>\r\n<p>\r\n&nbsp;<span style="font-size: 10pt">4. kat do 1.12.2013</span>\r\n</p>\r\n<p>\r\n3x 5. kat do 26. resp. 27.3.2014\r\n</p>\r\n<p>\r\n2x 6. kat do 27.3.2014&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nNedele\r\n</p>\r\n<p>\r\n- stab, vodka\r\n</p>\r\n<p>\r\n- vyjezd na Stross, poslana Sakeena, Sara a Koblih, opicarna, Thule, mrtvy Karl - zelenina\r\n</p>\r\n<p>\r\n- reci\r\n</p>\r\n<p>\r\n- jednani s Nejsvetlejsi\r\n</p>\r\n<p>\r\n- Vysehrad a blb, co nabehl svetlym do rukou\r\n</p>\r\n<p>\r\n- pro Evu&nbsp;\r\n</p>\r\n<p>\r\n- znovu Vysehrad a blb Zeleny\r\n</p>\r\n<p>\r\n- na stab Svetlych, haf haf\r\n</p>\r\n<p>\r\n&nbsp;<span style="font-size: 10pt">Pondeli</span>\r\n</p>\r\n<p>\r\n- stab a koordinace vyjezdu, dohoda se Zelenym, mozna prokleti, na stabu Adlerova a ta druha, sup pryc, talismany\r\n</p>\r\n<p>\r\nUtery&nbsp;\r\n</p>\r\n<p>\r\n- zadne prokleti, blb Zeleny, vcerejsi cerpac z Bezrucaku Sergej z Minsku, vyjednat, koupit, schovat, Richarduv ritual, matohy, dve zvedacky, deliriozni stav, Maike na stabu, posel z Moskvy na stabu, registrace tam a zase zpatky, posel neprijede. Co se mnou, mozna ritual obnovy? Setkani v Bezrucacich se Zelenou partou, ritual obnovy nepomuze. Na stabu Borovicka a Sergej naraz, Sergeje vypakovat, Borovickovi potrast pravici.\r\n</p>\r\n<p>\r\n&nbsp;Streda\r\n</p>\r\n<p>\r\nMatozeni se na stabu, dva debilove v podvini u ch. archivu, cerny mrak, vyslechy, vlkodlaci, problemy, pokus ve Studnickove, Ateronovo cerpani U Regenta, &nbsp;odklaneni svetlych a Trachty, uz to skoncilo, Maike dodala jazyk lhare, na zaver nahrady.\r\n</p>\r\n<p>\r\n<span style="font-size: 10pt">Ctvrtek</span>\r\n</p>\r\n<p>\r\n<span style="color: #222222; font-family: arial, sans-serif; font-size: 10pt">Pokus o energetickou optimalizaci, Maike na stabu, priprava na kuryra na florenci, energeticka optimalizace Ragulina, vyjezd na kuryra na florenci, dva okradeni svetli + Marova s Aidenem, navrat s kontrabandem, reseni dvou okradenych svetlych venku a na svetlem stabu, ukradl to Ateron, kontraband otevren na nasem stabu, Ragulin zdravy, tepla vyprava na zridlo v Bezrucacich, zatimco se neco del na Vysehrade, koordinace, reseni s Leholdem, jestli je to lek nebo naboj.</span>\r\n</p>\r\n<p>\r\n&nbsp;Patek\r\n</p>\r\n<p>\r\nMasivni letakova kampan, ukradeny tubus v zulu, vztekli svetli, prijel Pamppallini, jde po Maike, tloukl se s nim Richard s Koblihem, chteji ho registrovat u nich na stabu, Cerna je nezdvorila, omlouvajici se cerna, talismany, umlácený Richard,<span style="font-size: 10pt">&nbsp;</span><span style="font-size: 10pt">overeni info u sergeje, renkop na stabu,</span><span style="font-size: 10pt">&nbsp;svetli nekde v riti delaji proklinaci ritual, kopani do stenatek, Parukarka a Renkop, do toho prudici Lethold.</span>\r\n</p>\r\n<p>\r\nSobota\r\n</p>\r\n<p>\r\nDebaty na stabu, snura cerpani, kolumbova linie, prstenove rescany, opily Richard, strizlivy Richard k Trachtovi do Zulu, stab. Sergej na stabu, Hajek na stabu, identifikace Rosensteina, planovani postupu proti Fritzovi, sraz v Kafarne s lovcem Pamppallini, neprofesionalni Hradil, baterky na zridle, dva magori doktori na zridle, mezitim dojednavani mochomurky s Maike. Charistarch na stabu. Dojednani schuzky Sergeje s Letholdem. Problemy Letholda s Thule na Miraku, tyka se Marove, posilam vyjezdovku, Marova na stabu zatcena za pokus o vrazdu Richarda Novotneho. Dostavenicko celeho zapadu na Stabu, Zeleny and his krew. Zmatena diskuse Sergeje s Letholdem, nakonec z Letholda vypadlo, ze umi lebznu vybijet, tak jsem mu ji dal na vybiti a supli jsme ji zelenemu. Chudak. Ale pomohlo. Lethold slibil, ze lebznu jeste pujci. A pujcil si Marovou, aby vyresil Fritze. Misto toho vyresili jenom komando Thule. Idioti Koblizek a Richard. Vecere Jagellonske. Znovu idiot Richard. Na stab, zprcat idiota Richarda, posleze idiota Koblizka. Marova zpet na stabu a uz si ji tu nechame. Mengele na stabu a dlouha diskuse.\r\n</p>\r\n<p>\r\nNedele\r\n</p>\r\n<p>\r\nSergej odjel na Maledivy, protoze Charistarch rekl Sakeene, aby ho zabila. Tim u me Charistarch skoncil, Sergej byl posledni z mych znamych hlidkaru z meho rodneho mesta, my jako hlidka a ja jako pritel jsme mu poskytli azyl. Mozna ovsem Sakeena prehani a bylo to jinak.<br />\r\nNajemny inzerat na Maike, Zdislava a pruser. Lethold privezl lebznu.\r\n</p>\r\n', 0, 1200, 0, 1),
